INSERT INTO `document` VALUES (1,'1511500025','2021-02-05 14:01:36','367036','../files/1511500025.pdf',' \r\n \r\nIMPLEMENTASI ALGORITME MULTINOMIAL NAÃVE \r\nBAYES CLASSIFIER DAN TF-LTF SERTA STEMMING \r\nNAZIEF & ADRIANI UNTUK MENGKLASIFIKASI \r\nSENTIMEN MASYARAKAT TENTANG PENGALAMAN \r\nINTERVIEW DARI DATA TWITTER \r\nOleh : Rausal Valino Adjir  (1511500025) \r\nHumaika Resources Consulting merupakan sebuah konsultan Human Resources \r\nDepartement (HRD) dan Management terdepan dan terpercaya  yang berada di \r\nbawah  naungan  PT  Humanika  Amanah  Indonesia.  Konsultasi  yang  diberikan \r\nberfokus pada Recruitment, Assessment, Training, Development, dan Organization \r\nDevelopment. Humanika Consulting memudahkan para perusahaan untuk mencari \r\ndan mempersiapkan tenaga ahli yang dibutuhkan sesuai dengan kebutuhan dan \r\nstandar masing-masing perusahaan. Permasalahan yang muncul adalah timbulnya \r\nsebuah pertanyaan seperti \"Seberapa banyak masyarakat yang mengalami kesulitan \r\ndalam interview?\".  Oleh  karena  itu  dibutuhkan  sebuah  sistem  yang  dapat \r\nmengklasifikasikan sentimen masyarakat tentang pengalaman interview mereka. \r\nDalam penelitian ini, data bersumber dari twitter yang nantinya akan diolah terlebih \r\ndahulu. Data yang diklasifikasikan menjadi 3 kategori yaitu Positif, Negatif dan \r\nNetral.  Dalam  sistem  ini,  data  akan  diolah  terlebih  dahulu  melalui  tahap \r\nprapemrosesan  atau Preprocessing yang  dimana  terdapat  beberapa  tahap \r\ndidalamnya. Adapun tahap Preprocessing yang digunakan adalah Case Folding, \r\nCleansing, Tokenizing, Stopword Removal dan Stemming. Algoritme Nazief & \r\nAdriani digunakan dalam proses stemming untuk membuang imbuhan kata menjadi \r\nkata dasar pada Bahasa Indonesia/ Kemudian data tersebut diberikan bobot dengan \r\nmetode  pembobotan  kata  TF-LTF  yang  nantinya  akan  mengoptimalkan \r\nperhitungan  probabilitas  pada Algoritme Multinomial NaÃ¯ve  Bayes  Classifier. \r\nSetelah  melalui  semua  tahapan  tadi,  data  kemudian  diklasifikasikan  dengan \r\nalgoritme  Vmap NaÃ¯ve  Bayes  Classifier.  Dengan  adanya  sistem  klasifikasi  ini \r\ndiharapkan dapat membantu Humanika Resources Consulting dalam meningkatkan \r\nmutu interview berdasarkan pengalaman interview dari twitter.  \r\n \r\nKata Kunci : Klasifikasi Sentimen, Preprocessing, Nazief & Adriani, TF-LTF, \r\nMultinomial NaÃ¯ve Bayes Classifier, Vmap NaÃ¯ve Bayes Classifier. \r\nXviii + 92 halaman : 60 gambar, 24 tabel, 2 lampiran \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(2,'1511500082','2021-02-05 14:01:37','23007','../files/1511500082.pdf',' \r\nIMPLEMENTASI ALGORITMA DEPTH-FIRST-SEARCH SEBAGAI \r\nMAZE-BASED LEVEL GENERATOR PADA PROTOTIPE GAME 2D TOP \r\nDOWN SHOOTER PROPOSTEROUS DEFIANCE BERBASIS MOBILE \r\nOleh : Fadel Achmad Assegaf (1511500082) \r\n \r\n Video Game pada umumnya merupakan jenis hiburan yang disukai oleh \r\nhampir  semua  kalangan  orang saat  ini, mulai  dari kalangan anak-anak hingga \r\nkalangan dewasa. Video game juga sering digunakan  untuk  menghilangkan \r\nkejenuhan dalam  menjalankan aktivitas sehari-hari dan  juga untuk melatih diri \r\nseseorang  untuk lebih  berkonsentrasi  dan  fokus pada video game tersebut. \r\nPembuatan aset-aset level pada Video game biasanya dibuat secara manual dan \r\ndesain dan alur level akan selalu sama ketika level tersebut dimuat lagi. Maka dari \r\nitu, pembuatan Video game ini yang dikembangkan melalui Unity Engine bersifat \r\n2D, dengan genre top down shooter dengan judul game Proposterous Defiance \r\nmenggunakan Algoritma Depth-First-Search dalam pembuatan  level  secara \r\notomatis. Level nantinya dapat terbuat dengan arah jalur yang acak dari start hingga \r\nmenuju finish. Algoritma ini digunakan untuk pembuatan labirin perfect sehingga \r\ntidak terdapat jalan yang berulang, selain itu tidak ada sel yang terisolasi pada \r\nlabirin.  Algoritma  DFS  merupakan  algoritma  yang  digunakan  untuk  membuat \r\nsebuah labirin perfect. Pembuatan labirin pada game Proposterous Defiance yang \r\nselalu random atau acak dengan algoritma Depth-First-Search dapat memberikan \r\nkesan fresh setiap kali level dimainkan, karena pembuatan level dalam video game  \r\nini berbentuk labirin perfect yang mana selalu memiliki alur yang berbeda setiap \r\nkali  level  dimainkan. Metode  pengembangan menggunakan Multimedia \r\nDevelopment Life Cycle (MDLC), yaitu suatu tahap yang di dalamnya terdapat \r\npengolahan konsep, perancangan, pengumpulan bahan, pembuatan, testing, dan \r\nyang  terakhir  distribusi.  Dengan  MDLC  ini, video game yang  dibuat  akan \r\nmendapatkan  hasil  akhir  yang  diharapkan,  akurat,  serta  optimal.  Berdasarkan \r\npenelitian  yang  telah  dijalankan,  dengan  menggunakan  metode  MDLC  dapat \r\ndisimpulkan penggunaan algoritma Depth-First-Search dalam pembuatan maze-\r\nbased level-generator pada game 2D Proposterous Defiance telah terbukti dapat \r\nmembuat alur jalan labirin yang selalu acak setiap kali level pada game dimuat. \r\nKata Kunci : Depth-First-Search, Labirin, MDLC, Unity 3D, Video Game \r\nxv+70 halaman; 44 gambar; 2 tabel; 1 lampiran Perpustakaan Universitas Budi Luhur\r\n'),(3,'1511500132','2021-02-05 14:01:37','41297','../files/1511500132.pdf',' \r\n \r\nIMPLEMENTASI PENGAMANAN FILE MENGGUNAKAN \r\nALGORITMA ADVANCED ENCRYPTION STANDARD (AES) 128 BIT \r\nBERBASIS WEB PADA SMK PGRI 11 CILEDUG   \r\n \r\nOleh : Imbar Yuli Hartoko (1511500132)  \r\n \r\nDikarnakan  semakin berkembangnya  teknologi  komputer,  maka  semakin  tidak \r\naman  bagi  pengguna  komputer  dalam  menyimpan  maupun  bertukar  data  yang \r\nbersifat rahasia. Terutama di SMK PGRI 11 CILEDUG yang merupakan sebuah \r\ninstansi  yang  bergerak  dalam  bidang  pendidikan  di  kota  tangerang,  dimana \r\nterdapat file penting seperti soal ujian ataupun file yang bersifat rahasia lainya \r\nyang hanya disimpan dalam tempat penyimpanan komputer tanpa adanya suatu \r\npengamanan  untuk  mengamankan file.  SMK  PGRI  11  CILEDUG  mempunyai \r\nmasalah terkait soal ujian yang sering kali bocor. Maka dari itu dibutuhkanlah \r\nsuatu aplikasi yang dapat menjaga keamanan dan kerahasiaan file tersebut yaitu \r\ndengan menggunakan kriptografi, untuk mengamankan file yang berformat *.doc, \r\n*.docx, *.txt, *.pdf, *.xls, *.xlsx, *.ppt dan *.pptx. Kriptografi merupakan suatu \r\nmetode yang digunakan  untuk menjaga kerahasiaan dari suatu file yang bersifat \r\nrahasia agar  pihak yang  tidak  berkepentingan tidak  dapat  mengakses ataupun \r\nmemanfaatkannya untuk kepentingan pribadi. Algoritma yang digunakan dalam \r\npembuatan  aplikasi  pengamanan file adalah  algoritma Advanced  Encryption \r\nStandard (AES)  128  bit. Algoritma  ini  merupakan  algoritma  yang  termasuk \r\nkedalam algoritma yang menggunakan kunci simetri dengan ukuran kunci yang \r\nbervariasi  yaitu    128  bit,  192  bit,  256  bit,  yang  dimana  proses  enkripsi  dan \r\ndeskripsinya menggunakan kunci yang sama. Aplikasi ini dibangun berbasis web \r\ndengan  menggunakan  PHP  sebagai  bahasa  pemprograman  dalam  pembuatan \r\naplikasinya, dari hasil pengujian aplikasi ini dengan 10 file pengujian  didapatkan  \r\nrata-rata waktu  proses enkripsinya adalah  19,95503 millisecond dan waktu rata -\r\nrata deskripsinya adalah 20,79299 millisecond.  Dengan  adanya aplikasi \r\npengamanan file yang  menggunakan  algoritma Advanced  Encryption  Standard \r\n(AES) 128 bit, keamanan file soal ujian dan file yang bersifat rahasia lainya di \r\nSMK PGRI 11 CILEDUG menjadi lebih aman.  \r\n \r\nKata kunci : Kriptografi, Advanced Encryption Standard, File, AES \r\n \r\nxii+71 halaman; 71 gambar; 7 tabel; 1 lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(4,'1511500157','2021-02-05 14:01:37','177537','../files/1511500157.pdf',' \r\n \r\nImplementasi Teknologi Augmented Reality Menggunakan Metode Marker \r\nBased Tracking Sebagai Media Briefing Penerimaan Calon \r\nKaryawan Magang pada PT. Sewiwi Indonesia \r\n \r\nOleh: Deddy Rivaldy (1511500157) \r\n \r\nPenelitian  ini  bertujuan  untuk  mengembangkan  aplikasi Augmented \r\nReality pada  bidang briefing yang  medianya  berupa  kertas  pada  PT.  Sewiwi \r\nIndonesia. Melalui media briefing berupa buku yang hanya berisi tulisan tidak \r\njarang calon  karyawan  magang masih  merasa  bingung  untuk  membayangkan \r\ngambaran  atau  bentuk  topologi yang  akan  dijadikan  test  perusahaan  dan  juga \r\nmudah  rusak  jika  tetap  menggunakan  media  kertas. Sehingga  terkadang  calon \r\nkaryawan  magang  harus  bertanya untuk  mendapatkan  informasi  ataupun \r\ngambaran yang lebih jelas. Karena semakin berkembangnya zaman dan teknologi \r\nmaka ada  jalan  keluar  untuk  mengatasi  permasalahan  tersebut  yaitu  dengan \r\nmenggunakan aplikasi Augmented Reality (AR). Aplikasi ini nantinya akan berisi \r\ntentang Augmented  Reality  (AR) topologi  jaringan yang  akan  dijadikan  media \r\nbriefing. Aplikasi ini dibangun dengan menggunakan bahasa pemograman C# dan \r\njuga menggunakan metode Marker Based Tracking yang nanti nya ada sebuah \r\ntopologi  jaringan  berisi  gambar sebagai  salah  satu marker penanda  dan \r\nsmartphone untuk  memindai marker tersebut.  Hasil dari  penelitian  ini \r\nmenghasilkan aplikasi Augmented Reality (AR) yang dapat menyajikan sebuah \r\ngambar 3D dari Topologi Jaringan. \r\n \r\nKata kunci: Augmented Reality, Android, Marker Based Tracking \r\n \r\nXIII+52halaman; 34 Gambar; 12 Tabel; 6 Lampiran \r\n \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(5,'1511500199','2021-02-05 14:01:37','99221','../files/1511500199.pdf',' \r\n \r\nAPLIKASI PENGAMANAN FILE MENGGUNAKAN \r\nALGORITMA ADVANCED ENCRYPTION STANDARD (AES) 128 \r\nBERBASIS WEB PADA TOKO KHAYANGAN OUTDOOR \r\n \r\nOleh : Yayat (1511500199) \r\n \r\nKhayangan  Outdoor  yang  bergerak di  bidang  penjualan  alat  pendakian  memiliki \r\npendapatan yang cukup besar. Pendapatan mereka selalu dibukukan dan kemudian \r\ndiketik ulang ke dalam komputer. File tersebut rentan dicuri dan rusak karena belum \r\nada pengaman khusus. Sebuah data akan sangat berguna apabila digunakan dengan \r\nsebagaimana mestinya. Penyimpanan data sangat mudah untuk di sadap dan di susupi \r\noleh orang yang tidak bertanggung jawab. Pencurian data dapat dilakukan dengan cara \r\nmemindahkan langsung dari penyimpanan komputer ataupun melalui internet. Untuk \r\nitu diperlukan suatu aplikasi yang dapat menjaga kerahasian sebuah informasi. Salah \r\nsatu cara yang dapat digunakan adalah kriptografi. Kriptografi adalah sebuah seni \r\npenyandian  pesan.  Aspek  keamanan  kriptografi  adalah  kerahasiaan,  integritas, \r\notentikasi dan penyangkalan. Kriptografi memiliki banyak teknik dalam mengenkripsi \r\ndata, diantaranya adalah Advances Encryption Standard (AES). Advances Encryption \r\nStandard merupakan algoritma yang dapat mengamankan data. Keunggulan  Advances \r\nEncryption  Standard yaitu  kebal  terhadap  serangan  konvensional  (linear   dan \r\ndiferensial  attack)  yang  menggunakan  statistik  untuk memecahkan  sandi.  Dengan \r\nmenggunakan aplikasi ini pengguna dapat menyimpan data dengan aman tanpa takut \r\ndiketahui oleh pihak-pihak yang tidak berhak mendapatkan informasi tersebut. \r\n \r\nKata kunci : kriptografi, Advances Encryption Standard,   \r\nXVII+74 halaman; 89 Gambar; 8 Tabel; 2 Lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(6,'1511500207','2021-02-05 14:01:37','157335','../files/1511500207.pdf',' \r\n \r\nJudul  : Penerapan  Teknologi Augmented  Reality di  bidang  promosi  dengan \r\nmenggunakan  metode Marker  Based  Tracking berbasis android pada \r\nPT.Suryaprabha Jatisatya  \r\n \r\nPenelitian  ini  bertujuan  untuk  mengembangkan  aplikasi Augmented \r\nReality pada bidang promosi  yang medianya berupa brosur pada sebuah acara \r\npameran. Melalui media promosi yang berupa brosur tidak jarang calon pembeli \r\nmasih merasa bingung untuk membayangkan gambaran atau bentuk barang yang \r\nakan dibeli dikarenakan tidak semua barang di sample pada suatu pameran karena \r\nterbatasnya tempat venue. Sehingga terkadang pembeli harus mendatangi kantor \r\npemasaran  untuk  mendapatkan  informasi  ataupun  gambaran  yang  lebih  jelas. \r\nKarena  semakin  berkembangnya  zaman  dan  teknologi  maka  ada  jalan  keluar \r\nuntuk  mengatasi  permasalahan  tersebut  yaitu  dengan  menggunakan  aplikasi \r\nAugmented Reality (AR). Aplikasi ini nantinya akan berisi tentang Augmented \r\nReality (AR) dari beberapa produk-produk PT. Suryaprabha Jatisatya  yang akan \r\ndi  pasarkan.  Aplikasi  ini  dibangun  dengan  menggunakan  bahasa  pemograman \r\nUnity, Vuforia, Android SDK, Visual  Studio dan  juga  menggunakan  metode \r\nMarker  Based  Tracking yang  nanti  nya  ada sebuah  brosur  sebagai  salah  satu \r\nmarker penanda  dan smartphone untuk  mengscan marker tersebut.  Hasil  dari \r\npenelitian ini nanti nya akan menghasilkan aplikasi Augmented Reality (AR) yang \r\ndapat menyajikan sebuah gambar 3D dari produk PT. Suryaprabha Jatisatya. \r\n \r\nKata kunci : Augmented Reality, Android, Marker Based Tracking \r\n \r\nxiv+79 halaman; 46 gambar; 5 tabel; 2 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(7,'1511500215','2021-02-05 14:01:37','42033','../files/1511500215.pdf',' \r\n \r\nUntuk mengetahui sebuah gejala yang dapat berpotensi menyebabkan terjadinya \r\nbenacana kebakaran, maka di butuhkan alat yang dapat mendeteksi gas, asap, api \r\ndan  juga  dapat  mengirimkan  pemberitahuan  secara real-time kepada  pemilik \r\nbangunan. Dengan perkembangan yang pesat pada teknologi hardware pun terjadi \r\npada  perkembangan  mikrokontroler,  suatu hardware yang  dapat \r\nmengkomunikasikan  bahasa  pemograman  C  dengan  berbagai  macam  sensor, \r\nseperti sensor MQ-2 yang dapat mendeteksi adanya asap dan gas, flame sensor \r\nyang  dapat  mendeteksi  adanya  api  dan Module  GSM  Sim 800L yang  dapat \r\nmengirimkan pemberitahuan langsung  melalui Short Message Service ( SMS ), \r\nsehingga dapat membantu memberikan informasi secara real-time kepada pemilik \r\nbangunan dan juga melakukan first-action menggunakan pompa motor DC dan \r\nkipas. \r\n \r\nKata kunci: Alat pendekteksi kebakaran , Sensor asap MQ-2 , Buzzer , Arduino \r\nuno , Arduino GSM Sim 800L, Flame sensor,pompa motor DC, Kipas \r\nxv-78 halaman; 71 gambar; 7 table; 2 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\nJudul : PROTOTIPE  ALAT  PENDETEKSI  KEBAKARAN \r\nMENGGUNAKAN  ARDUINO  UNO  SENSOR  ASAP  MQ-2  DAN \r\nSENSOR  API  DENGAN  NOTIFIKASI  MELALUI  SMS \r\nMENGGUNAKAN MODUL GSM SIM 800L DAN FIRST ACTION \r\nMENGGUNAKAN POMPA MOTOR DC PADA SMK YADIKA 5 \r\nPONDOK AREN. \r\n Perpustakaan Universitas Budi Luhur\r\n'),(8,'1511500231','2021-02-05 14:01:37','199254','../files/1511500231.pdf',' \r\n \r\nPenerapan teknologi Augmented Reality Sebagai media pembelajaran tata cara \r\nberwudhu pada buku panduan wudhu berbasis android dengan menggunakan \r\nmetode Marker Based Tracking di TK Islam Darussalam. \r\n \r\nOleh : Yodi Syarofi (1511500231) \r\n \r\nTugas akhir (TA) ini membahas tentang Augmented Reality tata cara berwudhu di \r\nTK Islam Darussalam. Permasalahan yang terjadi di TK Islam Darussalam saat ini, \r\nanak-anak belajar berwudhu masih menggunakan buku tuntunan berbasis teks dan \r\ngambar.  Untuk  itu  diperlukan  inovasi  yang  lebih efisien,  yaitu  memanfaatkan \r\nteknologi  digital  dengan  teknologi Augmented  Reality.  Penggunaan Augmented \r\nReality ini diharapkan  dapat menarik minat belajar serta menambah wawasan anak-\r\nanak di TK Islam Darussalam dalam hal pengenalan tata cara wudhu agar menjadi \r\nlebih efektif. Aplikasi Augmented Reality ini menggunakan metode Marker Based \r\nTracking, metode  ini  dipilih  karena  mampu  membaca  objek  yang  nantinya  akan \r\nmemunculkan  objek  virtual 3  dimensi  dari  tata  cara  wudhu.  Langkah  awal  pada \r\npenyelesaian  masalah  ini  dilakukan  dengan  pembuatan  animasi  menggunakan \r\naplikasi Blender,  selanjutnya  menentukan  gambar  yang  akan  dijadikan Marker \r\nkemudian di export ke unity agar menjadi sebuah aplikasi Augmented Reality tata \r\ncara wudhu. Aplikasi ini berguna untuk media pembelajaran alternatif anak-anak, \r\nsehingga  para guru diharapkan  dapat meningkatkan  minat  belajar  anak-anak  TK \r\nIslam Darussalam. Metode pengujian yang digunakan adalah dengan menggunakan \r\nISO 9126 dan kuisioner dengan jumlah responden total 10 responden. Berdasarkan \r\nhasil pengujian yang telah dilakukan menunjukan bahwa aplikasi berjalan dengan \r\nbaik dan 88% responden menyatakan merasa puas dengan manfaat aplikasi tata cara \r\nwudhu ini. \r\n \r\n \r\nKata kunci : Augmented Reality, Marker Based Tracking, Android \r\n \r\nXII+46halaman; 31 Gambar; 11 Tabel; 11 Lampiran \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(9,'1511500249','2021-02-05 14:01:37','21348','../files/1511500249.pdf',' \r\n \r\nIMPLEMENTASI AUGMENTED REALITY PADA \r\nPENGEMBANGAN MEDIA PEMBELAJARAN TATA SURYA \r\nUNTUK SD NEGERI SUDIMARA 5 CILEDUG BERBASIS \r\nANDROID \r\n \r\nOleh : Mochammad Ricky Andriyanto (1511500249)  \r\n \r\n Pentingnya ilmu pengetahuan tentang sistem tata surya untuk siswa sekolah \r\ndasar, dalam pembelajaran pengenalan tata surya. Untuk memperkenalkan tata surya \r\nyang mana secara tidak langsung mengajak siswa membayangkan seperti apa bentuk \r\ndari  planet-planet  yang  ada  di  tata  surya  melalui  gambar  virtual  3D.  Dengan \r\nmenerapkan  teknologi virtual,  aplikasi ini dapat  digunakan  sebagai  media  untuk \r\nbelajar.  Salah  satu  teknologi  yang  digunakan  pada  saat  ini  sebagai  media \r\npembelajaran  adalah  teknologi augmented  reality. Penerapan aplikasi augmented \r\nreality ini dapat membantu siswa SD Negeri Sudimara 5 Ciledug dalam hal belajar, \r\nkarena objek yang digunakan berbentuk 3D. Aplikasi ini akan dapat dijalankan dalam \r\npiranti smartphone dengan operating  system Android. Menghasilkan  aplikasi \r\naugmented  reality yang  mudah  digunakan  oleh user. Aplikasi  yang  dibuat \r\nmenggabungkan  benda  maya dua dimensi atau tiga dimensi ke dalam  lingkungan \r\ndunia  nyata  tiga  dimensi,  kemudian  memproyeksikan  benda  maya  tersebut  dalam \r\nwaktu yang  nyata atau real-time, aplikasi  ini  memiliki  fitur  memunculkan planet-\r\nplanet  dalam  bentuk  tiga  dimensi  dari  masing-masing marker yang  ada.  Setiap \r\nmarker yang  dipilih,  akan  memunculkan  planet  yang  berbeda-beda.  Dalam \r\nimplementasinya aplikasi menggunakan kamera smartphone Android dan alat bantu \r\nberupa marker berbentuk  kertas  sebagai  permukaan  untuk  menampilkan  objek \r\nvirtual.  Aplikasi  ini  dibuat  untuk  menambahkan  media  pembelajaran  teknologi \r\naugmented  reality pada  SD  Negeri  Sudimara  5  Ciledug  agar  media  pembelajaran \r\ntentang pengetahuan tentang tata surya menjadi lebih menarik dan interaktif berupa \r\nanimasi  3D.  Dan  telah  di  tentukan  hasil  pengujian  kuesioner,  bahwa  hasil  yang \r\ndidapatkan dari 10 orang murid yang telah menjawab kuesioner yang diberikan oleh \r\npenulis. Hasil menunjukan bahwa 63% murid memilih Sangat Setuju dan 37% murid \r\nmemilih Setuju dari 12 pertanyaan tentang aplikasi augmented reality tata surya yang \r\nberbasis Android. \r\n \r\nKata kunci : Augmented Reality, Android, Tata Surya \r\n \r\nXvi + 67 halaman; 44 gambar; 5 tabel; 11 lampiran \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(10,'1511500264','2021-02-05 14:01:38','134360','../files/1511500264.pdf',' \r\n \r\n \r\nJudul : Augmented Reality (AR) Sebagai media pembelajaran perangkat \r\nkeras komputer pada SMK PGRI 1 Tangerang \r\n \r\nPenelitian  ini  bertujuan  untuk  memperkenalkan  media  pembelajaran  aplikasi \r\nAugmented Reality perangkat keras komputer kepada siswa Teknik Komputer dan \r\nJaringan  (TKJ)  di  SMK PGRI  1  Tangerang.  Permasalahan  sebelumnya  siswa \r\nTeknik  Komputer  dan  Jaringan  (TKJ)  di  SMK  PGRI  1  Tangerang  belum \r\nmenggunakan media pembelajaran Augmented Reality, masih berupa 2 dimensi. \r\nDalam  mengatasi  permasalahan  tersebut  maka  dengan  hasil  Analisa  dan \r\nobeservasi yang telah peneliti lakukan sebelumnya dibuatlah aplikasi Augmented \r\nReality. Dalam pembuatan aplikasi ini peneliti membuat sebuah database berupa \r\nmarker  atau gambar 2 dimensi perangkat keras komputer  menggunakan vuforia, \r\nkemudian mengexport nya ke dalam Unity untuk menampilkanya kedalam bentuk \r\n3 dimensi dan menjadikanya sebuah aplikasi Augmented Reality sebagai media \r\npembelajaran perangkat keras kepada siswa Teknik Komputer dan Jaringan (TKJ) \r\ndi  SMK  PGRI  1  Tangerang.  Dengan  adanya  aplikasi  ini  diharapkan  dapat \r\nmeningkatkan daya tarik serta mempermudah dalam memperkenalkan perangkat \r\nkeras  komputer  siswa  Teknik  Komputer  dan Jaringan  (TKJ)  di  SMK  PGRI  1 \r\nTangerang. \r\n \r\nKata Kunci : Augmented Reality, Single Marker, AndroidPerpustakaan Universitas Budi Luhur\r\n'),(11,'1511500272','2021-02-05 14:01:38','64683','../files/1511500272.pdf',' \r\n \r\nJudul : Implementasi Algoritma Vigenere Cipher dan Metode Least Significant Bit \r\n(LSB) dalam Perancangan Aplikasi Steganography untuk Menyisipkan Pesan \r\nTeks pada Gambar. \r\n \r\nSteganografi adalah teknik yang digunakan untuk menyisipkan informasi di dalam \r\nmedia  lainnya  dengan  tujuan  menjaga  keamanan  informasi.  Steganografi \r\nmembutuhkan dua media yang berbeda, yaitu media penampung (cover parent) dan \r\ninformasi  yang  akan  disisipkan  (child  file).  Media  penampung dan  data  yang \r\ndisisipkan dapat berupa gambar, suara, teks, dan video. \r\nSaat ini teknologi informasi sudah sangat berkembang menjadi salah satu media yang \r\npaling  popular  di  dunia.  Sayangnya  dengan  berkembangnya  teknologi  informasi \r\nsemakin  berkembang  pula  tindak  penyalahgunaan  informasi  yang  bukan  haknya. \r\nDengan  berbagai  teknik  banyak  yang  mencoba  untuk  mengakses  informasi  yang \r\nbukan haknya. Maka dari itu sejalan dengan berkembangnya media internet ini harus \r\njuga  dibarengin  dengan  berkembangan  pengamanan  informasi.  Berbagai  macam \r\nteknik digunakan untuk melindungi informasi yang dirahasiakan dari orang yang tidak \r\nberhak, salah satunya adalah teknik steganografi. Pada tugas akhir ini, dibuat aplikasi \r\nsteganografi yang bertujuan untuk mengamankan informasi bertipe pesan teks dengan \r\nmenyisipkan  (menyembunyikan)  kedalam  pesan  gambar  dengan  menggunakan \r\nmetode algoritma LSB (Least Significant Bit) dan enkripsi Vigenere Cipher. Hasil dari \r\naplikasi ini adalah dapat menyisipkan pesan tersembunyi berupa teks ke dalam file \r\ngambar  berformat  JPG  dan  dapat  mengenkripsi  file  teks  dengan  menggunakan \r\nalgoritma Vigenere Cipher. \r\nKata kunci: Steganografi, Kriptografi, Metode LSB, dan Vigenere Cipher \r\n \r\nxvii+ 57 halaman; 30 gambar; 7 tabel; 1 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(12,'1511500298','2021-02-05 14:01:38','70446','../files/1511500298.pdf',' \r\n \r\nPENERAPAN AUGMENTED REALITY UNTUK PEMBELAJARAN \r\nPENGENALAN PAHLAWAN NASIONAL PADA MATA UANG RUPIAH \r\n2016 DI MTSN 1 TANGERANG SELATAN \r\n \r\nOleh: Dicky Ananda (1511500298) \r\n \r\nTeknologi zaman sekarang mulai memiliki kemajuan yang sangat pesat. Banyak \r\nsekali sistem atau media pembelajaran yang bahkan dapat membantu anak-anak \r\nsekolah untuk mengerjakan pekerjaan sekolahnya, mata pelajaran sejarah tentang \r\npahlawan  khususnya.  Hasil  kuesioner  membuktikan  banyak  siswa/i  MTsN  1 \r\nTangerang  Selatan  yang  tidak  terlalu  tahu  ataupun  hafal  mengenai  pahlawan-\r\npahlawan Indonesia, terutama pahlawan yang berada di dalam mata uang Indonesia \r\nyang baru. Siswa/i MTsN 1 Tangerang Selatan tidak mengetahui siapa dan apa \r\nperanan dari para pahlawan yang ada di dalam uang baru tersebut. Dalam hal ini \r\nperlu adanya solusi  agar siswa/i dapat  mengetahui  pahlawan  yang ada  dengan \r\nmenggunakan media dan sistem pembelajaran interaktif. Salah satunya dengan \r\nmembuat  aplikasi  pengenalan  sejarah  pahlawan  menggunakan  teknologi \r\nAugmented Reality. Metode yang digunakan adalah marker based tracking. Marker \r\nyang digunakan pada aplikasi yang dibuat yakni menggunakan uang kertas tahun \r\nemisi 2016. Dalam laporan penelitian ini menjelaskan desain dan implementasi \r\naplikasi AR yang berjalan pada platform mobile Android. Hasil pengujian pada \r\nintensitas cahaya 66% berhasil dan hasil pengujian pada jarak antara smartphone \r\ndengan marker 100%  berhasil.  Hasil  percobaan  tersebut  dikonfirmasi  bahwa \r\naplikasi berjalan dengan cukup baik di perangkat mobile yang menggunakan sistem \r\noperasi Android. \r\n \r\nKata kunci : Augmented Reality, Uang, Android, 2D, Marker Based Tracking \r\nxiii+48 halaman; 34 gambar; 3 tabel; 37 lampiran. \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(13,'1511500314','2021-02-05 14:01:38','21600','../files/1511500314.pdf',' \r\nIMPLEMENTASI AUGMENTED REALITY SEBAGAI MEDIA \r\nPEMASARAN MENGGUNAKAN BROSUR MOTOR HONDA BERBASIS \r\nANDROID PADA PT. BEKY SRI REJEKI JAYA \r\n \r\nOleh : Muhamad Riyan Dwi Cahyadi (1511500314) \r\n \r\nPromosi adalah upaya untuk memberitahukan atau menawarkan produk atau jasa \r\ndengan  tujuan  menarik  pelanggan  atau  konsumen  untuk  menggunakan  produk \r\ntersebut. PT. Beky Sri Rejeki Jaya atau Dealer Honda Beky adalah dealer resmi \r\nsepeda motor Honda untuk wilayah Tangerang, melayani penjualan sepeda motor \r\nHonda, service, sparepart, aksesoris dan apparel Honda. Promosi yang dilakukan \r\npada PT. Beky Sri Rezeki Jaya adalah dengan cara memberikan brosur di depan \r\nshowroom tersebut, dan konsumen yang tertarik dapat singgah terlebih dahulu ke \r\nshowroom untuk  melihat  motor  tersebut.  Sedangkan  jika  diperluas  pembagian \r\nbrosur tersebut, yang di mana jauh dari showroom, brosur akan kurang efektif \r\nkarena konsumen atau calon pembeli tidak bisa melihat motor secara langsung. \r\nMaka dari itu, untuk meningkatkan angka penjualan dan dapat bersaing dengan \r\ndealer lain, penulis menyediakan solusi atau inovasi dalam pemasaran produk agar \r\nDealer Honda Beky bisa mempromosikan produknya dengan lebih atraktif. Yakni \r\ndengan menggunakan tekonologi augmented reality yang merupakan terobosan \r\nbaru  dalam  bidang  industri  otomotif. User tidak  hanya  melihat  produk  dalam \r\ngambar 2D atau 3D saja, bahkan user juga bisa melihat detail informasi dalam \r\nproduk tersebut. Augmented reality adalah suatu solusi baru dalam dunia teknologi \r\nyang dapat menyisipkan suatu informasi atau masukan tertentu ke dalam dunia \r\nmaya dan menampilkan di dunia nyata dengan bantuan perangkat Android dan \r\nkomputer. Tujuan dari pembuatan penelitian ini adalah untuk menciptakan sebuah \r\naplikasi yang berteknologi augmented reality untuk promosi motor. Aplikasi ini \r\ndiharapkan dapat membantu sales dalam kemudahan untuk promosi karena lebih \r\npraktis dan efisien. Dalam mengimplementasikan aplikasi ini dibutuhkan software \r\npendukung,  yaitu  Unity  3D  sebagai software utama  pembuatan  teknologi \r\naugmented  reality, software Blender  sebagai  pembuatan  objek  3D  yang  akan \r\nditampilkan pada aplikasi augmented reality, Microsoft Visual Studio 2017 sebagai \r\ntempat  penulisan script untuk  aplikasi augmented  reality dan Vuforia  sebagai \r\ntempat menyimpan database marker. Dari hasil uji coba menggunakan 3 (tiga) \r\nperangkat Android, di antaranya Xiaomi Mi A1, Vivo y71 dan Advan i7A dapat \r\nmenampilkan objek 3D motor secara baik dan jelas. \r\n \r\nKata Kunci :  Promosi, augmented reality, Unity 3D, motor, perangkat Android \r\n \r\nxvi + 72 halaman; 50 gambar; 6 tabel; 1 lampiran \r\n Perpustakaan Universitas Budi Luhur\r\n'),(14,'1511500363','2021-02-05 14:01:38','108846','../files/1511500363.pdf',' \r\nPada saat ini dunia telah memasuki era globalisasi, menghadapi suatu masa \r\ndimana teknologi telah berkembang dan memasuki segala bidang di kehidupan \r\nmanusia dengan sangat cepat dan pesat. Tak terkecuali sebuah perusahaan yang \r\nmau  tidak  mau  harus  mengikuti  perkembangan  teknologi  sebagai  bentuk \r\npenyesuaian untuk kenyamanan bertransaksi atau memasarkan produk yang \r\nmereka buat. Peran Head Of Product Research & Development di perusahaan \r\nsangat  penting  dalam  penelitian  dan pengembangan  produk  sehingga  para \r\ncalon pembeli dapat dengan mudah mengetahui dan mengerti tentang produk \r\ntersebut.  Namun  terkadang  para  calon  pembeli  merasa  kesulitan  untuk \r\nmengetahui dan mengerti tentang produk yang ingin mereka beli di perusahaan \r\ntersebut karena pengenalan produk yang dilakukan selama ini kurang menarik \r\ndan inovatif sehingga dibutuhkan penerapan teknologi augmented reality yang \r\ndiharapkan dapat memudahkan perusahaan dan para calon pembeli. Augmented \r\nreality diharapkan menjadi terobosan untuk membuat sebuah sistem untuk \r\nmemasarkan produk yang lebih menarik dan inovatif bagi sebuah perusahaan. \r\nKemampuan memunculkan objek 3D  yang disertai dengan informasi  pada \r\nsmartphone membuat augmented reality tidak membosankan untuk digunakan. \r\nsehingga pengguna  seakan  berinteraksi  langsung  dengan  objek yang \r\ndigunakan.  \r\n \r\nKata kunci: Augmented reality , Android, 3D , Smartphone, PT. Modera \r\nFurintraco Industry \r\nxii+56 halaman, 58 gambar, 2 tabel; \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n  \r\nJudul : IMPLEMENTASI  TEKNOLOGI  AUGMENTED  REALITY \r\nSEBAGAI MEDIA PEMASARAN BERBASIS ANDROID PADA PT. \r\nMODERA FURINTRACO INDUSTRY \r\n Perpustakaan Universitas Budi Luhur\r\n'),(15,'1511500397','2021-02-05 14:01:38','33635','../files/1511500397.pdf',' \r\nIMPLEMENTASI REST API DAN ALGORITMA VIGINERE CIPHER \r\nBERBASIS WEB SERVICE PADA KAFA PHOTOGRAPHY \r\nOleh : Irfan Irmawan (1511500397) \r\nDi  Indonesia  perkembangan e-commerce sangatlah  cepat. Banyaknya \r\nstartup besar yang tumbuh menjadi gambaran bahwa e-commerce menjadi gaya \r\nhidup  baru  masyarakat. Mode  akses  yang  bervariasi  (web, mobile)  menuntut \r\nintegrasi yang bisa diberikan oleh web service. REST web service merupakan salah \r\nsatu  bentuk  sistem  perangkat  lunak  yang  didesain  untuk  mendukung  interaksi \r\nmesin-ke-mesin melalui jaringan internet dan digunakan sebagai suatu  fasilitas \r\nyang disediakan oleh suatu web site untuk menyediakan layanan dalam bentuk \r\ninformasi kepada sistem lain. Kafa Photography merupakan salah satu penyedia \r\nlayanan jasa fotografi yang baru beroperasi sejak tahun 2018. Proses bisnis yang \r\ndilakukannya  masih  menggunakan  cara yang manual. Hal  ini tentunya akan \r\nmempersulit pelanggan yang ingin memesan layanan jasa fotografi dan juga untuk \r\npihak  Kafa  Photography  yang  harus  menyimpan  dan  menjaga  data  pelanggan \r\nsecara aman dan rapi. Untuk membentuk proses bisnis yang baik dapat diadaptasi \r\ndengan  kondisi  jaman maka  dibutuhkan  sebuah  aplikasi  yang  dapat \r\nmenghubungkan antara aplikasi dari berbagai platform yang berbeda dengan sistem \r\nyang dibuat. Agar masalah tersebut dapat teratasi maka dibutuhkan sebuah web \r\nservice dengan arsitektur REST yang dapat menghubungkan antara aplikasi dari \r\nberbagai  perangkat  yang  berbeda.  Karena  data  pelanggan  sangat  rawan  untuk \r\ndisalahgunakan  oleh  pihak  yang  tidak  bertanggung  jawab,  maka web  service \r\ntersebut dilengkapi dengan enkripsi. Enkripsi yang digunakan ini adalah dengan \r\nmenggunakan metode kriptografi algoritme Vigenere Cipher yang bertujuan untuk \r\nmengamankan  data  pelanggan  yang  tersimpan  dalam database. Pengujian API \r\ndilakukan dengan tools aplikasi postman. Hasil dari penelitian ini adalah penerapan \r\nteknologi web service dengan arsitektur REST yang dapat digunakan oleh berbagai \r\nmacam jenis client seperti aplikasi mobile, dan aplikasi web, yang dapat membantu \r\npelanggan Kafa Photography dalam melakukan pemesanan layanan jasa dan juga \r\nmempermudah  perusahaan  dalam  menerima  pesanan  dari  pelanggan.  Sehingga \r\ndapat mempercepat proses pesanan. \r\n \r\nKata Kunci : Web Service, Android, Vigenere Cipher, REST, API, E-commerce. \r\n  \r\nxxiv +128 Halaman; 144 Gambar; 11 Table; 3 Lampiran \r\n \r\n  \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(16,'1511500421','2021-02-05 14:01:38','212941','../files/1511500421.pdf',' \r\n \r\nIMPLEMENTASI ALGORITMA KRIPTOGRAFI RC4 UNTUK \r\nKEAMANAN DATABASE PADA DATA PENJUALAN RUMAH DI PT. \r\nPUNDI GRAHA KENCANA \r\n \r\nOleh : Muhammad Wahyudin (1511500421) \r\n \r\nSaat  ini  data  dan  informasi  menjadi  hal  yang  penting  bagi  perusahaan. \r\nBerbagai perusahaan telah memanfaatkan teknologi database untuk menyimpan \r\ndata  perusahaannya.  Keamaanan  data  yang  di  simpan  dalam database sudah \r\nmenjadi hal yang sangat dibutuhkan. Namun keamanan pada database sudah tidak \r\ndapat lagi menjamin keamanan data karena kebocoran data dapat disebabkan oleh \r\npihak-pihak  yang  langsung  berhubungan  dengan database itu  sendiri  seperti \r\nadministrator database. PT.  Pundi  Graha  Kencana  adalah  perusahaan  yang \r\nbergerak dibidang property (perumahan). Keamanan data perusahaan sangatlah \r\npenting data yang ada tidak hanya Data Penjualan Rumah saja, terdapat juga data \r\ndari pembeli  rumah  yang  sangat  rahasia.  Maka  dari  itu dibutuhkan  keamanan \r\ndatabase. Semakin berkembang nya dunia teknologi, maka semakin besar pula \r\ntingkat pencurian data. bagi beberapa perusahaan data adalah hal yang penting \r\ndan akan sangat bahaya apabila data tersebut dicuri. PT. Pundi Graha Kencana \r\nmenyimpan data pada sebuah database, yang memiliki keamanan rendah, dimana \r\nsewaktu-waktu  data  tersebut  dapat  dicuri  oleh  orang  yang  tidak  bertanggung \r\njawab. PT.  Pundi  Graha  Kencana  membutuhkan  aplikasi  untuk  menjaga \r\nkerahasian  data  perusahaan  yaitu data  penjualan rumah. Dibuatlah  aplikasi \r\nkeamanan Database menggunakan  teknik  kriptografi, Didalam  kriptografi \r\nterdapat  dua  proses  utama  yaitu  enkripsi  dan  dekripsi.  Enkripsi  merupakan \r\nmengubah  pesan  asli  menjadi  pesan  sandi  sedangkan  dekripsi  adalah  proses \r\npengembalian pesan sandi menjadi pesan aslinya. Metode  yang dipakai adalah \r\nmetode Rivest code 4 (RC4) karena metode RC4 merupakan salah satu metode \r\nyang hasil penyandian (chipertext) memiliki ukuran Panjang karakter yang sama \r\ndengan pesan asli (plaintext). Metode ini terdiri dari tiga tahap yaitu KSA(Key \r\nSchedulling  Algorithm),  PRGA(Pseudo  Random  Generation  Algoritm),  dan \r\nproses XOR. Hasil penelitian ini menunjukan bahwa data menjadi lebih aman \r\nkarena sudah terenkripsi, yang membuat data tersebut sulit untuk dibaca. Data \r\njuga terdekripsi dengan baik tanpa mengurangi data yang sebelumnya di buat. \r\n \r\n \r\nKata Kunci : Database, RC4, Enkripsi, Deskripsi \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(17,'1511500470','2021-02-05 14:01:38','199161','../files/1511500470.pdf',' \r\nIMPLEMENTASI A*(STAR) ALGORITHM PATHFINDING DALAM \r\nAPLIKASI GAME 2D PLATFORM \"THE ADVENTURE OF \r\nBRAVESTAND\" BERBASIS WINDOWS MENGGUNAKAN UNITY \r\nOleh : IQBRAR ADJI PRIGANORO ( 1511500470 ) \r\nKotak kreatif yang biasa disingkat kotif adalah sebuah komunitas studio game \r\ndi Universitas Budi Luhur di Jakarta yang sudah menghasilkan banyak game \r\nberkualitas  dan selalu  berkembang  di  setiap  karyanya.  Kotif  juga  pernah \r\nbeberapa  kali  memenangkan  kompetisi  game  developer,  tetapi  dibalik \r\nkesuksesannya itu kotif masih ada kendala dengan membuat coding Artifical \r\nIntelligence (AI) pada setiap game yang dibuat. Oleh karena itu saya membuat \r\ngame \"The Adventure Of Bravestand\", dimana peneliti akan merancang game \r\n2D  Platformer  berbasis  desktop  dengan  menggunakan  tiga  jenis Artifical \r\nIntelligence (AI) dan satu  AI menggunakan animation transitions dan state \r\nmachine behaviors dengan tambahan adanya  jalan cerita yang dibuat untuk \r\nmenambahkan rasa penasaran user pada saat meminkan game tersebut. Secara \r\nsingkat game ini bercerita tentang kerajaan yang diserang dan dikuasai oleh \r\nasosiasi monster yang dipimpin dan diselamatkan oleh kesatria pemberani dari \r\nsebuah desa. Dengan hasil dapat mengimplementasikan beberapa AI dan yang \r\npaling utama adalah AI yang diterapkan menggunakan metode pencarian rute \r\n(Pathfinding) dengan Algoritma A*(Star) dalam game yang dibuat, yang dapat \r\ndigunakan  oleh  Kotak  Kreatif  dalam  pembuatan  game  selanjutnya,  dengan \r\nmenggunakan Artifical Intelligence (AI) yang ada pada game yang dibuat oleh \r\npeneliti atau bahkan dapat dikembangkan menjadi lebih baik lagi. \r\n \r\nKata Kunci : Game 2D, Artifical Intelligence (AI), Pathfinding, A-Star, Desktop \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(18,'1511500520','2021-02-05 14:01:38','87910','../files/1511500520.pdf',' \r\nIMPLEMENTASI WEB SERVICE BERBASIS REST DAN ALGORITMA \r\nVIGENERE CIPHER PADA HOTEL WIRA CARITA \r\nOleh : Fikri Nugraha (1511500520) \r\n \r\nDengan berkembangnya teknologi, membuat gaya baru pada masyarakat \r\ndalam  melakukan  transaksi.  Teknologi  dapat mempermudah  pelanggan  dalam  \r\nmelakukan transaksi apapun dan dimana pun dengan sangat cepat, aman dan tanpa \r\nbatasan  waktu.  Pelanggan  juga  dapat  memesan  jasa penginapan yang  sesuai \r\ndengan  keinginan mereka  sendiri  secara  mudah  dan  cepat  tanpa  harus  datang \r\nsecara langsung ke Hotel Wira Carita. Kelebihan  dari majunya teknologi  tersebut \r\nmerupakan suatu  keuntungan sendiri bagi pemilik jasa penginapan, karena tidak \r\nmembutuhkan biaya yang besar dalam memasarkan jasanya. Hotel Wira Carita \r\nmerupakan perusahaan  jasa penginapan yang  sudah beroprasi sejak tahun 1984 \r\ndan didrikan oleh Patar Julianto Hartana. Untuk membentuk proses bisnis yang \r\ndapat bersaing dengan penyedia jasa penginapan lain dan era modern saat ini, \r\nMaka dibutuhkan sebuah aplikasi yang dapat menghubungkan antar aplikasi dari \r\nberbagai platform yang  berbeda  dengan  sistem  yang  dibuat.  Untuk  dapat \r\nmengatasi  masalah  tersebut  maka  dibutuhkan  sebuah web  service dengan \r\narsitektur  REST  yang  dapat  menghubungkan  antara  aplikasi  dari  berbagai \r\nperangkat  yang  berbeda.  Karena  data  pribadi  pelanggan  sangat  rawan  untuk \r\ndisalah gunakan oleh pihak yang tidak bertanggung jawab. Untuk dapat menjamin \r\nkeamanan data pelanggan tersebut maka web service tersebut dilengkapi dengan \r\nenkripsi. Metode yang digunakan dalam melakukan enkripsi ini adalah Vigenere \r\nCipher. Tujuan dari penelitian ini adalah untuk menerapkan teknologi web service \r\ndengan arsitektur REST yang dapat digunakan oleh berbagai macam jenis client \r\nseperti aplikasi mobile dan aplikasi web, yang dapat membantu pelanggan Hotel \r\nWira  Carita dalam  melakukan pemesanan hotel dan  juga  mempermudah \r\nperusahaan  dalam  menerima  pesanan  dari  pelanggan.  Sehingga  dapat \r\nmempercepat  proses  pesanan.  Penelitian  ini  juga  akan  menerapkan  Algoritma \r\nVigenere  Cipher  sebagai  enkripsi  yang  bertujuan  untuk  mengamankan  data \r\npelanggan dan transaksi yang tersimpan dalam database. \r\n \r\nKata Kunci : REST API, Web Service, Vigenere Cipher, PHP, Android. \r\n  \r\nxvi +74 halaman; 73 gambar; 7 table; 3 lampiran \r\n \r\n  \r\n Perpustakaan Universitas Budi Luhur\r\n'),(19,'1511500538','2021-02-05 14:01:38','42054','../files/1511500538.pdf',' \r\n \r\nIMPLEMENTASI DATA MINING SEBAGAI SISTEM PREDIKSI \r\nPENJUALAN MENGGUNAKAN ALGORITMA KLASIFIKASI  \r\nK-NEAREST NEIGHBOR DENGAN METODE PENGUKURAN JARAK \r\nEUCLIDEAN DISTANCE BERBASIS WEB PADA RESTORAN GIOI \r\nJAKARTA SELATAN \r\n \r\nOleh : Roosananda Gama Fitranto (1511500538) \r\n \r\nPerusahaan atau badan usaha didirikan dengan tujuan menghasilkan barang dan jasa \r\nyang  ditujukan  untuk  kebutuhan  konsumen  sekaligus  untuk  mendapatkan \r\nkeuntungan bagi  perusahaan  atau  badan  usaha  tersebut.  Kegiatan  penjualan \r\nmerupakan salah satu indikator penting dalam dunia usaha. GIOI merupakan badan \r\nusaha yang bergerak pada bidang restoran. GIOI masih menghadapi permasalahan \r\nyang umum dihadapi oleh pemilik badan usaha, misalnya adanya kesulitan dalam \r\npenyediaan stok  bahan  makanan  atau minuman, seperti banyaknya stok bahan \r\nmakanan dan minuman yang kosong atau tidak laku terjual. Pada penulisan tugas \r\nakhir ini, penulis ingin membangun suatu sistem yang dapat memprediksi jumlah \r\npenjualan pada restoran GIOI Jakarta Selatan dengan menggunakan data penjualan \r\nharian  yang  ada,  dengan  pengimplementasian  bidang  ilmu data  mining \r\nmenggunakan algoritma K-Nearest Neighbor, dengan metode pengukuran jarak \r\nEuclidean Distance, serta atribut  yang akan digunakan adalah sebagai  berikut: \r\nmenu, kategori menu, kategori hari, kategori tanggal dan jumlah terjual. Dataset \r\nyang digunakan adalah dataset penjualan selama bulan Maret 2019 yang berjumlah \r\n3.414 data yang dibagi menjadi 2 bagian yakni: 3.307 dataset latih dan 107 dataset \r\nuji. Hasil yang diperoleh dari penelitian ini menghasilkan nilai akurasi terbaik \r\ndengan K = 3 sebesar 81.86%, dengan nilai Mean Absolute Error (MAE) sebesar \r\n1.66 dan nilai Mean Percentage Error (MAPE) sebesar 18.14%.  \r\n \r\nKata Kunci : Data Mining, K-Nearest Neighbor, Euclidean Distance \r\n \r\nxiv+46 halaman; 32 gambar; 11 tabel; 1 lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(20,'1511500579','2021-02-05 14:01:38','84603','../files/1511500579.pdf',' \r\nIMPLEMENTASI KRIPTOGRAFI BERBASIS WEB DENGAN ALGORITMA AES 256 \r\nDAN KOMPRESI HUFFMAN UNTUK PENGAMANAN FILE DI SMK SATRIA \r\nOleh : NIZAMUDDIN AULIA KAFA (1511500579) \r\nKeamanan dan kerahasiaan suatu data di zaman sekarang ini terutama bagi \r\nsuatu instansi atau organisasi tertentu merupakan hal yang sangat penting. Ada \r\ndata yang bersifat rahasia, artinya data yang bersifat rahasia akan sangat dijaga \r\ndan  diperhatikan  karena  itu  sangat  penting  menjaga  kerahasiaan  data  tersebut. \r\nMenjaga  keamanan  data  yang  bersifat  rahasia  diperlukan  suatu  system  yang \r\ndigunakan untuk menyandikan data yang berupa file dan membukanya diperlukan \r\nkunci  rahasia  yang  sifatnya  sulit  untuk  dideteksi  orang  yang  tidak  berhak \r\nmembukanya. Keamanan data pada Tata Usaha di SMK SATRIA yang bergerak \r\ndalam  bidang  pengolahakan  data  yang  berfungsi  untuk  mengatur  pelaksanaan \r\nadministrasi  program  dan  anggaran  sekolah,  terutama  pada  data  guru,  siswa \r\nkeuangan dan nilai yang penting untuk mendukung pembelajaran sekolah. Agar \r\ntidak terjadi manipulasi data maka diperlukan sebuah aplikasi kriptografi yang \r\ndapat mengamankan data dari terjadinya manipulasi data. Dalam penelitian ini \r\nmembahas  konsep  yang  dapat  digunakan  untuk  menjaga  keamanan  data  yaitu \r\nilmu kriptografi.Metode kriptografi yang akan digunakan dalam penelitian tugas \r\nakhir ini adalah AES 256 sebagai algoritma kriptografinya dan metode kompresi \r\nHuffman sebagai  mekanisme  kompresi. Sehingga  keamanan  data  akan  lebih \r\nterhindar dari manipulasi data oleh pihak yang tidak berwenak dan data file tidak \r\nterlalu  besar  setelah  dijalankan  proses.  Dokumen  yang  diuji  adalah  dokumen \r\nbertipe .doc, .docx, .xls, .xlsx, dan .pdf. Dari hasil implementasi dan pengujian \r\ndidapat kesimpulan bahwa algoritma kriptografi AES 256 dan kompresi Huffman \r\ndapat diimplementasikan dalam menjaga kehasiaan dan keamanan data. \r\n \r\nKata Kunci : Kriptografi, Kompresi, Algoritma, AES 256, Huffman \r\n  \r\nxiii + 68 halaman; 64 gambar; 11 algoritme; 8 table;  2 lampiran \r\n \r\n   \r\n Perpustakaan Universitas Budi Luhur\r\n'),(21,'1511500595','2021-02-05 14:01:38','21379','../files/1511500595.pdf',' \r\nIMPLEMENTASI METODE KLASIFIKASI DATA MINING \r\nBERBASIS WEB DENGAN ALGORITME NAÃVE BAYES UNTUK \r\nPREDIKSI KELANCARAN KREDIT NASABAH KOPERASI SIMPAN \r\nPINJAM MITRA USAHA KOTA TANGERANG \r\n \r\nOleh : Hengki Cahya Wijaya (1511500595) \r\nKoperasi adalah suatu badan usaha yang bergerak di bidang ekonomi. Koperasi \r\ndapat  membantu  masyarakat  terutama masyarakat  menengah  dan  ke bawah. \r\nKoperasi juga memegang peranan penting untuk membantu perekonomian negara. \r\nKoperasi terbagi  menjadi  beberapa  jenis yaitu  Koperasi  Produksi,  Koperasi \r\nKonsumsi, Koperasi Simpan Pinjam, dan Koperasi Serba Usaha. Koperasi Simpan \r\nPinjam dikenal dengan nama Koperasi Kredit. Koperasi ini menyediakan pinjaman \r\nuang dan penyimpanan uang. Risiko yang dihadapi oleh koperasi simpan pinjam \r\nadalah  peminjam  tidak  membayar  pinjaman  uangnya  sehingga  dapat \r\nmengakibatkan terjadinya kredit macet dan hilangnya pendapatan dari koperasi itu \r\nsendiri. Di koperasi peminjaman uang kepada anggotanya hanya dengan mengisi \r\nformulir dan survei ke lapangan serta memberikan fotocopy KTP tanpa ada jaminan \r\nlain  bila  tidak  melunasi  pinjaman  tepat  pada  waktunya. Untuk  meminimalisir \r\nkemungkinan terjadinya kredit macet, maka perlu memprediksi kelayakan calon \r\nnasabah baru yang akan melakukan peminjaman uang menggunakan data mining. \r\nTeknik  data mining yang  digunakan  adalah  klasifikasi  menggunakan algoritme \r\nnaÃ¯ve bayes. Hasil proses klasifikasi dievaluasi menggunakan confusion matrix, \r\nholdout validation untuk mengetahui tingkat akurasi. Berdasarkan hasil pengujian \r\ndiperoleh tingkat akurasi sebesar 66.67 % , sensitivity (True Positive Rate (TP Rate) \r\nor  Recall)  sebesar 82.60%, dan specificity (Positive  Predictive  Value (PPV or \r\nPrecision) sebesar 70.37%. \r\n \r\nKata Kunci : Algoritme NaÃ¯ve Bayes, Data Mining, Klasifikasi, Koperasi.  \r\n \r\nxiii+63 halaman; 31 gambar; 10 tabel; 9 lampiran  Perpustakaan Universitas Budi Luhur\r\n'),(22,'1511500645','2021-02-05 14:01:38','20580','../files/1511500645.pdf',' \r\n \r\nPENERAPAN DATA MINING KLASIFIKASI BERBASIS WEB UNTUK \r\nPERPANJANGAN POLIS ASURANSI MOBIL DENGAN ALGORITME \r\nNAÃVE BAYES PADA PT ASURANSI SINARMAS \r\n \r\nOleh : Diana Seprianti (1511500645) \r\n \r\nAsuransi adalah suatu kegiatan pemindahan atau pengalihan risiko untuk mencegah \r\nterjadinya kerugian besar. Asuransi dibagi menjadi beberapa jenis, diantaranya  \r\nasuransi  kebakaran,  asuransi  kendaraan bermotor, asuransi  perjalanan, asuransi \r\nkecelakaan diri, asuransi kesehatan dan asuransi jiwa. Asuransi kendaraan bermotor \r\nadalah suatu pertanggungan kerugian yang khusus untuk melindungi tertanggung \r\ndalam  adanya  risiko  kerusakan  atau  kerugian  yang  ditimbulkan  dari  berbagai \r\nmacam  kejadian.  Dalam  asuransi  kendaraan  bermotor  lembaga  jaminan  yang \r\ndipercayakan untuk pemberian jaminan perlindungan dirasa semakin penting, tetapi \r\nmasih  terdapat  masyarakat  yang  belum  memahami  peran  asuransi kendaraan \r\nbermotor  dalam  meringankan  beban  baik  kepada  korban  maupun  jaminan  itu \r\nsendiri  dan  mempersulit  perusahaan  untuk  menentukan  nasabah  tersebut \r\nperpanjang atau tidak dan perusahaan masih menggunakan sistem yang sederhana \r\natau manual, namun masih tetap memenuhi syarat prinsip dari sebuah perusahaan. \r\nMaka dari itu dibutuhkan aplikasi untuk klasifikasi yang dapat menentukan calon \r\nnasabah perpanjang atau tidak dengan menggunakan salah satu metode yaitu data \r\nmining dan  menggunakan  algoritma naÃ¯ve  bayes.  Hasil  pengujian  dievaluasi \r\nmenggunakan confusion  matrix,  holdout  validation untuk  mengetahui  akurasi. \r\nBerdasarkan hasil pengujian diperoleh hasil akurasi sebesar 75,55%, presisi sebesar \r\n16,66%, dan recall sebesar 14,28%. \r\n \r\nKata Kunci : Asuransi, Algoritma NaÃ¯ve Bayes, Confusion Matrix, Data Mining, \r\nHoldout Validation, Klasifikasi. \r\n \r\nxiv+66 halaman;34 gambar;7 tabel;8 lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(23,'1511500660','2021-02-05 14:01:38','19965','../files/1511500660.pdf',' \r\n \r\nJudul : Aplikasi Chatbot pada Pendaftaran Online Dengan Google Assistant Di \r\nSMK PGRI 1 Tangerang \r\n \r\nPenelitian ini bertujuan untuk memperkenalkan media informasi interaktif berupa \r\naplikasi Chatbot kepada pendaftar  maupun  guru  dan  staff di  SMK  PGRI  1 \r\nTangerang.  Permasalahan  sebelumnya pendaftar  kurang  tertarik  membaca \r\ninformasi pendaftaran yang sudah desediakan berupa browsur pendaftaran dan di \r\nwebsite sekolah belum tersedianya layanan pesan 24 jam masih melayani melalui \r\nemail. Dalam mengatasi permasalahan tersebut maka dengan hasil Analisa dan \r\nobeservasi  yang  telah  peneliti  lakukan  sebelumnya  dibuatlah  aplikasi chatbot. \r\nDalam pembuatan  aplikasi  ini  penulis membuat  sebuah Kecerdasan  Buatan \r\n(Artificial  Intelegence)  di  implementasikan  menjadi  NLP  (Natural  Language \r\nProcessing) kemudian agar lebih memudahkan pengguna maka chatbot ini sudah \r\nterintegrasi dengan Google Assistant yang ada di platform android. Lalu chatbot \r\nini  sudah  dibekali  dengan machine  learning dengan  melihat  log  aktifitas  di \r\nfirebase admin bisa menambah base knowladge atau pengetahuan chatbot. Dari \r\nhasil uji coba disimpulkan bahwa aplikasi ini berjalan dengan baik, chatbot dapat \r\nmerespon sesuai pertanyaan atau perintah yang pengguna berikan. \r\n \r\nKata Kunci : Chatbot, Google Assistant, Android \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(24,'1511500694','2021-02-05 14:01:38','20954','../files/1511500694.pdf',' \r\nIMPLEMENTASI AUGMENTED REALITY UNTUK \r\nPENGENALAN ALAT MUSIK TRADISIONAL MENGGUNAKAN \r\nMETODE MARKER BASED TRACKING PADA SD NEGERI \r\nCIKUPA 3 BERBASIS ANDROID \r\n \r\nOleh : Dimas Febriansyah (1511500694) \r\n \r\nSaat  ini,  teknologi  terbaru  yang  digunakan  dalam  penyampaian  informasi  adalah \r\nAugmented Reality (AR). Kurangnya pemanfaatan teknologi AR di SD Negeri Cikupa \r\n3 dalam penyampaian materi membuat anak-anak menjadi bosan dalam belajar karena \r\nmedia yang dipakai hanya menampilkan satu sudut pandang saja yang searah dan \r\nkurang interaktif dalam proses pembelajaran. Dalam penelitian ini peneliti membuat \r\nsolusi atau inovasi dengan  Augmented Reality sebagai metode Pengenalan Alat Musik \r\nTradisional  adalah  salah  satu  cara  untuk  mempelajari  dan  melestarikan  budaya \r\nIndonesia, Pengenalan Alat Musik Tradisional menerapkan teknologi dari Augmented \r\nReality dan Web Service, yang diharapkan dapat mempermudah penyajian informasi \r\nsecara interaktif dan real-time. Aplikasi ini berjalan pada platform mobile android. \r\nCara  kerja  dari  aplikasi  ini  adalah  dengan  melakukan scan terhadap marker \r\nmenggunakan kamera smartphone, lalu jika sudah terdeteksi maka akan menampilkan \r\ninformasi dari alat musik tersebut. Dalam pembuatan aplikasi ini ini peneliti berharap \r\nagar berjalan dengan skema yang telah di rancang sedemikian rupa. Hasil uji responden \r\nmenggunakan  kuisioner  ISO  9126 yang  dilakukan  pada  10 guru dan  30  siswa \r\nmenghasilkan 80% maka dapat dikatakan aplikasi efektif dan berjalan sesuai kriteria \r\nuji kualitas aplikasi. \r\n \r\nKata kunci: Augmented Reality, Web Service, teknologi, Alat Musik Tradisional \r\n \r\nxii+65 halaman, 32 gambar, 2 tabel, 42 lampiran \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(25,'1511500710','2021-02-05 14:01:39','76877','../files/1511500710.pdf',' \r\nAPLIKASI AUGMENTED REALITY UNTUK PEMBELAJARAN \r\nGERAKAN SHALAT BERBASIS ANDROID PADA PAUD FOKUS AS \r\nSALAM \r\nOleh : Setiawan Dwi Hartono (1511500710) \r\n \r\nPembelajaran adalah upaya untuk  memberikan  ilmu  kepada murid agar \r\nmendapatkan  pengetahuan  yang  lebih  dari  yang  sebelumnya.  Banyak  metode \r\npembelajaran yang disajikan dan dengan cara yang berbeda-beda. PAUD Fokus As \r\nSalam adalah sebuah instansi swasta yang  bergerak di bidang pendidikan. Di \r\nzaman modern seperti saat ini, media informasi dan teknologi berkembang sesuai \r\ndengan  perkembangan  zaman. Maka  dari  itu  dalam  penelitian  ini, penulis \r\nmenyediakan solusi  atau inovasi dalam melakukan suatu  metode pembelajaran \r\ngerakan shalat pada PAUD Fokus As Salam agar lebih menarik dan atraktif dalam \r\nbelajar gerakan shalat, yakni dengan menggunakan teknologi augmented reality. \r\nTeknologi augmented  reality merupakan  suatu  terobosan  baru  dalam  bidang \r\npembelajaran, khususnya pembelajaran gerakan shalat. Augmented reality adalah \r\nsuatu metode pembelajaran baru dalam dunia pendidikan yang dapat menyisipkan \r\nsuatu informasi atau masukan tertentu ke dalam dunia maya dan menampilkan di \r\ndunia  nyata  dengan  bantuan  beberapa  perangkat  kamera smartphone, atau \r\nperangkat komputer. Aplikasi yang dibuat penulis adalah berbasis Android. Tujuan \r\ndari  pembuatan  penelitian  ini  adalah  untuk  menciptakan  sebuah  aplikasi  yang \r\nmenggunakan teknologi augmented reality sebagai media pembelajaran gerakan \r\nshalat. Aplikasi ini diharapkan dapat bermanfaat dan membantu guru atau wali \r\nmurid dalam memberikan kemudahan materi dalam belajar gerakan shalat dengan \r\nmenggunakan  teknologi augmented  reality agar  murid-murid  terlihat  lebih \r\ninteraktif  dan  semangat  dalam  belajar  gerakan  shalat,  dan  murid-murid  akan \r\nmendapatkan  pengalaman  pembelajaran  baru  dengan  menggunakan  perangkat \r\nkamera smartphone. Dalam mengimplementasikan aplikasi ini dibutuhkan software \r\npendukung, yaitu Unity 3D sebagai software utama untuk pembuatan teknologi \r\naugmented reality, software Blender sebagai pembuatan karakter atau objek 3D \r\nyang akan ditampilkan pada aplikasi augmented reality, Microsoft Visual Studio \r\n2017 sebagai tools dalam penulisan script untuk aplikasi augmented reality, dan \r\nVuforia sebagai database untuk aplikasi augmented reality. Dari hasil uji coba \r\nmenggunakan 2 (dua) perangkat smartphone,  yaitu Vivo Y51L dan Vivo Y71 \r\nmenunjukkan hasil dimana dua perangkat smartphone tersebut dapat menampilkan \r\nanimasi 3D gerakan shalat dengan baik. \r\n \r\nKata Kunci : Pembelajaran, augmented reality, Unity3D, Blender, Microsoft\r\n  Visual Studio 2017 \r\n \r\nlxxiii+73 halaman; 61 gambar; 5 tabel; 1 lampiran \r\n Perpustakaan Universitas Budi Luhur\r\n'),(26,'1511500728','2021-02-05 14:01:39','40814','../files/1511500728.pdf',' \r\n \r\nJudul : IMPLEMENTASI ALGORITMA KRIPTOGRAFI ADVANCED  \r\nENCRYPTION STANDARD-128 (AES-128) UNTUK PENGAMANAN \r\nBASISDATA BERBASIS WEB PADA PT. AL AMIR TOUR & TRAVEL \r\n \r\n \r\nSaat ini data dan informasi menjadi hal yang penting. Berbagai perusahaan, \r\norganisasi,  instansi,  dan  lainnya  telah  memanfaatkan  teknologi  database  untuk \r\nmenyimpan dan juga mengelola data organisasi atau perusahaannya. Keamanan \r\nterhadap  data  yang  disimpan  dalam  database  sudah  menjadi  hal  yang  sangat \r\ndibutuhkan. Namun keamanan pada database dengan pembatasan hak akses sudah \r\ntidak lagi dapat menjamin keamanan data karena kebocoran data dapat disebabkan \r\noleh pihak-pihak yang langsung berhubungan dengan database itu sendiri seperti \r\nadministrator database. Salah satu caranya adalah dengan menggunakan algoritma \r\nkunci simetris, dimana kunci enkripsi dan dekripsi tersebut sama namun jika kunci \r\ntidak dapat diketahui oleh penyadap, maka isi pesan tidak dapat diketahui oleh \r\npenyadap. PT. Al Amir Tour & Travel adalah perusahaan yang bergerak dibidang \r\njasa wisata dan perjalanan, yang salah satunya adalah mengadakan keberangkatan \r\nUmroh dan Haji. PT. Al Amir Tour & Travel mempunyai tujuan untuk memberikan \r\npelayanan yang baik kepada pelanggan. PT. Al Amir Tour & Travel memiliki data \r\nyang disimpan dalam sebuah database. Salah satu data tersebut adalah data jamaah \r\nhaji yang merupakan data penting yang perlu dijaga keamanannya. Pada tugas akhir \r\nini dirancang suatu aplikasi kriptografi yang digabungkan dengan database, dimana \r\npenulis mengharapkan aplikasi ini kriptografi yang dapat membantu segala kegiatan \r\npada PT. Al Amir Tour & Travel. Dalam perancangan aplikasi ini menggunakan \r\nmetode  pengembangan  sistem  dengan  model  waterfall.  Aplikasi  menggunakan \r\nalgoritma AES (Advanced Encryption Standard) 128 dengan bahasa pemrograman \r\nPHP, dimana kunci enkripsi dan dekripsi sudah diatur oleh sistem, hal ini dilakukan \r\nagar informasi kunci tidak dapat diketahui dengan mudah oleh penyadap. Algoritma \r\nAES (Advanced Encryption Standard) 128 diharapkan mampu memproses enkripsi \r\ndan dekripsi data dengan waktu yang lebih cepat dan pengamanan yang lebih aman. \r\n \r\nKata  Kunci  : Database,  AES (Advanced  Encryption  Standard) 128, Enkripsi, \r\nDekripsi. \r\nxviii+163 \r\n Perpustakaan Universitas Budi Luhur\r\n'),(27,'1511500736','2021-02-05 14:01:39','245836','../files/1511500736.pdf',' \r\n \r\n \r\nIMPLEMENTASI TEKNOLOGI AUGMENTED REALITY SEBAGAI \r\nMEDIA PEMMBELAJARAN TENTANG LANDMARK (MARKAH \r\nTANAH) BERBASIS ANDROID PADA SISWA SD MULYA PANTURA \r\n \r\nOleh : Azkia Amalia (1511500736) \r\n \r\nPelajaran tentang negara - negara di dunia tidak terlepas dari Landmark yang \r\nmerupakan  objek  khusus  pada  suatu  negara.  Banyak  siswa  yang  mempelajari \r\npelajaran tersebut tetapi kurang memahami informasi penting pada suatu objek \r\nlandmark. Pembuatan Augmented Reality menggunakan beberapa software yang \r\ndigunakan  untuk  pembuatan  aplikasi  dari  awal  hingga  akhir    yaitu  Unity  3D, \r\nBlender  dan  software  pendukung  lainnya.  Objek  yang  dibuat  yaitu  mengenai \r\nlandmark  yang  ada  disuatu  negara.  Setelah Augmented  Reality sudah  bisa \r\ndigunakan, gambar di buku pelajaran dapat diganti dengan marker. Marker adalah \r\npola yang dibuat dalam bentuk gambar yang akan dikenali oleh kameraTeknologi \r\nAugmented Reality pada aplikasi pengenalan Landmark di dunia diharapkan dapat \r\nmenyumbangkan inovasi pembelajaran dan mampu menabah variasi dari media \r\npembelajaran sebelumya di SD Mulya Pantura. \r\n \r\nKata kunci :  Augmented Reality, Landmark, Android SDK \r\n \r\nxiii+50 halaman; 17 gambar; 12 tabel; 2 lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(28,'1511500793','2021-02-05 14:01:39','177044','../files/1511500793.pdf',' \r\n \r\nIMPLEMENTASI ALGORITMA AES-256 UNTUK PENGAMANAN \r\nLAYANAN API PADA RESTFUL DENGAN AUTENTIKASI JSON WEB \r\nTOKEN PADA CV. BINTANG CEMERLANG ABADI \r\nOleh : Hafied Rafiudin (1511500793)  \r\n \r\nPada  perkembangan  Teknologi  Informasi  dan Komunikasi  yang  sudah  sangat \r\npesat  ini,  tentunya  manusia  membutuhkan  bantuan  teknologi  untuk  membantu \r\nsetiap permasalahannya. Dan hampir disetiap perusahaan dari besar sampai  kecil, \r\nberlomba-lomba untuk meningkatkan kualitas dalam sisi teknologi. CV. Bintang \r\nCemerlang Abadi adalah perusahaan yang bergerak dibidang General Supplier, \r\nProductivity Cleaning, Workplace Safety Distributor, 3M Authorized Distributor \r\nyang berlokasi di daerah Karang Tengah, Kota Tangerang. Terdapat beberapa unit \r\ndalam lingkungan perusahaan. Masing-masing unit memiliki system yang berbeda \r\nplatform dan bahasa pemrograman. Terdapat beberapa database yang digunakan \r\nsecara terpisah dan aplikasi yang berbeda-beda. Salah satu solusi untuk mengatasi \r\nmasalah tersebut adalah dengan membuat RestFul Web Service  yang berfungsi \r\nuntuk mengintegrasi  data  antara  web  dengan  mobile  yang  dilengkapi  dengan \r\nAlgoritma AES-256 untuk mengamankan data API dengan autentikasi JSON Web \r\nToken untuk melakukan proses autentikasi pada Restful Web Service. Sehingga \r\npegawai tidak perlu lagi update secara manual dan menggunakan aplikasi yang \r\nberbeda pada saat melakukan pengiriman barang. \r\nKata kunci :Web Service, AES-256, Android, JSON Web Token. \r\n \r\nxiv+117 halaman; 78 gambar;  22 tabel; 1 lampiran.  Perpustakaan Universitas Budi Luhur\r\n'),(29,'1511500827','2021-02-05 14:01:39','69491','../files/1511500827.pdf',' \r\n \r\nPENERAPAN SENSOR CAHAYA DAN HUJAN UNTUK SISTEM \r\nOTOMATISASI ATAP MENGGUNAKAN ARDUINO BERBASIS \r\nTHRESHOLD PADA LARASSETTE LAUNDRY \r\nOleh : Muhamad Rizky Syawalludin (1511500827) \r\nLarassette Laundry adalah tempat usaha yang berdiri semenjak 1 Agustus 2001 \r\nyang  bergerak  di  bidang jasa Laundry  &  Dry Cleaning. Tempat usaha  ini \r\nmenggunakan sumber matahari sebagai media untuk mengeringkan pakaian. Jenis \r\nbarang yang dijemur pada Larassette Laundry bukan hanya pakaian saja, bahkan \r\nbarang-barang berat seperti gorden, karpet, sofa, maupun spring bed pun harus \r\ndijemur. Hal ini mengakibatkan apabila sedang musim hujan atau hujan datang \r\nsecara tiba-tiba pada saat musim kemarau, karyawan pada perusahaan Larassette \r\nLaundry harus mengangkat jemurannya yang tidak sedikit dan sangat merepotkan. \r\nOleh  karena  itu  dibutuhkan  suatu  sistem  yang  dapat  memudahkan  dan \r\nmengefesiensikan  proses  penjemuran  pada  Larassette  Laundry. Sistem  yang \r\ndigunakan untuk mudahkan dan mengefektifkan proses menjemur pada Larassette \r\nLaundry ini adalah sistem atap otomatis. Penelitian ini menggunakan Arduino Uno \r\nR3 sebagai mikrokontroler, dikombinasikan dengan driver motor DC dan DC motor \r\nsebagai penggeraknya. Sistem  atap  otomatis ini  juga  menggunakan  kontrol \r\notomatis menggunakan sensor deteksi hujan (Raindrop Sensor) dan sensor cahaya \r\nLDR (Light Dependent Resistor). Sistem atap otomatis ini juga dapat di monitoring \r\nmelaui website yang dihubungkan melalui module WIFI ESP8266 tipe ESP-01. \r\nKondisi atap akan terbuka apabila memenuhi kondisi nilai threshold cahaya <=699 \r\ndan nilai threshold hujan >=930. Kondisi atap akan tertutup apabila memenuhi 3 \r\nkondisi: nilai    threshold  cahaya <=699 dan  nilai  threshold  hujan  <=929,  nilai  \r\nthreshold cahaya >=700 dan nilai threshold hujan <=929 serta nilai  threshold \r\ncahaya >=700 dan nilai threshold hujan >=930. Sistem atap otomatis ini dapat \r\nmenjadi solusi  bagi  permasalahan kondisi cuaca  yang  tidak menentu  sehingga \r\nkegiatan menjemur pada perusahaan Larassette Laudry menjadi efektif. \r\n \r\nKata Kunci : Arduino UNO R3, Sensor Hujan, Sensor Cahaya, Motor DC, ESP-\r\n01, Algoritme Threshold \r\nXvii + 78 halaman ; 49 gambar; 11 tabel; 1 lampiran \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(30,'1511500868','2021-02-05 14:01:39','57269','../files/1511500868.pdf',' \r\n \r\nSISTEM SMART ATTENDANCE MENGGUNAKAN BLUETOOTH DAN \r\nNODEMCU ESP8266 BERBASIS MOBILE ANDROID \r\n \r\nOleh : Chintya Rifyaningrum (1511500868) \r\n \r\nDalam pertemuan di kelas setiap hari mahasiswa wajib melakukan pendataan \r\npresensi mahasiswa yang dilakukan oleh dosen. Pendataan normalnya dilaksanakan \r\nsecara manual oleh dosen dengan cara menyebutkan nama mahasiswa satu per satu. \r\nMaka dari itu pada penelitian ini disusunlah suatu sistem berbasis android dengan \r\nmenggunakan konsep Internet of Things (IoT)  menggunakan beberapa komponen \r\nyaitu  modul bluetooth HC-05,  modul  WiFi  NodeMCU  ESP8266,  dan  modul \r\nbuzzer. Penyusunan  sistem  ini  dilakukan  agar  di  Universitas  Budi  Luhur  ada \r\nmetode pendataan presensi mahasiswa selain menggunakan cara seperti yang telah \r\ndideskripsikan. Dalam  penggunaan  aplikasi android,  terdapat  perbedaan  jenis \r\npengguna,  dibedakan  berdasarkan  hak  aksesnya  terhadap  fitur  yang  diberikan. \r\nDalam penggunaan sensor bluetooth dan WiFi-nya,  yang menggunakan adalah \r\ndosen dan mahasiswa. Dosen sebagai trigger awal untuk mengambil data presensi, \r\ndan  mahasiswa  sebagai  subjek  yang  id-nya  didata  oleh  sensor. Adapun  hasil \r\npenelitian ini adalah sistem yang dapat membaca 1 hingga 10 id bluetooth dalam \r\nwaktu 4 detik yang sudah disertai dengan waktu pengirimannya ke dalam server.  \r\n  \r\nKata Kunci : Internet of Things, HC-05, NodeMCU ESP8266, smart attendance \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(31,'1511500918','2021-02-05 14:01:39','215471','../files/1511500918.pdf',' \r\n \r\n \r\nPenerapan Teknologi Augmented Reality berbasis android dengan \r\nmenggunakan metode Marker Based Tracking sebagai media pemasaran \r\nproduk pada Haus Coffee \r\n \r\nOleh : Julian Pratama Ashidik (1511500918) \r\n \r\nPenelitian  ini  bertujuan  untuk menerapkan aplikasi Augmented  Reality \r\npada bidang pemasaran produk yang medianya berupa daftar menu produk pada \r\nkedai kopi Haus Coffee. Melalui media pemasaran produk yang berupa daftar \r\nmenu yang hanya berisi tulisan tidak jarang calon pembeli masih merasa bingung \r\nuntuk membayangkan gambaran atau bentuk kopi yang akan dibeli dikarenakan \r\ntidak semua pembeli mengetahui tentang kopi. Sehingga terkadang pembeli harus \r\nbertanya kepada karyawan kedai untuk mendapatkan informasi ataupun gambaran \r\nyang lebih jelas. Karena semakin berkembangnya jaman dan teknologi maka ada \r\njalan keluar untuk mengatasi permasalahan tersebut yaitu dengan menggunakan \r\naplikasi Augmented  Reality  (AR). Aplikasi  ini  nantinya  akan  berisi  tentang \r\nAugmented Reality (AR) produk-produk kopi yang akan di pasarkan. Aplikasi ini \r\ndibangun dengan menggunakan bahasa pemograman C# dan juga menggunakan \r\nmetode Marker Based Tracking yang nanti nya ada sebuah daftar menu berisi \r\ngambar sebagai  salah  satu marker penanda  dan smartphone untuk scanning \r\nmarker tersebut. Hasil dari penelitian ini nanti nya akan menghasilkan aplikasi \r\nAugmented Reality (AR) yang dapat menyajikan sebuah gambar 3D dari produk \r\nHaus Coffee. Pada  pengujian  melalui  kuisioner  yang  di  sebarkan  kepada \r\npengunjung Haus Coffee mendapatkan hasil pencapaian keseluruhan 85%(Baik). \r\nDari  hasil  pengujian  tersebut  dapat  di  simpulkan  aplikasi  yang  di  buat  dapat \r\nberjalan dengan baik, sesuai dengan apa yang di butuhkan di Haus Coffee. \r\n \r\nKata kunci : Augmented Reality, Android, Marker Based Tracking \r\n \r\nXIV+56Halaman; 44Gambar; 12Tabel;  31Lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(32,'1511500934','2021-02-05 14:01:39','40692','../files/1511500934.pdf',' \r\n \r\nIMPLEMENTASI DATA MINING KLASIFIKASI BERBASIS WEB \r\nUNTUK PREDIKSI STATUS POLIS ASURANSI KESEHATAN DENGAN \r\nALGORITME NAÃVE BAYES PADA PT ASURANSI SINARMAS \r\n \r\nOleh : Jovansgha Avegad (1511500934) \r\n \r\nPT  Asuransi  Sinar  Mas  merupakan  perusahaan  yang  bergerak  dalam  bidang \r\nasuransi dan memiliki nasabah yang cukup banyak. Data PT Asuransi Sinar Mas \r\ntidak diolah sedemikian rupa dan hanya disimpan sebagai data nasabah. Untuk \r\nmengoptimalkan pemanfaatan data tersebut maka dibutuhkan suatu sistem yang \r\ndapat  mengolah  data  agar  menjadi  suatu  informasi  yang  bermanfaat.  Salah \r\nsatunya adalah menggunakan teknik data mining. Pada penulisan tugas akhir ini, \r\npenulis  ingin  membangun  suatu  sistem  yang  dapat  memprediksi  perpanjang \r\nasuransi kesehatan nasabah menggunakan data yang dimiliki PT Asuransi Sinar \r\nMas. Pendekatan yang dilakukan adalah menggunakan algoritme NaÃ¯ve Bayes, \r\ndengan  metode  evaluasi Confusion  Matrix dan  validasi Holdout dengan \r\npembagian data latih 2/3 dan data uji 1/3. Dataset yang digunakan adalah dataset \r\nnasabah dalam 12 bulan selama tahun 2018 sejumlah 225 dengan atribut nomor \r\npolis,  nama,  jenis  kelamin,  usia,  pekerjaan,  tanggungan,  mulai  asuransi,  plan, \r\npremi tahunan, periode asuransi, riwayat penyakit, rasio klaim dan perpanjangan. \r\nHasil  yang  diperoleh  dari  model  dapat  memprediksi  status  perpanjangan  polis \r\nasuransi dengan akurasi sebesar 88%, presisi 89,19% dan recall 100%. Dengan \r\nhasil yang relatif baik ini maka PT Asuransi Sinar Mas dapat melakukan upaya-\r\nupaya  peningkatan  pendapatan  misalnya  dengan  menawarkan  program \r\nperpanjangan polis asuransi pada nasabah-nasabah tertentu. \r\n \r\nKata Kunci : Data Mining, Klasifikasi, NaÃ¯ve Bayes, Confusion Matrix, Holdout \r\nValidation \r\n \r\nxi+55 halaman; 24 gambar; 27 tabel; 1 lampiran \r\n \r\n \r\n \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(33,'1511500942','2021-02-05 14:01:40','21096','../files/1511500942.pdf',' \r\n \r\nIMPLEMENTASI TEKNOLOGI AUGMENTED REALITY  \r\nSEBAGAI MEDIA PEMBELAJARAN ANATOMI TUBUH MANUSIA \r\nMENGGUNAKAN METODE MARKER BASED TRACKING \r\nPADA SMP NEGERI 187 JAKARTA. \r\n \r\nOleh : Wahyu (1511500942) \r\n \r\nSMP Negeri 187 Jakarta merupakan salah satu sekolah negeri yang ada di \r\nJakarta Barat yang termasuk dalam sekolah dengan fasilitas yang baik dan memadai \r\ndalam kegiatan belajar-mengajar. Sekolah ini memiliki 23 ruangan yang terdiri dari \r\n21  ruang  kelas  dan  2  laboratorium diantaranya  laboratorium komputer  dan \r\nlaboratorium ilmu  pengetahuan  alam.  Ruangan  laboratorium ilmu  pengetahuan \r\nalam dapat  digunakan  seluruh  siswa  yang  menyebabkan  pembelajaran  tentang \r\nanatomi tubuh kurang maksimal dikarenakan tidak semua siswa dapat masuk ke \r\nlaboratorium ilmu pengetahuan alam setiap jam pelajarannya. Saat ini pembelajaran \r\ntentang anatomi tubuh manusia hanya dilakukan melalui buku dan torso manusia, \r\ndimana penyajian  dari buku  dan  torso  manusia saja masih kurang  memberi \r\nkemudahan  kepada siswa. Untuk mengatasi masalah tersebut diperlukan inovasi \r\nmetode pembelajaran salah  satunya  melalui augmented reality untuk \r\nmempermudah pebelajaran tentang anatomi tubuh manusia. Aplikasi ini akan berisi \r\ntentang beberapa bagian anatomi tubuh manusia yang sudah dibuat tiga dimensinya. \r\nAplikasi ini dibangun dengan menggunakan bahasa pemrograman C# dan juga \r\nmenggunakan metode marker based tracking. Aplikasi augmented reality mampu \r\nmenyajikan sebuah gambar tiga dimensi dari anatomi tubuh manusia dengan baik. \r\n \r\nKata kunci : Augmented Reality, Android, Marker Based Tracking,  \r\n \r\nxv + 58 halaman; 28 Gambar; 12 Tabel; 15 Lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(34,'1511500959','2021-02-05 14:01:40','83111','../files/1511500959.pdf',' \r\nSistem Penunjang Keputusan Penentu Siswa Berprestasi Pada SMK \r\nYuppentek 1 Tangerang Berbasis Web Menggunakan Metode AHP \r\n(Analytical Hierarchy Process) \r\nOleh : Aji Suryo Utomo (1511500959) \r\n SMK  Yuppentek  1  Tangerang  adalah  Lembaga  Pendidikan  sekolah \r\nmenengah kejuruan yang memiliki prestasi diberbagai bidang. Pemilihan siswa \r\nberprestasi  merupakan  suatu  proses  untuk  mendapatkan dan  menggunakan \r\ninformasi siswa yang berprestasi disekolah. Akan tetapi dalam proses penentuan \r\nsiswa berprestasi yang sudah dilalukan secara manual ada beberapa kelemahan dan \r\ndapat menimbulkan persoalan, diantaranya yaitu, proses pemilihan membutuhkan \r\nwaktu  yang  lama,  terjadinya  human  error,  menimbulkan  kecemburuan.  Guru \r\nsebagai seorang yang menentukan keputusan pemilihan siswa berprestasi harus \r\nmemberikan  keputusan  yang  tepat  dan  relevan  sehingga  tidak  ada  terjadinya \r\nkesalahan-kesalahan.  Perkembangan  teknologi  yang  sangat  pesat  dalam \r\nperkembangan software dan hardware akan sangat membantu untuk pemilihan \r\npengambil keputusan. Maka dari itu penulis membuat sebuah aplikasi yang akan \r\nmembantu  meringankan  guru  dalam  penentuan  siswa  berprestasi.  Dalam \r\npembuatan aplikasi ini berbasis web dengan Bahasa pemrograman PHP dan untuk \r\npengolahan data menggunakan MySQL sebagai database.  Metode yang digunakan \r\nadalah menggunakan metode AHP (Analytical Hierarchy Process). Metode yang \r\ndigunakan ini efektif untuk memecahkan permasalahan sesuai dengan kriteria pada \r\nsetiap siswa sehingga guru dapat menentukan secara akurat dan objektif dalam \r\nkeputusan menentukan siswa berprestasi. Hasil dari perhitungan sistem penunjang \r\nkeputusan berdasarkan data tahun ajaran 2019 menunjukkan bahwa pada peringkat \r\npertama siswa berprestasi dengan metode AHP bernilai 0.208. \r\nKata Kunci : Analytical Hierarchy Process (AHP), Sistem Penunjang Keputusan, \r\nPenentu siswa berprestasi. \r\nxiii+68 halaman; 50 gambar; 10 tabel; 9 algoritma; 2 lampiran \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(35,'1511500967','2021-02-05 14:01:40','304654','../files/1511500967.pdf',' \r\n \r\nIMPLEMENTASI ALGORITMA KRIPTOGRAFI RC4 UNTUK \r\nKEAMANAN DATABASE APLIKASI PENGGAJIAN \r\nKARYAWAN BERBASIS WEB PADA PT. TRANS INTRA \r\nASIA \r\nOleh : Andre Setiawan (1511500967) \r\nPT. Trans Intra Asia adalah perusahaan yang bergerak di bidang consultant \r\nmanagement yang mempuyai 70 karyawan. Setiap bulannya Perusahaan melakukan \r\npenggajian  terhadap  karyawan  dimana  data  yang  disimpan  dalam database \r\nmemiliki keamanan kurang baik karena hanya memakai keamanan dari database \r\nsaja dan  sewaktu-waktu  bisa  saja  diserang  oleh  pihak-pihak  yang  tidak \r\nbertanggung  jawab. Sehingga  perlu dibuat  aplikasi  keamanan database untuk \r\nmengamankan data penggajian karyawan. Teknik kriptografi menjadi salah satu \r\nalternatif  solusi  yang  dapat  digunakan  dalam  pengamanan database.  Adapun \r\nmetode  kriptografi  yang  digunakan  adalah  metode  algoritma  kriptografi  RC4 \r\n(Rivest Code 4) yang termasuk dalam kriptografi kunci simetris, yaitu algoritma \r\nkriptografi yang menggunakan kunci enkripsi dan sama dengan kunci dekripsinya. \r\nKelebihan dari kriptografi kunci simetris antara lain proses enkripsi atau dekripsi \r\nmembutuhkan waktu yang singkat, ukuran kunci simetris relatif pendek dan dapat \r\ndigunakan untuk membangkitkan bilangan acak. Aplikasi ini menggunakan bahasa \r\npemrograman  PHP  (Hypertext  Prepocessor)  dengan  database  MySQL. Hasil \r\npenelitian  ini  menunjukkan  data  penggajian  karyawan  pada   perusahaan dapat \r\nterjaga kerahasiaannya karena  melalui proses enkripsi terlebih dahulu sehingga \r\nterhindar dari pencurian data atau diketahui oleh pihak yang tidak bertanggung \r\njawab. \r\n \r\n \r\nKata kunci :  Database, Kriptografi, RC4, Enkripsi, Dekripsi  \r\n \r\nxi+88 halaman; 93 gambar; 9 tabel; 1 lampiran \r\n \r\n  \r\n'),(36,'1511500975','2021-02-05 14:01:40','22165','../files/1511500975.pdf',' \r\nPENERAPAN TEKNOLOGI AUGMENTED REALITY UNTUK \r\nMENYAJIKAN INFORMASI LUKISAN PADA MUSEUM BASOEKI \r\nABDULLAH \r\n \r\nOleh: Fauzi Setyo Fendhio (1511500975) \r\n \r\nTeknologi  Informasi  dan  Komunikasi  sudah  berkembang  dengan  sangat  pesat. \r\nDengan teknologi informasi, manusia bisa mengakses informasi dengan lebih cepat \r\ndan  mudah  ketika  diperlukan. Perkembangan  selalu  ada  untuk  memudahkan \r\nmanusia  dalam  berbagai  pekerjaan  dan  kegiatan  sehari-hari,  termasuk  dalam \r\npenyajian informasi. Penyajian informasi tersebut dapat memudahkan pengunjung \r\nmaupun pemandu wisata dalam menyampaikan informasi dari lukisan tersebut. \r\nTerdapat berbagai  macam  koleksi  yang  ditampilkan pada Museum  Basoeki \r\nAbdullah, salah satunya adalah lukisan. Namun, karena kurangnya informasi secara \r\nmendetail pada setiap koleksi lukisan, pemandu wisata akan kesulitan menjelaskan \r\ninformasi mengenai lukisan tersebut ketika banyaknya pengunjung yang datang. \r\nUntuk saat ini informasi mengenai lukisan masih bersifat umum, yaitu informasi \r\nyang disajikan dikelompokkan sesuai tema dari lukisan. Penyajian informasi yang \r\ndikemas secara informatif dan interaktif, serta dengan digunakannya teknologi yang \r\ntepat seperti augmented reality dan web service diharapkan dapat menarik minat \r\npara  pengunjung Museum  Basoeki  Abdullah,  memudahkan  pengunjung dalam \r\nmengakses informasi mengenai koleksi lukisan yang ada. Aplikasi ini mererapkan \r\nteknologi augmented reality dan web service, serta digunakannya Unity sebagai \r\nsoftware  engine, dan Vuforia sebagai  SDK  (Sofware  Development  Kit). SDK \r\nmendeteksi  dan  melacak  fitur  yang  secara  alami  ditemukan  dalam  gambar  itu \r\nsendiri dengan membandingkan fitur alami ini dengan database sumber daya target \r\nyang diketahui. Aplikasi ini berjalan pada platform mobile, yaitu Android. Cara \r\nkerja aplikasi ini adalah dengan cara melakukan scanning terhadap marker yang \r\nsudah  ditentukan menggunakan  kamera smartphone.  Lalu  aplikasi  akan \r\nmenampilkan  informasi mengenai lukisan tersebut. Selain  itu,  dengan \r\ndigunakannya augmented reality dapat memberikan efek visual yang menarik serta \r\nmemberikan kemudahan dalam menyajikan informasi lukisan. Web service juga \r\ndapat memperbarui data atau informasi secara aktual, memberikan informasi yang \r\nakurat dan efisien bagi para pengunjung. Dengan dibuatnya aplikasi ini, diharapkan \r\ndapat mempermudah penyajian informasi secara informatif, interaktif dan real-\r\ntime. Selain itu para pengunjung juga dapat menjelajahi museum dengan bebas \r\nnamun tetap dapat mengetahui informasi yang sesuai mengenai lukisan tersebut. \r\n \r\nKata  kunci: Augmented Reality, Web  Service, Vuforia, Image Target, Unity, \r\nLukisan \r\n \r\nxiv+49 halaman; 38 gambar; 4 tabel; 2 lampiran \r\n Perpustakaan Universitas Budi Luhur\r\n'),(37,'1511500991','2021-02-05 14:01:40','49663','../files/1511500991.pdf',' \r\nIMPLEMENTASI ALGORITMA KRIPTOGRAFI RC4 UNTUK \r\nKEAMANAN DATABASE PADA PT. NUANSA INDONESIA \r\n \r\nSaat ini data dan informasi menjadi hal yang penting bagi perusahaan. Berbagai \r\nperusahaan  telah  memanfaatkan teknologi database untuk menyimpan  data \r\nperusahaannya. Keamanan data yang disimpan dalam database sudah menjadi hal \r\nyang sangat dibutuhkan. Namun keamanan pada database sudah tidak dapat lagi \r\nmenjamin keamanan data karena kebocoran data dapat disebabkan oleh pihak-\r\npihak  yang  langsung berhubungan  dengan database itu  sendiri  seperti \r\nadministrator database. PT. Nuansa Indonesia adalah perusahan yang bergerak \r\ndibidang konstruksi.  Data-data  perusahaan  yang  disimpan  di database yang \r\nmemiliki keamanan kurang baik karena hanya memakai keamanan dari database \r\nsaja  dan  sewaktuwaktu  bisa  saja  diserang  oleh  pihak-pihak  yang tidak \r\nbertanggung jawab. Salah satu cara untuk mengamankan data adalah dengan cara \r\nteknik  kriptografi.  Kriptografi  merupakan  cara  yang  dilakukan untuk \r\nmenyandikan  pesan  asli  menjadi  pesan  acak  yang  sulit  dipahami. Didalam \r\nkriptografi  terdapat  dua  proses  utama  yaitu  enkripsi  dan  dekripsi. Enkripsi \r\nmerupakan mengubah pesan asli menjadi pesan sandi sedangkan dekripsi adalah \r\nproses pengembalian pesan sandi menjadi pesan aslinya. Metode yang dipakai \r\nadalah metode Rivest code 4 (RC4) karena metode merupakan salah satu metode \r\nyang hasil penyandian (chipertext) memiliki ukuran Panjang karakter yang sama \r\ndengan pesan asli (plaintext). Metode ini terdiri dari tiga tahap yaitu KSA(Key \r\nSchedulling  Algorithm), PRGA(Pseudo  Random  Generation  Algoritm),  dan \r\nproses  XOR.  Hasil penelitian  ini  menunjukan  bahwa  data  penggajian  menjadi \r\nlebih aman karena sudah terenkripsi, yang membuat data penggajian tersebut sulit \r\nuntuk  dibaca.  Data  juga  terdekripsi  dengan  baik  tanpa  mengurangi  data yang \r\nsebelumnya di buat. Keberhasilan program ini adalah 100% karena karakter yang \r\nterenkrip sama dengan Panjang karaketer yang diinput. \r\n \r\nKata Kunci: RC4. Enkripsi, Dekripsi, Kriptografi, Database '),(38,'1511501007','2021-02-05 14:01:40','75434','../files/1511501007.pdf',' \r\n \r\n \r\nJudul : DECISION  SUPPORT SYSTEM PENILAIAN PENERIMAAN \r\nPERSONAL  TRAINER DENGAN METODE ANALYTICAL \r\nHIERARCHY PROCESS (AHP) BERBASIS WEB PADA GIN GYM \r\nFITNESS & BODY BUILDING \r\n \r\nPenilaian personal trainer untuk menentukan personal trainer terbaik yang sesuai \r\ndengan kebutuhan merupakan hal yang wajib dilakukan untuk menunjang kualitas \r\ndalam menyediakan seorang personal trainer pada perusahaan fitness. Beberapa \r\npermasalahan  dalam  menentukan personal  trainer adalah  belum  adanya \r\npembobotan dari setiap kriteria, sehingga pihak perusahaan yang menilai kesulitan \r\nuntuk menentukan kandidat personal trainer, dan dalam pengolahan data penilaian \r\nmasih  belum  terkomputerisasi,  sehingga  membutuhkan  waktu  yang  lama  dan \r\nperhitungannya belum akurat. Tujuan dari penelitian ini untuk memudahkan pihak \r\nGin Gym dalam mencari personal trainer yang sesuai dengan kriteria (Personality, \r\nProfessional, Communication, Energy, Certification) yang telah ditetapkan untuk \r\nmenunjang kualitas dalam menyediakan seorang personal trainer. Maka dari itu, \r\npenelitian  ini bertujuan  untuk  menghasilkan Decision  Support  System (DSS). \r\nPenelitian ini menggunakan metode Analytical Hierarchy Process (AHP) untuk \r\nmenentukan  bobot  kriteria  dan  memberikan  peringkat  berdasarkan  alternatif. \r\nDengan adanya DSS yang menggunakan metode AHP dapat mempermudah dan \r\nmenyajikan  informasi  yang  dibutuhkan  untuk  mengambil  keputusan  dalam \r\npemilihan personal trainer yang sesuai dengan kebutuhan pihak Gin Gym. \r\n \r\nKata kunci : Decision Support System, Analytical Hierarchy Process, Penilaian \r\nPenerimaan Personal Trainer. \r\n \r\n \r\n \r\nxiii+54 halaman; 53 gambar; 11 tabel; 3 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(39,'1511501023','2021-02-05 14:01:40','21939','../files/1511501023.pdf',' \r\nAPLIKASI PENYAJIAN INFORMASI MENGENAI SEJARAH \r\nMENGGUNAKAN TEKNOLOGI AUGMENTED REALITY BERBASIS \r\n ANDROID DENGAN METODE MARKER BASED TRACKING  \r\nPADA MUSEUM JUANG TARUNA \r\n \r\nOleh : Riyadus Bintang Ramadhan (1511501023) \r\n \r\nMuseum Juang Taruna  Tangerang memiliki sejumlah koleksi foto-foto sejarah \r\npara taruna saat menempuh pendidikan Akademi Militer Tangerang Pertempuran \r\nLengkong. Museum ini terbagi dalam tiga ruangan. Ruangan pertama merupakan \r\nperpustakaan mini  yang memuat  buku-buku sejarah peninggalan jaman dahulu \r\nyang tetap dipertahankan dan deretan foto pahlawan nusantara. Di ruangan tengah \r\nyang mengusung konsep minimalis modern, terdapat sejumlah foto para Taruna \r\ndan  sejarah  singkat  Peristiwa  Lengkong  yang  dilengkapi  foto  para  pahlawan. \r\nSedangkan ruangan ketiga adalah didesain seperti jaman perjuangan ketika para \r\nVeteran  memberikan  materi  kepada  pelajar  sehingga  dapat  memunculkan \r\nsemangat perjuangan. Keseluruhan koleksi foto-foto sejarah dimuseum ini berjumlah \r\n97 koleksi foto, namun kurangnya teknologi informasi secara men-detail, membuat \r\npengunjung  kesulitan  untuk  mempelajari  sejarah  dimuseum  tersebut. Tujuan \r\naplikasi ini dapat mempermudah pengunjung dalam penyajian informasi secara \r\ninformatif,  interaktif  dan lebih  menarik dengan  menggunakan  teknologi \r\naugmented reality. Aplikasi ini menerapkan teknologi augmented reality, serta \r\ndigunakannya Unity sebagai software engine, dan Vuforia sebagai SDK (Sofware \r\nDevelopment Kit). Dengan metode yang digunakan marker based tracking adalah \r\nAugmented Reality yang menggunakan marker atau penanda objek dua dimensi \r\nyang memiliki suatu pola yang akan dibaca komputer melalui media webcam atau \r\nkamera yang tersambung dengan komputer. Aplikasi ini berjalan pada platform \r\nAndroid. Cara kerja aplikasi ini ketika marker dipindai oleh kamera smartphone \r\nterhadap marker yang  sudah  ditentukan,  menggunakan  kamera smartphone. \r\nAplikasi  mampu menampilkan objek  tiga  dimensi  dan informasi  sejarah pada \r\nMuseum Juang Taruna dengan baik, dimana 85% responden menyatakan puas \r\nsaat menggunakan aplikasi tersebut. Hasil uji responden menggunakan kuisioner \r\nISO  9126 yang  dilakukan  pada  30 responden menghasilkan 85%  maka  dapat \r\ndikatakan aplikasi efektif dan berjalan sesuai kriteria uji kualitas aplikasi. \r\n \r\nKata kunci: Augmented Reality, Marker, Vuforia, Unity, Informasi, Sejarah. \r\n \r\nXiii + 90 halaman; 54 gambar; 10 tabel; 4 lampiran  Perpustakaan Universitas Budi Luhur\r\n'),(40,'1511501064','2021-02-05 14:01:40','159590','../files/1511501064.pdf',' \r\n \r\nIMPLEMENTASI DATA MINING MARKET BASKET ANALYSIS \r\nMETODE ASOSIASI UNTUK TRANSAKSI PENJUALAN BERAS \r\nDENGAN MENGGUNAKAN ALGORITMA APRIORI BERBASIS WEB \r\nPADA PT. BERKAH AGRO ENERSI \r\n \r\nOleh : Rafli Gilang Darmawan (1511501064) \r\n \r\nKeberadaan persediaan barang disatu pihak merupakan pemborosan sehingga \r\ndapat dikatakan sebagai suatu beban yang harus dihilangkan, tetapi di lain pihak \r\nsangat diperlukan untuk menjamin kelancaran pemenuhan permintaan sebab bila \r\ntidak ada persediaan maka kebutuhan tidak terpenuhi. Dalam permasalahan yang \r\nada di PT. Berkah Agro Enersi tidak dapat memanfaatkan data transaksi penjualan \r\nyang  ada  dan  biasanya  dari  data  transaksi  penjualan  pihak  manajemen  dapat \r\nmengetahui kebiasaan pembeli mengenai produk beras apa saja yang sering dibeli. \r\nPermasalahan  lain  adalah  untuk  mengendalikan  persediaan  barang  di  gudang, \r\nkarena jika barang terlalu lama disimpan akan mudah rusak dan menghilangkan \r\nkualitas beras tersebut. Salah satu strategi dan cara untuk meningkatkan penjualan \r\nyaitu  dikembangkannya  aplikasi Data  Mining berbasis website dengan \r\nmenggunakan bahasa pemrograman PHP (Hypertext Preprocessor) dan algoritma \r\napriori (association rule) yang dapat membentuk frequent itemset sebanyak yang \r\ntelah ditentukan sebelumnya berdasarkan dua parameter, nilai support dan nilai \r\nconfidence untuk  mendapatkan  kombinasi  antar item. Data Mining itu  sendiri \r\nadalah  proses  pencarian  pola-pola  yang  tersembunyi  berupa  pengetahuan \r\n(knowledge)  yang  tidak  diketahui  sebelumnya  dari  suatu  sekumpulan  data, \r\nsedangkan algoritma apriori merupakan salah satu teknik asosiasi yang digunakan \r\nuntuk menemukan kandidat itemset dan melakukan penggabungan dengan item \r\nlain. Dengan tujuan  untuk  menerapkan  pola  kecenderungan  pembelian  produk \r\nberas yang sering dijual secara bersamaan dari data transaksi, serta mengendalikan \r\npersediaan barang yang ada menggunakan algoritma apriori. Hasil analisa dimana \r\npenjualan beras dengan nilai support dan confidence tertinggi adalah beras IR42 \r\ndan beras Sorais dengan nilai support 30% dan nilai confidence 50%. Prediksi \r\npenjualan beras antara bulan Maret 2019 dan bulan April 2019 didapatkan hasil \r\nbahwa rata-rata prediksi keakuratan dari hubungan asosiasi yang ada yaitu sebesar \r\n88,23 % yang meliputi beras IR42 dengan keakuratan 76,47% dan beras Sorais \r\ndengan keakuratan 100,00%. \r\n \r\nKata Kunci : Data mining, Penjualan, Beras, Apriori, Asosiasi \r\nlxvi+66 halaman; 50 gambar; 16 tabel; 1 lampiran \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(41,'1511501106','2021-02-05 14:01:40','479431','../files/1511501106.pdf',' \r\n \r\nIMPLEMENTASI AUGMENTED REALITY PENGENALAN HEWAN DAN \r\nBUAH MENGGUNAKAN METODE MARKER BASED TRACKING \r\nBERBASIS ANDROID PADA RA. NURUS SA\'ADAH. \r\n \r\nOleh : Chandra Tri Prasetyo (1511501106) \r\n \r\nPada era modern  sekarang  banyak  orang  tua  yang  mengajari  anaknya  dengan \r\nmenggunakan gadget sebelum memasuki jenjang taman kanak-kanak (TK). Oleh \r\nkarena itu saat memasuki taman kanak-kanak guru masih menggunakan buku untuk \r\ndapat  mengajari  anak-anak.  Dengan  menggunakan  buku, banyak  guru  yang \r\nmengeluh mengenai anak yang tidak minat atau tidak mendengarkan guru saat \r\nmengajar berlangsung. Pada siswa dan siswi di  lembaga raudhatul athfal (RA) \r\nNurus Sa\'adah yang  masih  belum  mengenal  berbagai  macam  hewan dan buah \r\ndikarenakan keterbatasan biaya untuk mengunjungi kebun binatang dan membeli \r\nbuah yang mereka belum tahu. Teknologi ini diharapkan mampu membuat proses \r\npembelajaran dapat berlangsung secara kontinu tanpa batas ruang dan batas waktu. \r\nMaka dari itu para tenaga pengajar dan para orang tua turut mendukung aplikasi \r\naugmented  reality (AR).  Tujuan  penelitian  ini  untuk  menggunakan  teknologi \r\naugmented  reality (AR)  diharapkan  anak-anak  pada  RA.  Nurus  Sa\'adah dapat \r\nmenambah minat belajar karena pada era sekarang ini menggunakan buku yang \r\nhanya sebatas gambar dua dimensi (2D) sulit untuk menarik perhatian anak untuk \r\nbelajar. Aplikasi ini diharapkan dapat membantu para tenaga pengajar dalam proses \r\npembelajaran, sehingga belajar tidak menjadi hal yang membosankan lagi, para \r\norang tua juga dapat mengajarkan putra putrinya di rumah dan hal itu membuat \r\nanak menjadi lebih pintar. Dalam penelitian aplikasi AR ini menggunakan metode \r\nMarker  Based  Tracking dengan  bantuan  aplikasi Unity 3D  dan Vuforia untuk \r\nmembuat  aplikasi augmented  reality (AR). Hasil data  pengujian menggunakan \r\nkuesioner  didapat  dari  nilai  keseluruhan  aplikasi  pengenalan  hewan  dan  buah \r\nsebesar 78.8% yang diinterprestasikan yaitu baik. \r\n \r\nKata kunci: Augmented Reality, Marker Based Tracking, Unity 3D, Vuforia, Media \r\nPembelajaran, Teknologi. \r\n \r\nxii+54 halaman; 5 tabel; 40 gambar; 11 lampiran.  Perpustakaan Universitas Budi Luhur\r\n'),(42,'1511501163','2021-02-05 14:01:41','211675','../files/1511501163.pdf',' \r\n \r\nPENERAPAN SENSOR ULTRASONIK HC-SR04 UNTUK \r\nSISTEM OTOMATISASI TEMPAT SAMPAH \r\nMENGGUNAKAN ARDUINO DAN NODEMCU BERBASIS \r\nTELEGRAM PADA PT. YAYANG MANDIRI \r\nOleh : Dodi Yuwansyah (1511501163) \r\nPT.  Yayang  Mandiri  adalah  sebuah  perusahaan  yang  bergerak  dalam  bidang \r\nfurniture. Perusahaan ini dapat menghasilkan sampah limbah industri seberat 30-\r\n50kg/hari.  Hal  ini  dapat  mengakibatkan  pencemaran  lingkungan  disekitar  area \r\nperkantoran apabila tidak dikelola dengan baik. Maka dibuatlah sebuah sistem \r\nyang dapat memudahkan dalam  membuang sampah tersebut. Sistem yang peneliti \r\nbuat untuk memudahkan dan mengefesiensikan dalam proses membuang sampah \r\nadalah Tempat Sampah Otomatis. Peneliti ini menggunakan Arduino R3 sebagai \r\nMikrokontroler,  dikombinasikan  dengan  Servo  Motor  sebagai  penggeraknya. \r\nSistem  ini  menggunakan metode  pengendalian  otomatis  dengan dua  sensor \r\nUltrasonik. Sistem tempat sampah otomatis ini juga dapat memberikan notifikasi \r\ntelegram  jika  tempat  sampah  sudah terisi penuh  yang  dihubungkan  melalui \r\nmodule NodeMCU. Kondisi tempat sampah terbuka apabila nilai jarak sensor <= \r\n6cm.  Kondisi  tempat  sampah  tertutup  apabila  jarak  nilai  sensor  >=7cm.  Dan \r\nkondisi tempat sampah penuh apabila nilai jarak sensor <= 5cm. Sistem tempat \r\nsampah otomatis ini diharapkan dapat menjadi solusi bagi permasalahan sampah \r\ndi lingkungan area perkantoran PT. Yayang Mandiri. \r\n \r\n \r\nKata Kunci : Arduino UNO R3, Servo Motor, Sensor Ultrasonik, NodeMCU \r\nxii + 52 Halaman : 31 gambar, 5 tabel, 1 lampiran \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(43,'1511501189','2021-02-05 14:01:41','189099','../files/1511501189.pdf',' \r\n \r\nIMPLEMENTASI KRIPTOGRAFI ALGORITMA RC4 UNTUK \r\nKEAMANAN BASIS DATA PADA PT.YAZTECH ENGINEERING \r\nSOLUSINDO \r\n \r\nOleh : ALI (1511501189) \r\n \r\n \r\nKemajuan teknologi yang sangat cepat mendorong setiap instansi untuk \r\ntetap mengikuti perkembangan teknologi dan terus meningkatkan kemampuannya \r\ndalam mengelola data-data dan informasi yang lebih aman, akurat, dan efisien yang \r\ndibutuhkan suatu instansi. PT. Yaztech Engineering Solusindo adalah perusahaan \r\nyang bergerak dibidang IT (Information Technology) dan elektronik. Keamanan \r\ndata perusahaan sangatlah penting data yang ada tidak hanya Data Project saja, \r\nterdapat juga data lengkap dari perusahaan client yang sangat rahasia. Maka dari itu \r\ndibutuhkan keamanan database. Semakin berkembang nya dunia teknologi, maka \r\nsemakin besar pula tingkat pencurian data. bagi beberapa perusahaan data adalah \r\nhal yang penting dan akan sangat bahaya apabila data tersebut dicuri. PT. Yaztech \r\nEngineering  Solusindo menyimpan  data  pada  sebuah database,  yang  memiliki \r\nkeamanan rendah, dimana sewaktu-waktu data tersebut dapat dicuri oleh orang \r\nyang tidak bertanggung jawab. PT. Yaztech Engineering Solusindo membutuhkan \r\naplikasi untuk menjaga kerahasian data perusahaan yaitu data detail barang, detail \r\nperusahaan, dan data project. Dibuatlah aplikasi keamanan Database menggunakan \r\nteknik kriptografi, Didalam kriptografi terdapat dua proses utama yaitu enkripsi dan \r\ndekripsi. Enkripsi merupakan mengubah pesan asli menjadi pesan sandi sedangkan \r\ndekripsi adalah proses pengembalian pesan sandi menjadi pesan aslinya. Metode \r\nyang  dipakai  adalah  metode Rivest  code  4 (RC4), penggunaan  algoritma  RC4 \r\nkarena  cukup  mudah  untuk  digunakan  secara  luas pada  beberapa  aplikasi  dan \r\nalgoritmanya sudah dinyatakan cukup aman untuk diterapkan. Ada banyak model \r\ndan metode enkripsi, salah satu di antaranya adalah enkripsi dengan algoritma \r\nRivest Code 4 (RC4). Hasil penelitian ini adalah penggunaan program Enkripsi \r\nRC4 Stream Cipher dengan jumlah karakter asli (plaintext) berhasil di enkripsi \r\nsama dengan jumlah karakter hasil enkripsi (ciphertext) dengan averages waktu \r\nenkripsi 0,000923604 dengan  byte  1384, sehingga  data  yang  di  input  akan  di \r\nsimpan  pada  database  dalam  keadaan  terenkripsi  sehingga  keamanan  dan \r\nkerahasiaan datanya dapat terjaga. \r\n \r\nKata Kunci : RC4, Enkripsi, Deskripsi,Database,Rivest Cipher  Perpustakaan Universitas Budi Luhur\r\n'),(44,'1511501197','2021-02-05 14:01:41','6502','../files/1511501197.pdf',' \r\nIMPLEMENTASI KRIPTOGRAFI DENGAN ALGORITMA RC4 \r\nBERBASIS WEB PADA TUPPERWARE BL PANCARANMEGAH \r\n \r\nKemajuan dan perkembangan teknologi informasi saat ini telah berpengaruh pada \r\nsetiap aspek kehidupan, yang dapat dengan mudah melakukan pertukaran data \r\ndalam berbagai bentuk tanpa batas ruang dan waktu. Sehingga keamanan data \r\nmenjadi sangat penting agar data yang bersifat rahasia hanya dapat diketahui oleh \r\npihak yang berhak. Tupperware BL Pancaran Megah adalah salah satu perusahaan \r\nyang  memiliki  banyak  data  yang  penting  dan  bersifat  rahasia  dari  file  hingga \r\nlaporan  keuangan.  Maka  dibutuhkan  suatu  metode  yang  dapat  menjaga \r\nkerahasiaan \r\ndata, metode yang dimaksud adalah kriptografi. Algoritma yang akan digunakan \r\nadalah algoritma RC4. RC4 merupakan salah satu algoritma kunci simetris yang \r\nberbentuk stream cipher dimana algoritma ini melakukan proses enkripsi/dekripsi \r\ndalam satu byte dan menggunakan kunci yang sama. Hasil dari penelitian ini akan \r\ndiimplementasikan dalam bentuk aplikasi berbasis web yang dapat memudahkan \r\nuser untuk mengamanan data-data yang bersifat rahasia. \r\n \r\nKata kunci : Kriptografi, Simetris, RC4, Enkripsi, Dekripsi \r\nxiv+68 halaman; 64 gambar; 4 tabel; 2 lampiran. '),(45,'1511501254','2021-02-05 14:01:41','233883','../files/1511501254.pdf',' \r\n \r\nIMPLEMENTASI DATA MINING UNTUK REKOMENDASI RENCANA \r\nSTUDI MATAKULIAH PILIHAN MAHASISWA MENGGUNAKAN \r\nALGORITME APRIORI PADA PROGRAM STUDI TEKNIK \r\nINFORMATIKA UNIVERSITAS BUDI LUHUR \r\n \r\nOleh : Ahmad Syahrul (1511501254) \r\n \r\nPenentuan konsentrasi atau rencana studi bagi sebagian besar mahasiswa masih \r\nmembingungkan dan cenderung berdampak pada pemilihan rencana studi yang \r\ntidak  sesuai  dengan  kriteria  atau  bagan  yang telah  disediakan.  Peran  dosen \r\npembimbing  akademik  dalam  membantu  mahasiswa  menentukan  pengambilan \r\nmatakuliah di semester yang akan datang sangatlah penting, tetapi pada beberapa \r\nkasus, terdapat dosen pembimbing akademik yang tidak memiliki waktu untuk \r\nberdiskusi  kepada  mahasiswanya  dalam  perekomendasian  pengambilan  mata \r\nkuliah, untuk itu dibuatlah sebuah sistem yang bisa membantu mahasiswa dalam \r\nmerekomendasikan pengambilan matakuliah di semester yang akan datang. Sistem \r\nperekomendasian pengambilan matakuliah ini menggunakan metode association \r\nrule mining dengan algoritme apriori. Association rule mining merupakan suatu \r\naturan  pada  proses  data  mining  yang  sering  kali  digunakan  untuk  mencari \r\npengetahuan  tentang  korelasi  antara  item.  Sistem  yang  dikembangkan  pada \r\npenelitian ini akan mencoba mencari korelasi antara mahasiswa dengan matakuliah \r\nyang  diambil  persemesternya. Dengan  dibuatnya  aplikasi  perekomendasisan \r\npengambilan matakuliah ini mahasiswa akan terbantu untuk mengambil keputusan \r\ndalam mengambil matakuliah di semester yang akan datang. Hasil uji coba dari \r\nsistem ini menunjukan persentase keberhasilan perekomendasian rata-rata di atas \r\n79.43% berdasarkan min confidence = 80%, dan min support = 7. Dengan hasil \r\ntersebut,  sistem  ini  bisa  dijadikan  sebagai  sarana  mahasiswa  untuk  membantu \r\nmengambil  keputusan  dalam  pengambilan  matakuliah  di  semester  yang  akan \r\ndatang. \r\n \r\nKata Kunci : Association rule mining, Data Mining, Apriori \r\n \r\nxiv+58 halaman; 38 gambar; 8 tabel; 2 lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(46,'1511501296','2021-02-05 14:01:41','71933','../files/1511501296.pdf',' \r\n \r\nAUGMENTED REALITY UNTUK MEMBANTU PROSES PEMBELAJARAN \r\nMATEMATIKA MENGENAL BANGUN RUANG DENGAN METODE MARKED \r\nBASED TRACKING BERBASIS ANDROID DI MTSN 1  TANGERANG \r\nSELATAN \r\n \r\nOleh : Shelia Saputri (1511501296) \r\n  \r\nbanyak siswa/i dari MTsN 1 Tangerang Selatan yang kurang tertarik dalam \r\npelajaran ini dikarenakan sulit untuk menemukan hasil dalam menghitung luas \r\ndan volume bangun ruang tersebut dan memvisualisasikan dari bentuk yang nyata. \r\nDari mata  pelajaran  ini, kebanyakan  guru  yang  mengajar terkadang harus \r\nmembuat  sebuah  kerangka  atau  bangunan peraga  agar  siswa/i  dapat  melihat \r\nbangunan dengan nyata sehingga bisa mengerti mata pelajaran ini. Dengan adanya \r\nmasalah ini maka penulis membuat aplikasi sistem pembelajaran bangun ruang \r\ndengan marker augmented reality berbasis android. Aplikasi ini dapat membantu \r\nsiswa/i  untuk belajar  dan  mengerjakan  pelajaran  dari  bangun  ruang  hanya \r\nmenggunakan smartphone berbasis android. Aplikasi ini dapat digunakan dengan \r\ncara pengguna harus memindai kartu yang sudah tersedia menggunakan kamera \r\nsmartphone, lalu objek akan keluar di layar smartphone pengguna dengan bentuk \r\nbenda terapan dari bangun ruang tersebut. Lalu didalam nya juga ada rumus dari \r\nbangun ruang dan juga pengguna dapat menghitung rumus volume dari bangun \r\nruang tersebut. Metode yang digunakan yaitu dengan Marked Based Tracking. \r\nDari hasil yang didapatkan dari aplikasi ini, Augmented Reality Camera dapat \r\nmemindai gambar  didalam  pencahayaan  yang  sangat  minim, juga  dapat \r\nmemindai  dan  mengeluarkan  objek hingga kejauhan 50cm jarak  dari  kamera \r\nmenuju image target. Manfaat dari aplikasi ini yaitu, 78% dari 30 siswa/i MTsN 1 \r\nTangerang Selatan yang  telah  mencoba  aplikasi  ini dengan  mudah  dapat \r\nmengerjakan  pelajaran  bangun  ruang. lalu,  siswa/i  dapat  memvisualisasikan \r\ngambar terapan dari sebagian bangun ruang yang ada didalam aplikasi sehingga \r\nguru dalam matapelajaran ini tidak perlu untuk menggambar bentuk bangun ruang \r\nyang rumit. \r\n \r\nKata  kunci  : Bangun  Ruang, Augmented  Reality, 3D, Android,  Marked  Based \r\nTracking \r\n  \r\nxiv+99 halaman; 41 gambar; 3 tabel; 35 lampiran Perpustakaan Universitas Budi Luhur\r\n'),(47,'1511501312','2021-02-05 14:01:41','71263','../files/1511501312.pdf',' \r\n \r\nSISTEM PENDUKUNG KEPUTUSAN GIZI BALITA \r\nDENGAN METODE SIMPLE ADDICTIVE WEIGHTING \r\n(SAW) BERBASIS WEB PADA POSYANDU FLAMBOYAN II \r\nDI WILAYAH KELURAHAN REMPOA CIPUTAT TIMUR \r\n \r\nPerkembangan  dunia  globalisasi  ini  membuat  kehidupan  tiap  orang  menjadi \r\nmudah. Semua  orang  menggunakan  sebuah  alat  teknologi  internet  untuk \r\nmelakukan pertukaran data seperti dokumen, dan lain  lain. PT Gunung Geulis \r\nElok  Abadi  adalah  perusahaan yang  bergerak  di  beberapa  bidang  seperti food \r\ncourt, hotel, dan lain  lain. Perusahaan ini terdapat data dokumen yang bersifat \r\npenting dan tidak semua orang boleh melihat ataupun mengambil data tersebut \r\nsecara  mudah.  Permasalahannya  adalah  perusahaan ini  tidak  memiliki  sistem \r\nuntuk  pengamanan  data  khususnya  dibagian  dokumen  yang penting  untuk \r\nperusahaan  sebagai  pencegahan  dari  orang  yang  melakukan  penyadapan data. \r\nSolusi dari permasalahan tersebut adalah merancang suatu aplikasi yang dapat \r\nmengamankan  data  agar  tidak  dapat  digunakan  oleh  orang  lain.  Perancangan \r\naplikasi ini menggunakan algoritma AES-128 untuk proses enkripsi dan dekripsi \r\ndata. Perancangan  aplikasi  dibuat  dengan Notepad++.  Hasil  dari  percobaan \r\nenkripsi dan dekripsi dari 20 file, menunjukkan rata  rata waktu enkripsi yaitu \r\n12.769 ms dan rata  rata waktu dekripsi yaitu 18.075 ms. \r\n \r\nKata Kunci : enkripsi, AES-128, dokumen \r\nvii+48 halaman; 34 gambar; 6 tabel ');
INSERT INTO `document` VALUES (48,'1511501320','2021-02-05 14:01:41','20745','../files/1511501320.pdf',' \r\n \r\nAPLIKASI PEMBELAJARAN ORGAN SISTEM KOORDINASI DAN \r\nSISTEM EKSKRESI TUBUH MANUSIA DENGAN METODE MARKER \r\nBASED TRACKING BERBASIS AUGMENTED REALITY PADA SMA \r\nNEGERI 7 KOTA TANGERANG SELATAN \r\n \r\nOleh: Dimas Setiawan (1511501320) \r\n \r\nPada  era  berkembangnya  teknologi  yang  semakin  meningkat  maka  teknologi \r\nkomputer  semakin  menjadi  kebutuhan,  terlebih  di  bidang  pendidikan. Metode \r\npembelajaran yang digunakan untuk mendukung proses kegiatan belajar mengajar \r\nkhususnya untuk mata pelajaran IPA saat ini masih menggunakan media buku, \r\nLKS,  dan  menggunakan  bahan  praktek.  Teknologi augmented  reality mampu \r\nmerealisasikan  dunia  virtual  ke  dunia  nyata dan dapat  mengubah  objek-objek \r\ntersebut menjadi objek 3D, sehingga metode pembelajaran tidaklah monoton. Oleh \r\nkarena itu penulis membuat sebuah aplikasi yang dapat menampilkan objek 3D \r\nbeserta informasinya dari layar smartphone. Aplikasi ini menggunakan teknologi \r\naugmented reality dengan metode marker based tracking. Dengan metode marker \r\nbased tracking, kamera dari smartphone mampu mendeteksi marker 2D yang sudah \r\nterdaftar  di website  vuforia dan  mengubahnya  menjadi  objek  3D.  Aplikasi  ini \r\nberjalan pada smartphone dengan sistem operasi android. Cara kerja dari aplikasi \r\nini dengan melakukan pendeteksian marker yang sudah ditentukan menggunakan \r\nkamera smartphone. Lalu aplikasi akan menampilkan objek 3D, informasi, dan link \r\nmateri  yang  menuju  ke website objek  terkait.  Dengan  dibuatnya  aplikasi  ini \r\ndiharapkan  mampu  meningkatkan  minat  belajar,  menambah  pengetahuan  para \r\nsiswa  siswi  yang  tidak  mereka  dapatkan  didalam  buku,  dan  mendapatkan \r\nkemudahan dalam memahami apa yang mereka pelajari di sekolah sehingga mampu \r\nmeningkatkan kualitas pendidikan di SMA Negeri 7 Kota Tangerang Selatan. \r\n \r\nKata  Kunci  : Augmented  Reality,  Marker  Based  Tracking,  Organ,  Koordinasi, \r\nEkskresi \r\n \r\nxvi+93 halaman; 87 gambar; 3 tabel; 2 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(49,'1511501338','2021-02-05 14:01:41','328371','../files/1511501338.pdf',' \r\n \r\nIMPLEMENTASI ALGORITMA ANALYTICAL HIERARCHY PROCESS \r\n(AHP) UNTUK MENENTUKAN ASISTEN TERBAIK PADA \r\nLABORATORIUM INFORMATION AND COMMUNICATION \r\nTECHNOLOGY (LAB ICT) TERPADU UNIVERSITAS BUDI LUHUR \r\n \r\nOleh : Nanda Kusmianda (1511501338) \r\n \r\nLaboratorium Information  and  Communication  Technology  (LAB ICT) \r\nTerpadu Universitas Budi Luhur merupakan Tempat praktikum mahasiswa dalam \r\nproses  belajar  mengajar.  Selain  tempat  untuk  kegiatan  belajar  mengajar, \r\nLaboratorium  ICT  Terpadu  juga  dapat  digunakan  untuk  kegiatan  pengabdian \r\nmasyarakat  yang  dilakukan  oleh  para  dosen,  pusat  pelatihan  untuk  mahasiswa \r\ndalam mengikuti ajang perlombaan, juga sebagai keperluan riset mahasiswa atau \r\ndosen. Asisten memiliki jadwal rutin untuk bertugas selama Senin sampai dengan \r\nJum\'at untuk menjalankan berbagai tugas diantaranya adalah monitoring kelas, \r\nmengupdate perangkat lunak yang digunakan untuk perkuliahan oleh dosen dan \r\nmahasiswa. Dalam kemajuan teknologi dan komunikasi akan terus berkembang \r\nseiring perkembangan zaman. Perkembangan selalu datang untuk memudahkan \r\nmanusia  membantu  kegiatan  rutinitas  sehari-hari. Tidak  kecuali  dalam  hal \r\npengambilan keputusan. Pengambilan keputusan bukanlah hal yang sulit namun \r\nharus  ada  tanggung  jawab  yang  besar  setelah  mengambil  keputusan. Karena \r\nmemiliki tanggung jawab yang besar dalam sebuah pengambilan keputusan. Maka \r\nadanya keputusan berdasarkan data yang di dalamnya terdapat berbagai macam \r\nasisten (LAB ICT) Terpadu Universitas Budi Luhur. Pada tiap semester, diadakan \r\npemilihan  Asisten  terbaik  pada  Laboratorium Information  and  Communication \r\nTechnology (LAB ICT) Terpadu Universitas Budi Luhur. Dalam proses pemilihan \r\nAsisten terbaik belum menggunakan metode yang efektif dan efisien. Maka dari itu \r\ndiperlukan sebuah Aplikasi untuk Pemilihan Asisten Labotratorium terbaik dengan \r\nmenggunakan metode AHP (Analytical Hierarchy Process). Metode AHP tersebut \r\nmempunyai  kelebihan  yang mampu menentukan bobot, berdasarkan pada nilai \r\nkriteria dan bobot preferensi yang sudah dihitung dengan menggunakan metode \r\nAHP (Analytical  Hierarchy  Process). Selain  itu  Metode AHP tersebut  mampu \r\nmenentukan peringkat dari banyak nya alternatif (asisten). Total perubahan nilai \r\nyang  dihasilkan  lebih  banyak  sehingga  sangat  relevan  untuk  menyelesaikan \r\nmasalah yang terdapat pada sistem pemilihan Asisten Terbaik pada Laboratorium \r\nInformation and Communication Technology (LAB ICT) Terpadu Universitas Budi \r\nLuhur. Dengan adanya aplikasi ini, user dapat lebih mudah menetapkan peringkat \r\ndari nilai dan data yang telah terkumpul dan akan terdokumentasi dengan baik, \r\nsehingga pada saat user mengambil keputusan memberikan penghargaan Asisten \r\nterbaik menjadi lebih objektif. Perpustakaan Universitas Budi Luhur\r\n'),(50,'1511501379','2021-02-05 14:01:42','107735','../files/1511501379.pdf',' \r\nJUDUL : APLIKASI AUGMENTED REALITY SSPOL(Solar System Planet \r\nand Orbital Lines). \r\nSekolah  Dasar  Negri  Cipadu  3  adalah  sebuah  sekolah  yang  berada  di \r\nTangerang selatan. Tata surya adalah suatu pelajaran ilmu pengetahuan alam di \r\nSDN Cipadu 3, Media pembelajaran yang digunakan untuk mempelajari planet dan \r\ntata surya masih menggunakan globe, presentasi, dan buku. Dalam menentukan \r\naplikasi  dibutuhkan  beberapa  tahap  yaitu  Mengumpulkan  data  dan  informasi \r\nmelalui catatan kuliah, analisis, Perancangan aplikasi dan implementeasi aplikasi. \r\nDengan  menggunakan  media  pembelajaran  menggunakan augmented reality  \r\ndengan media android dan dengan animasi 3D diharapkan siswa dan siswi jadi \r\nmenarik untuk belajar, mengerti bentuk dari planet tata surya dan bisa mempelajari \r\nplanet tata surya dirumah.  . Menggunakan video siswa-siswi juga dapat melihat \r\nsambil mendengarkan video yang disampaikan.   Augmented Reality adalah sebuah \r\nteknologi masa kini yang menggabungkan antara dunia maya dan dunia nyata \r\nsecara realtime. Augmented  reality biasa  digunakan  untuk  bidang  militer, \r\nkedokteran, game,  edukasi  anak-anak  dll. Spesifikasi  dari  aplikasi augmented \r\nreality SSPOL (Solar System Planet and orbital lines) adalah menggunakan ram 2 \r\nGB, memiliki memori internal minimal 400 MB, resolusi kamera minimal  5 Mega \r\nPixels, dan menggunakan android versi 4.1 (Jelly bean).Aplikasi augmented reality \r\nSSPOL (Solar System Planet and orbital lines)  menggunakan metode Natural  \r\nFeature Tracking berbasis android. Untuk membantu proses pembelajaran siswa-\r\nsiswi di SDN Cipadu 3 dengan memberikan permodelan 3 dimensi  planet dan garis \r\norbit sehingga dapat menjadikan pembelajaran interaktif dan menarik. Dengan \r\nmenggunakan perangkat lunak Autodesk 3ds Max 2010 yang digunakan untuk \r\nmembuat  objek  3  dimensi,  pembuatan marker di  website \r\nwww.developer.vuforia.com, membuat aplikasi digunakan aplikasi unity dan untuk \r\nmenambah  perintah  pada  aplikasi  menggunakan Visual  Studio  Code. Natural \r\nFeature tracking adalah proses pendeteksian dengan melacak titik-titik sudut pola \r\ngambar. Menurut kepuasaan user yang telah mencoba Aplikasi augmented reality \r\nSSPOL (Solar System Planet and orbital lines) bahwa aplikasi ini sangat menarik, \r\ninteraktif, menyenangkan dan mudah digunakan untuk media pembelajaran.  \r\nKATA KUNCI : Augmented Reality, Android, Vuforia, Planet dan tata surya. \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(51,'1511501395','2021-02-05 14:01:42','232871','../files/1511501395.pdf',' \r\n \r\nPENGEMBANGAN APLIKASI AUGMENTED REALITY \r\nMENGGUNAKAN METODE MARKER BASED TRACKING BERBASIS \r\nANDROID SEBAGAI MEDIA PEMBELAJARAN VISUAL ORGAN \r\nTUBUH MANUSIA PADA SDS AL HURRIYAH \r\n \r\nOleh : Andi Rahmadi (1511501395) \r\n \r\nPerkembangan  teknologi  pada  saat  ini  telah  memasuki  era  globalisasi, dimana \r\nteknologi telah memasuki segala bidang di kehidupan manusia. Salahsatunya dalam \r\ndunia  pendidikan yang  dapat  membantu  meningkatkan  kualitas  dalam  proses \r\nbelajar-mengajar di sekolah dan menjadi media pembelajaran terhadap anak-anak \r\nagar lebih menarik dan menyenangkan. Namun, beberapa sekolah belum dapat \r\nmenerapkan teknologi sebagai media pembelajaran. Salah satunya adalah SDS Al \r\nHurriyah, terletak di Kota Jakarta Barat Kecamatan Tambora yang didirikan pada \r\ntahun 1976 dan sekarang mempunyai 167 siswa. Dalam proses belajar-mengajar, \r\nsekolah ini menggunakan metode ceramah yang selalu digunakan pada sekolah-\r\nsekolah  lainnya.  Metode  ceramah  adalah  cara  umum  yang  digunakan  untuk \r\nmenyampaikan pelajaran kepada peserta didik atau mempraktikan teori yang ada di \r\npelajaran.  Pada  pelajaran  Ilmu  Pengetahuan  Alam  (IPA  ) penggunaan  metode \r\nceramah  dapat  dipadukan  dengan  menggunakan  alat peraga untuk dapat \r\nmemperjelas uraian dalam proses belajar mengajar. Namun, karena minimnya alat \r\nperaga di SDS Al Hurriyah membuat para siswa kurang mengenal organ-organ pada \r\ntubuh manusia. Maka dari itu dengan menggunakan teknologi augmented reality \r\nini,  akan  dapat memperjelas  uraian  mengenai  organ-organ  tubuh  manusia  dan \r\nmemvisualisasikan objek seperti jantung, otak, usus, lambung, hati, dan paru-paru. \r\nAugmented reality mempunyai kelebihan yaitu dapat menampilkan visual yang \r\nmenarik,  karena  dapat  menampilkan  objek  3D yang  seakan-akan  ada  pada \r\nlingkungan nyata dan dapat disandingkan dengan informasi tentang objek tersebut. \r\nTeknologi augmented  reality juga dapat  digunakan  sebagai  alternatif  media \r\npembelajaran secara visual atau dapat dipadukan dengan metode ceramah yang \r\nmembuat  siswa  menjadi  tertarik  dalam  mengenal  organ  tubuh  manusia. \r\nBerdasarkan pengujian kompabilitas, aplikasi ini dapat berjalan dengan baik pada \r\nperangkat mobile Android  mulai  dari  Android  versi  4.2.0  (Jelly  Bean)  hingga \r\nAndroid versi Android versi 9.0 (Pie). Dari hasil pengujian ISO 9126, persentase \r\nyang didapatkan untuk functionality sebesar 83%, reliability sebesar88%, usability \r\nsebesar 85% dan efficiency sebesar 85%.   \r\n \r\nKata kunci : Media Pembelajaran, Visual, Android, Augmented Reality, Virtual, \r\n3D \r\n \r\nxiv+79 halaman; 40 gambar; 4 tabel; 11 lampiran \r\n Perpustakaan Universitas Budi Luhur\r\n'),(52,'1511501403','2021-02-05 14:01:42','207601','../files/1511501403.pdf',' \r\nAPLIKASI SISTEM PEMBELAJARAN PENGENALAN PRESIDEN DAN \r\nWAKIL PRESIDEN DENGAN MARKER AUGMENTED REALITY BERBASIS \r\nANDROID PADA SDN KADOMAS 3 \r\nOleh : Novianti Alfarisi (1511501403) \r\nAugmented Reality adalah salah satu teknologi yang belakangan ini berkembang \r\nsecara  pesat, Augmented  Reality kini  sudah  digunakan  dalam  berbagai  bidang  dalam \r\nkehidupan, tak  terkecuali dalam  bidang  Pendidikan. Tujuan  dari  penelitian ini  adalah \r\nmenerapkan Augmented Reality dalam bidang pendidikan untuk memberikan inovasi baru \r\ndan  memberikan  kesan  belajar yang  lebih  interaktif  yaitu  dengan  mengubah  konsep \r\nmedia pembelajaran yang sebelumnya hanya menggunakan media cetak (buku) menjadi \r\nmedia digital agar menarik minat belajar para siswa/i, membangun interaksi yang lebih \r\ninteraktif antara guru dengan siswa, dan meningkatkan mutu serta kualitas siswa - siswi \r\nSDN Kadomas 3. Dalam membangun aplikasi Sistem Pembelajaran Pengenalan Presiden \r\ndan Wakil Presiden ini menggunakan bahasa C# (C Sharp) dengan menggunakan metode \r\nMarker Based Tracking dimana aplikasi AR (Augmented Reality) ini memerlukan suatu \r\ngambar  yang  diambil  dari  sebuah  kamera smartphone sebagai  sumber  masukan, \r\nkemudian  aplikasi  ini  akan  melacak  dan  mendeteksi marker (penanda),  dengan \r\nmenggunakan sistem tracking. Setelah marker terdeteksi, akan muncul objek virtual yang \r\nakan  tampil  diatas marker. Objek  yang  muncul  berupa  foto  Presiden,  informasi  dan \r\nbiodata yang dapat terhubung ke web serta fitur suara mengenai Prestasi Presiden. Hasil \r\npenilaian dari  40  koresponden yang  merupakan  siswa/i kelas  IV  SDN Kadomas  3 \r\nmenunjukkan 95% tampilan dari aplikasi Sistem Pembelajaran Pengenalan Presiden dan \r\nWakil Presiden ini menarik, 77,5% menyatakan aplikasi Sistem Pembelajaran Pengenalan \r\nPresiden dan Wakil Presiden ini mudah digunakan, 85% menyatakan marker bisa cepat \r\ndideteksi, 95% menyatakan aplikasi Sistem Pembelajaran Pengenalan Presiden dan Wakil \r\nPresiden ini membantu  dalam  Mengenal  Presiden  dan  Wakil  Presiden,  92,5% \r\nmenyatakan aplikasi Sistem Pembelajaran Pengenalan Presiden dan Wakil Presiden ini \r\nbermanfaat, 80%  menyatakan menyukai  aplikasi Sistem  Pembelajaran Pengenalan \r\nPresiden dan Wakil Presiden ini, 85% menyatakan akan menggunakan aplikasi Sistem \r\nPembelajaran Pengenalan Presiden dan Wakil Presiden ini jika aplikasi ini terinstall di \r\nsmartphone, 75% menyatakan puas melihat tampilan dan informasi yang tersedia dalam \r\naplikasi Sistem Pembelajaran Pengenalan Presiden dan Wakil Presiden ini dan 77,5% \r\nmenyatakan setuju jika ada sebuah aplikasi  untuk belajar mengenal Presiden dan wakil \r\nPresiden dengan tujuan memudahkan untuk belajar.  \r\nKata  Kunci : Augmented  Reality, Sistem  Pembelajaran,  Pengenalan  Presiden, \r\nMarker, Android. \r\n \r\nxiv +74 halaman; 53 gambar; 8 table; 4 lampiran \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(53,'1511501429','2021-02-05 14:01:42','104293','../files/1511501429.pdf',' \r\n \r\n \r\nImplementasi Augmented Reality untuk Pengenalan Buah-Buahan pada TK \r\nYadika 3 Berbasis Android \r\n \r\nOleh : Titok Angga Kurniawan (1511501429) \r\n \r\nPenelitian  ini  bertujuan  untuk  mengembangkan  aplikasi Augmented \r\nReality untuk memperkenalkan media pembelajaran baru terhadap anak-anak di \r\nTK Yadika 3. Permasalahan untuk saat ini anak-anak masih belajar mengenal \r\nbuah-buahan masih menggunakan media pembelajaran yang masih berbentuk 2 \r\ndimensi. Dengan menggunakan aplikasi Augmented Reality (AR) ini diharapkam \r\ndapat membuat daya tarik anak anak dalam mengenal buah-buahan. \r\nMetode marker based tracking ini dipilih karena mampu membaca teks \r\ndan gambar yang masih berbentuk 2 dimensi. Dalam hal ini yang dimaksud adalah \r\nmarker atau penanda yang terkoneksi dengan kamera agar mengenali objek yang \r\nakan ditambah menjadi bentuk 3 dimensi. \r\nLangkah  awal  pada  penyelesaian  masalah  ini  dilakukan  dengan \r\nmenentukan  marker  yang  akan  dijadikan  objek  untuk  memunculkan  animasi \r\nmenggunakan vuforia sebagai database, kemudian export ke unity agar menjadi \r\nsebuah aplikasi yang optimal yaitu Augmented Reality pengenalan buah-buahan. \r\nAplikasi ini diharapkan dapat membantu anak-anak belajar sambil bermain untuk \r\nmenambah ilmu melalui smartphone nya. \r\n \r\nKata kunci : Augmented Reality, Android, Marker Based Tracking \r\n \r\nxii+48halaman; 24 Gambar; 11 Tabel;  Lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(54,'1511501437','2021-02-05 14:01:42','20433','../files/1511501437.pdf',' \r\n \r\n \r\nIMPLEMENTASI AUGMENTED REALITY MENGGUNAKAN METODE \r\nMARKER BASED TRACKING UNTUK PENGENALAN ALAT DAN \r\nPRODUK MAKEUP BAGI PEMULA \r\n \r\n \r\nOleh : Auliatunnisa Kamila (1511501437) \r\n \r\n \r\nMenurunnya  minat  orang  dalam  belajar Make  Up,  menyebabkan  lembaga- \r\nlembaga pelatihan Make Up bisa mengalami prospek yang kurang baik. Tiyang \r\nAyu  merupakan  salah  satu  lembaga  penyedia  pelatihan Make  Up yang \r\nmenghadapi  permasalahan  menurunnya  minat  belajar Make  Up menggunakan \r\nmetode konvensional. Peneliti melihat peluang untuk mengatasi kurangnya minat \r\nbelajar Make Up tersebut dengan cara kreatif dan menarik yaitu menggunakan \r\naplikasi augmented reality. Aplikasi augmented reality dibuat untuk membantu \r\npeserta mempelajari  produk  dan  materi  pengajaran  secara  mandiri  di  sela-sela \r\nwaktu kelas berlangsung dan bahkan dapat dibawa pulang. Aplikasi augmented \r\nreality dibangun menggunakan metode marker based tracking dengan bantuan \r\nUnity  dan  Vuforia.  Cara  kerja  aplikasi augmented  reality adalah  pendeteksian \r\nmarker.  Setelah marker dikenali,  sesuai  data  yang  terdapat  di  dalam system \r\naplikasi,  maka  aplikasi  dapat  menampilkan  sebuah  objek  2D  beserta \r\npenjelasannya baik itu dalam bentuk tulisan maupun video. Dari hasil pengujian \r\naplikasi tersebut dapat diketahui bahwa aplikasi dapat berjalan dengan baik pada \r\nperangkat smartphone android. Hasil user acceptance test dari aplikasi ini adalah \r\n78%  responden  menyatakan  aplikasi  dapat  digunakan  untuk  media  bantu \r\npembelajaran Make Up bagi pemula. \r\n \r\n \r\n \r\nKata kunci: Media Pembelajaran, Augmented Reality, Alat dan Produk, Android, \r\nMarker Based Tracking, Unity, Vuforia \r\n \r\nxi+42 halaman; 2 tabel; 34 gambar; 11 lampiran Perpustakaan Universitas Budi Luhur\r\n'),(55,'1511501502','2021-02-05 14:01:42','8301','../files/1511501502.pdf',' \r\n \r\nIMPLEMENTASI ALGORITMA KRIPTOGRAFI RSA UNTUK  PLIKASI \r\nPENGAMANAN DATA BERBASIS DESKTOP PADA AGEN PT. CITRA \r\nVAN TITIPAN KILAT \r\n \r\nDi  era  teknologi  internet  sekarang  ini,  semua  informasi  dapat  dikirim  dengan \r\nbebas  melalui  suatu  jaringan  dengan  tingkat  keamanan  yang  rentan  dan \r\nmemungkinkan  terjadinya  penyadapan  suatu  informasi.  Hal  tersebut  secara \r\nlangsung maupun tidak langsung mempengaruhi sistem perdagangan, transaksi \r\nbisnis,  perbankan,  industri  dan  pemerintahan  yang  umumnya  mengandung \r\ninformasi rahasia. PT. Citra Van Titipan Kilat adalah salah satu perusahaan jasa \r\npengiriman  barang  yang  mengandalkan penggunaan  teknologi  informasi  dan \r\ntelekomunikasi dalam melakukan pertukaran data yang ada di perusahaan. Faktor \r\nutama  yang  harus  dipenuhi  dalam  mengamankan  data  rahasia  adalah  tingkat \r\nkeamanan teknologi informasi yang tinggi. Salah satu cara yang digunakan adalah \r\ndengan  menyandikan  isi  informasi  menjadi  suatu  kode-kode  yang  tidak \r\ndimengerti sehingga penyadap akan kesulitan untuk mengetahui informasi yang \r\nsebenarnya. Kriptografi dapat digunakan untuk mengamankan data file dokumen. \r\nOleh karena itu, penggunaan file dokumen sangat membutuhkan kriptografi untuk \r\nmemenuhi kebutuhan keamanan akan file dokumen yang disimpannya. Penerapan \r\nkriptografi pada  tugas  akhir  ini  akan  difokuskan  bagaimana  kriptografi  dapat \r\nmengamankan file dokumen yang akan dikirim melalui media misalnya internet, \r\nemail, dan media lainnya menjadi aman sampai dengan dokumen tiba ke tujuan \r\ndan dibuka oleh pihak yang berwenang untuk membukanya. Algoritma kriptografi \r\nyang akan digunakan yaitu RSA. RSA merupakan algoritma pertama yang cocok \r\nuntuk digital signature seperti halnya enkripsi. Pada algoritma RSA terdapat 3 \r\nlangkah  utama yaitu keygeneration (pembangkit  kunci),  enkripsi  dan  dekripsi. \r\nKunci pada RSA mencakup dua buah kunci yaitu public key digunakan untuk \r\nmelakukan  enkripsi dan  dapat  diketahui  oleh  orang  lain  dan private  key yang \r\ndirahasiakan  untuk melakukan  dekripsi.  Dengan  demikian,  aplikasi  mampu \r\nmengamankan data pada agen PT. Citra Van Titipan Kilat dengan baik sehingga \r\nkerahasiaan data tetap terjaga. \r\n \r\nKata Kunci: Kriptografi, Algoritma, RSA, Enkripsi, Dekripsi, Key \r\nxvi+107 halaman; 128 Gambar; 3 Tabel; 2 Lampiran '),(56,'1511501510','2021-02-05 14:01:42','248766','../files/1511501510.pdf',' \r\n \r\nIMPLEMENTASI TEKNOLOGI AUGMENTED REALITY SEBAGAI  \r\nMEDIA PROMOSI DAN PENGENALAN PRODUK MENGGUNAKAN \r\nMETODE MARKER BASED TRACKING BERBASIS ANDROID PADA \r\nSHOWROOM BENTENG BETAWI MOTOR \r\n \r\nOleh : Muhammad Ryan \r\n \r\nBenteng Betawi Motor merupakan salah satu Showroom yang bergerak di \r\nbidang penjualan motor yang ada di kota Tangerang. Dimna tingkat persaingan \r\npenjualan sepeda  motor sangat tinggi. Oleh  sebab  itu, diperlukan  inovasi  baru \r\nyang  lebih efisien,  seperti dengan  mengubah  konsep  media  promosi  yang \r\nsebelumnya  menggunakan  media  cetak  (brosur)  menjadi  media  digital  seperti \r\nteknologi Augmented  reality.  Tujuan  dari  penelitian  ini  adalah  menerapkan \r\nteknologi Augmented reality  ke dalam bidang promosi dan pengenalan model \r\nmotor,    sehingga membuat promosi  lebih efisien dan interaktif. Aplikasi \r\nAugmented Reality ini menggunakan Unity3D, sebagai Software Engine, dimana \r\naplikasi  ini  memerlukan  sebuah gambar  yang diambil dari kamera smartphone \r\nsebagai sumber  masukan, kemudian aplikasi  ini akan  melacak dan  mendeteksi \r\npenanda  (marker) dengan  menggunakan  sistem tracking,  setelah marker \r\nterdeteksi, objek virtual 3 dimensi dari produk Showroom Benteng Betawi Motor \r\nakan tampil diatas marker. Dengan adanya aplikasi ini, diharapkan akan terjadi \r\npeningkatan minat konsumen terhadap produk yang ditawarkan oleh Showroom \r\nBenteng Betawi Motor. Hasil uji coba aplikasi ini menunjukan 80% responden \r\nmenyatakan aplikasi ini berguna dan bermanfaat \r\n \r\nKata  kunci  : Unity3D, Smartphone, Augmented  Reality, Showroom Benteng \r\nBetawi Motor, produk. \r\n \r\nxiii + 88 halaman; 53 gambar; 15 tabel; 21 lampiran \r\n Perpustakaan Universitas Budi Luhur\r\n'),(57,'1511501544','2021-02-05 14:01:42','128773','../files/1511501544.pdf',' \r\nIMPLEMENTASI AUGMENTED REALITY SEBAGAI MEDIA \r\nPEMBELAJARAN TUNTUNAN SHALAT DENGAN METODE MARKER \r\nBASED TRACKING BERBASIS ANDROID DI SDN PONDOK BAHAR 5 \r\nTANGERANG \r\nOleh: Safitri Yuwani (1511501544) \r\nPada  dunia  pendidikan,  kegiatan  belajar  mengajar  sekarang  masih \r\nmenggunakan  buku  berupa  teks  dan  gambar  dua  dimensi  (2D)  sebagai  sarana \r\npemberi materi oleh pengajar, cara ini kurang efektif untuk siswa-siswi yang sedang \r\nbelajar shalat, karena belajar shalat dibutuhkan sebuah alat peraga yang mampu \r\nmenampilkan gerakan shalat secara nyata, bukan hanya melalui gambar berupa dua \r\ndimensi saja, untuk itu dibutuhkan sebuah teknologi yang dapat membantu proses \r\nbelajar  dengan  memanfaatkan smartphone yaitu  menggunakan  teknologi \r\nAugmented  Reality (AR). Augmented  Reality merupakan  teknologi  yang \r\nmenggabungkan antara dunia nyata dan dunia virtual untuk menampilkan objek \r\ntiga dimensi (3D). Tujuan dibuatnya tugas akhir dengan teknologi AR sebagai \r\nmedia pembelajaran ini adalah untuk membantu siswa-siswi SDN Pondok Bahar 5 \r\nTangerang  yang  sedang  belajar  gerakan  shalat  agar  lebih  bersemangat  karena \r\nsiswa-siswi  dapat  melihat  objek  animasi  3D  gerakan  shalat  yang  menyerupai \r\ngerakan shalat aslinya, terdapat juga audio dari setiap bacaan shalat dan audio surat-\r\nsurat Al-Qur\'an disertai tombol informasi yang memuat bacaan shalat dengan huruf \r\narab  dan  terjemahan  Bahasa  Indonesia  agar  siswa-siswi  juga  dapat  menghafal \r\nbacaan shalat. Metode yang digunakan pada tugas akhir ini adalah dengan metode \r\nmarker based tracking yaitu menggunakan marker atau kertas sebagai penanda \r\nyang nantinya ketika AR kamera di arahkan ke marker, sistem akan melakukan \r\nproses pelacakan marker setelah proses pelacakan marker selesai, akan tampil \r\nobjek animasi 3D gerakan shalat dan audio pada perangkat android. Marker yang \r\ndigunakan  sebelumnya  sudah  di upload ke database  vuforia. Kontribusi  pada \r\npenelitian ini adalah terdapat audio lafal bacaan shalat sehingga siswa-siswi dapat \r\nmenghafal  bacaan  shalat,  terdapat  objek  animasi  3D  yang  menyerupai  aslinya \r\nsehingga siswa-siswi dapat mengikuti gerakan shalat, terdapat 10 marker setiap 1 \r\nmarker menampilkan 1 gerakan shalat. Hasil dari penelitian ini adalah sebuah \r\naplikasi yang menerapkan teknologi augmented reality berbasis android sebagai \r\nmedia  pembelajaran  tuntunan  shalat serta  hasil  dari  pengujian  kuesioner \r\nmenyatakan bahwa  siswa-siswi  SDN  Pondok  Bahar  5  senang  dan puas \r\nmenggunakan aplikasi berteknologi AR ini dengan jumlah persentase 100%. \r\nKata Kunci: Media Pembelajaran, Augmented Reality, Vuforia, Android, Marker. \r\nxv+76 halaman; 69 gambar; 8 tabel; 21 lampiran \r\n Perpustakaan Universitas Budi Luhur\r\n'),(58,'1511501551','2021-02-05 14:01:42','138287','../files/1511501551.pdf',' \r\n \r\nKLASIFIKASI TEKS BERBAHASA INDONESIA PADA TWITTER \r\nMENGGUNAKAN METODE BACKPROPAGATION ARTIFICIAL \r\nNEURAL NETWORK PADA BADAN NASIONAL PENANGGULANGAN \r\nBENCANA (BNPB) \r\n \r\nOleh: Helmi Nur Ihsan (1511501551) \r\n \r\nMedia sosial telah mengalami perkembangan yang sangat pesat, dengan jumlah \r\npenggunanya yang sangat masif, membuat penyebaran informasi menjadi sangat \r\nluas dan cepat. Selain memudahkan penggunanya untuk saling berinterkasi dan \r\nbersosialisasi, media sosial juga dapat dimanfaatkan untuk mendapatkan informasi \r\nmengenai bencana alam yang terjadi, karena kecendrungan pengguna yang akan \r\nsegera memberikan update keadaan terkini seputar bencana alam yang dialami. \r\nTwitter sebagai salah satu penyedia jasa media sosial, tercatat memiliki pengguna \r\nyang berasal dari Indonesia sebesar 19,5 juta orang. Dengan tersedianya sumber \r\ninformasi tersebut, akan terasa sulit jika harus memeriksa informasi yang dibagikan \r\noleh pengguna satu per satu, dan mengkalsifikasi apakah informasi tersebut benar \r\nmemiliki subjek bencana longsor atau bukan. Oleh karena itu, diperlukan suatu \r\nimplementasi algoritme yang dapat mengatasi masalah tersebut. Untuk menyusun \r\ntugas akhir ini penulis mengambil judul \"Klasifikasi Teks Berbahasa Indonesia \r\npada Twitter Menggunakan Metode Backpropagation Artificial Neural Network \r\npada Badan Nasional Penanggulangan Bencana (BNPB)\". Metode ini memiliki \r\nkelebihan mampu melakukan klasifikasi secara akurat dengan memberikan nilai \r\nbobot pada setiap kata yang terdapat dalam informasi yang didapat dari Twitter, \r\nsehingga hasil klasifikasi lebih akurat dan tidak bias. Dengan hasil pengujian yang \r\nmemberikan nilai akurasi sebesar 98% dan tingkat nilai kesalahan hanya sebesar \r\n0,01756. \r\n \r\nKata  kunci: Backpropagation, Text  Classification, Media  Sosial, Bencana \r\nLongsor \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(59,'1511501569','2021-02-05 14:01:43','113068','../files/1511501569.pdf',' \r\n \r\nPENERAPAN SENSOR NFC DAN ULTRASONIK UNTUK SISTEM \r\nPEMBAYARAN PARKIR MENGGUNAKAN ARDUINO UNO DAN \r\nMODULE ESP8266 DI PT BLU PARKING \r\n \r\nOleh: Putra Panji Wicaksono(1511501569) \r\n \r\nParkir merupakan tempat pemberhentian sementara waktu bagi alat transportasi \r\nkhususnya kendaraan pribadi roda dua. Saat ini pembayaran biaya parkir dengan \r\nuang tunai masih banyak digunakan. Hal ini mengakibatkan proses pembayaran \r\nmembutuhkan  waktu,  ditambah  lagi  bila  terjadi  adanya  pengembalian  uang. \r\nDampak dari pembayaran menggunakan uang tunai, dapat terjadi antrian bila ada \r\nbeberapa motor  yang  keluar  pada  saat  bersamaan. Berdasarkan  permasalahan \r\ntersebut  maka perlunya  dibuatkan  sistem  pembayaran  biaya  parkir  dengan \r\nmenggunakan uang elektronik metode yang digunakan berbasis teknologi NFC \r\nuntuk mengatasi masalah pada PT. BLU Parking yang mengelola lahan parkir di \r\nUniversitas Budi Luhur. Sistem sensor NFC dan Ultrasonik dengan mikrokontroler \r\nArduino Uno dan WiFi Module ESP8266 berbasis web yang akan mempercepat \r\nproses pembayaran parkir. Konsep dasar dari sistem sensor NFC yaitu dengan \r\nprinsip pertukaran data melalui sinyal gelombang radio. Teknologi yang digunakan \r\nNFC didasarkan pada RFID (Radio Frequency Identification) yang menggunakan \r\ninduksi eleketromagnetik untuk pertukaran data. Dengan sistem ini mempercepat \r\nsaat proses pembayaran parkir dan petugas parkir dapat mencetak data transaksi \r\nmelalui website, serta dapat meningkatkan kualitas layanan pada PT. BLU Parking \r\nsebagai pengelola parkir. \r\n \r\nKata Kunci : Sistem Pembayaran Parkir, Sensor Ultrasonik , Sensor NFC \r\n \r\nXvii + 56 halaman; 43 gambar; 7 tabel; 1 lampiran \r\nAbstrak \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(60,'1511501619','2021-02-05 14:01:43','70411','../files/1511501619.pdf',' \r\n \r\nIMPLEMENTASI AUGMENTED REALITY PENGENALAN BUAH-\r\nBUAHAN  BERBASIS ANDROID DENGAN METODE MARKER BASED \r\nTRACKING DI TAMAN KANAK-KANAK PERMATA BUNDA \r\nOleh : Ilham Mardany ( 1511501619) \r\nDengan seiring berkembang pesatnya ilmu pengetahuan dan teknologi informasi \r\npada era globalisasi dan serba modern akan kecanggihan teknologi yang dimiliki, \r\nhal ini menjadikan teknologi sebagai kebutuhan dalam mempermudah aktivitas \r\nmanusia sehari - hari, seperti aktivitas militer, pemerintah, perkantoran, hiburan dan \r\nlainnya.  Salah  satu  diantaranya  adalah  pendidikan,  dengan  adanya  penerapan \r\nteknologi yang canggih tentunya dapat membantu aktivitas dalam sistem belajar \r\nmengajar. Banyak  terobosan  teknologi  baru  yang  semakin  canggih  telah  \r\ndikembangkan di  Indonesia. Salah satunya  adalah teknologi augmented reality  \r\ndimana dengan teknologi augmented reality yang menggabungkan benda maya dua \r\ndimensi dan ataupun tiga dimensi ke dalam sebuah lingkungan nyata tiga dimensi \r\nlalu memproyeksikan benda-benda maya tersebut dalam waktu nyata sehingga bisa \r\nterlihat lebih nyata. Fakta yang dihadapi di taman kanak-kanak permata bunda ialah \r\nsangat minimnya penyampaian suatu informasi pembelajaran menggunakan suatu \r\nteknologi. Harapannya dapat mengenalkan suatu aplikasi dengan menggunakan \r\nteknologi augmented reality untuk pembelajaran buah-buahan yang menampilkan \r\nobjek  3D dan  informasinya  di  taman  kanak-kanak  permata  bunda.  Dari \r\npermasalahan  tersebut,  tentu  saja  dibutuhkan  suatu  aplikasi  edukasi  yang \r\nmendukung  untuk  kegiatan  pembelajaran.  Aplikasi  yang  dibuat  memiliki  fitur \r\nmemunculkan suatu buah-buahan dari masing-masing marker yang tersedia secara \r\n3D. setiap marker yang ada, akan memunculkan button informasi dan button back. \r\nTeknologi  augmented  reality  ada  3  metode,  yaitu Marker Based Tracking, \r\nMarkerless Based Tracking, dan GPS Based Tracking. Aplikasi buah-buahan ini \r\nmenggunakan metode marker based tracking. Aplikasi ini dibuat menggunakan \r\nunity3D, dimana unity  3D mempermudah  pengguna  untuk  mengembangkan \r\naplikasi berbasis augmented reality, lalu menggunakan Vuforia sebagai SDK ( \r\nSoftware Development Kit ). SDK mendeteksi dan melacak fitur yang secara alami \r\nditemukan dalam gambar itu sendiri dengan membandingkan fitur alami ini dengan \r\ndatabase sumber daya target yang diketahui. Hasilnya apabila pengguna aplikasi \r\nini  mengarahkan  ke  marker  yang  tersedia,  akan  muncul  objek  3D dan  button \r\ninformasi. Apabila button informasi di klik, akan muncul informasi dari buah yang \r\nmuncul sebelumnya.  \r\nKata Kunci : Augmented Reality, Marker Based Tracking, Vuforia, Unity3D \r\nXiv+52 halaman; 45 gambar; 2 tabel; 4 lampiran \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(61,'1511501627','2021-02-05 14:01:43','57994','../files/1511501627.pdf',' \r\n \r\nPROTOTIPE SURVIVAL ZOMBIE GAME MENGGUNAKAN UNITY 3D \r\nDENGAN METODE PATH FINDING BERBASIS DESKTOP  \r\nPADA LAB MEDIA KOMUNIKASI UNIVERSITAS BUDI LUHUR \r\nOleh : Samuel Hansen (1511501627) \r\n \r\nGame merupakan suatu hiburan yang tidak terlewatkan untuk melepas penat \r\nterlebih setelah melaksanakan aktivitas sehari-hari. Dengan dasar tersebut, hingga \r\nsaat ini game masih melekat pada konsep media hiburan. Akhirnya, muncul konsep \r\nbaru yang menerapkan pembelajaran dalam bermain game. Konsep belajar pun \r\nmasuk  seiring game tersebut  dikembangkan.  Hampir  semua  genre game telah \r\nditerapkan konsep pembelajaran. Salah satunya adalah game bergenre First Person \r\nShooter (FPS). Survival Zombie Game merupakan game pembelajaran bergenre \r\nFirst Person Shooter (FPS) dengan sudut pandang orang pertama sebagai tokoh \r\nutama. Game ini di desain dengan mengambil studi kasus perang melawan zombie. \r\nPemain akan dibawa ke suatu tempat dimana pemain harus bisa bertahan hidup dari \r\nserangan zombie. Para zombie akan bisa berjalan sedemikian rupa mencari pemain \r\nsetelah  diberikan artificial  intelligence berupa  algoritma  pencarian  heuristik \r\ntersebut. Dalam  mengimplementasikan  aplikasi  ini  dibutuhkan  software \r\npendukung, yaitu Unity 3D sebagai software utama untuk pembuatan aplikasi game \r\ndevelopment, Microsoft Visual Studio 2017 sebagai tools dalam penulisan script \r\nuntuk aplikasi game development. \r\nKata Kunci : Game, First Person Shooter, Artificial Intelligence \r\nxvi+58 halaman; 49 gambar; 1 tabel; 1 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(62,'1511501635','2021-02-05 14:01:43','101079','../files/1511501635.pdf',' \r\nIMPLEMENTASI ALGORITME A* (ASTAR) PADA APLIKASI \r\nPERMAINAN EDUKASI PENGELOMPOKAN SAMPAH  TRASHERO  \r\nOleh: DIKI HENAS SATRIAWAN (1511501635) \r\nSampah  merupakan  sarang kuman  penyakit  dan  dapat  memperburuk  global \r\nwarning  karena  adanya sampah  yang  tidak  dapat  di urai  oleh  alam,  adanya \r\npengelompokan sampah sendiri ditujukan untuk membedakan sampah yang dapat \r\nterurai oleh alam dan sulit di urainya oleh alam. Sampah yang sulit diolah oleh alam \r\nini akan di daur ulang menjadi barang yang sejenis atau menjadi kreasi tangan yang \r\nmempunyai  nilai  lebih,  tetapi  saat  ini  penerapan  pengelompokan  sampah  di \r\nmasyarakat  Indonesia  masih  belum  maksimal.  Dengan  adanya  pembelajaran \r\nalternatif baru  yang  dapat  menarik  minat  semua  umur  untuk  mendapatkan \r\npengetahuan pengelompokan  sampah.  Penelitian  ini  bertujuan  untuk \r\nmengembangkan  sebuah  aplikasi  permainan  edukasi  pengelompokan  sampah \r\ndengan mengimplementasikan algoritme A-Star sebagai kecerdasan buatan pada \r\nNon-Playable  Character (NPC) atau  monster  yang  menjadi  tantangan    pada \r\naplikasi permainan ini. Melalui UAT yang dilakukan penelitian ini mendapatkan \r\n92%  mendapat  respon  positif  dapat  menjadi  sarana  alternatif  pembelajaran \r\npengelompokkan  sampah 85%  menyatakan  bahwa  aplikasi  permainan  ini \r\nmemberikan pengetahuan  tentang  pengelompokan  dengan  jelas,  dan  59% \r\nmenyatakan bahwa kepintaran pada monster membuat permainan menjadi lebih \r\nsulit. \r\n \r\nKata Kunci: Game, A-Star, Edukasi, Pengelompkan Sampah \r\nxii + 48 halaman; 32 gambar; 4 tabel, 1 lampiran \r\n Perpustakaan Universitas Budi Luhur\r\n'),(63,'1511501643','2021-02-05 14:01:43','44701','../files/1511501643.pdf',' \r\n \r\nIMPLEMENTASI TEKNOLOGI AUGMENTED REALITY \r\nMENGGUNAKAN MARKER BASED TRACKING UNTUK ANAK \r\nBERKEBUTUHAN KHUSUS PADA SEKOLAH KHUSUS NURASIH \r\nTANGERANG SELATAN \r\n \r\nOleh: Ahmad Albi Aldriyan \r\n \r\nPada  era  globalisasi  saat  ini  teknologi  sudah  memasuki  segala  bidang \r\nkehidupan manusia termasuk dalam bidang pendidikan bagi anak berkebutuhan \r\nkhusus.  Kurangnya  pendidikan  tentang  teknologi  membuat  anak-anak \r\nberkebutuhan  khusus  tertinggal  dalam  bidang  teknologi  padahal  penggunaan \r\nteknologi  dapat  membuat  proses  pembelajaran  menjadi  lebih  baik  lagi.  Proses \r\npembelajaran  yang  baik  haruslah  memuat  aspek  interaktif,  menyenangkan, \r\nmenantang, memotivasi dan memberikan ruang yang lebih bagi siswa untuk dapat \r\nmengembangkan  kreativitas  dan  kemandirian.  Kegiatan  pembelajaran  yang \r\nmenyenangkan  sangat  dipengaruhi  oleh  berbagai  faktor,  salah  satunya  adalah \r\npemilihan media pembelajaran yang digunakan haruslah dapat menarik bagi siswa \r\nuntuk belajar, interaktif saat digunakan, namun tidak mengurangi esensi materi \r\nyang  disampaikan. Implementasi teknologi augmented  reality dapat  digunakan \r\nsebagai  alat  pembelajaraan  bagi  anak-anak  berkebutuhan  khusus  karena \r\naugmented reality itu sendiri sangat mudah digunakan, interaktif, menyenangkan \r\ndan augmented  reality memiliki  desain interface (antarmuka)  yang  sangat \r\nbersahabat dengan pengguna (user friendly), terlebih penggunaan metode marker \r\nbased tracking pada augmented reality juga dapat memudahkan pengguna yang \r\ndalam  hal  ini  ialah  anak-anak  berkebutuhan  khusus  karena  pengguna  hanya \r\nmengarahkan kamera smartphone ke arah marker yang sudah tersedia berdasarkan \r\nkategori marker yang ada, yaitu marker guru, marker siswa dan marker jadwal \r\nagar dapat  menampilkan objek virtual 3Dnya. Selain itu proses scanning juga \r\nsangat  mudah  karena  dapat  di scan sampai  pada  jarak  kejauhan  100  cm  dan \r\ntingkat kemiringan hingga 90o untuk marker guru dan marker siswa sedangkan \r\nuntuk marker jadwal dapat di scan sampai pada jarak kejauhan 75 cm dan tingkat \r\nkemiringan  hingga  60o serta  mampu  menampilkan  objek virtual 3D  dengan \r\ntingkat pencahayaan yang minim. Penggunaan smartphone pun terbilang ringan \r\nkarena  hanya  membutuhkan  minimal Operating  System (OS) android 5.0 \r\n(Lollipop) mengingat  perkembangan android hingga  tahun  2019  ini  sudah \r\nmenyentuh android 9.0 (Pie). Dengan media pembelajaran yang menggunakan \r\nteknologi augmented reality dapat membuat interaksi antara siswa dengan guru \r\nmenjadi lebih baik lagi, proses belajar dan mengajar menjadi lebih menyenangkan  \r\nsehingga  dapat  menghasilkan  suatu  proses  belajar  dan  mengajar  yang  lebih \r\nberkualitas. \r\n \r\nKata  Kunci  : Augmented  Reality, Marker,  Sekolah  Khusus,  Metode Marker \r\nBased Tracking Perpustakaan Universitas Budi Luhur\r\n'),(64,'1511501676','2021-02-05 14:01:43','8665','../files/1511501676.pdf',' \r\n \r\nIMPLEMENTASI AUGMENTED REALITY MENGGUNAKAN \r\nMETODE MARKER BASED TRACKING BERBASIS \r\nANDROID SEBAGAI MEDIA PROMOSI SEKOLAH PADA \r\nSMK YADIKA 4 KARANG TENGAH \r\n \r\nPada era modern ini kegiatan manusia selalu dikelilingi dengan adanya teknologi, \r\nPerkembangan teknologi informasi dan komunikasi saat ini sudah berkembang \r\npesat dari berbagai bidang. Baik pendidikan, dunia hiburan, pelatihan militer, \r\nmedis, desain, media promosi dan lain-lain. Media Promosi merupakan suatu alat \r\nuntuk mengkomunikasikan suatu produk, jasa, image, perusahaan, instansi agar \r\ndapat lebih dikenal masyarakat lebih luas. Dalam perkembangan media promosi \r\nsekarang ini masih menjumpai promosi yang dilakukan dalam bentuk mencetak \r\nbrosur yang terlihat kurang menarik minat pembaca. SMK Yadika 4 Karang \r\nTengah adalah salah satu lembaga pendidikan yang masih menggunakan media \r\npromosi dengan brosur yang belum difasilitasi teknologi animasi tiga dimensi \r\n(3D). Dengan memanfaatkan teknologi Augmented Reality (AR) sebagai media \r\npromosi dalam bentuk informasi tiga dimensi (3D) yang ditampilkan secara \r\nvirtual yang nantinya menggunakan perangkat smartphone. Dengan adanya \r\npemanfaatan teknologi Augmented Reality (AR) sehingga dapat menumbuhkan \r\nminat orang tua dan calon siswa/siswi baru untuk lebih tertarik dalam membaca \r\nbrosur yang diberikan, sehingga dapat menumbuhkan minat pendaftar siswa/siswi \r\nbaru. Dalam penelitian aplikasi AR ini menggunakan metode Marker Based \r\nTracking dengan bantuan aplikasi Unity 3D dan Vuforia untuk membuat aplikasi \r\naugmented reality (AR). Berdasarkan hasil pengujian yang dilakukan \r\nmenggunakan kuesioner penelitian, mendapatkan responden sebanyak 30 \r\nresponden, yang menunjukan bahwa aplikasi termasuk kedalam aplikasi sangat \r\nbaik, dengan skor hasil 1278 dari skala 1500 dan disetujui dapat menumbuhkan \r\nminat pendaftar siswa/siswi baru sebanyak 29 responden dari 30 responden. \r\n \r\nKata kunci: Augmented Reality, Marker Based Tracking, Unity 3D, Vuforia, \r\nMedia Promosi. \r\nxiv+89 halaman; 15 tabel; 69 gambar; 2 lampiran. '),(65,'1511501692','2021-02-05 14:01:43','21091','../files/1511501692.pdf',' \r\nIMPLEMENTASI ALGORITMA PATHFINDING DAN DECISION \r\nTREE DALAM PEMBUATAN VIDEO GAME BERGENRE THIRD \r\nPERSON SHOOTER. \r\nOleh : Bambang Sugianto ( 1511501692 ) \r\nPermainan  Video  (Video  Game)  adalah  permainan  yang  memanfaatkan \r\nteknologi berupa alat elektronik yang mampu menampilkan suatu gambar sebagai \r\nmedia antarmuka dengan pengguna dan pengguna dapat mengendalikan Obyek \r\nyang ada dalam gambar tersebut dengan alat pengendali (Input Device). Seiring \r\nperkembangan zaman, Permainan Video memiliki media keluaran lain (Output) \r\nseperti suara dan juga getaran. Universitas Budi Luhur memiliki komunitas yang \r\ndinamakan  Kotak  Kreatif,  yaitu  sebuah  komunitas developer  video  game di \r\nUniversitas Budi Luhur. Komunitas Kotak Kreatif sudah menciptakan beberapa \r\npermainan untuk platform Android dan PC. Namun, pada komunitas ini belum \r\npernah  menerapkan  teknik  khusus Artificial  Intelligence (AI) dalam  judul \r\npermainan yang telah diciptakan oleh komunitas Kotak Kreatif. Oleh karena itu \r\ntujuan utama dari Tugas Akhir ini adalah untuk menciptakan konten AI dalam \r\npermainan bergenre Third Person Shooter (TPS) sebagai lawan main, karena genre \r\nTPS  tersebut  bergantung  pada  lawan  main  sebagai  aspek  utama.  Untuk  itu \r\ndibutuhkan  Metode Pathfinding sebagai  penentu  arah  jalan  dan Decision  Tree \r\nsebagai  penentu  tindakan  (Behaviour)  lawan  main. Metode Pathfinding \r\nmenggunakan Algoritma A*, cara kerjanya dengan mengambil jarak antara setiap \r\nnode dan  tujuan.  Metode Decision  Tree adalah  sebuah  pohon  hirarki  yang \r\ndiimplementasikan  dengan  menggunakan Nested  if-else,  setiap  kondisi  akan \r\ndiperiksa dan keputusan akan diambil bedasarkan kondisi. \r\nKata  Kunci: Kecerdasan  Tiruan, Artificial  Intelligence, Pathfinding,  A* \r\nAlgorithm, Decision Tree, AI Behaviour. \r\nxiii+56 Hal; 3 Tabel; 37 Gambar \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(66,'1511501718','2021-02-05 14:01:43','75111','../files/1511501718.pdf','   \r\n \r\nAplikasi Keamanan Kendaraan Bermotor Berbasis Android Menggunakan \r\nMikrokontroler Arduino ATMega2560     \r\nOleh : Randi Saputra (1511501718) \r\nKasus   pencurian  kendaraan  bermotor  sering kali  terjadi, tindak  kriminal  \r\npencurian  kendaraan  bermotor  terjadi karena salah satunya  masih  kurangnya  \r\nsistem  keamanan  kendaraan yang efektif. Pengguna kendaraan cenderung masih \r\nmenggunakan  sistem  keamanan dengan  kunci  ganda.  Selain  itu  kurangnya  \r\npengawasan  dari  pemilik  kendaraan  menjadi  faktor  sering  terjadinya  kasus \r\npencurian. Dengan  dibuatnya  sistem  keamanan  kendaraan ini    diharapkan \r\nkendaraan  yang  terparkir dapat dimonitor dan dikontrol dengan  menggunakan \r\nsmartphone Android yang terintegrasi dengan  mikrokontroler,  dimana  nantinya  \r\nkendaraan  yang  terparkir  di depan  rumah  dapat di monitor oleh aplikasi Android. \r\nSistem keamanan kendaraan ini dapat bekerja melalui mikrokontroler Atmega2560 \r\nyang dapat  dimonitor  oleh  aplikasi Android. Apabila kendaraan  bergerak  keluar  \r\ntanpa  sepengetahuan  pemilik  kendaraan maka sistem keamanan akan memberi \r\nperingatan  melalui bunyi  alarm  dari  alat  yang  sudah  terpasang  di  kendaraan, \r\nsehingga  pemilik  kendaraan  dapat  menghentikan  laju  kendaraan  yang  dicuri \r\ndengan hanya mengklik tombol system off  pada aplikasi Android yang terhubung \r\npada module relay  yang  dipasangkan  di  kendaraan,  selain  dapat  mematikan \r\nkendaraan  menggunakan  Android  pengguna  juga  dapat  menyalakan  kendaraan \r\ndengan  menggunakan  Android  yaitu  pertama  pengguna  kendaraan  mengklik \r\ntombol system on di Androidnya, dan ketika sistem sudah aktif lalu klik tombol \r\nstart engine maka kendaraan akan menyala. Di aplikasi ini juga pengguna bisa \r\nmengecek posisi  kendaraan ketika di parkir dengan mengklik tombol call jika \r\ntombol call di klik maka kendaraan akan bunyi alarm  yang menandakan letak \r\nkendaraan tersebut, dan jika kendaraan hilang maka pengguna bisa mengecek posisi \r\nkendaraan  tersebut  dengan  mengklik  tombol get  location maka  alat  akan \r\nmengirimkan  pesan  ke smartphone titik  koordinat  lokasi  kendaraan  itu  berada \r\nmelalui GPS module Ublox Neo-6M dan GSM SIM 800L yang ada di alat yang \r\nterpasang  di  kendaraan  pengguna. Arduino  IDE  sebagai  perangkat  lunak \r\npenghubung  antara  program  ke mikrokontroler ATMega2560 dengan  \r\nmenggunakan  bahasa pemrograman  C. Dengan dibuatnya aplikasi keamanan \r\nkendaraan bermotor berbasis Android ini bisa mengurangi pencurian kendaraan \r\nbermotor yang sering kali terjadi di lingkungan masyarakat dan membuat pemilik \r\nkendaraan tidak was-was ketika harus meninggalkan kendaraannya. \r\n \r\nKata  Kunci  : Aplikasi  Keamanan,Smartphone  Android, module relay,  alarm, \r\nmodule GPS Ublox Neo-6M, GSM SIM 800L, Mikrokontroller ATMega2560 \r\nXVIII+63 halaman; 38 Gambar; 5 Tabel; 3 Lampiran  \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(67,'1511501734','2021-02-05 14:01:43','193726','../files/1511501734.pdf',' \r\n \r\nIMPLEMENTASI JARINGAN SYARAF TIRUAN BACKPROPAGATION \r\nUNTUK SISTEM PREDIKSI PENJUALAN BARANG PERCETAKAN \r\nBERBASIS WEB PADA PT. KARYAPRIMA UTAMA PERKASA \r\n \r\nOleh : Agung Kurniawan Raharjo (1511501734) \r\n \r\nPT. Karyaprima Utama Perkasa merupakan perusahaan yang bergerak di bidang \r\nindustri. Komoditas yang diproduksi yaitu barang percetakan. Sekarang ini tingkat \r\njumlah produksi barang cetakan PT. Karyaprima Utama Perkasa cukup tinggi dan \r\ntidak menentu. Permasalahan yang muncul adalah berapa banyak bahan baku yang \r\nharus disuplai untuk memenuhi kebutuhan produksi.  Oleh karena itu dibutuhkan \r\nsebuah sistem yang akurat yang dapat memprediksi penjualan barang percetakan \r\nsebagai pertimbangan berapa banyak bahan baku produksi yang harus disuplai pada \r\nbulan selanjutnya. Sehingga kegiatan produksi dapat bejalan dengan lancar dan \r\ntindakan pencegahan atau pemanfaatan peluang yang akan terjadi dapat dilakukan. \r\nPenelitian ini menghasilkan sebuah model prediksi untuk mengestimasi penjualan \r\nbarang percetakan dengan metode Jaringan Syaraf Tiruan Backpropagation. Data \r\nbersumber dari rekapitulasi penjualan 64 bulan terakhir dari 3 jenis barang yaitu \r\nkartu nama, leaflet, dan flyer. Berdasarkan hasil penelitian, diperoleh hasil prediksi \r\nyang berbeda dari setiap barang percetakan. Setiap barang menggunakan arsitektur \r\n12 input layer, 4 hidden layer dan 1 output layer dengan learning rate terbaik 0.4. \r\nHasil prediksi penjualan pada kartu nama menghasilkan akurasi 89.66% dengan \r\nMSE = 0.00242, leaflet 96.78% dengan MSE = 0.00406 dan flyer 95.13% dengan \r\nMSE = 0.00642. \r\n \r\nKata Kunci : Prediksi, Jaringan Syaraf Tiruan, Backpropagation \r\n \r\nx+64 halaman; 42 gambar; 9 tabel; 4 lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(68,'1511501742','2021-02-05 14:01:43','119658','../files/1511501742.pdf',' \r\n \r\nPROTOTIPE GAME HORROR ZOMBIE SLAYER MENGGUNAKAN \r\nUNITY 3D DENGAN ALGORITMA PATHFINDING A* \r\n \r\nOleh : Ifan Pratama Susanto (1511501742)  \r\n \r\n  Videogame merupakan salah satu media hiburan yang banyak dipilih oleh \r\norang  untuk  melepas  kepenatan  ataupun  mengisi  waktu  luang.  Jumlah pemain \r\nvideogame  di  dunia  maupun  di  Indonesia  sendiri  mengalami  peningkatan  dari \r\ntahun  ketahun.  Hal  ini  dibuktikan  dengan  meningkatnya  penjualan  mesin \r\nvideogame dan semakin maraknya bermunculan berbagai jenis genre videogame. \r\nAdapun manfaat yang diberikan dalam membangun sebuah game adalah untuk \r\nmemberikan  hiburan  kepada  user  secara  interaktif  dan  melatih  user  berpikir \r\nstrategi  dalam  membuat  keputusan  menyelesaikan  rintangan  yang  di  dalam \r\nsebuah game. AI(Artificial  Intellegence)  yang  digunakan  dalam  sebuah game \r\ndigunakan untuk meningkatkan kualitas game dengan menirukan tingkah laku dan \r\nfungsi  otak  manusia.  Dengan  adanya  game  berbasis AI membuat  para  pemain \r\nlebih tertantang dalam mengatur strategi untuk mengalahkan atau melawati segala \r\nrintangan  yang  ada  didalam  sebuah game.  Untuk  membuat AI dalam  sebuah \r\ngame, penulis mengimplementasikan algoritma Pathfinding A*(Star). algoritma \r\nPathfinding  A*(Star)  merupakan  algoritma  yang  cukup  popular  didunia  yang \r\nmemiliki  lebih  dari  seribu  literatur.  algoritma Pathfinding  A*(Star)  digunakan \r\nuntuk mencari jalur terpedek (Shortest Path) dari titik awal ke titik tujuan, dalam \r\nhal ini algortima Pathfinding A*(Star) digunakan oleh musuh (AI) untuk mencari \r\nkeberadaan  atau  posisi  pemain  sehingga  musuh  (AI)  dapat  mengejar  pemain \r\nsecara otomatis tanpa harus membuat sebuah jalur (Path) secara manual. Sebagai \r\nhasil akhir, didapatkan game fps yang memiliki AI berbasis algoritma Pathfinding \r\nA(Star) yang dapat melakukan kalkulasi secara otomatis dan dinamis dari titik \r\nawal ke titik tujuan selama game atau permainan berlangsung serta memberikan \r\npengalaman bermain yang lebih menarik. \r\n \r\nKata kunci : Game, Artificial Intellegence, Algoritma Pathfinding A*(star) \r\n \r\n\r\nxi+50 halaman; 34 gambar; 2 tabel; 1 lampiran \r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n Perpustakaan Universitas Budi Luhur\r\n'),(69,'1511501775','2021-02-05 14:01:44','72532','../files/1511501775.pdf',' \r\n \r\nGAME MYSTERY ZOMBIE ISLAND MENGGUNAKAN \r\nALGORITMA A* DENGAN UNITY 3D PADA PT MATATA CORP \r\n \r\nGame merupakan jenis hiburan yang disukai oleh hampir semua kalangan \r\norang, mulai dari anak-anak, dewasa, sampai yang sudah tua. Game sekarang \r\nmenggunakan  AI  (Artificial  Intellegence)  untuk  meningkatkan  kualitas \r\npermainan. Kecerdasan buatan / Artificial Intellegence merupakan bagian bidang \r\nilmu  yang dapat  menirukan  tingkah  laku  dan  fungsi  otak  manusia  agar  dapat \r\nmelakukan \r\npekerjaan seperti yang dapat dilakukan manusia. Game juga digunakan untuk \r\nmenghilangkan kejenuhan dalam menjalankan aktivitas sehari-hari dan juga untuk \r\nmelatih diri seseorang untuk lebih berkonsentrasi dan fokus dengan game tersebut. \r\nGame itu sendiri adalah sebuah permainan dalam video yang menggunakan \r\ninteraksi antarmuka pengguna melalui gambar yang dihasilkan oleh piranti video. \r\nGame biasanya memiliki karakter utama yang selalu dikontrol oleh pemain, dan \r\njuga karakter musuh yang dikendalikan oleh komputer atau game itu sendiri. Oleh \r\nkarena itu, dengan adanya penelitian tentang game ini, diharapkan agar nantinya \r\ngame yang di buat dapat menghilangkan rasa jenuh dan melatih kesabaran serta \r\nkonsentrasi  pada  pada  pemain  itu,  dan  untuk  mengetahui  bagaimana  cara \r\nmembuat \r\nmusuh berupa zombie menggunakan algoritma A* untuk bisa bergerak menyerang \r\nke arah titik pemain berada. Saat ini, sudah banyak aplikasi untuk membuat \r\ngame,seperti Unreal Engine, Unity 3D, dan masih banyak lagi. Unity 3D saat ini \r\nmerupakan salah satu game development engine yang sangat umum digunakan, \r\nkarena sangat mudah di pelajari oleh pemula sekalipun, beserta user friendly yang \r\nditawarkannya. Sudah banyak game dengan genre survival zombie yang dibuat \r\ndengan algoritma A* ini, agar NPC(Non Player Character) bisa bergerak menuju \r\ntitik  yang  dituju.  Algoritma  A*  itu  sendiri  adalah  algoritma  yang  dapat \r\nmemberikan \r\nsolusi yang tepat dalam pencarian jalur terbaik pada suatu graf. Dengan riset ini \r\n,penulis akan menerapkan algoritma A* pada game bergenre FPS(First Person \r\nShooter) dengan judul Game Mystery Zombie Island menggunakan framework \r\nunity.Sebagai  hasil  akhir,  didapatkan game dengan  genre  FPS(First  Person \r\nShooter) dengan judul Mystery Zombie Island berbasis algoritma A*. \r\n \r\nKata Kunci : Algoritma A*, Artificial Intelegent, First Person Shooter, Single \r\nPlayer, Survival horror '),(70,'1511501783','2021-02-05 14:01:44','40228','../files/1511501783.pdf',' \r\n \r\nSISTEM PAKAR DIAGNOSIS GANGGUAN PSIKOLOGIS DENGAN \r\nMETODE CERTAINTY FACTOR BERBASIS WEB PADA KLINIK CLUB \r\nHYPNOSIS SEHATI UNIVERSITAS BUDI LUHUR \r\n \r\nOleh : Kevin Andrean (1511501783) \r\n \r\nTidak sedikit pasien penderita gangguan psikologis yang sungkan untuk melakukan \r\nkonsultasi kepada psikiater, hal ini terjadi karena adanya beberapa kendala yang \r\ndialami oleh pasien, seperti jarak antara pasien  dan psikiater  yang jauh, biaya \r\nkonsultasi  yang  relatif  mahal,  serta  kurang  terbukanya pasien  akan  gangguan \r\npsikologis yang mungkin dideritanya. Dari permasalahan yang telah dipaparkan \r\nsebelumnya, dibuatlah sistem pakar berbasis website yang mampu mendiagnosis \r\ngangguan psikologis agar dapat digunakan kapan saja dan dimana saja. Salah satu \r\ncara untuk menangani gangguan psikologis adalah dengan melakukan hipnoterapi. \r\nHipnoterapi  adalah  sebuah  terapi  yang  dilakukan  terhadap  pasien  untuk \r\nmemberikan sugesti-sugesti positif yang mampu merubah mindset pasien  yang \r\nmenderita suatu gangguan psikologis tertentu. Sistem pakar ini menggunakan solusi \r\nyang langsung bisa dijadikan terapi oleh pasien, dimana solusi tersebut berupa \r\naudio rekaman hipnoterapi yang diperoleh dari suara rekaman psikiater. Sistem \r\npakar ini dibuat dengan metode certainty factor untuk menentukan nilai kepastian \r\ndari suatu diagnosis. Melalui hasil uji user acceptance test (UAT), penelitian ini \r\nmendapatkan  respon  80.8%  positif  dari  pengalaman user dalam  menggunakan \r\naplikasi ini. \r\n \r\nKata Kunci : Sistem Pakar, Hipnoterapi, Certainty Factor \r\nxiii+70 halaman; 54 gambar; 9 tabel; 4 lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(71,'1511501825','2021-02-05 14:01:44','9201','../files/1511501825.pdf',' \r\n \r\nAPLIKASI PREDIKSI KELULUSAN UJIAN NASIONAL \r\nMENGGUNAKAN ALGORITMA KLASIFIKASI K-NEAREST \r\nNEIGHBOR DENGAN PENGUKURAN JARAK MANHATTAN \r\nDISTANCE PADA SEKOLAH MENENGAH PERTAMA BANI \r\nTAQWA KOTA BEKASI BERBASIS JAVA DESKTOP \r\n \r\nSekolah  Menengah  Pertama  (SMP)  Bani  Taqwa  Kota  Bekasi  setiap  tahunnya \r\nmengadakan  2  kali  ujian tryout untuk  persiapan  ujian  nasional  (UN). Tryout \r\nterdiri dari  mata  pelajaran  Bahasa  Indonesia,  Bahasa  Inggris,  Matematika  dan \r\nIlmu Pengetahuan  Alam  (IPA).  Ujian tryout dijadikan  sebagai  acuan  untuk \r\npersiapan menghadapi UN. Dari hasil tryout tersebut, pihak sekolah melakukan \r\nprediksi untuk mengetahui apakah siswa-siswi dapat lulus atau tidak dalam UN. \r\nSaat  ini  pihak sekolah melakukan  prediksi  kelulusan  UN  dengan  cara  manual \r\nyaitu menggunakan perhitungan dengan Microsoft Excel. Hal ini dianggap kurang \r\nefektif  dan  efisien, karena  banyaknya  jumlah  data  dan  lamanya  waktu  yang \r\ndibutuhkan.  Sekolah  tersebut membutuhkan  suatu  aplikasi  untuk  membantu \r\nproses prediksi sesuai dengan hasil nilai tryout. Tujuan dari penelitian ini adalah \r\nuntuk  merancang  sebuah  sistem  yang dapat  mengatasi  masalah  efisiensi  dan \r\nefektifitas  untuk  memprediksi  kelulusan  UN  di sekolah  tersebut.  Proses \r\npembangunan  aplikasi  menggunakan  algoritma  klasifikasi KNearest Neighbor \r\ndengan  metode  pengukuran  jarak Manhattan  Distance untuk memprediksi \r\nkelulusan UN disekolah tersebut. Atribut yang digunakan adalah nilai rata-rata \r\ndari pelajaran Bahasa Indonesia tryout 1, Bahasa Inggris tryout 1, Matematika \r\ntryout 1, IPA tryout 1 (rata-rata) tryout 1, dan Bahasa Indonesia tryout 2, Bahasa \r\nInggris tryout 2, Matematika tryout 2, IPA tryout 2 (rata-rata) tryout 2. Algoritma \r\nK-Nearest  Neighbor merupakan  sebuah  metode  untuk  melakukan klasifikasi \r\nterhadap objek tersebut. Dengan menggunakan dataset siswa dari 3 tahun terakhir \r\nyang berjumlah 555, kemudian menggunakan 5 parameter (k) yaitu k=3,  k=5, \r\nk=7, k=9, k=11. Maka dihasilkan tingkat accuracy untuk tahun ajaran 2016/2017, \r\n2017/2018 dan 2018/2019 dengan k=3  nilai accuracy sebesar 98.20%, dengan \r\nk=5 nilai accuracy sebesar 98.20%, dengan k=7 nilai accuracy sebesar 97.60%, \r\ndengan k=9 nilai accuracy sebesar 97.60%, dengan k=11 nilai accuracy sebesar \r\n98.20%, maka  rata-rata accuracy sebesar  97.96%.  Berdasarkan  hasil  dari \r\nserangkaian proses pengujian yang dilakukan, dapat disimpulkan bahwa aplikasi \r\ndapat memprediksi kelulusan ujian nasional siswa-siswi SMP Bani Taqwa Kota \r\nBekasi. \r\n \r\nKata Kunci : Prediksi, K-Nearest Neighbor, Manhattan Distance \r\nxiii + 75 halaman; 37 Gambar; 6 Tabel; 1 Lampiran '),(72,'1511501841','2021-02-05 14:01:44','8440','../files/1511501841.pdf',' \r\n \r\nIMPLEMENTASI TEKNOLOGI AUGMENTED REALITY \r\nSEBAGAI MEDIA PEMBELAJARAN DENGAN METODE \r\nMARKER BASED TRACKING BERBASIS MOBILE \r\nANDROID PADA PAUD ANANDA KREO SELATAN \r\n \r\nSebelum  memasuki  jenjang  pendidikan  sekolah  dasar  (SD)  calon  siswa/I \r\ndiharuskan  sudah  dapat  membaca  dan menulis  agar  proses  pembelajaran  pada \r\njenjang SD dapat berjalan lebih efektif. Untuk itu anak-anak yang berusia 4-5 \r\ntahun disarankan  untuk  mengikuti  pembelajaran  terlebih  dahulu  pada  taman \r\nkanak-kanak (TK) atau pada lembaga pendidikan anak usia dini (PAUD). PAUD \r\nAnanda merupakan  salah  satu  lembaga  pendidikan  anak  usia  dini  yang \r\nmemberikan pembelajaran dasar tentang membaca dan menulis. Tetapi saat ini \r\nsudah menghadapi  Era  Revolusi  Pendidikan  4.0.  Era  Revolusi  Pendidikan  4.0 \r\nmerupakan pendidikan  yang  memanfaatkan  teknologi  digital  dalam  proses \r\npembelajaran  atau dikenal  dengan sistem  siber  (cyber  system).  Sistem  ini \r\ndiharapkan  mampu  membuat proses  pembelajaran  dapat  berlangsung  secara \r\nkontinu tanpa batas ruang dan batas waktu. Maka dari itu para tenaga pengajar \r\ndan para orang tua harus turut mendukung sistem pendidikan 4.0. Tujuan dari \r\npenelitian ini adalah untuk mendukung era pendidikan 4.0 dan menambah minat \r\nbelajar  anak-anak  karena menggunakan mobile yang  saat  ini  lebih  diminati \r\ndaripada menggunakan buku. Salah satu metode yang digunakan untuk penelitian \r\nini adalah Augmented Reality (AR). AR merupakan terobosan baru dalam bidang \r\nteknologi yang dapat menampilkan gambar dan tulisan secara 3D sehingga anak-\r\nanak akan lebih tertarik dalam proses pembelajaran. Aplikasi ini diharapkan dapat \r\nmembantu  para  tenaga pengajar  dalam  proses  pembelajaran,  sehingga  belajar \r\ntidak menjadi hal yang membosanan lagi, para orang tua juga dapat mengajarkan \r\nputra putrinya di rumah dan hal itu membuat anak menjadi lebih pintar. Dalam \r\nmengimplementasikan Aplikasi  AR  ini  peneliti  menggunakan  metode Marker \r\nBased Tracking, Unity 3D dan Vuforia. \r\n \r\nKata  kunci: Augmented  Reality, Marker  Based  Tracking, Unity 3D, Vuforia, \r\nMedia \r\nPembelajaran. \r\nxiv+55 halaman; 4 tabel; 41 gambar; 3 lampiran. '),(73,'1511501858','2021-02-05 14:01:44','340165','../files/1511501858.pdf',' \r\n \r\nIMPLEMENTASI ALGORITMA PEMBOBOTAN TF-IDF DAN COSINE \r\nSIMILARITY UNTUK PENENTAPAN KATEGORI PADA ARTIKEL \r\nWEBSITE UNIVERSITAS BUDI LUHUR \r\n \r\nOleh : Nico (1511501858) \r\n \r\nUniversitas  Budi  Luhur  yang  berpusat  di  kota  Jakarta  Selatan,  merupakan \r\nuniversitas komputer swasta pertama di Indonesia yang sejak awal berdiri memiliki \r\ntujuan menghasilkan tenaga - tenaga trampil atau professional di bidang komputer. \r\nDirektorat Teknologi Informasi merupakan direktorat Universitas Budi Luhur yang \r\nmenangani sistem dan infrastruktur di Budi Luhur termasuk pengelolaan website. \r\nMasalah dalam penyebaran informasi di website Budi Luhur mengenai kategorisasi \r\nartikel yang dipublikasi oleh admin mengakibatkan ambiguitas artikel karena setiap \r\nadmin  memiliki  persepsi  yang  berbeda  beda  pada  tiap  artikel,  sehingga \r\nmenimbulkan kebingungan dari sisi pembaca, juga ketika ingin menampilkan atau \r\nmencari artikel/berita yang sesuai dengan kategori. Pengkategorian artikel yang \r\nambigu kerap kali terjadi disebabkan oleh kategori yang dipilih berdasarkan opini \r\npribadi masing - masing admin website www.budiluhur.ac.id yang jumlahnya ada \r\n4 orang. Penelitian ini bertujuan untuk membuat tools yang dapat mengkategorikan \r\nartikel  secara  otomatis  menggunakan  metode Information  Retrieval (Perolehan \r\nInformasi).  Metode  yang  digunakan  untuk  mengelola  serta  mengkategorikan \r\ninformasi yaitu ruang vektor (Vector Space Model). Penelitian ini menghasilkan \r\nakurasi ketepatan pada klasifikasi kategori terhadap dataset yang telah diuji sebesar \r\n61.11%. \r\n \r\nKata Kunci : klasifikasi artikel, pembobotan, TF-IDF, Cosine Similarity \r\nxiv + 80 halaman; 49 gambar; 12 tabel; 6 lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(74,'1511501874','2021-02-05 14:01:44','20609','../files/1511501874.pdf',' \r\nIMPELEMENTASI ALGORITME ANALITYCAL HIERARCHY PROCESS \r\n(AHP) DAN SIMPLE ADDITIVE WEIGHT (SAW) UNTUK PEMILIHAN \r\nKARYAWAN TERBAIK DI PT Sinergi Digital Technologies \r\nOleh : Silmi Mukarromah (1511501874) \r\n \r\n Pada semua perusahaan, Karyawan merupakan salah satu aset terpenting \r\nyang  dimiliki  oleh  perusahaan.  Penghargaan  yang  diberikan  oleh  perusahaan \r\nkepada karyawan  terbaiknya  dapat  mendorong  setiap  karyawan  untuk  selalu \r\nmemberikan kinerja yang terbaik bagi perusahaan dalam melaksanakan tugas dan \r\nkewajibanya di perusahaan. Untuk menentukan karyawan terbaik bukanlah hal \r\nyang  mudah  bagi  perusahaan  karena  penilaian  tersebut  harus  didasarkan  pada \r\nkriteria yang sudah ditetapkan oleh perusahaan. Selain dengan penilaian absensi \r\nkehadiran, penilaian secara tugas yang dikerjakan juga dapat dinilai sebagai salah \r\nsatu  acuan  untuk  perusahaan,  jika  pekerja  tidak  memiliki kemampuan  yang \r\nmemumpuni,  makan  akan  banyak  pekerjaan  yang  terulur-ulur  waktu \r\npengerjaannya.  \r\nSistem  pendukung  keputusan  pemilihan  karyawan  terbaik  menggunan \r\nmetode Analytical Hierarchy Process (AHP) dan Simple Additive Weight (SAW) , \r\ndimana proses dpengambilan keputusan dilakukan dengan menilai alternatif pilihan \r\nberdasarkan kriteria yang telah ditetapkan. Penelitian dilakukan dengan mencari \r\nnilai bobot untuk setiap atribut, kemudian dilakukan proses pengurutan kandidat \r\nyang akan menentukan alternatif yang optimal, yaitu untuk pemilihan karyawan \r\nterbaik. Dengan melihat masalah yang ada dalam pengambilan keputusan dalam \r\npemilihan karyawan terbaik, sistem pendukung keputusan dengan menggunakan \r\nmetode Analitycal Hierarchy Process (AHP)  dan Simple Additive Weight (SAW) \r\nbisa  digunakan  untuk  membantu  pengambilan  pengambilan  keputusan  untuk \r\nmenentukan karyawan terbaik di PT Sinergi Digital Technologies. Diharapkan hasil \r\ndalam penelitian ini dapat membantu mengambil keputusan dalam menentukan \r\npemilihan karyawan terbaik di PT Sinergi Digital Technologies. \r\n \r\n \r\nKata  kunci  : Sistem  Penunjang  Keputusan,  Pemilihan  Karyawan  Terbaik, \r\nAnalitycal Hierarchy Process (AHP) , Simple Additive Weight (SAW), PT Sinergi \r\nDigital Technologies. \r\n \r\n \r\n \r\n \r\nKATA PENGANTAR Perpustakaan Universitas Budi Luhur\r\n'),(75,'1511501882','2021-02-05 14:01:44','100639','../files/1511501882.pdf',' \r\nIMPLEMENTASI KRIPTOGRAFI PENGAMANAN DATA FILE BERBASIS WEB \r\nMENGGUNAKAN ALGORITMA ADVANCE ENCRYPTION STANDARD 256  \r\nDAN KOMPRESI HUFFMAN PADA  \r\nPT.PRIMA TEKNOLOGI EDUKASI \r\nOleh : MUHAMMAD FAQIH SYAM PUTRA (1511501882) \r\nKemajuan teknologi telah berkembang pesat, khususnya pada pertukaran \r\ninformasi yang semakin global. Kemampuan untuk mengakses serta bertukar data \r\nsudah sangat  cepat.  Hal ini juga mempengaruhi dunia kriminalitas pada dunia \r\nmaya  atau  lebih  dikenal  dengan cyber  crime.  Seorang  atau  kelompok  secara \r\nsengaja  mengambil  dan  menyebarluaskan  ataupun  menggunakan  sebuah \r\ninformasi  penting  tanpa  tanggung  jawab.  dengan  demikian  perlunya  sebuah \r\npengamanan untuk menjaga kerahasiaan suatu data. Pengamanan data PT.PRIMA \r\nTEKNOLOGI EDUKASI yang bergerak dalam bidang perkembangan teknologi \r\nkhususnya yang berkaitan dengan bidang pendidikan, terutama pada data soal-soal \r\nujian berangkat dari rentannya data yang berada di komputer tanpa pengamanan \r\nkhusus.  Terlebih  lagi  tentang  bocornya  soal-soal  ujian  yang  beredar  luas  di \r\nkalangan  siswa  dalam  bentuk  dokumen  dalam  smartphone  mereka.  Sehingga \r\ndilakukan cara atau metode untuk mengamankan data yang penting terutama soal \r\nujian. Metode kriptografi yang akan digunakan dalam penelitian ini adalah AES \r\n256 sebagai  algoritma kriptografinya dan metode Huffman sebagai mekanisme \r\nkompresi. Sehingga keamanan akan lebih terjaga dengan memperkuat keamanan \r\nserta hasil file tidak terlalu besar setelah dijalankan proses. Hasilnya data akan \r\nlebih  terjaga  kerahasiaannya  dan  dapat  diakses  kembali  dengan  aman tanpa \r\nadanya perubahan atau kerusakan isi data file. Selain itu dapat diaplikasikan pada \r\ntahun-tahun kedepan. \r\nKata Kunci : AES 256, Huffman, Kriptografi. Keamanan data. \r\n  \r\nxv + 64 halaman; 67 gambar; 13 tabel;  lampiran 2 \r\n  \r\n Perpustakaan Universitas Budi Luhur\r\n'),(76,'1511501890','2021-02-05 14:01:44','62258','../files/1511501890.pdf',' \r\n \r\n \r\nMENDETEKSI BANJIR DENGAN ARDUINO UNO DAN \r\nSENSOR RAIN DROP SERTA ULTRASONIK  \r\nMELALUI SMS GATEWAY \r\n \r\nOleh : Fajar nur cahyo  (1511501890) \r\n \r\nBanjir  merupakan  bencana  alam  yang  sering  terjadi  di  indonesia \r\nkhususnya  daerah  Tangerang  Selatan  pada  perumahan  Pondok  Maharta,  banjir \r\nyang  terjadi  secara  tiba-tiba  dimalam  hari  saat  warga  sekitar  sedang  dalam \r\nkeadaan  beristirahat,  hal  tersebut  membuat  warga  sekitar  tidak  dapat \r\nmengantisipasi  segala  kemungkinan  dari  kerusakan  dan  kerugian  dari  bencana \r\nbanjir.  Dengan  adanya system prototype untuk  mendeteksi  banjir  dini  yang \r\nmenggunakan Arduino  UNO sebagai microcontroller yang mengatur  dan \r\nmengendalikan sensor ultrasonic sebagai  pengukur  ketinggian  air  sungai  serta \r\nsensor rain  drop sebagai  pendeteksi  curah  hujan  dimana  akan  memberikan \r\ninformasi terkait ketinggian air sungai dengan hujan melalui SIM 800L sebagai \r\nmedia yang memberikan informasi via SMS dan akan memberi informasi kepada \r\nwarga sekitar khususnya petugas keamanan yang berjaga. Implementasi Arduino \r\nUNO dengan sensor ultrasonic serta sensor rain  drop sebagai input dalam \r\nprosesnya  yang  terbagi  ke dalam  beberapa  kategori  sebagai  indikator  dalam \r\npengiriman  pesan  SMS  melalui SIM 800L.  Hasil  dari  penelitian  ini  membuat \r\nperangkat microcontroller dengan Arduino UNO serta sensor ultrasonic dan \r\nsensor rain  drop sebagai  perangkat  yang  mandiri,  mampu  berfungsi  otomatis \r\ntanpa  adanya server yang  diperlukan  dalam  prosesnya  penyampaian  informasi \r\ndalam mengetahui tingginya air sungai demi menghindari terjadinya kerugian dari \r\nbencana banjir. \r\n \r\nKata kunci :  Banjir, Arduino UNO,Sensor Uultrasonic , Sensor Rain Drop, SIM \r\n800L \r\n \r\nxi + 42 halaman; 30 gambar; 11 tabel; 2 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(77,'1511501924','2021-02-05 14:01:44','32817','../files/1511501924.pdf',' \r\n \r\nAPLIKASI INVENTORY MANAGEMENT MENGGUNAKAN TEKNOLOGI \r\nAUGMENTED REALITY DAN WEB SERVICE BERBASIS ANDROID PADA \r\nPT. INLINGUA INTERNATIONAL INDONESIA \r\n \r\nOleh : Setyo Handoko (1511501924) \r\n \r\nPerkembangan  Teknologi  Informasi  dan  Komunikasi  yang  semakin  cepat  setiap \r\nharinya,  tentu  membuat  manusia  dimudahkan  dalam  setiap  kegiatan  yang  mereka \r\nlakukan. Dan hampir semua perusahaan dari perusahaan besar maupun kecil mencoba \r\nuntuk  meningkatkan  kualitas  dalam sisi teknologi.  Salah  satunya  PT.  Inlingua \r\nInternational Indonesia yang merupakan sebuah lembaga pendidikan yang bergerak \r\ndi bidang edukasi bahasa. Kantor pusat Inlingua berada di Bern, Swiss dan membuka \r\ncabang  di  Indonesia.  Sebagai  kantor  yang  sedang  berkembang,  pastinya  transaksi \r\nbarang  keluar  dan  barang  masuk  menjadi  sangat  padat. Dengan  permasalahan \r\ntersebut,  maka  disiapkan  sebuah  Sistem  Satu  Pintu  Inlingua  yang  didalamnya \r\nterdapat fitur Inventory Management. Namun, ternyata sistem tersebut tidak berjalan \r\nseperti  yang  diinginkan karena  para  pegawai  tidak  menginput  ke  sistem  ketika \r\nmengambil  barang  dari  gudang  sehingga  menimbulkan  masalah  baru  yaitu  data \r\nmenjadi  tidak  update dan  tidak  valid.  Dengan  dibuatnya  Aplikasi Inventory \r\nManagement berbasis Augmented  Reality dan Web  Service ini,  diharapkan  para \r\npegawai  dapat  mengikuti  aturan  saat  mengambil  barang  di  gudang.  Dikarenakan \r\naplikasi  yang  dibuat  menjadi  lebih  interaktif  dan  mengurangi  kegiatan  mengetik. \r\nSehingga  bagian  gudang  mendapatkan  data  yang menjadi  update  dan  lebih  valid. \r\nAplikasi Inventory  Management Inlingua  ini  menggunakan  teknologi Augmented \r\nReality sebagai interface pada smartphone. Penulis  menggunakan  Unity  sebagai \r\nGame Engine dan Vuforia sebagai SDK (Software Development Kit) dan juga sebagai \r\nmedia  penyimpanan database  marker. Untuk  menghubungkan  Aplikasi Inventory \r\nManagement Inlingua  dengan  Sistem  Satu  Pintu  Inlingua  penulis  menggunakan \r\nteknologi Web  Service dengan  bahasa  pemrogramaan  PHP  dengan framework \r\nLaravel.  Dan database yang  digunakan  yaitu  MySQL.  Pengguna  yang  dapat \r\nmenggunakan  aplikasi  hanya  yang  sudah  memiliki  akun  di  Sistem  Satu  Pintu \r\nInlingua. Setelah pengguna berhasil login, maka pengguna bisa mengambil barang \r\ndengan cara melakukan scan ke marker yang ditempelkan pada rak-rak barang. Lalu \r\npengguna menginput jumlah barang yang diambil pada aplikasi. Maka aplikasi akan \r\notomatis mengupdate stok barang yang diambil. Setelah masa pengembangan aplikasi \r\ndan uji coba, penulis lalu melakukan pengujian aplikasi dengan metode black box dan \r\nISO 9126 untuk melihat bagaimana aplikasi bekerja dan respon dari pengguna. \r\n  \r\nKata kunci : augmented reality, web service, unity, vuforia, android \r\n \r\nxi+84 halaman; 57 gambar; 7 tabel; 3 lampiran Perpustakaan Universitas Budi Luhur\r\n'),(78,'1511502146','2021-02-05 14:01:44','106158','../files/1511502146.pdf',' \r\n \r\nJudul  :   APLIKASI MENGENAL  TOKOH PAHLAWAN UANG KERTAS \r\nKELUARAN  TAHUN  2016  DENGAN AUGMENTED  REALITY \r\nPADA SD ISLAM NURUL AZHAR \r\n \r\nPerkembangan  tekonologi  informasi  dan  komunikasi  menjadikan smartphone \r\nsebagai  kebutuhan  yang  wajib  dimiliki  oleh  seseorang. Smartphone dapat \r\ndimanfaatkan untuk pencarian informasi tentang sejarah tokoh pahlawan. Tokoh \r\npahlawan  yang  dekat  dengan  kehidupan  adalah  tokoh  pahlawan  yang  terdapat \r\npada  uang  kertas,  dengan  memanfaatkan smartphone pengguna  dapat  mencari \r\ninformasi mengenai sejarah tokoh pahlawan tersebut. Tidak adanya pemanfaatan \r\nteknologi augmented reality untuk mengenal  tokoh pahlawan di SD Islam Nurul \r\nAzhar,  pembelajaran  mengenai  sejarah  hanya  menggunakan  media  buku  dan \r\ndilakukan di kelas. Untuk itu penulis memanfaatkan teknologi augmented reality \r\nuntuk media pembelajaran sejarah, agar siswa dan siswi dapat mengenal sejarah \r\ntokoh  pahlawan.    Dengan  menggunakan  metode marker  based  tracking yaitu \r\naplikasi  membutuhkan  sebuah marker untuk  di  pindai.  Aplikasi  ini  bekerja \r\ndengan cara  menyorotkan kamera smartphone ke nominal uang kertas keluaran \r\ntahun  2016  di  sisi  yang  terdapat  gambar  tokoh  pahlawan,  pengguna  dapat \r\nmengetahui informasi tentang tokoh pahlawan tersebut yang ditampilkan dalam \r\nbentuk  gambar  tokoh  pahlawan  dalam  bentuk  3D,  narasi,  video  yang  memuat \r\nsejarah singkat tokoh pahlawan dan link untuk mendapatkan informasi yang lebih \r\nbanyak dari menu info atau video di aplikasi.  \r\n \r\nKata kunci: augmented reality, sejarah, android, uang kertas \r\nxv+89 halaman; 66 gambar; 3 tabel; 29 lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(79,'1511502153','2021-02-05 14:01:44','138604','../files/1511502153.pdf',' \r\n \r\nIMPLEMENTASI REKOMENDASI APLIKASI ONLINE ASSESSMENT \r\nDENGAN METODE USER-BASED COLLABORATIVE FILTERING DAN \r\nPEARSON CORRELATION COEFFICIENT PADA PT. LINGKAR \r\nOPTIMA INDONESIA (LOOPINC.ID) UNTUK MENGETAHUI \r\nPRIORITAS PERBAIKAN KOMPETENSI PENGEMBANGAN DIRI \r\n \r\nOleh : Pandhu Wibowo (1511502153) \r\n \r\nPerkembangan teknologi yang sangat pesa t, membuat kemudahan  dan \r\nkeuntungan dapat dirasakan dalam kehidupan sehari-hari. Mudahnya mengakses \r\ninformasi di internet dari mana saja, dilokasi yang berbeda, dekat-jauh, berbeda \r\nkampus, berbeda daerah, berbeda negara, bahkan sampai berbeda benua pun masih \r\nsangat dapat menerima informasi yang sama. Berbagai macam pencarian di internet \r\nterjadi seiring dengan perkembangan kebutuhan, inovasi terbaru, dan melimpahnya \r\ninformasi di dalamnya, salah satunya adalah dalam mencari situs bimbingan dan \r\nkonseling. Beragam situs menyediakan f itur-fitur yang dapat me mbantu \r\npermasalahan yang terjadi pada siswa ya ng mengala mi sulitnya merencanakan \r\nmasa depan dalam berkarier, sulit menentukan pilihan antara kuliah atau bekerja, \r\nmenemukan jurusan, minat atau pun fokus bidang yang cocok saat sudah kuliah \r\natau pun nantinya ketika ingin bekerja. Pada PT. Lingkar Optima Indonesia terdapat \r\nonline assessment  berbasis web, dengan proses  penilaian melal ui pengisian \r\nkuesioner. Hasil akhirnya ber upa nilai  setiap kompetensi  dan rekomendasi \r\npenjelasan secara umum. Pada hasil tersebut, belum ada pemberian rekomendasi \r\ndalam hal prioritas perbaikan yang memiliki kompetensi yang nilainya kurang. \r\nUntuk itu diberikan solusi berupa pemberian  rekomendasi prioritas perbaikan \r\nkompetensi tersebut. Sistem rekomendasi adalah salah satu bidang yang sering \r\ndigunakan dalam mengatasi permasalahan pencarian informasi yang berkaitan dari \r\nbanyaknya informasi yang tersedia. Sistem rekomendasi biasanya diterapkan ketika \r\nsumber data pada suatu platform sudah besar atau banyak sehingga pemanfaatannya \r\nterlihat. Platform yang sudah memiliki data yang besar biasanya sangat kesulitan \r\nbagi pengguna yang ingin mencari informasi yang berkaitan dan berelasi. Sehingga \r\nsiswa akan mendapatkan suatu rekomendasi kompetensi yang mana yang harus \r\ndidahulukan untuk diperbaiki . Pada metode ini,  rekomendasi yang dibe rikan \r\nberdasarkan siswa lain yang memiliki nilai tertinggi dan nilai hampir pada seluruh \r\nkompetensinya terbilang mirip oleh siswa. Metode atau pendekatan yang dipilih \r\nyaitu metode User-based Collaborati ve Filtering dengan teknik penc arian \r\nsimilaritas bernama Pearson Correlation C oefficient. Hasilnya dengan metode \r\nyang dikerjakan jika datanya semakin besar dan bertambah, proses rekomendasi \r\nakan membutuhkan waktu yang lebih lama. \r\n \r\nKata Kunci :  Sistem Rekomendasi, User-Based Collaborative  Filtering, \r\nPearson Correlation Coefficient, Online Assessment \r\n \r\nxix+171 halaman; 182 gambar; 17 tabel; 7 lampiran Perpustakaan Universitas Budi Luhur\r\n'),(80,'1511502187','2021-02-05 14:01:45','213901','../files/1511502187.pdf',' \r\n \r\nImplementasi Teknologi Augmented Reality Pengenalan Hewan Berbasis \r\nAndroid pada Taman Kanak-Kanak Islam Ar-Rahman \r\n \r\nOleh : Muhamad Akmal (1511502187) \r\n \r\n Taman Kanak-Kanak Islam Ar-Rahman merupakan salah satu taman kanak-\r\nkanak  yang  berada  di  Tangerang  selatan. Mengingat  kurangnya  sumber  daya \r\nmanusia dalam penerapan teknologi Augmented Reality ke dalam dunia pendidikan, \r\nkhususnya dalam bidang pengajaran. Oleh sebab itu diperlukan inovasi yang lebih \r\nefisien, yaitu dengan mengubah konsep pengajaran yang sebelumnya menggunakan \r\nmedia cetak menjadi media digital dengan teknologi augmented reality. Tujuan dari \r\npenelitian  ini  adalah  menerapkan  teknologi augmented  reality dalam  media \r\npembelajaran  tentang pengenalan hewan dan  menambah  wawasan  anak-anak. \r\nAplikasi augmented  reality ini  menggunakan Unity3D, C# sebagai  bahasa \r\npemograman, dimana aplikasi ini memerlukan sebuah gambar yang diambil dari \r\nkamera mobile phone sebagai sumber masukan, kemudian aplikasi ini akan melacak \r\ndan mendeteksi penanda (marker) dengan menggunakan sistem tracking, setelah \r\nmarker terdeteksi, objek virtual 3 dimensi dari hewan akan tampil di atas marker. \r\nDengan adanya aplikasi pengenalan hewan mampu meningkatkan minat belajar, \r\nmenambah pengetahuan anak-anak tentang pengenalan hewan, dan mendapatkan \r\nkemudahan dalam memahami apa yang mereka pelajari di sekolah sehingga mampu \r\nmeningkatkan kualitas pendidikan Taman Kanak-Kanak Islam Ar-Rahman. \r\n \r\n \r\nKata kunci : Android, 3D, Augmented Reality, Hewan \r\n \r\nXiii+65 halaman; 41 Gambar; 8 Tabel; 11 Lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(81,'1511502203','2021-02-05 14:01:45','20366','../files/1511502203.pdf',' \r\n \r\nJudul : Implementasi  Pengamanan  Data  Menggunakan  Algoritma  Elgamal \r\nBerbasis Java Dekstop Pada SMP Negeri 5 Kota Tangerang Selatan \r\n \r\nOleh : Randy Adytia Rahmadany (1511502203) \r\n \r\nSMP  Negeri 5 merupakan  Sekolah Menengah  Pertama Negeri  Kota \r\nTangerang Selatan. Sebagai instansi yang bergerak di bidang pendidikan, Sekolah \r\nMenengah Pertama Negeri 5 mempunyai masalah lokal terkait soal ujian. Untuk \r\nmelindungi  data  soal  ujian,  perlu  diterapkan  teknologi  terkini  untuk \r\nmengamankan  data.  Untuk  mengamankan  data  bisa  dilakukan  dengan  cara \r\nmengenkripsi.  Enkripsi  adalah  proses  mengamankan  suatu  data  dengan  suatu \r\nalgoritma tertentu yang membuat data tersebut tidak dapat dibaca. Supaya data \r\ntersebut dapat dibaca, dilakukan proses yang disebut dengan dekripsi. Dekripsi \r\nadalah kebalikan dari enkripsi yaitu mengubah kembali bentuk tersamar tersebut \r\nmenjadi informasi awal. Dalam melakukan proses dekripsi data dibutuhkan suatu \r\npengetahuan  khusus,  yaitu  kunci.  Teknik  yang  bisa  digunakan  untuk \r\nmengenkripsi  serta  mendekripsi  data  adalah  kriptografi.  Algoritma  kriptografi \r\nyang  digunakan  adalah  Algoritma  Kriptografi  ElGamal.  Pemilihan  Algoritma \r\nElGamal dalam metode kriptografi dikarenakan dalam pembentukan salah satu \r\nkuncinya menggunakan bilangan prima dan menitik beratkan kekuatan kuncinya \r\npada  pemecahan  masalah  logaritma  diskrit.  Sehingga  dengan  menggunakan \r\nmemanfaatkan  bilangan  prima  yang  besar  dan  serta  masalah  logaritma  diskrit \r\nyang  cukup  meyulitkan,  maka  keamanan  kuncinya  akan  lebih  terjamin. \r\nBerdasarkan  analisis  dan  perancangan,  pembuatan,  serta  serangkaian  uji  coba \r\ndalam program dari aplikasi kriptografi, hasil penelitian dengan adanyan program \r\nini proses penyimpanan dan pertukaran informasi menjadi lebih aman. Data yang \r\ndapat digunakan pada aplikasi ini berupa file dokumen dengan ekstensi *.doc, \r\n*.xls, *.pdf, dan *.txt.  \r\n \r\nKata kunci : Kriptografi, Enkripsi, Dekripsi, Elgamal \r\n \r\nLXXIV+74 halaman; 62 gambar; 6 tabel; 3 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(82,'1511502211','2021-02-05 14:01:45','53042','../files/1511502211.pdf',' \r\n \r\nAPLIKASI HONEYPOT MEDIUM INTERACTION MENGGUNAKAN \r\nBAHASA PEMOGRAMAN PYTHON DENGAN MEMANFAATKAN \r\nKONSEP EVENT-DRIVEN NETWORK PROGRAMMING FRAMEWORK \r\nDENGAN TWISTED BERBASIS CLI PADA PT. NEPTUS TEKNOLOGI \r\nINDONESIA JAKARTA PUSAT \r\n \r\nOleh : Fajar Prasetio (1511502211) \r\n \r\nFaktor keamanan pada teknologi informasi saat ini sangatlah penting, di era \r\n4.0 seperti sekarang, data merupakan asset yang penting bagi setiap organisasi, baik \r\npemerintah maupun non pemerintah, untuk negara yang sedang berkembang seperti \r\nyang dialami di Indonesia, asset yang berupa data merupakan segalanya bagi setiap \r\norganisasi. Kehidupuan teknologi semakin berkembang di era 4.0 dimana segalanya \r\nterhubung  satu  sama  lain  melalui  jaringan  internet,  baik  berupa device seperti \r\nhandphone, komputer, server, cloud, dan  lain-lain,  dengan  berkembangnya \r\nteknologi  yang semakin canggih  pengamanan pun seperti device firewall yang \r\nberada di sebuah data center juga berkembang, tetapi tidak menutup kemungkinan \r\nancaman  serangan  pun  juga ikut  berkembang, demi  meraih  sebuah  data  yang \r\nsebenarnya tersedia pada setiap layanan yang berada di dalam sebuah database \r\nyang berisikan data-data pemakai layanan, hacker pun semakin kreatif dalam proses \r\npercobaan  mendapatkan  data  tersebut.  Walaupun  demikian  maka  diperlukan \r\nadanya sebuah penanganan terhadap ancaman dengan suatu aplikasi yang dapat \r\nmemantau dan menganalisis ancaman serangan yang sedang berlangsung tanpa \r\nmenyentuh dan merusak server. Honeypot merupakan solusi yang diberikan karena \r\nmerupakan sebuah  sistem  umpan  atau  aplikasi  simulasi  yang  mensimulasikan \r\nseluruh  jaringan  untuk  memikat  penyerang  dengan  menyamarkan  diri  sebagai \r\nsistem aslinya yang rentan. Honeypot membantu untuk memantau dan menganalisis \r\nkegiatan penyerang yang tertangkap di honeypot. Honeypot ini berjenis medium-\r\ninteraction yang dibuat  menggunakan  bahasa  pemrograman  python  yang \r\nmemanfaatkan  konsep event-driven  network  programming dengan twisted. \r\nAplikasi honeypot berjalan  di server, nantinya honeypot akan  menjadi server \r\nbayangan  yang  mampu  menipu,  menganalisis,  dan  memantau  penyerang  yang \r\nmengancam pada server asli. Tujuan dari penelitian ini adalah untuk menganalisis \r\nperilaku apa yang dilakukan penyerang di dalam server dan juga kemungkinan \r\npassword yang  digunakan  oleh penyerang,  dengan  begitu  hasil  dari  serangan \r\nsebagai pembelajaran untuk membuat server lebih aman. \r\n \r\nKata kunci: Honeypot, medium-interaction, event-driven programming, twisted, \r\nkemanan. \r\nxii + 54 halaman; 11 tabel; 43 gambar; 5 lampiran.  Perpustakaan Universitas Budi Luhur\r\n'),(83,'1511502286','2021-02-05 14:01:45','230137','../files/1511502286.pdf',' \r\n \r\nAUGMENTED REALITY SEBAGAI MEDIA PEMBELAJARAN JENIS \r\nTUMBUHAN LANGKA MENGGUNAKAN METODE MARKER BASED \r\nTRACKING PADA SMP ISLAM AL-FALAAH CIPUTAT  \r\nBERBASIS ANDROID \r\n \r\nPada saat ini dunia sudah memasuki era gblobalisasi, dimana teknologi sudah ada \r\ndi segala bidang kehidupan manusia. Tak terkecuali dalam bidang pendidikan yang \r\ndapat membantu meningkatkan kualitas proses belajar-mengajar kepada siswa agar \r\nlebih menarik dan menyenangkan. Namun beberapa sekolah menengah pertama \r\nbelum dapat menerapkan teknologi augmented reality sebagai media pembelajaran \r\nsalah satunya SMP Islam Al-Falaah, yang terkesan pasif karena kurangnya alat \r\nperaga dalam penyampaian materi pelajaran. Oleh karena itu dengan memanfaatkan \r\nperkembangan  teknologi  informasi  dan  komunikasi  maka  dirancang  sebuah \r\naplikasi berbasis smartphone android yang memberikan informasi secara virtual \r\ndan  menarik. Augmented  Reality adalah  teknologi  yang  dapat  menampilkan \r\ninformasi berbentuk dua dimensi dan tiga dimensi ke dalam sebuah  lingkungan \r\nnyata tiga dimensi lalu memproyeksikan objek virtual tersebut secara nyata (real \r\ntime). Dengan aplikasi augmented reality dibuat sebuah aplikasi yang mendukung \r\nkegiatan belajar yang awalnya menggunakan media cetak menjadi media digital \r\nberbasis android serta menciptakan media pembelajaran tentang jenis tumbuhan \r\nlangka dalam bentuk objek virual 3D. Dengan aplikasi augmented reality dapat \r\nmembantu  pihak  sekolah  dalam  memberikan  informasi  tentang  pembelajaran \r\nkepada para siswanya. \r\nKata Kunci : Augmented Reality, Jenis Tumbuhan Langka, Android  \r\nxiv+71 halaman, 23 gambar, 5 tabel, 2 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(84,'1511502302','2021-02-05 14:01:45','21392','../files/1511502302.pdf',' \r\n \r\nIMPLEMENTASI METODE ANALYTICAL HIERARCHY PROCESS (AHP) \r\nDAN \r\nSIMPLE ADDITIVE WEIGHTING (SAW) UNTUK PENENTUAN \r\nASISTEN TERBAIK PADA LABORATORIUM MEDIA KOMUNIKASI \r\nUNIVERSITAS BUDI LUHUR \r\n \r\nOleh : Akbar Tirto Samudro (1511502302)\r\n \r\n \r\nKemajuan teknologi informasi dan komunikasi akan selalu berkembang. \r\nPerkembangan selalu hadir untuk memudahkan manusia dalam berbagai \r\nperkerjaan dan kegiatan sehar-hari. Tidak terkecuali dalam hal pengambilan \r\nkeputusan. Pengambilan keputusan bukanlah hal yang sulit namun selalu ada \r\ntanggung jawab yang be\r\nsar dalam sebuah keputusan. Maka adanya sebuah \r\nkeputusan berdasarkan data yang didalam nya terdapat Laboratorium Media \r\nKomunikasi dengan berbagai macam asisten. Sangat penting bagi Laboratorium \r\nMedia Komunikasi untuk memastikan bahwa Laboratorium bukan hanya sebagai \r\ntempat belajar-mengajar dengan fasilitas baik, tapi juga sebagai Laboratorium \r\nyang memiliki tenaga pendidik yang baik. Sehingga Laboratorium ini memiliki \r\nprosedur penilaian kinerja asisten setiap semesternya. Penelitian ini membahas \r\ntentang pengambilan keputusan penentuan asisten terbaik pada Laboratorium \r\nMedia Komunikasi. Beberapa masalah dalam menentukan asisten terbaik adalah \r\nbelum adanya pembobotan pada setiap kriteria yang sudah ditentukan dan belum \r\nadanya hasil penilaian antar asisten. Hal \r\nini membuat kepala \r\nlaboratorium sebagai \r\npengambil keputusan sulit menentukan asisten yang dapat dijadikan kandidat \r\nasisten terbaik, selain itu perlu waktu lama dalam pengumpulan data. Oleh karena \r\nitu penelitian ini bertujuan untuk menghasilkan sebuah siste\r\nm penunjang \r\nkeputusan penentuan asisten terbaik. Dengan metode Analytical Hierarchy \r\nProcess (AHP) digunakan untuk penentuan bobot kriteria dan metode Simple \r\nAdditive Weighting (SAW) digunakan untuk menentukan asisten terbaik dengan \r\nmenghasilkan \r\nranking\r\n \r\nalternatif. \r\n \r\nKata Kunci : Sistem Penunjang Keputusan, Analytical Hierarchy Process \r\n(AHP),\r\n Simple Additive Weighting (SAW), Penentuan Asisten \r\nTerbaik. \r\n \r\ncvii+107 halaman; 87 gambar; 25 tabel; 4 lampiranPerpustakaan Universitas Budi Luhur\r\n'),(85,'1511502310','2021-02-05 14:01:45','231468','../files/1511502310.pdf',' \r\n \r\nPENERAPAN DATA MINING MENGGUNAKAN METODE \r\nASSOCIATION RULES DENGAN ALGORITMA APRIORI UNTUK \r\nMENCARI POLA KETERKAITAN SETIAP ITEM LEWAT PERILAKU \r\nPELANGGAN PADA GAVIO BOUTIQUE COLLECTION \r\nJAKARTA PUSAT \r\n \r\nOleh : Muhammad Hasanul Huda (1511502310) \r\n \r\nSusunan atau pemetaan produk pada butik GAVIO tidak tersusun rapi dan \r\nhanya  sekadar  di  tampilkan  pada  pelataran  toko  tanpa  mempelajari  perilaku \r\npelanggan  yang  dapat  menguntungkan  dalam  sisi  jangkauan  pelanggan  yang \r\nmemiliki keterkaitan antara produk satu dan lainnya, juga dalam pengadaan barang \r\npemilik melakukan pembelian barang dengan jumlah yang sama (setiap produk) \r\ntiap melakukan pengadaan, hal itu berimbas pada banyaknya barang yang hanya \r\nsedikit  diminati  pelanggan  hanya  akan  menumpuk  dan  mengurangi  nilai \r\nkeuntungan. Demi mengoptimalkan pemanfaatan data tersebut maka dibutuhkan \r\nsuatu sistem yang dapat mengolah data menjadi suatu informasi yang bermanfaat. \r\nSalah satunya adalah menggunakan teknik data mining. Pada penulisan tugas akhir \r\nini,  penulis  membangun  suatu  sistem  yang  dapat mencari  pola  keterkaitan \r\n(Association rules) antara item satu dengan item lainnya dengan menggunakan data \r\ntransaksi penjualan menggunakan algoritma apriori, sehingga diharapkan dapat \r\nlebih efisien dalam proses bisnis. Dengan menggunakan item yang berjumlah 42. \r\nDataset  yang  digunakan  adalah  dataset penjualan (transaksi  penjualan) selama \r\nperiode bulan September 2018 hingga Maret 2019 yang berjumlah 1.493 transaksi.  \r\nHasil yang diperoleh dari penelitian ini menghasilkan informasi yang disebut aturan \r\n(rules) dengan  jumlah  beragam  yaitu, jika  nilai  minimum  support  50  dengan \r\nminimum confidence 80% maka rules yang terbuat berjumlah 14, jika minimum \r\nsupport 50 dengan minimum confidence 90% aturan yang terbuat berjumlah 11, \r\ndan jika minimum support 50 dengan minimum confidence 100% maka aturan yang \r\nterbuat hanya berjumlah 9. \r\n \r\nKata Kunci: Data Mining, Apriori Algorithm, Confidence, Support, Association \r\nRules \r\n \r\nxv+71 halaman; 35 gambar; 19 tabel; 1 lampiran  '),(86,'1511502328','2021-02-05 14:01:45','20605','../files/1511502328.pdf',' \r\nSISTEM PENUNJANG KEPUTUSAN KELAYAKAN PEMBERIAN \r\nKREDIT MENGGUNAKAN METODE ANALYTICAL HIERARCHY \r\nPROCESS-TECHNIQUE FOR OTHERS REFERENCE BY SIMILARITY TO \r\nIDEAL SOLUTION (AHP-TOPSIS) DI PT SINARMAS HANA FINANCE \r\nJAKARTA BARAT \r\nOleh : Aditya Bagus Wicaksono (1511502328) \r\n \r\nDalam  penelitian  ini  membahas  tentang  Sistem  Pendukung  Keputusan \r\nkelayakan  pemberian  kredit,  terhadap  nasabah  yang  ingin  melakukan  kredit \r\nkendaraan  roda  empat  di  PT.  Sinarmas  Hana  Finance.  Sistem  Pendukung \r\nKeputusan  digunakan  untuk  membantu  nasabah  untuk  melakukan  pengecekan \r\nterhadap dirinya untuk melakukan kredit kendaraan roda empat, selain itu untuk \r\nmempermudah karyawan dalam melakukan seleksi terdapat nasabah yang sudah \r\nmelakukan ajuan cicilan. Metode yang digunakan dalam penelitian ini adalah AHP \r\n(Analytical  Hierarchy  Process)  dan  TOPSIS  (Technique  Order  Preference  by \r\nSimilarity  to  Ideal  Solution).  AHP  digunakan  untuk  pembobotan  kriteria  yang \r\ndigunakan dalam TOPSIS. Dan TOPSIS digunakan untuk peringkat nasabah yang \r\ndiberikan pemberian kredit.  \r\nProgram ini bisa menentukkan nasabah yang melakukan pengajuan kredit \r\nberdasarkan  kriteria,  gaji  pokok,  status  rumah,  kredit  sebelumnya,  dan  status \r\npekerjaan. Sehingga program ini dapat memberikan solusi untuk nasabah dalam \r\nmelakukan  kredit  kendaraan  roda  empat.  agar  tidak  terjadinya  masalah  yang \r\nmenyulitkan pihak nasabah maupun merugikan pihak perusahaan akibat kredit yang \r\nkurang lancar. Metode ini dipilih karena mampu menyeleksi alternatif terbaik dari \r\nsejumlah alternatif. Penelitian dilakukan dengan mencari nilai bobot untuk setiap \r\natribut, kemudian dilakukan proses perankingan yang akan menentukan alternatif \r\nyang optimal. Hasil dari penelittian ini adalah sebuah aplikasi sistem pendukung \r\nkeputusan  yang  bermanfaat  untuk  memudahkan  pengambilan  keputusan  yang \r\nterkait dengan masalah menentukan kelayakan pemberian kredit pada nasabah PT \r\nSinarmas  Hana  Finance, sehingga  analis  kredit  dapat  memberikan  keputusan \r\nkelayakan kredit secara tepat dan sesuai berdasarkan sistem. \r\n \r\nKata Kunci : Penunjang Keputusan, AHP, TOPSIS, Kelayakan Kredit. \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(87,'1511502344','2021-02-05 14:01:45','58372','../files/1511502344.pdf',' \r\n \r\nJudul : PROTOTIPE  ALAT  PENDETEKSI  KEBAKARAN  BERBASIS \r\nARDUINO  UNO,  SENSOR  ASAP  MQ-2  DAN  SENSOR  API, \r\nDENGAN  NOTIFIKASI  MELALUI  SMS  MENGGUNAKAN \r\nMODUL GSM SHIELD 800L MICRO SERVO DAN KIPAS UNTUK \r\nPENCEGAHAN  PERTAMA  PADA  SMK  NUSANTARA  1 \r\nTANGERANG SELATAN. \r\n \r\nSering terjadinya kebakaran pada bangunan, baik bangunan tempat tinggal, pabrik \r\nmaupun perkantoran terkadang disebabkan oleh berbagai macam faktor, seperti \r\nhubungan pendek arus listrik, kompor meledak, kecerobohan manusia, dan lain \r\nsebagainya. Setiap bangunan akan memiliki potensi terjadinya kebakaran, terlebih \r\nlagi jika material bagunan tersebut terdiri dari bahan yang mudah terbakar. Untuk \r\nmengurangi kemungkinan terjadinya kebakaran, maka diperlukan sebuah prototipe \r\nalat  pendeteksi  dan  peringatan kebakaran dini  yang  mudah  digunakan.  Seiring \r\ndengan makin umumnya teknologi mikrokontroler yang kecil dan fleksibel seperti \r\nArduino Uno R3, penulis mengembangkan prototipe alat pendeteksi kebakaran \r\nmenggunakan sensor asap MQ-2 dan sensor api dan menggunakan micro servo, \r\nkipas untuk pencegahan pertama yang mendukung mekanisme peringatan berbasis \r\nsuara  dan SMS.  Dengan  menggunakan  komponen  yang  mudah  ditemukan  dan \r\ndirangkai seperti Arduino, GSM Shield 800L dan menggunakan PC biasa, Prototipe \r\nalat pendeteksi kebakaran berbasis Arduino uno ini dapat menjadi alternatif bagi \r\nSMK Nusantara 1 Tangerang  Selatan yang  membutuhkan  alat  pendeteksi \r\nkebakaran. Prototipe alat pendeteksi kebakaran ini terdiri dari komponen fisik yang \r\ndiletakan pada panel kontrol listrik. \r\n \r\nKata kunci: Alat pendekteksi kebakaran , Sensor asap MQ-2 , Buzzer , Arduino \r\nuno , Arduino GSM Shield 800L. \r\nxv + 68 halaman; 66 gambar; 7 tabel; 2 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(88,'1511502369','2021-02-05 14:01:45','21105','../files/1511502369.pdf',' \r\nIMPLEMENTASI KRIPTOGRAFI MENGGUNAKAN METODE RC4 \r\nUNTUK MENGAMANKAN DATABASE SISTEM INFORMASI PROYEK \r\nBERBASIS WEB PADA PT. VALVINDO MEGAH \r\nOleh : Nurul Fajar (1511502369) \r\nPT. Valvindo Megah adalah perusahaan yang bergerak di bidang proyek konstruksi, \r\nkhususnya menyediakan service dan produk konstruksi. Keamanan data perusahaan \r\nsangatlah penting, data yang ada tidak hanya data proyek konstruksi saja, terdapat \r\njuga  data  pelanggan  yang  sangat  rahasia.  Maka  dari  itu  dibutuhkan  keamanan \r\ndatabase. Semakin berkembangnya dunia teknologi dan informasi, maka semakin \r\nbesar dan mudah tingkat pencurian data. PT. Valvindo Megah menyimpan data \r\npada sebuah database, yang memiliki tingkat keamanan rendah, dimana sewaktu-\r\nwaktu data tersebut dapat dicuri oleh orang yang tidak bertanggung jawab. PT. \r\nValvindo Megah membutuhkan sebuah aplikasi untuk menjaga kerahasiaan data \r\nperusahaan yaitu data proyek dan pelanggan. Dalam mengatasi keamanan data \r\ntersebut maka diperlukan cara untuk mengamankan informasi data tersebut agar \r\ntidak dapat di salah gunakan. Salah satu cara untuk menjaga keamanan data tersebut \r\nadalah menggunakan teknik enkripsi dalam kriptografi. Metode yang diterapkan \r\ndalam pengamanan database adalah algoritma RC4 stream cipher. Algoritma RC4 \r\nadalah salah satu dari algoritma simetri. Kelemahan dari algoritma simetri adalah \r\nproses enkripsi dan dekripsi menggunakan kunci yang sama. Untuk mengatasi hal \r\ntersebut dilakukan pengacakan kunci pada setiap record database. Sehingga dapat \r\nmeminimalkan  kemungkinan  terjadi  kebocoran  data.  Metode  RC4  memiliki \r\nkelebihan dalam kecepatan proses enkripsi dan dekripsi. Hasil dari penelitian ini \r\nadalah isi record pada database dapat terenkripsi, serta proses enkripsi dan dekripsi \r\ndapat dilakukan dengan cepat dan memiliki tingkat keamanan yang cukup tinggi. \r\nDari hasil percobaan didapatkan rata-rata durasi proses enkripsi sebuah record \r\nadalah 0.144590043 ms, 32768 byte dan rata-rata durasi proses dekripsi sebuah \r\nrecord adalah 0.145128442 ms, 32768 byte. \r\nKata Kunci : Kriptografi, RC4 Stream Cipher, Enkripsi, Dekripsi. \r\nxvii+108 halaman; 93 gambar; 42 tabel; 3 lampiran; Perpustakaan Universitas Budi Luhur\r\n'),(89,'1511502377','2021-02-05 14:01:46','352090','../files/1511502377.pdf',' \r\n \r\nNIM : 1511502377 \r\nNama : FATEHSON DENDAH RAGESTU \r\nJudul : SISTEM PENUNJANG KEPUTUSAN PEMILIHAN SISWA \r\nTELADAN DENGAN MENGGUNAKAN METODE FUZZY \r\nTSUKAMOTO BERBASIS  JAVA DESKTOP DI  SMP \r\nMAZRO\'ATUL ULUM TANGERANG \r\n \r\nSekolah Menengah Pertama (SMP) Mazroatul Ulum di Tangerang merupakan \r\nsekolah yang berusaha meningkatkan mutu pendidikan agar dapat bersaing dengan \r\nsekolah  lainnya.  Salah  satunya  dengan  pemilihan  murid  teladan  berdasarkan \r\npenilaian yang diperoleh, juga hal yang umum diterapkan dengan tujuan untuk \r\nmenanamkan  semangat  siswa  untuk  berkompetisi  sejak  dini. Proses  untuk \r\nmenentukan  predikat  siswa  teladan  di  SMP  Mazro\'atul  Ulum saat  ini dengan \r\nmempertimbangkan 4 kriteria yaitu data rata-rata rapor, total absensi berdasarkan \r\nalpha,  nilai  kepribadian  dan  nilai  ekstrakulikuler. Di  SMP  Mazro\'atul  Ulum \r\npendapat para guru tentang menentukan predikat siswa teladan berbeda, ada yang \r\nberpendapat bahwa nilai ekstrakulikuler dan kepribadian tidak terlalu diperhatikan. \r\nMisalnya, siswa memiliki nilai rata-rata rapor yang tinggi seperti nilai yang layak \r\nmendapatkan predikat siswa teladan dan alpha yang dikategorikan sedikit, para \r\nguru  hanya  memperhatikan  dari  nilai  rata-rata  rapor  dan  absensi  saja. Untuk \r\nmengatasi masalah tersebut, dikembangkan Sistem Penunjang Keputusan (SPK) \r\ndengan metode Fuzzy Tsukamoto. Metode tersebut merupakan pilihan yang tepat \r\ndalam menangani  masalah pengambilan  sebuah  keputusan  yang  menggunakan \r\nbeberapa kriteria. Hingga menghasilkan dua keputusan  yaitu teladan dan tidak \r\nteladan. Jika nilai probabilitas siswa lebih besar sama dengan 70 maka masuk ke \r\nrekomendasi teladan, jika di bawah 70 maka tidak teladan. Dalam pengujian yang \r\ndilakukan pada data siswa kelas 7,8 dan 9 pada tahun ajaran 2018/2019, bahwa \r\nsistem ini dapat menentukan siswa yang berhak mendapatkan predikat teladan dan \r\nmemberikan penilaian dari hasil keputusan agar tepat dan efesien. \r\n \r\nKata kunci : Siswa Teladan, Fuzzy Inference System, Metode Tsukamoto \r\n \r\nxiv+69 Hal; 14 Tabel; 48 Gambar; 2 Lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(90,'1511502401','2021-02-05 14:01:46','106240','../files/1511502401.pdf',' \r\nPENGENALAN BINATANG MENGGUNAKAN TEKNOLOGI \r\nAUGMENTED REALITY BERBASIS LAYAR ANDROID DENGAN \r\nMETODE MARKER BASED TRACKING PADA SD DUA MEI \r\n \r\nOleh : Rizham Bayu Salazar ( 1511502401 ) \r\nTeknologi Augmented  Reality dizaman  yang  serba  modern  ini  sangatlah \r\ndibutuhkan, terutama untuk anak-anak yang masih duduk dibangku sekolah dasar.  \r\nAnak-anak  mencari  sesuatu  yang  menurutnya  terlihat  menarik  contohnya \r\nAugmented Reality ini. Augmented Reality adalah teknologi yang memanfaatkan \r\nlayar untuk memunculkan obyek 3d, Augmented Reality adalah teknologi yang \r\npas untuk diterapkan kepada anak-anak, saat melihat obyek 3d maka anak-anak \r\nakan  sambil  mengimajinasikan  apa  yang  dilihatnya.  Maka  dari  itu  dibuatlah \r\naplikasi  pengenalan  binatang  berbasis Android ini  untuk  SD  Dua  Mei,  agar \r\nmemudahkan siswa untuk mengetahui binatang-binatang di dunia ini. Anak-anak \r\nterkadang hanya mengetahui  binatang-binatang yang muncul dalam kehidupan \r\nsehari-hari  seperti  kucing  dan  anjing  saja.  Maka  jika  ingin  mengetahui  lebih \r\nbanyak tentang binatang-binatang yang tidak ada di lingkungan sekitar anak-anak \r\nharus mendatangi kebun binatang yang mana sudah pasti di dalamnya terdapat \r\nbinatang-binatang  yang  jarang di  temui  seperti gajah, jerapah, monyet  bahkan \r\nbinatang buas harimau sekalipun. Diharapkan aplikasi dapat mempermudah anak-\r\nanak untuk mengetahui binatang - binatang apa saja yang jarang ditemukan pada \r\nlingkungan  sekitar,  Dengan  menggunakan  teknologi augmented  reality yang \r\ndibuat  dengan  editor unity  3d dan database Vuforia maka  hanya  dengan \r\nmendekatkan  layar  kamera  ke  obyek marker maka  akan  muncul  binatang - \r\nbinatang 3d,  disertai  juga  dengan  informasi  dan  suara  binatang  tersebut. \r\nAugmented  Reality ini menggunakan  metode Marker  Based  Tracking yaitu \r\ndimana  membutuhkan marker yang  merupakan gambar  atau  sejenisnya  yang \r\nsudah dimasukan kedalam database Vuforia, metode ini adalah metode paling \r\nsederhana dimana hanya perlu mendekatkan layar kamera ke marker yang sudah \r\nada  didalam database maka  obyek 3d akan  muncul.  Dengan  menggunakan \r\naplikasi  maka  anak-anak  tidak  perlu  lagi  membuang-buang  waktu  unruk \r\nmendatangi satwa kebun binatang hanya karena ini melihat seperti apa binatang-\r\nbinatang  yang  jarang  ditemui  dan  dengan  obyek 3dnya  maka  akan  membuat \r\nketertarikan  tersendiri  terhadap  anak-anak. Dengan hanya menyalakan \r\nsmartphone kemudian  menginstall  aplikasinya  dan  tinggal  mengarahkan  layar \r\nkamera ke marker huruf abjad yang sudah dimasukan ke dalam database, maka \r\nmunculah binatang 3d sesuai dengan abjad yang dipilih. \r\nKata Kunci : Pengenalan Binatang, Binatang 3d, Augmented Reality \r\nxv+86 halaman; 47 gambar; 4 tabel; 3 lampiran ');
INSERT INTO `document` VALUES (91,'1511502419','2021-02-05 14:01:46','423380','../files/1511502419.pdf',' \r\n \r\nKLASIFIKASI TWEET UJARAN KEBENCIAN BERBAHASA \r\nINDONESIA TERKAIT PEMILIHAN UMUM (PEMILU) 2019 \r\nMENGGUNAKAN ALGORITME C4.5 PADA BADAN SIBER DAN SANDI \r\nNEGARA (BSSN) \r\n \r\nOleh: Gugum Gumilar (1511502419) \r\n \r\n \r\nMaraknya ujaran kebencian yang terjadi dalam media sosial menjadi suatu hal \r\npenting untuk diperhatikan, salah satunya pada aplikasi Twitter. Banyaknya posting \r\nyang  terjadi  disetiap  waktu  membuat  pihak  penegak  hukum  kesulitan  untuk \r\nmelakukan pengawasan. Dengan dibukanya akses untuk mendapatkan data dari \r\npengelola perangkat lunak tersebut sangat membantu dalam proses pengolahannya.  \r\nPengklasifikasian tweet menggunakan Algoritme C4.5 dilakukan untuk membantu \r\nproses prediksi ujaran kebencian yang terjadi pada media sosial tersebut. Pohon \r\nkeputusan  akan  dijadikan  acuan  penentu  apakah  sebuah  data  baru  termasuk \r\nkedalam kategori ujaran kebencian. Pemanfaatan teknologi web service diterapkan \r\nuntuk menambah nilai fungsionalitas aplikasi sebagai sarana informasi yang mudah \r\npenggunaannya. Penyajian fitur import csv membuat proses prediksi data lebih rapi \r\nuntuk disimpan. Perolehan nilai akurasi dari program akan sangat bergantung pada \r\nseberapa lengkap dan optimal data berlabel yang dijadikan sebagai pembelajaran. \r\nHasil pengujian dengan menggunakan 250 data dan 10 nilai K untuk K-Fold Cross \r\nValidation menghasilkan nilai akurasi sebesar 80.4% dengan waktu pemrosesan \r\nyang digunakan mencapai 6 jam 13 menit dan 43 detik. \r\n \r\nKata Kunci : Twitter, ujaran kebencian, klasifikasi, text mining, Algoritme C4.5 \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n '),(92,'1511502435','2021-02-05 14:01:46','110004','../files/1511502435.pdf',' \r\n \r\nIMPLEMENTASI AUGMENTED REALITY PENGENALAN PAKAIAN ADAT \r\nTRADISIONAL MENGGUNAKAN METODE MARKER BASED TRACKING \r\nBERBASIS MOBILE ANDROID PADA SD NEGERI SUKASARI 7 \r\n \r\nOleh : Rizky Maulana (1511502435) \r\n \r\nKurangnya pemanfaatan teknologi Augmented  Reality di Sekolah  Dasar  (SD) \r\nNegeri Sukasari 7 dalam pengenalan materi. Media  sebelumnya yang digunakan \r\nuntuk  menyampaikan  materi  dianggap  kurang  efektif  karena  hanya \r\nmemperlihatkan satu sisi atau sudut pandang yang searah dan kurang interaktif \r\nuntuk  belajar.  Perlu  dipertimbangkan  dalam  pemilihan  media  yaitu  tujuan \r\npembelajaran,  efektif,  dan  mudah  diperoleh,  peserta  didik,  penggunaan,  tidak \r\nkaku, biaya, dan kualitas. Salah satu perkembangan media pembelajaran yang saat \r\nini  masih  baru  adalah  media  pembelajaran  dengan  menggunakan augmented \r\nreality.  Hasil  akhir  berupa  media  pembelajaran  interaktif  dengan augmented \r\nreality.  Dalam  penelitian  ini  penulis menyediakan  solusi  atau  inovasi  dalam \r\nmelakukan suatu metode pembelajaran pengenalan pakaian adat indonesia pada \r\nsiswa/i SD Negeri Sukasari 7 agar lebih menarik dan mudah untuk dipahami. \r\nAplikasi  ini  dibuat  untuk  menambahkan  media  pembelajaran  ber-teknologi \r\nAugmented  Reality pada  Sekolah  Dasar  Negeri  Sukasari  7  agar  proses \r\npembelajaran tentang pengetahuan Pakaian Adat Tradisional di Indonesia menjadi \r\nlebih menarik dan interaktif karena terdapat objek 3D. Aplikasi ini menggunakan \r\nMetode Marker Based Tracking, dimana marker objeknya nanti berupa kertas 2D, \r\naplikasi  ini  berjalan  di platform Android. Hasil  uji  responden  menggunakan \r\nkuisioner ISO 9126 yang dilakukan pada 31 siswa menghasilkan 89% dari hasil \r\npengujian tersebut dapat disimpulkan aplikasi yang dibuat dapat berjalan dengan \r\nbaik. \r\n \r\nKata Kunci : Teknologi, Augmented Reality, Pakaian Adat, Objek3D,  Android. \r\nXV + 90 Halaman; 54 gambar; 3 tabel; 3 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(93,'1511502443','2021-02-05 14:01:46','120095','../files/1511502443.pdf',' \r\nSISTEM PENUNJANG KEPUTUSAN PENENTUAN RANKING SISWA \r\nDENGAN MENGGUNAKAN METODE SIMPLE ADDITIVE WEIGHTING \r\nBERBASIS JAVA DEKSTOP DI MTS BUARAN KOTA TANGERANG \r\nOleh : Aldi Nuriansyah(1511502443) \r\n \r\nProses pemberian penilaian dan ranking merupakan metode  yang digunakan  pada \r\nproses  belajar  dan  mengajar  di  sekolah.  Proses  ini  dilakukan  dengan  berbagai \r\ntujuan, yaitu menilai pencapaian peserta didik, memberikan umpan balik proses \r\nbelajar  mengajar,  memotivasi  para  siswa  dan  siswi  untuk  menaikan  kapasitas \r\nkemampuan masing-masing, dan menanamkan hasrat berkompetisi menjadi yang \r\ntarbaik.  Namun  pemberian ranking apabila  dicermati  dengan  teliti  pemberian \r\nranking hanya dihitung bedasarkan nilai mata pelajaran yang diraih di kelas saja. \r\nPemberian ranking tidak dipengaruhi aspek penilaian lain seperti nilai sikap, nilai \r\nyang didapatkan dari ektrakulikuler, nilai percaya diri, dan absensi. Agar berbagai \r\naspek tersebut dapat dihitung, maka dirancang penilaian baru dengan menggunakan \r\nlima  aspek  untuk  menghitung  menentukan ranking.  Dengan  banyaknya  aspek \r\npenilaian ranking maka akan dikembangkan Sistem Penujang Keputusan metode \r\nyang  digunakan  dalam  perancangan  ini  adalah  Metode Simple  Additive \r\nWeighting(SAW) sering juga dikenal istilah metode penjumlahan terbobot. Konsep \r\ndasar metode SAW adalah mencari penjumlahan terbobot dari rating kinerja pada \r\nsetiap alternatif pada semua atribut. Dalam proses pemberian ranking ada lima \r\naspek yaitu nilai akademik, nilai sikap, nilai ekstrakulikuler, nilai percaya diri, \r\nabsensi. Aspek nilai akademis, nilai sikap, nilai percaya diri, nilai ekskul dihitung \r\ndengan dari rata-rata jumlah keseluruhan nilai aspek disetiap semesternya. Aspek \r\nabsensi akan dihitung jumlah murid absen dari kelas. Dengan adanya penelitian ini \r\ndiharapkan dapat menbantu Kepala Sekolah dan Wali Kelas dalam menentukan \r\nranking siswa  perkelasnya  disetiap  semester.  Mempercepat  proses  penentuan \r\nranking siswa dan dapat mengurangi kesalahan dalam menentukan ranking siswa. \r\n \r\nKata Kunci : Sistem Penunjang Keputusan, Simple Additive Weighting, ranking \r\n \r\nxi+114 ; 29 Tabel; 152 Gambar; 2 Lampiran Perpustakaan Universitas Budi Luhur\r\n'),(94,'1511502468','2021-02-05 14:01:46','44158','../files/1511502468.pdf',' \r\n \r\nIMPLEMENTASI SISTEM PENDUKUNG KEPUTUSAN UNTUK \r\nPROMOSI JABATAN MANAJER DENGAN METODE SIMPLE \r\nADDITIVE WEIGHTING BERBASIS WEB PADA PT. ADFIN BUREAU \r\nINDONESIA \r\n \r\nOleh : Muhamad Hapiz Herdiansyah (1511502468) \r\n \r\nPT. Adfin Bureau Indonesia merupakan salah satu perusahaan swasta nasional yang \r\nbergerak  dibidang  jasa  Konsultan  Teknik  dan  Manajemen  (Engineering  and \r\nManagement Consultant), didirikan PT. Adfin Bureau Indonesia di Jakarta pada \r\ntanggal  3  Juni  2005  sebagai  perusahaan  konsultan  yang  relatif  cukup \r\nberpengalaman. Oleh karena itu PT. Adfin Bureau Indonesia selalu melakukan \r\npemilihan jabatan tingkat manajer disetiap 4 tahun sekali. Namun penilaian calon \r\nmanajer masih bersifat subjektif dari pihak perusahaan dan hanya menilai dari segi \r\nkeaktifannya saja. Sehingga banyak pegawai yang mengeluh tentang keputusan \r\ntersebut. Untuk mengatasi hal ini maka perlu dirancang adanya sistem pendukung \r\nkeputusan.  Sistem  Pendukung  Keputusan  (SPK)  adalah  suatu  sistem  informasi \r\nberbasis  komputer  untuk  menyediakan  dukungan  kepada  pengambil  keputusan \r\ndalam memecahakan masalah. Metode yang digunakan adalah Simple Additive \r\nWeighting (SAW). Metode ini dapat melakukan penilaian secara lebih tepat karena \r\ndidasarkan pada nilai kriteria dan bobot yang sudah ditentukan. Kriteria dan bobot \r\nyang digunakan terdiri dari 5 yaitu nilai kemampuan manajemen dengan bobot \r\n30%, kemampuan komunikasi dengan bobot 25%, masa kerja dengan bobot 10%, \r\nprestasi dengan bobot 15%, dan penilaian kinerja dengan bobot 20%. Setelah proses \r\nperhitungan selesai maka didapat hasil dengan nilai terbesar yang akan mendapat \r\npromosi jabatan menjadi manajer. Dengan menggunakan sistem ini diharapkan \r\ndapat membantu pihak perusahaan untuk menentukan calon manajer secara objektif \r\ndan tepat karena dapat menghitung berdasarkan kriteria dan bobot  yang sudah \r\nditentukan. \r\n \r\nKata kunci : Sistem Pendukung Keputusan, Simple Additive Weighting, Manajer \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(95,'1511502492','2021-02-05 14:01:46','119760','../files/1511502492.pdf',' \r\n \r\nIMPLEMENTASI ALGORITME AES  \r\n(ADVANCED ENCRYPTION STANDARD) PADA SYSTEM PENILAIAN \r\nAKADEMIK SMK AL-HASRA. \r\n \r\nOleh : Ibnu Bahtiar Rianto (1511502492) \r\n \r\n Data  sangatlah  berharga  bagi  semua  pengguna  komputer,  belakangan  ini \r\nkriptografi  menjadi  metode  yang  digunakan  dalam  mengamankan  data. \r\nKriptografi  adalah  ilmu  yang  mempelajari  teknik-teknik  matematika  dalam \r\nmengamankan suatu informasi atau pesan asli (Plainteks) menjadi  sebuah teks \r\ntersembunyi  (Chiperteks)  dan  kemudian  di  ubah  menjadi  pesan  asli  kembali. \r\nKriptografi mempunyai tiga unsur penting yaitu pembangkitan kunci, enkripsi dan \r\ndeskipsi.  Dalam  kriptografi  di  kenal  algoritma  block  chiper  yang didalamnya \r\nterdapat  AES  (Anvanced  Encyption  Standard)  merupakan  bagian  dari  Modern \r\nSymmetric Key Cipher, algoritme ini menggunakan kunci yang sama pada saat \r\nproses enkripsi dan deskripsi sehingga data yang kita miliki akan sulit dimengerti \r\nmaknanya. Teknik algoritma tersebut digunakan untuk mengkonversi data dalam \r\nbentuk kode-kode tertentu, untuk tujuan agar informasi yang tersimpan tidak bisa \r\ndi baca siapa pun kecuali orang-orang yang berhak. Oleh karena itu, Penelitian ini \r\nbertujuan untuk memberikan Keamanan pada System Penilaian Akademik SMK \r\nAL-HASRA. Melalui media Informasi yang berupa daftar menu yang berisi data \r\nsiswa, guru, mata pelajaran, ruang kelas, dan nilai siswa yang sangat rentan akan \r\npencurian  dan  diubah  oleh  pihak  yang  tidak  bertanggung  jawab. Sehingga \r\ndiperlukannya keamanan pada database agar tidak dapat diubah oleh pihak yang \r\ntidak  bertanggung  jawab  menggunakan  Algortime  AES. Aplikasi  ini  nantinya \r\nakan  berisi  tentang  Keamanan  pada System Penilaian  Akademik  seperti  data \r\nsiswa, data guru, data kelas, dan mata pelajaran yang nanti akan digunakan untuk \r\nmengisi  data  nilai  siswa.  Aplikasi  ini  dibangun  dengan  menggunakan  bahasa \r\npemograman  PHP dan  juga  menggunakan  metode Agoritme  AES  (Advanced \r\nEncryption Standard) yang nanti nya ada sebuah daftar menu berisi data siswa, \r\ndata guru, mata pelajaran ruan kelas sebagai salah satu master data untuk mengisi \r\nnilai siswa untuk mengenkripsi dan dekripsi database. Hasil dari penelitian ini \r\nnanti nya akan menghasilkan aplikasi Kemanan pada System Penilaian Akademik. \r\n \r\nKata kunci : Algoritme AES, System Penilaian Akademik, Database \r\n \r\nX+84 halaman;  Gambar;  Tabel;  Lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(96,'1511502500','2021-02-05 14:01:46','22329','../files/1511502500.pdf',' \r\nKLASTERISASI INFORMASI BANJIR DI TWITTER MENGGUNAKAN \r\nMETODE FREQUENT TERM-BASED CLUSTERING (FTC) DAN \r\nEKSTRAKSI NAMED ENTITY RECOGNITION MENGGUNAKAN INNER \r\nPADA BADAN NASIONAL PENANGGULANGAN BENCANA (BNPB) \r\n Oleh : Zahra Permata Jodea (1511502500) \r\nBNPB  merupakan  lembaga  pemerintah  yang  bertugas  untuk  menanggulangi \r\nbencana alam, dalam penanggulangnya BNPB belum menggunakan data Twitter \r\nsebagai sarana menanggulangi bencana alam secara maksimal di era globalisasi \r\nini, pengguna  media  sosial  memberikan  beberapa  informasi  terkait  terjadinya \r\nbencana  alam  seperti lokasi  terjadinya  bencana  alam. Namun,  informasi  yang \r\nberasal dari media sosial memiliki struktur yang tidak baku serta kredibilitas yang \r\nrendah  sebagai  penyedia  informasi.  Data  media  sosial  yang  tidak  terstruktur \r\nberdampak pada informasi terkait lokasi bencana alam menjadi sulit diidentifikasi. \r\nOleh  karena  itu,  harus  digunakan  suatu  metode,  salah  satunya  dengan \r\npemanfaatan text  mining,  yang merupakan  proses  ataupun  kegiatan  untuk \r\nmengumpulkan data yang berukuran besar kemudian mengekstraksi data tersebut \r\nmenjadi  informasi  yang  nantinya  dapat  digunakan.  Tujuan  dari  penelitian  ini \r\nadalah untuk membantu BNPB dalam mencari data tweet bencana alam dengan \r\nkonsep menggali informasi dan mengelompokan data tweet yang terdapat pada \r\ntwitter, pendekatan text mining diharapkan dapat menjawab permasalahan tersebut, \r\ndengan menggunakan metode Clustering dengan algoritme Frequent Term Based \r\nClustering.  Frequent  Term  Based  Clustering merupakan  sebuah algoritme \r\nklasterisasi  menggunakan  metode  probabilitas  dan  statistik  mentah  untuk \r\nmengelompokan  suatu  data dan  mendapatkan  informasi  yang  baik. Ditambah \r\ndengan InNer, pengguna  dapat  mengekstrak  informasi  lebih  banyak  dibanding \r\nclustering biasanya. Hasil  identifikasi  entitas  Lokasi dapat  membantu  Badan \r\nNasional  Penanggulangan  Bencana  (BNPB)  untuk  mendapatkan  informasi  dini \r\nterkait bencana alam yang terjadi di Indonesia secara faktual dan aktual dalam \r\nmelakukan clustering tweet atau  mengelompokan  data  yang  berdasarkan \r\nkemiripannya. Penggunaan metode clustering dapat  memudahkan  pengguna \r\ndalam  mendapatkan  informasi  dari  sosial  media twitter. Di sisi  lain,  informasi \r\ntersebut dapat digunakan sebagai langkah alternatif penyebaran informasi terkait \r\nbencana  alam  yang  digunakan  oleh  masyarakat. Hal  ini dibuktikan  dengan \r\nvalidasi  eksternal dengan  pengukuran  purity bencana  alam  memiliki tingkat \r\nhomogen sebesar 0,60. \r\n \r\nKata Kunci: Data Mining, Text Mining , Bencana Alam, Clustering, Frequent \r\nTerm based Clustering, Named Entity Recognition, INNER \r\nxiii+60 halaman; 27 Gambar; 32 tabel; 1 lampiran \r\n Perpustakaan Universitas Budi Luhur\r\n'),(97,'1511502534','2021-02-05 14:01:46','42378','../files/1511502534.pdf',' \r\n \r\nNIM : 1511502534 \r\nNama : Indra Hadyan \r\n \r\nJudul : Implementasi Augmented Reality dengan Metode Marker Berbasis \r\nAndroid untuk Pengenalan Lingkungan Kampus pada Universitas Budi \r\nLuhur Jakarta \r\n \r\n Pengenalan  lingkungan  kampus  pada Universitas  Budi  Luhur  awalnya \r\nmasih menggunakan sebuah brosur yang dirasa kurang efisien dan kurang interaktif \r\ndalam mengenalkan lingkungan kampus. Pada era modern saat ini, sebagian besar \r\nmahasiswa membutuhkan informasi seputar kampus yang disajikan dalam bentuk \r\ndigital  dengan  media smartphone. Untuk  itu  diperlukan  aplikasi  yang  dapat \r\nmembantu mengetahui lingkungan kampus dan fasilitas seperti apa yang disediakan \r\ndi kampus dengan penyajian informasi secara visual yang lebih interaktif. Untuk \r\nmenunjang penyajian informasi secara visual dengan tampilan yang menarik, dapat \r\ndilakukan  dengan  cara  mengimplementasikan  teknologi augmented  reality. \r\nAugmented Reality sebagai media yang mampu menengahi ide antara manusia dan \r\nkomputer, manusia dan manusia. Augmented Reality atau dalam bahasa indonesia \r\ndisebut dengan realitas tertambah merupakan inovasi dan Computer Graphic yang \r\ndapat menyajikan visualisasi dan animasi dari sebuah model atau desain objek yang \r\nmenggambarkan dunia maya dua dimensi maupun tiga dimensi kedalam dunia \r\nnyata. Sistem  ini  dibangun  sebagai  media  untuk  menampilkan  informasi  dari \r\ngedung, ruangan dan fasilitas lainnya pada Universitas Budi Luhur Jakarta. Tujuan \r\ndari  pembuatan  penelitian  ini  adalah membangun  aplikasi  untuk  menyediakan \r\ninformasi kepada pengguna di lingkungan Universitas Budi Luhur Jakarta dengan \r\naplikasi berbasis android, serta embuat tampilan informasi tiap gedung dan ruangan \r\npada  Universitas  Budi  Luhur Jakarta secara visual dengan  pemodelan 2D \r\nmenggunakan  teknologi  teknologi Augmented  Reality menjadi  menarik  dan \r\ninteraktif bagi pengguna. Metode yang digunakan untuk mengimplementasikan \r\nteknologi augmented  reality ini  yaitu  dengan  menggunakan  metode marker. \r\nMetode ini digunakan karena mudah dalam pengimplementasianya serta efektif \r\nuntuk pengenalan gedung dan ruangan pada Universitas Budi Luhur Jakarta. Hasil \r\nuji coba usabilitas dari aplikasi yang mengimplementasikan teknologi augmented \r\nreality ini menghasilkan angka 89,03% dan masuk dalam katergori sangat baik. Uji \r\ncoba ini dilakukan terhadap 40 responden dalam uji coba aplikasi dan juga dengan \r\ncara penyebaran kuesioner. Berdasarkan hasil uji coba, dapat disimpulkan bahwa \r\naplikasi ini layak digunakan sebagai media pengenalan kampus pada Universitas \r\nBudi  Luhur  Jakarta.  Dengan  mengimplementasikan augmented  reality dan \r\nmenggunakan metode marker, aplikasi ini dapat menjawab permasalahan pada latar \r\nbelakang permasalahan. \r\n \r\nKata Kunci : Unity 3D, Vuforia, Pengenalan lingkungan kampus, 3 Dimensi, \r\nAugmented Reality. \r\n \r\nxiv + 67 halaman; 41 gambar; 13 tabel; 10 lampiran; Perpustakaan Universitas Budi Luhur\r\n'),(98,'1511502542','2021-02-05 14:01:47','20338','../files/1511502542.pdf',' \r\nIMPLEMENTASI METODE PENGACAKAN LINEAR CONGRUENTIAL \r\nGENERATOR (LCG) DALAM PEMBUATAN PERMAINAN EDUKASI \r\nBERBASIS ANDROID PADA SD NEGERI TANAH TINGGI 3 \r\nTANGERANG \r\nOleh : Jacky Rachmat Wirawan ( 1511502542 ) \r\nSeiring berkembangnya  teknologi  informasi,  begitu  pula  dengan \r\nberkembangnya permainan  atau game,  banyaknya  permainan  saat  ini \r\nmengakibatkan  kurangnya  minat  belajar  khususnya  pada  anak-anak.  Sebuah \r\npermainan edukasi kuesioner yang memiliki unsur Mobile Learning (M-Learning) \r\nyang  ada  dalam smartphone tentu  dapat  memberikan  hiburan  yang  menarik \r\nkepada pengguna, serta dapat memberikan media pembelajaran untuk menambah \r\nwawasan tentang ilmu pengetahuan. Kuesioner merupakan bentuk permainan atau \r\npikiran dimana pemain (sebagai individu) berusaha untuk menjawab pertanyaan \r\ndengan benar dalam mencapai  satu  tujuan dalam  metode pembelajaran. Anak-\r\nanak di Sekolah Dasar Negeri Tanah Tinggi 3 Tangerang masih sulit mencari \r\npermainan yang sesuai dan yang dapat bisa membantu melatih mereka menjawab \r\npertanyaan-pertanyaan  tentang  ilmu  pengetahuan  umum  yang  ada  di  sekolah. \r\nMaka  dari  itu  dibuatlah  permainan  bergenre edukasi  kuesioner  dengan \r\nmenggunakan  metode Linear  Congruential  Generator (LCG)  yang  berfungsi \r\nuntuk mengacak pertanyaan-pertanyaan yang ada pada permainan secara random, \r\nsehingga pengguna dipaksa untuk berfikir dalam menjawab pertanyaan tersebut. \r\nDengan adanya permainan edukasi kuesioner berbasis android dengan tampilan \r\nyang menarik dan juga menyenangkan dapat meningkatkan minat belajar pada \r\nanak-anak. Hasil  dari  UAT  menunjukan  bahwa user suka  dengan  permainan \r\nKUAS dan permainan KUAS dapat meningkatkan minat belajar. \r\nKata Kunci : Permainan Edukasi, Kuesioner, Linear Congruential Generator \r\nxiii+62 halaman; 38 Gambar; 7 Tabel; 3 Lampiran   Perpustakaan Universitas Budi Luhur\r\n'),(99,'1511502567','2021-02-05 14:01:47','20852','../files/1511502567.pdf',' \r\n \r\nIMPLEMENTASI ALGORITMA TOPSIS UNTUK MENENTUKAN \r\nSISWA TERBAIK PADA SMK MAKARYA \r\n \r\nOleh : Arief Novianto (1511502567) \r\n \r\nKemajuan  teknologi  informasi  dan  komunikasi  selalu  berkembang. \r\nPerkembangan  akan  selalu  hadir  untuk  memudahkan  manusia  dalam  berbagai \r\npekerjaan  dan  kegiatan  sehari-hari.  Tidak  terkecuali  dalam  hal  pengambilan \r\nkeputusan.  Pengambilan  keputusan  bukanlah  hal  yang  sulit  namun  selalu  ada \r\ntanggung  jawab  yang  besar  dalam  sebuah  keputusan.  Sistem  pendukung \r\nkeputusan pemilihan siswa terbaik ini diharapkan dapat membantu sekolah dalam \r\nproses pemilihan siswa terbaik dalam setiap semester di SMK Makarya. Proses ini \r\ndilakukan  dengan  berbagai  tujuan,  yaitu  meningkatkan  semangat  siswa  dalam \r\nbelajar dan supaya memotivasi para siswa untuk terus berlomba supaya menjadi \r\nsiswa  terbaik  disekolah  .  Atas  dasar  penelitian  tersebut  dibangun  Sistem \r\nPendukung  Keputusan  (SPK)  untuk  dapat  menilai  siswa.  Sistem  pendukung \r\nkeputusan  untuk  memilih  siswa  terbaik  dilakukan  berdasarkan  penilaian  dari \r\npihak sekolah yang diberikan wewenang untuk menilai para siswa. Oleh karena \r\nitu  maka  perlu  dirancang  suatu  sistem  pendukung  keputusan  yang  dapat \r\nmembantu pengambil keputusan dalam mendapatkan informasi untuk menentukan \r\nsiswa terbaik. Sistem pendukung keputusan atau Decision Support Systtem (DSS) \r\nadalah  sistem  yang  dimaksudkan  untuk  para  pengambil  keputusan  manajerial \r\ndalam  situasi  keputusan  semiterstruktur.  Dalam  penelitian  ini  metode  yang \r\ndigunakan  adalah Technique  For  Order  Preference  By  Similiarity  To  Ideal \r\nSolution (TOPSIS).  Terdapat  4  kriteria  yang  diperhitungkan  yaitu,  nilai  rapor, \r\nnilai akademik, nilai ekstrakulikuler dan nilai kehadiran. Penggunaan metode ini \r\nkarena dapat menyeleksi alternatif terbaik dari sejumlah alternatif yang ada, hasil \r\npenelitian ini diimplementasikan pada sebuah program berbasis web yang dibuat \r\ndengan  bahasa  pemrograman PHP. Dalam  pembuatan  program  ini  penulis \r\nberharap agar berjalan dengan skema yang telah di rancang sedemikian rupa dan \r\ndapat membantu proses pemilihan siswa terbaik secara tepat. \r\n \r\nKata Kunci : Sistem pendukung Keputusan, Technique For Order Preference By \r\nSimiliarity To Ideal Solution (TOPSIS), Siswa Terbaik. \r\niv+68 halaman, 40 gambar, 10 tabel, 8 lampiran Perpustakaan Universitas Budi Luhur\r\n'),(100,'1511502575','2021-02-05 14:01:47','143650','../files/1511502575.pdf',' \r\nAPLIKASI PENCARIAN INFORMASI DEBU GUNUNG BERAPI \r\nMENGGUNAKAN PENGOLAHAN BAHASA ALAMI (NATURAL \r\nLANGUAGE PROCESSING) STUDI KASUS BIDANG MANAJEMEN \r\nOPERASI METEOROLOGI PENERBANGAN BMKG \r\nOleh: HILMI NICO PUTRA (1511502575) \r\nIndonesia merupakan daerah dengan wilayah yang dikelilingi dengan rangkaian \r\npegunungan mediteranian dan rangkaian pegunungan sirkum pasifik serta daerah \r\nrawan  pertemuan  antara  lempeng  indo-australia,  lempeng  Eurasia,  dan  juga \r\nlempeng  pasifik. Dikarenakan  posisi  wilayah  Indonesia  maka  banyak  terjadi \r\nbencana,  salah  satunya  yaitu bencana  letusan  gunung  berapi,  dampak  yang \r\ndisebabkan oleh  letusan  gunung  berapi  adalah  debu  vulkanik.  Bagi  pihak \r\npenerbangan debu vulkanik adalah bencana yang dapat dikategorikan berbahaya \r\nkarena debu vulkanik dapat masuk kedalam mesin pesawat sehingga menyebabkan \r\nturbelensi hingga matinya mesin pesawat. Informasi tentang debu gunung berapi \r\nsulit untuk diuraikan, hanya pihak-pihak tertentu yang dapat membacanya dan \r\ninformasi  tersebut  harus  menunggu  kepastian  pihak  bmkg  sehingga  terjadinya \r\nketerlambatan  penyampaian  informasi.  Pada  saat  ini  penyampaian  informasi \r\ntentang debu gunung berapi masih terbatas pada data-data lampau dan masukkan \r\nnya  hanya  dapat  berupa  tanggal mulai  dan  tanggal  akhir. Penelitian  ini \r\nmenggunakan  bahasa  alami  untuk  mencari  informasi  agar lebih  interaktif  dan \r\nkeluaran yang diinginkan sesuai dengan masukkan yang diberikan. Penelitian ini \r\nmenggunakan  pengolahan  bahsa  alami  dengan tujuan untuk memudahkan \r\npencarian  informasi  kepada  masyarakat  mengenai  debu  gunung  berapi  sesuai \r\ndengan menggunakan  pendekatan  aturan  produksi yang  sudah  ditentukan. \r\nPenelitian ini menghasilkan empat tipe aturan produksi yang dapat digunakan untuk \r\nmelakukan pencarian informasi debu gunung berapi dengan pola atribut, atribut - \r\nkondisi, atribut - atribut - kondisi, atribut - atribut - kondisi - kondisi. \r\n \r\nKata Kunci: Pengolahan Bahasa Alami, Aturan Produksi, Informasi. \r\nxi + 48 halaman; 24 gambar; 4 tabel; 1 lampiran Perpustakaan Universitas Budi Luhur\r\n'),(101,'1511502591','2021-02-05 14:01:47','100897','../files/1511502591.pdf',' \r\n \r\nNIM : 1511502591 \r\nNama : FANDRA SATRIA \r\nJudul : SISTEM  PENUNJANG  KEPUTUSAN  PEMILIHAN \r\nKARYAWAN  TERBAIK  DENGAN  METODE FUZZY \r\nTSUKAMOTO BERBASIS  JAVA DESKTOP DI  PT. \r\nPATRA TRADING \r\n \r\nPT.  Patra  Trading  merupakan  anak  perusahaan  PT.  PERTAMINA  PATRA \r\nNIAGA  yang  bergerak  dalam  aktivitas  niaga  produk-produk  non  BBM dan \r\nmengoperasikan Stasiun Pengisian Bulk Elpiji (SPBE), Terminal Aspal Curah dan \r\nPengelolaan  Depot. Bagi  pimpinan perusahaan, menganggap  karyawan  yang \r\nbekerja di perusahaannya sebagai roda penggerak yang penting bagi kelangsungan \r\nperusahaan. Setiap  perusahaan  memliki  karyawan  yang  berkualitas  supaya \r\nperusahaan  dapat  tumbuh  dan  berkembang  dengan  pesat.  Untuk  menentukan \r\nkaryawan  yang  berkualitas diperlukan  manajemen  sumber  daya  manusia  di \r\nsebuah  perusahaan  dengan  melakukan  pemilihan  karyawan  terbaik  untuk \r\nmeningkatkan semangat dan kinerja karyawan di perusahaan dari tahun ke tahun. \r\nSelama ini proses pemilihan karyawan terbaik di PT. Patra Trading dilakukan \r\ndengan  mempertimbangkan beberapa  kriteria  yaitu:  Absensi,  kepribadian  dan \r\nproblem  solving.  Untuk  menentukan  hasilnya  dilakukan  perhitungan  secara \r\nmanual  dengan  membandingkan  kriteria  yang  ada  di  data  karyawan  tersebut. \r\nPerhitungan  manual  saat  ini  tidak  menggunakan tools apapun.  Proses  yang \r\ndilakukan  adalah  mengambil  data  absensi  dari  mesin  absensi  dan  pengamatan \r\nsecara  visual  oleh  pengawas. Jadi  untuk nilai dari  kepribadian  dan problem \r\nsolving diabaikan. Oleh  karena  itu  diperlukan  aplikasi  yang  dapat  membantu \r\ndalam  pemilihan  karyawan  terbaik  secara  tepat.  Salah  satunya  aplikasi  yang \r\nmengimplementasi metode fuzzy  tsukamoto untuk  membantu  dalam  pemilihan \r\nkaryawan terbaik secara cepat, tepat dan akurat. Metode ini dipilih karena metode \r\ntsukamoto bersifat  intuitif  dan  dapat  memberikan  tanggapan  berdasarkan \r\ninformasi yang bersifat kualitatif, tidak akurat, dan ambigu. Perhitungan dengan \r\nfuzzy  tsukamoto mempertimbangkan  3  variabel  yaitu:  Nilai  Absensi  yang \r\nberdasarkan  sudah  berapa  banyak  karyawan  tersebut  tidak  masuk,  Nilai \r\nKepribadian  dan  Nilai  Problem  Solving.  Untuk  menguji  coba  digunakan  30 \r\nsampel data, dari 30 sampel data diperoleh hasil karyawan  yang \"TERBAIK\" \r\nadalah atas nama Muhamad Rafsanjani dengan nilai probabilitasnya 90,855856. \r\nSedangkan  untuk  karyawan  yang  \"TIDAK  TERBAIK\"  berjumlah  1  orang. \r\nDiharapkan dengan adanya aplikasi ini dapat mempermudah pihak PT. PATRA \r\nTRADING  untuk  mengambil  keputusan dalam  pemilihan  karyawan  terbaik. \r\nUntuk keputusan akhir tetap berada pada pihak perusahaan. \r\n \r\nKata Kunci : Pemilihan Karyawan Terbaik, Fuzzy, Metode Tsukamoto \r\n \r\nxv+67 Hal; 11 Tabel; 54 Gambar; 1 Lampiran Perpustakaan Universitas Budi Luhur\r\n'),(102,'1511502617','2021-02-05 14:01:47','72607','../files/1511502617.pdf',' \r\n \r\nIMPLEMENTASI ALGORITMA ADVANCED ENCRYPTION STANDARD \r\n(AES-128) DENGAN MENGGUNAKAN ONE TIME PASSWORD MOBILE \r\nTOKEN PADA LOGIN APLIKASI LENNA PT. SINERGI DIGITAL \r\nTEKNOLOGI \r\n \r\nOleh : Agung Santoso (1511502617) \r\n \r\nPT.  Sinergi  Digital  Teknologi  merupakan  Perusahaan  IT  yang  menerapkan \r\nteknologi  kecerdasan  buatan(Artificial Intelligence)  dan Aplikasi  Lenna  adalah \r\nsalah satu produk teknologi informasi berbasis AI (Artificial Intelligence) yang di \r\nfungsikan  sebagai  asisten  personal  berbasis  bahasa  indonesia. Lenna \r\nmengutamakan fitur perintah suara (Voice Command) yang dapat memudahkan \r\npenggunanya  melakukan  perintah  daripada  memerlukan input berupa  kalimat \r\nteks. Selain itu aplikasi lenna bisa memerintahkan untuk menjalankan berbagai \r\nhal seperti : membeli pulsa seluler, membeli tiket transportasi atau bioskop. Lenna \r\njuga dilengkapi fitur uang elektronik atau e-wallet untuk memenuhi kebutuhan \r\ntransaksi.  Para  pengguna  dapat  melakukan  pengisian  saldo e-wallet dengan \r\nnominal  tertentu.Untuk  bisa  menggunakan  aplikasi  lenna  kita  diharuskan \r\nmemberikan  data  diri  kita  agar  dapat  menggunakan  teknologi  tersebut. Oleh \r\nkarena itu keamanan data menjadi aspek yang harus diperhatikan juga, sehingga \r\ndata diri kita tidak disalahgunakan pihak yang tidak betanggung jawab. Selama ini \r\nlogin  aplikasi  Lenna  hanya  menggunakan  Metode One  Time  Password (OTP) \r\ntanpa  adanya  enrkipsi  data.  Hal  ini  menyebabkan  pencurian  data,  sehingga \r\ndiperlukannya keamanan data atau informasi untuk mengamankan informasi atau \r\ndata dari yang tidak berwenang. Metode pembangkit kode One Time Password \r\n(OTP)  pada  penelitian  ini  menggunakan Algoritma  kriptografi Advanced \r\nEncryption Standard dengan jumlah bit 128 (AES-128 Bit) yang digunakan untuk \r\nenkripsi data masukan oleh pengguna yang akan diambil 6 digit sebagai kode \r\nOTP dan digunakan sebagai validasi Kode OTP yang berada di database. Pada \r\nProses enkripsi algoritma AES (Advancd Encryption Standard) terdiri dari 4 jenis \r\ntransformasi bytes,  yaitu SubBytes, Shiftrows,  MixColumns, dan Addroundkey. \r\nPada  awal  enkripsi,  input  yang  telah  di copy ke  dalam state akan  mengalami \r\ntransformasi Subbytes, Shiftrows,MixColumns, dan Addroundkey secara berulang-\r\nulang sebanyak Nr. penerapan ini menggunakan algoritma simetris yang memiliki \r\nkey pada saat enkripsi dan dekripsi menggunakan kunci yang sama. Selanjutnya \r\nkey tersebut berada pada API dan android dengan mengambil 16 karakter dari \r\nproses md5. Tujuan penulisan skripsi ini adalah mencoba keamanan tambahan \r\npada aplikasi Lenna berbasis android dengan menambahkan keamanan tersebut \r\npada sebelum menggunakan aplikasi tersebut atau setelah login.  \r\n \r\nKata kunci : One Time Password (OTP), Advanced Encryption Standard (AES-\r\n128),Android. \r\n \r\nxvii+67 halaman; 52 gambar; 14 tabel; 1 lampiran  Perpustakaan Universitas Budi Luhur\r\n'),(103,'1511502625','2021-02-05 14:01:47','157717','../files/1511502625.pdf',' \r\n \r\nIMPLEMENTASI TEKNOLOGI AUGMENTED REALITY SEBAGAI \r\nMEDIA INFORMASI MENGGUNAKAN METODE MARKER BASED \r\nTRACKING PADA GALERI ISLAM MASJID RAYA AL-AZHOM KOTA \r\nTANGERANG \r\n \r\nOleh : Iman Prayogi (1511502625) \r\n \r\nMasjid  Raya  Al-Azhom  merupakan  masjid terbesar  di  Kota  Tangerang. \r\nKeunikan yang dimiliki Masjid Raya Al-Azhom tidak hanya dari segi kemegahan \r\nbangunan saja, namun juga struktur bangunan dan terdapatnya Galeri Islam pada \r\nbagian dalam masjid. Pada Galeri Islam Masjid Raya Al-Azhom terdapat bingkai \r\nyang  berisi  gambar  berikut  informasi  terkait  gambar  tersebut.  Hanya  saja \r\ninformasi yang disajikan tidak lengkap (singkat). Melihat keterbatasan informasi \r\nyang didapat dari gambar tersebut, maka diperlukan sebuah inovasi baru yang \r\ndapat menyajikan informasi lebih detail. Dengan mengubah penyajian informasi, \r\nyang  sebelumnya  menggunakan  media  cetak  (poster),  akan  diubah  kedalam \r\nbentuk media digital. Tujuan dari penelitian ini adalah menyajikan informasi yang \r\nlebih detail dengan memanfaatkan teknologi Augmented Reality kedalam sebuah \r\ngaleri. Sehingga pengunjung galeri tidak kesulitan dalam mendapatkan informasi \r\ndetail dari  gambar  tersebut.  Pembangunan  aplikasi  menggunakan  bahasa \r\npemrograman C# (C sharp) dan menggunakan metode Marker Based Tracking, \r\ndimana aplikasi ini memerlukan marker (gambar) sebagai sumber masukan yang \r\ndiambil  dari  kamera smartphone untuk  menampilkan  informasi  terkait  gambar \r\ntersebut. Hasil dari penelitian ini berupa sebuah aplikasi Augmented Reality yang \r\ndapat menyajikan informasi detail dalam bentuk digital. \r\n \r\nKata kunci  :  Augmented Reality, masjid, galeri, detail \r\n \r\nxiv + 60 halaman; 53 gambar; 2 tabel; 6 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(104,'1511502690','2021-02-05 14:01:47','212375','../files/1511502690.pdf',' \r\n \r\nNIM : 1511502690 \r\nNama : Fandy Laksono \r\n \r\nJudul : Penerapan Teknologi Augmented Reality dengan Metode Marker Based \r\nTracking untuk  Pengenalan  Lingkungan  Sekolah  pada  SMK  An-\r\nNurmaniyah Tangerang \r\n \r\n \r\nPengenalan  lingkungan  sekolah  pada  SMK  An-Nurmaniyah  awalnya \r\nmasih menggunakan sebuah brosur yang dirasa kurang efisien dan kurang interaktif \r\ndalam  memperkenalkan  lingkungan  sekoah.  Meningkatnya  kebutuhan  manusia \r\nakan teknologi yang inovatif, sebagian besar calon siswa membutuhkan informasi \r\nseputar lingkungan sekolah dalam bentuk digital dengan media smartphone. Untuk \r\nitu diperlukan aplikasi yang dapat membantu memperkenalkan lingkungan sekolah \r\ndan beberapa fasilitas yang ada pada sekolah dengan penyajian informasi secara \r\nvisual yang lebih interaktif. Untuk menunjang penyajian informasi secara visual \r\ndengan  tampilam  yang  menarik,  dapat  dilakukan  dengan  cara  menerapkan \r\nteknologi Augmented Reality. Augmented Reality sebagai  media  yang  mampu \r\nmenengahi ide antara manusia dan komputer, manusia dan manusia. Sistem ini \r\ndibangun sebagai media untuk menampilkan informasi dari gedung, ruang kelas, \r\ndan beberapa fasilitas lainnya yang ada pada SMK An-Nurmaniyah Tangerang. \r\nTujuan  dari  pembuatan  penelitian  ini  adalah  membangun  aplikasi  untuk \r\nmenyediakan  informasi  kepada  pengguna  di  lingkungan  SMK  An-Nurmaniyah \r\nTangerang dengan aplikasi berbasis android, serta membuat tampilan informasi \r\ngedung  dan  tiap  fasilitas  pada  SMK  An-Nurmaniyah  Tangerang  secara  visual \r\ndengan  pemodelan  3D  menggunakan  teknologi Augmented  Reality menjadi \r\nmenarik dan interaktif bagi pengguna. Metode yang digunakan pada penerapan \r\nteknologi Augmented Reality ini yaitu dengan menggunakan metode marker based \r\ntracking. Metode ini digunakan karena mudah dalam pengimplementasiannya serta \r\nefektif  untuk  memperkenalkan  gedung  dan  beberapa  fasilitas  pada  SMK  An-\r\nNurmaniyah  Tangerang.  Hasil  pengujian  terhadap  responden  dari  aplikasi  ini \r\nmenghasilkan (80%) dan masuk dalam kategori setuju. Uji coba dilakukan terhadap \r\n40 responden dalam uji coba aplikasi dan juga dengan cara penyebaran kuisioner. \r\nBerdasarkan hasil uji coba, dapat disimpulkan bahwa aplikasi ini layak digunakan \r\nsebagai media pengenalan sekolah pada SMK An-Nurmaniyah Tangerang. \r\n \r\n \r\nKata Kunci :  Augmented Reality, Unity 3D, Vuforia, Pengenalan lingkungan \r\nsekolah, 3 Dimensi. \r\n \r\nxiv + 88 halaman: 32 Gambar: 24 Tabel: 21 Lampiran       \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(105,'1511502724','2021-02-05 14:01:47','244141','../files/1511502724.pdf',' \r\n \r\nIMPLEMENTASI DATA MINING MENGGUNAKAN ALGORITMA \r\nAPRIORI UNTUK MENINGKATKAN POLA PENJUALAN OBAT PADA \r\nAPOTIK PUSAKA ARTA  \r\n \r\nOleh : Ramadani Saputra (1511502724) \r\n \r\nDengan adanya kegiatan transaksi penjualan setiap hari, data semakin lama \r\nakan  semakin  bertambah  banyak.  Data  tersebut  tidak  hanya  berfungsi  sebagai \r\narsip  bagi  perusahaan,  data  tersebut  dapat  dimanfaatkan  dan  diolah  menjadi \r\ninformasi untuk meningkatan penjualan obat. Permasalahan yang sering timbul di \r\nApotik Pusaka Arta yaitu sering sekali penjualan obat yang diinginkan konsumen \r\ntidak  ada  atau  habis  karena apotek  tidak  memperhatikan  stok,  apotek tidak \r\nmemanfaatkan  data  transaksi  penjualan yang  ada  dan  biasanya  data  transaksi \r\npenjualan  tersebut  hanya menjadi arsip yang  tidak  dimanfaatkan.  Untuk \r\nmemecahkan  masalah  tersebut,  maka  dibuatlah  aplikasi Data mining \r\nmenggunakan Algoritma  Apriori metode  yang  akan  dipakai  penulis  dalam \r\nmenerapkan penelitian ini adalah Association Rules. Asociation Rule merupakan \r\nsuatu teknik dalam data mining untuk menentukan  hubungan antar item dalam \r\nsatu data  set (sekumpulan  data)  yang  telah  ditentukan.  Teknik  ini  mencari \r\nkemungkinan  kombinasi  yang  sering  muncul  (frequenct)  dari  suatu itemset \r\n(sekumpulan item).  Dalam  penelitian ini Association  Rule berfungsi  untuk \r\nmenganalisa  beberapa  sering  suatu  obat  yang  sering  dijual  secara  bersamaan, \r\nanalisis  ini  akan  ditinjau  dari  data  transaksi  yang  telah  terjadi. Penerapan \r\nAlgoritma Apriori dalam aplikasi ini berhasil mencari kombinasi item terbanyak \r\nberdasarkan data transaksi dan kemudian membentuk pola asosiasi dari kombinasi \r\nitem tersebut. Hasil aplikasi ini dapat mengetahui apa saja obat yang sering dibeli \r\noleh konsumen secara bersamaan sehingga dapat mengetahui pola penjualan obat. \r\n \r\nKata kunci :  Data Mining,  Algoritma Apriori, Association Rules, Penjualan     \r\n  Obat \r\n \r\n \r\nxii+69 halaman; 37 gambar; 24 tabel; 1 lampiran   Perpustakaan Universitas Budi Luhur\r\n'),(106,'1511502740','2021-02-05 14:01:47','20970','../files/1511502740.pdf',' \r\nAPLIKASI PENGENALAN JENIS-JENIS BINATANG PADA BINA \r\nKELUARGA BERENCANA PENDIDIKAN ANAK USIA DINI \r\nMENGGUNAKAN AUGMENTED REALITY BERBASIS ANDROID \r\n \r\nOleh : Rizqi Wahyudi (1511502740) \r\n \r\nKemajuan  teknologi  informasi  dan  komunikasi  akan  selalu  berkembang, \r\nperkembangan itu hadir untuk mempermudah manusia dalam melakukan berbagai \r\npekerjaan  dan  kegiatan  sehari-hari. Salah  satu  diantaranya  adalah  pendidikan, \r\ndengan  adanya  penerapan  teknologi  yang  canggih  tentunya  dapat  membantu \r\naktivitas dalam sistem belajar mengajar menjadi lebih mudah dan menyenangkan. \r\nPemanfaatan  teknologi  Informasi  dalam  proses  penyampaian  informasi \r\nmengalami  perkembangan  pesat.  Saat  ini,  teknologi  terbaru  yang  digunakan \r\ndalam  penyampaian  informasi  adalah Augmented  Reality (AR).  Di  dunia \r\npendidikan, AR dapat digunakan sebagai media pembelajaran baru untuk anak-\r\nanak. Augmented Reality sebagai metode Pengenalan Jenis-Jenis Binatang adalah \r\nsalah satu cara untuk mempelajari dan mengenalkan jenis binatang apa saja yang \r\nada didunia bukan hanya di lingkungan sekitar, pengenalan jenis-jenis binatang \r\nini  diharapkan  dapat  mempermudah  penyajian  informasi  secara  interaktif  dan \r\nreal-time pada  Bina  Keluarga  Berencana  Pendidikan  Anak  Usia  Dini  Wijaya \r\nKusuma.  Aplikasi  ini  berjalan  pada platform  mobile Android. Cara  kerja  dari \r\naplikasi ini adalah dengan melakukan scan terhadap marker menggunakan kamera \r\nsmartphone, lalu jika sudah terdeteksi maka akan menampilkan informasi dari alat \r\nmusik tersebut. Dalam pembuatan aplikasi ini ini penulis berharap agar berjalan \r\ndengan skema yang telah di rancang sedemikian rupa dan dapat menarik minat \r\nbelajar para murid agar tidak mudah bosan saat belajar di kelas. \r\n \r\n \r\nKata kunci: Augmented Reality, Vuforia, Smartphone, Android, Unity, PAUD \r\n \r\nxv+69 halaman; 35 gambar; 6 tabel; 11 lampiran \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(107,'1511502773','2021-02-05 14:01:48','39849','../files/1511502773.pdf',' \r\nIMPLEMENTASI WEB SERVICE BERBASIS REST DAN ALGORITMA \r\nVIGENERE CIPHER PADA MUST A FIRE OFFICE \r\nOleh : Wahiidah Zakiah (1511502773) \r\nE-commerce saat  ini  telah  menjadi  gaya  hidup  baru  masyarakat  dalam \r\nmelakukan transaksi apapun. Hal tersebut menjadi akses yang sangat mudah dan \r\ncepat dan mempermudah pelanggan dalam melakukan transaksi apapun dan di \r\nmana pun tanpa batasan waktu. Pelanggan juga dapat memesan jasa photography \r\nyang sesuai dengan keinginan mereka sendiri secara mudah dan cepat tanpa harus \r\ndatang  secara  langsung.  Selain  itu  kelebihan  kemajuan  tersebut  juga  tentunya \r\nmenjadi keuntungan sendiri bagi pemilik jasa, karena tidak membutuhkan biaya \r\nyang besar dalam memasarkan jasanya. Must A Fire Office merupakan perusahaan \r\npenyewaan dan jasa photography yang telah beroperasi sejak tahun 2017 . Untuk \r\nmembentuk  proses  bisnis  yang  skalabel  yang  dapat  diadaptasi  dengan  kondisi \r\njaman.  Maka  dibutuhkan  sebuah  aplikasi  yang  dapat  menghubungkan  antara \r\naplikasi dari berbagai platform yang berbeda dengan sistem yang dibuat. Untuk \r\ndapat mengatasi masalah tersebut maka dibutuhkan sebuah web service dengan \r\narsitektur  REST  yang  dapat  menghubungkan  antara  aplikasi  dari  berbagai \r\nperangkat yang berbeda. Karena data pribadi pelanggan sangat rawan untuk disalah \r\ngunakan  oleh  pihak  yang  tidak  bertanggung  jawab.  Untuk  dapat  menjamin \r\nkeamanan data pelanggan tersebut maka web service tersebut dilengkapi dengan \r\nenkripsi. Metode yang digunakan dalam melakukan enkripsi ini adalah Vigenere \r\nCipher. Tujuan dari penelitian ini adalah untuk menerapkan teknologi web service \r\ndengan arsitektur REST yang dapat digunakan oleh berbagai macam jenis client \r\nseperti aplikasi mobile, aplikasi web, dan aplikasi desktop yang dapat membantu \r\npelanggan Must A Fire Office dalam melakukan pemesanan jasa photography dan \r\njuga mempermudah perusahaan dalam menerima pesanan dari pelanggan. Sehingga \r\ndapat mempercepat proses pesanan. Penelitian ini juga akan menerapkan Algoritma \r\nVigenere  Cipher  sebagai  enkripsi  yang  bertujuan  untuk  mengamankan  data \r\npelanggan dan transaksi yang tersimpan dalam database. \r\n \r\nKata Kunci : REST API, Web Service, Vigenere Cipher, PHP, Android. \r\n  \r\nxii + 101 halaman; 82 gambar; 9 table; 1 lampiran \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(108,'1511502781','2021-02-05 14:01:48','345512','../files/1511502781.pdf',' \r\n \r\nSISTEM PENGAMANAN DATA GAMBAR MENGGUNAKAN \r\nKRIPTOGRAFI ALGORITMA RC4 DAN STEGANOGRAFI EOF PADA \r\nMEDIA VIDEO MP4 BERBASIS JAVA DESKTOP PADA \r\nKEMENTERIAN PENDIDIKAN DAN KEBUDAYAAN  \r\n \r\nOleh : Abid Fikriyan (1511502781) \r\n \r\n \r\nMasalah keamanan dan kerahasiaan data merupakan hal yang sangat penting \r\nbaik dalam suatu organisasi komersial, perguruan tinggi, lembaga pemerintahan, \r\nmaupun  individu.  Keamanan  data  gambar pada  Kementerian  Pendidikan  dan \r\nKebudayaan akan sangat berharga bila di dalamnya terdapat sebuah data dan tidak \r\nboleh diketahui oleh orang lain. Sebab itu dibutuhkan aplikasi yang dapat menjaga \r\nkerahasiaan terhadap data tersebut. Oleh karena itu dibangun sebuah aplikasi yang \r\nmemiliki  tingkat  keamanan  yang  cukup  tinggi  untuk  menjamin  keamanan dan \r\nkerahasiaan data - data penting pada Kementerian Pendidikan dan Kebudayaan. \r\nHal ini dilakukan untuk menjaga agar data tersebut jangan sampai di baca apalagi \r\ndibajak atau diubah oleh pihak yang tidak berwenang. Sehingga untuk mencegah \r\nterjadinya hal - hal yang tidak di inginkan tersebut salah satu cara adalah dengan \r\nmemanfaatkan kriptografi dan steganografi, yaitu salah satu teknik mengenkripsi \r\ndata sehingga orang luar tidak dapat melihat data asli dari file gambar yang sudah \r\ndi  enkripsi  dapat  dilakukan dengan cara mengembalikannya ke bentuk  semula \r\nyaitu dengan cara di dekripsi, sehingga data asli dapat di lihat seperti semula. \r\nPada tugas akhir ini, kriptografi yang di gunakan adalah algoritma Rivest Code 4 \r\n(RC4) dan steganografi dengan menggunakan metode End Of File (EOF). Tujuan \r\ndi buatnya sistem keamanan file gambar atau data dalam gambar tersebut agar \r\narsip tidak dicuri, mengalami kerusakan dan penyalahgunaan data. Aplikasi ini \r\ndibangun  dengan  menggunakan  bahasa  pemograman java berbasis desktop. \r\nDengan sistem  keamanan file gambar  ini  di  harapkan  dapat  melindungi  data \r\npenting pada Kementrian pendidikan dan Kebudayaan. \r\nKata kunci : Kriptografi, RC4, Steganografi, EOF \r\nxii + 69 Halaman; 1 Tabel; 56 Gambar; 4 Lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(109,'1511502823','2021-02-05 14:01:48','21748','../files/1511502823.pdf',' \r\nData Mining Klasifikasi Berbasis Web Untuk Prediksi Perpanjangan Paket \r\nInternet Dengan Algoritma NaÃ¯ve Bayes Di PT Sewiwi Indonesia \r\n \r\nOleh :Ikbal Yantoro (1511502823) \r\n \r\nInternet Service Provider adalah  badan usaha  yang memperdagangkan koneksi \r\ninternet atau sejenisnya kepada pelanggan. Internet merupakan media informasi \r\nyang tidak akan bisa lepas dari kehidupan masyarakat saat ini. Koneksi internet \r\ntidak hanya dibutuhkan bagi per orangan saja, melainkan bagi lingkup yang sangat \r\nluas,  seperti  perusahaan  dan perkantoran.  Tidak  sedikit  perusahaan  yang  ingin \r\nmenambahkan  paketan internetan  mereka demi mendapatkan  hasil  kerja  yang \r\nmaksimal.. Di masa sekarang teknologi basis data telah berkembang pesat maka \r\nmuncul kebutuhan untuk menyimpan informasi yang lebih dari data yang tersimpan \r\ndalam basis data yaitu Pengetahuan Knowledge. Informasi yang diinginkan tidak \r\ndapat  diperoleh  dengan  mudah  sebab  volume  data yang  besar.  Sehingga  di \r\nbutuhkan  suatu  metode  untuk  mendapatkan  pengetahuan  yang  tidak  terlihat  di \r\ndalam data namun potensial untuk digunakan yaitu metode Data Mining. maka akan \r\nmembahas tentang klasifikasi perpanjangan paket internet yang selama ini tidak \r\npernah dilakukan  untuk  menentukan  perpanjangan  paket internet  atau tidaknya \r\nsuatu pelanggan dengan menggunakan metode algoritma NaÃ¯ve Bayes. Atribut yang \r\ndigunakan  adalah Kota,  Usaha,  Nunggak,  Paket  dan  Layanan. Dari 30  data \r\npelanggan untuk dijadikan data latih dan digunakan 3 data pelanggan untuk data \r\ntraining yang diuji, diperoleh tingkat akurasi sebesar 73,33%, tingkat sensitivity \r\n(True Positive Rate (TP Rate) or Recall) sebesar 86,36%, tingkat specificity (False \r\nNegative  Rate  (FN  Rate)  or  Precision)  sebesar  79.16% di  mana  dari 30 data \r\npelanggan yang diuji terdapat 22 data pelanggan yang berhasil diklasifikasikan \r\ndengan benar. \r\n \r\nKata Kunci :  Data Mining, NaÃ¯ve Bayes, Klasifikasi, Internet Service Provider \r\n \r\nxiv+60 halaman; 31 gambar; 24 tabel; 2 lampiran   Perpustakaan Universitas Budi Luhur\r\n'),(110,'1511502864','2021-02-05 14:01:48','68241','../files/1511502864.pdf','S \r\nAplikasi Pembelajaran Monumen di Dunia Berbasis Augmented Reality \r\ndengan Metode Marker Based Tracking pada SD Katolik Ricci 2 \r\nOleh : Fajar Satrio Wibowo (1511502864) \r\nPenelitian  ini  bertujuan  untuk  menerapkan  aplikasi Augmented  Reality \r\ndalam bidang pendidikan dengan menggunakan media berupa buku. Melalui buku \r\ntidak  jarang  siswa  dan  siswi  tidak  terlalu  antusias  untuk  belajar  karena  hanya \r\nmelihat  tulisan  dan  gambar  yang  berbentuk  2D  yang  hanya  terpaku  pada text \r\nbook. Sehingga terkadang guru harus mencari cara untuk meningkatkan antusias \r\nbelajar  dari  siswa  dan  siswinya.  Karena  semakin  berkembangnya  jaman  dan \r\nteknologi  maka  ada  jalan  keluar  untuk  mengatasi  permasalahan  tersebut  yaitu \r\ndengan  menggunakan  aplikasi Augmented  Reality  (AR). Aplikasi  ini  nantinya \r\nakan berisi tentang Augmented Reality (AR) dari beberapa monumen yang ada di \r\ndunia. Aplikasi ini dibangun dengan menggunakan bahasa pemograman C# dan \r\njuga menggunakan metode Marker Based Tracking yang nanti nya ada sebuah \r\nbuku sebagai salah satu marker penanda dan smartphone untuk mengscan marker \r\ntersebut.  Hasil  dari  penelitian  ini  nanti  nya  akan  menghasilkan  aplikasi \r\nAugmented Reality (AR) yang dapat menyajikan sebuah gambar 3D dan informasi \r\nmengenai monumen yang sudah dimasukan dalam database.  Berdasarkan hasil \r\nyang telah ujikan dalam kuisioner yang sudah disebar dan mendapakan hasil 83% \r\ndisimpulkan  bahwa  aplikasi  dapat  berjalan  dengan  baik  dan  dapat  membantu \r\ndalam kegiatan belajar mengajar. \r\nKata kunci :Augmented Reality,Android, Marker Based Tracking \r\nX-47; 37 Gambar; 9 Tabel; 31 Lampiran. \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(111,'1511502955','2021-02-05 14:01:48','34550','../files/1511502955.pdf',' \r\n \r\nSISTEM PENDUKUNG KEPUTUSAN MENGGUNAKAN METODE \r\nSIMPLE ADDITIVE WEIGHTING (SAW) BERBASIS WEB UNTUK \r\nPEMILIHAN GURU TERBAIK PADA SMA NEGERI 3 TANGERANG \r\n \r\nOleh : Inayahtullah (1511502955) \r\n \r\nPenelitian ini bertujuan untuk mengembangkan sistem pendukung keputusan yang \r\ndapat  memudahkan  dalam  proses  pemilihan  guru  terbaik  dan  memberikan \r\nalternatif peringkat hasil seleksi pemilihan guru terbaik. Kegiatan ini bertujuan \r\nuntuk memberikan penghargaan untuk Guru sesuai dengan UU No 14 tahun 2005 \r\ntentang  Guru  dan Dosen,  Pasal  14  Ayat  (1)  Butir  b,  bahwa  Guru  berhak \r\nmendapatkan promosi dan penghargaan sesuai dengan tugas dan prestasi kerja. \r\nMelalui penghargaan ini setiap guru diharapkan akan termotivasi untuk menjadi \r\nlebih baik dan selalu meningkatkan kualitas. Adapun permasalahan yang dihadapi \r\nyaitu adanya kesulitan dalam menentukan keputusan siapa yang terpilih menjadi \r\nguru terbaik dengan kriteria-kriteria sudah ditentukan pasti dengan cepat. Untuk \r\nmengatasi  permasalahan  tersebut  maka  dirancang  sebuah  sistem  pendukung \r\nkeputusan untuk pemilihan guru terbaik menggunakan Metode Simple Additive \r\nWeighting (SAW).  Adapun  kriteria  yang  dipakai  yaitu  nilai  absensi,  gaji, \r\npembelajaran, personality dan prestasi. Sistem ini juga dapat menampilkan hasil \r\nperangkingan guru terbaik berdasarkan hasil perhitungan metode SAW. Sistem \r\npendukung  keputusan  pemilihan  guru  terbaik  pada  SMA  Negeri  3  Tangerang \r\ndengan metode SAW ini dapat membantu mempermudah pelaksanaan pemilihan \r\nguru terbaik dan memberikan alternatif hasil perangkingan dengan metode SAW. \r\nPenelitian  selanjutnya  disarankan  untuk  mengembangkan  sistem  pendukung \r\nkeputusan  pemilihan  guru  terbaik  dengan  menggunakan  metode  yang  berbeda \r\natau mengkombinasikan metode SAW dengan metode lainnya. \r\n \r\nKata Kunci : Sistem Pendukung Keputusan, Simple Additive Weighting, Guru \r\nTerbaik \r\n \r\nxv+85 halaman; 74 gambar; 18 tabel; 1 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(112,'1511502963','2021-02-05 14:01:48','36280','../files/1511502963.pdf',' \r\n \r\nPENGAMANAN FILE MENGGUNAKAN KRIPTOGRAFI \r\nDENGAN METODE AES-128 BERBASIS WEB DI KOMITE \r\nNASIONAL KESELAMATAN TRANSPORTASI \r\n \r\nOleh : Dian Widyawan (1511502963)  \r\n \r\nKriptografi  adalah  ilmu  dan  seni  untuk  menjaga  kerahasiaan  pesan  dengan  cara \r\nmenyandikannya  kedalam  bentuk  yang  tidak  dapat  dimengerti  lagi  maknanya.  Data \r\nadalah catatan atas  kumpulan  fakta  atau  suatu variable yang  bentuknya  dapat  berupa \r\nangka, kata-kata atau citra. Namun, terkadang data yang bersifat private sering terjadinya \r\nkebocoran dan kehilangan data. Penggunaan komputer menjadi suatu kebutuhan yang \r\ntidak  dapat  dipisahkan  lagi  untuk  disetiap  kegiatan,  tidak  terkecuali  dalam  Komite \r\nNasional Keselamatan Transportasi bekerja dibidang investigasi. Demi kelancaran dalam \r\nmelakukan  investigasi  untuk  itu  dibutuhkan  suatu  aplikasi  yang  dapat  menjaga \r\nkerahasiaan  data  tersebut. Penelitian  ini  bertujuan  untuk  menghasilkan  aplikasi untuk \r\nmembantu  dalam  proses  pengamanan  data.  Aplikasi  ini  dibangun  berbasis web dan \r\nmenggunakan php sebagai bahasa pemrogramannya dan menggunakan metode Advanced \r\nEncryption  Standard (AES)  128  bit. Metode Advanced  Encryption  Standard (AES) \r\nmerupakan standar enkripsi dengan kunci-simetris dengan ukuran kunci yang bervariasi \r\nyaitu 128 bit, 192 bit, dan 256 bit. Dari hasil implementasi diperoleh kesimpulan bahwa \r\naplikasi  mampu  mengamankan file investigasi dari  yang  semula  berbentuk plaintext \r\nmenjadi chipertext dengan hasil akhir file yang tidak dapat dimengerti lagi maknanya. \r\nKata kunci : Kriptografi, Advanced Encryption Standard, File  \r\n \r\nxiii+59 halaman; 67 gambar; 25 tabel; 2 lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(113,'1511503011','2021-02-05 14:01:48','242753','../files/1511503011.pdf',' \r\n \r\nSISTEM KENDALI OTOMATIS SUHU DAN KELEMBABAN PADA \r\nMODEL INKUBATOR HEWAN PELIHARAAN DENGAN \r\nMENGGUNAKAN SENSOR DHT11 DAN DHT22 BERBASIS \r\nMIKROKONTROLER ARDUINO UNO R3 \r\n \r\nOleh : Muhammad Fakhri Ammarrizky (1511503011) \r\n \r\nManusia dan hewan sudah sejak dahulu hidup berdampingan. Hewan memiliki \r\nperan dalam kelangsungan hidup manusia mulai dari sumber pangan, digunakan \r\nsebagai media trasnportasi bahkan dipelihara sebagai teman hidup. Ada banyak \r\nmanusia yang memilih untuk tinggal hidup dengan hewan peliharaannya salah satu \r\ncontoh hewan yang biasa di pelihara adalah hewan bertubuh kecil seperti kucing, \r\nkelinci, anjing, ikan, burung dan hewan bertubuh kecil lainnya. Sebagai hewan \r\npeliharaan  mereka  memiliki  ketergantungan  hidup  kepada  manusia  mulai  dari \r\npemberian makan, minum, kebutuhan kebersihan, kandang tempat tinggal, dan juga \r\nkesehatan mereka. Ketika jatuh sakit hewan peliharaan membutuhkan perhatian \r\nkhusus  dari  pemiliknya  dan  membutuhkan  perawatan  dan  obat-obatan  seperti \r\nmanusia. Untuk merawat dan menyembukan hewan tersebut dibutuhkan dokter \r\nhewan dan ruang khusus untuk merawat hewan yang sedang sakit tersebut. Cara \r\nmerawat hewan yang sakit adalah dengan memisahkannya pada ruang khusus agar \r\npenyakit tidak menular dan kenyamanan hewan terjaga agar bisa segera sembuh. \r\nUntuk memenuhi kebutuhan tersebut di Pet Shop Indonesia, penulis mengusulkan \r\npembuatan incubator untuk merawat hewan yang sakit. Inkubator yang dibuat untuk \r\nmenghangatkan  suhu  dan  menjaga  kelembaban  pada  ruang  yang  dibutuhkan. \r\nDengan menggunakan bantuan sensor suhu dan kelembaban DHT11 dan DHT22 \r\nserta mikrokontroler dibuat model alat yang dapat mengendalikan pemanas dan \r\njuga kipas untuk menyesuaikan dengan kebutuhan suhu dan kelembaban ruang \r\nrawat tersebut secara otomatis. \r\n \r\nKata Kunci : Inkubator, Sensor suhu dan kelembaban,mikrokontroler, Pengendali \r\nsuhu otomatis, DHT11,DHT22 \r\n \r\nxiv+54 halaman; 45 gambar; 6 tabel; 2 lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(114,'1511503029','2021-02-05 14:01:48','7357','../files/1511503029.pdf',' \r\n \r\nGAME EDUKASI NILAI KEBUDILUHURAN MENGGUNAKAN \r\nALGORITMA A* (A-STAR) BERBASIS DEKSTOP PADA RA AL-\r\nFURQON GANDUL. \r\n \r\nBudi luhur mempunyai nilai-nilai baik yang diterapkan dalam lingkungan \r\nyayasan pendidikan Budi Luhur Cakti. Budi Luhur terdiri dari dua kata \r\nyaitu budi yang berarti perilaku dan luhur yang berarti baik. Untuk \r\nmemperkenalkan nilai-nilai budi luhur kepada masyarakat luas maka \r\npeneliti membuat sebuah game edukasi bertema adventure yang berbasis \r\ndekstop. RA (Raudhatul Athfal) Al-Furqon Gandul memiliki visi \r\nmewujudkan generasi yang beriman, bertaqwa, berakhlaqul karimah, \r\nkreatif, cerdas dan mandiri. Hal ini sesuai dengan tujuan peneliti membuat \r\ngame edukasi nilai kebudiluhuran. Selain untuk mengenalkan nilai-nilai \r\nbudi luhur, game ini juga bertujuan sebagai sarana edukasi mengenai nilai \r\nmoral. Dengan harapan murid dapat mengambil contoh dan menerapkan \r\nnilai-nilai yang diterapkan dalam game. Dalam mengimplementasikan game \r\nini peneliti menggunakan algoritma A* (A-Star) dan Unity 3D \r\n \r\nKata kunci: Game edukasi, Algoritma A*(A-Star), Unity 3D \r\nxiii+41 halaman; 4 tabel; 24 gambar; 3 lampiran. '),(115,'1511503037','2021-02-05 14:01:48','50933','../files/1511503037.pdf',' \r\n \r\nIMPLEMENTASI GAME THIRD PERSON METODE FINITE STATE \r\nMACHINE UNTUK GAME BATTLE MONSTERS DENGAN \r\nALGORITMA A* PADA PT. MATATA CORP \r\n \r\nPermainan  atau  sering  disebut  dengan game merupakan  suatu  hiburan  yang \r\ndiminati dan dimainkan baik dari dikalangan anakanak hingga dewasa. Pada era \r\ndigital  banyak game sekarang  menggunakan  AI  untuk  meningkatkan  kualitas \r\npermainan. Kecerdasan Buatan (Artifial Intelegence) merupakan bagian bidang \r\nilmu yang  dapat  menirukan  tingkah  laku  dan  fungsi  otak manusia  agar  dapat \r\nmelakukan pekerjaan seperti yang dapat dilakukan manusia. Hal ini menyebabkan \r\nlahirnya bidang  teknologi  yang  dapat  dikatakan  bersifat  sistem  cerdas,  dan \r\nkhususnya  pada perkembangan game modern  saat  ini.  Dengan  adanya game \r\nberbasis  AI  ini  membuat ara  pemain  terlibat  untuk  mengasah  dan  mengatur \r\nstrategi untuk mengalahkan lawan main dari AI tersebut. TPS atau Third Person \r\nShooter adalah jenis game yang mengutamakan kecepatan gerakan character kita \r\ndalam permainan. Dalam jenis ini akan lebih banyak baku tembak serta kita harus \r\nberpetualang dan bertahan selama mungkin hingga permainan berakhir. Disebut \r\nThird Person Shooter karena sudut pandang dalam game jenis ini adalah sudut \r\npandang  orang  ketiga.  Untuk  menciptakan AI  yang  memiliki  tindakan  sesuai \r\nkeadaan untuk game TPS, Pada game Battle Monsters merupakan permainan yang \r\nbertujuan  mengalahkan  para monsters yang menghadang  dan  menyelamatkan \r\ntemannya  yang  dikurung  di  dalam  pulau  yang  berisi dengan monsters.  Pada \r\npermainan Battle  Monsters pemain  akan  masuk  ke storyline atau  disebut  alur \r\ncerita  yang  akan  membuat  cerita  menjadi  lebih  menarik  dan real pada  saat \r\npermainan dijalankan. Metode yang digunakan untuk permainan Battle Monsters \r\nini menggunakan metode Finite State Machine (FSM) sebagai tingkah laku untuk \r\nmenentukan State (Keadaan), Event (Kejadian), dan Action (Aksi). Algoritma A* \r\nmerupakan  salah  satu  contoh  algoritma  pencarian  jalur  terpendek  yang  cukup \r\npopular di dunia yang memiliki lebih banyak literatur. Dengan riset ini, penulis \r\nakan mengimplementasikan  Algoritma  A*  pada game TPS  menggunakan \r\nframework unity. Sebagai hasil akhir, didapatkan game TPS yang memiliki AI \r\nberbasis  algoritma  A* untuk  pencarian  jalur  terpendek  yang  berguna  untuk \r\nmenuju ke pemain dan juga menggunakan metode FSM untuk dapat mendeteksi \r\ndan untuk menentukan sistem patroli dan ketika sudah mendeteksi keberadaan \r\npemain  yang  akan  melakukan  aksi serangan  pada  musuh  ke  pemain  tanpa \r\nmembutuhkan pengguna game lain. \r\n \r\nKata Kunci : Algoritma A*, Artifical Intelegence, Single Player, Third Person, \r\nFinite State Machine \r\nXii+ 98 Hal; 73 Gambar; 3 Tabel; 1 Lampiran '),(116,'1511503086','2021-02-05 14:01:48','289215','../files/1511503086.pdf',' \r\n \r\nIMPLEMENTASI ALGORITMA RC4 UNTUK KEAMANAN DATABASE \r\nAPLIKASI STOK BARANG BERBASIS WEB PADA KFC RAMAYANA \r\nCIPUTAT \r\n \r\nOleh : Lintang Bagus Nusantoro (1511503086) \r\n \r\nSistem database (basis data) telah menjadi simbol dari salah satu bentuk aset \r\nyang paling berharga seiring dengan perkembangan teknologi dalam dunia bisnis. \r\nDengan  semakin  luasnya  penggunaan  sistem database,  pengamanan  terhadap \r\ninformasi  di  dalamnya  pun  menjadi  sangat  dibutuhkan  untuk  melindungi  dari \r\nberbagai macam ancaman seperti pembacaan data, manipulasi data dan yang lebih \r\nparah adalah perusakan data oleh pihak yang tidak berwenang. Teknik kriptografi \r\nmenjadi  salah  satu  alternatif  solusi  yang  dapat  digunakan  dalam  pengamanan \r\ndatabase.  Salah  satu  cara  untuk  menjaga  keamanan database  tersebut  adalah \r\nmenggunakan teknik enkripsi. Adapun metode yang digunakan untuk pengamanan \r\ndatabase  adalah  dengan  enkripsi stream  cipher RC4  karena  metode  tersebut \r\nmempunyai kelebihan dalam kecepatan pemrosesan dan tingkat keamanan yang \r\ncukup tinggi. Dengan teknik ini, informasi yang terdapat dalam database hanya \r\ndapat dilihat oleh pihak yang memiliki kewenangan. Metode algoritma RC4 (Rivest \r\nCode  4) stream  cipher termasuk  ke  dalam  kriptografi  kunci  simetris,  yaitu \r\nalgoritma  kriptografi  yang  menggunakan  kunci sama  pada  proses  enkripsi  dan \r\ndekripsi. Stock opname merupakan kegiatan perhitungan persediaan fisik (barang \r\ndagang) atau stok yang berada di dalam toko atau gudang. Aplikasi keamanan \r\ndatabase stok barang dibuat untuk mempermudah pegawai KFC Ramayana Ciputat \r\ndalam melakukan proses stock opname. Hasil penelitian menunjukkan database \r\ndapat terenkripsi dengan baik sehingga data tidak dapat dibaca oleh pihak yang \r\ntidak berwenang. \r\n \r\nKata kunci :  RC4, database, enkripsi, dekripsi \r\n \r\n \r\nxii+79 halaman; 72 gambar; 12 tabel; 1 lampiran    \r\n'),(117,'1511503144','2021-02-05 14:01:48','117254','../files/1511503144.pdf',' PENGEMBANGAN GAME RACING SUNDAY MORNING RACE DENGAN METODE MULTIMEDIA DEVELOPMENT LIFE CYCLE (MDLC) MENGGUNAKAN UNITY 3D Oleh : Fadhil Hilmi Prasetia (1511503144)   Game merupakan jenis hiburan yang disukai oleh hampir semua kalangan orang,  mulai  dari  anak-anak,  dewasa,  sampai  yang  sudah  tua. Masalah  yang dihadapi dalam penelitian ini yaitu cara membuat game 3 dimensi dengan genre racing yang dapat dimainkan oleh semua kalangan dengan menggunakan metode pengembangan Multimedia Development  Life  Cycle (MDLC). Unity  3D merupakan salah satu game development engine yang sangat umum digunakan karena user friendly yang ditawarkan. Dengan menggunakan metode Multimedia Development Life Cycle (MDLC), yaitu suatu tahap yang di dalamnya terdapat pengonsepan,  perancangan,  pengumpulan  bahan,  pembuatan,  testing,  dan  yang terakhir distribusi. Dengan MDLC ini, game yang dibuat akan mendapatkan hasil akhir yang diharapkan, akurat, serta optimal. Manfaat dari penelitian ini adalah untuk mengetahui cara penerapan Multimedia Development Life Cycle (MDLC) dalam pengembangan suatu game, agar game yang dikembangkan lebih optimal dan juga untuk mengetahui cara menghubungkan fungsi dari satu script ke script yang lain dengan Unity 3D dan juga bahasa pemrograman C#. Hasil penelitian adalah sebuah game racing yang fungsional.  Kata Kunci : Racing, Game, Unity 3D, Multimedia Development Life Cycle xiv+70 halaman; 50 gambar; 2 tabel; 4 lampiran \r\n'),(118,'1511503169','2021-02-05 14:01:49','20643','../files/1511503169.pdf',' \r\n \r\nJudul :  IMPLEMENTASI ALGORITME KRIPTOGRAFI RIVEST CODE \r\n4 (RC4) UNTUK PENGAMANAN RECORD DATABASE \r\nBERBASIS WEB PADA KOPERASI RUMAH SAKIT PATRIA \r\nIKKT \r\n \r\nOleh : Hadhif Alifyanka Amien (1511503169) \r\n \r\nKoperasi Rumah Sakit Patria IKKT merupakan suatu wadah yang dapat \r\nmembantu para karyawan tetap pada Rumah Sakit Patria IKKT. Koperasi Rumah \r\nSakit Patria IKKT memiliki data-data penting seperti data anggota, data simpanan \r\ndata  pengambilan,  data  pinjaman,  dan  data  angsuran  yang  belum  diamankan, \r\nsehingga rentan  untuk disalah gunakan oleh orang yang tidak bertanggung jawab. \r\nDengan adanya masalah tersebut maka di buatlah aplikasi untuk menggunakan \r\npengaman record  database menggunakan rivest  code  4  (RC4).  Kriptografi \r\nmerupakan cara yang dilakukan pesan asli menjadi pesan acak yang sulit dipahami. \r\nDidalam kriptografi terdapat dua proses utama yaitu enkripsi dan dekripsi. Enkripsi \r\nmerupakan mengubah dua pesan asli menjadi pesan sandi, sedangkan dekripsi \r\nadalah proses pengembalian dari pesan sandi ke pesan aslinya. Metode yang di \r\npakai adalah Rivest Code 4  (RC4) karena metode ini merupakan salah satu metode \r\nyang hasil penyandian (ciphertext) memiliki ukuran panjang karakter yang sama \r\ndengan pesan aslinya (plaintext). Dengan metode Algoritme RC4 agar isi record \r\ndatabase  yang  disimpan  menjadi  lebih  aman  dan  tidak  ada  yang  dapat \r\nmengaksesnya. Penelitian ini menghasilkan keamanan database dengan metode \r\nRivest Code (RC4) berbasis Web. Aplikasi pengamanan database menggunakan \r\nbahasa pemrograman PHP dan menggunakan database MySQL. Beberapa hasil \r\npengujian  pada  aplikasi  ini  berhasil  melakukan  enkripsi  dan  dekripsi record \r\ndatabase. Aplikasi yang dibuat dapat memberikan keamanan lebih terhadap isi data \r\nyang bersifat rahasia ke dalam database tanpa takut adanya pihak lain yang tidak \r\nbertanggung jawab. \r\n \r\nKata Kunci : Rivect Code, Kriptografi, Metode \r\n \r\nXIV+101Halaman; 109 Gambar; 14 Tabel; Lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(119,'1511503185','2021-02-05 14:01:49','213029','../files/1511503185.pdf',' \r\n \r\nIMPLEMENTASI KRIPTOGRAFI PADA APLIKASI EMAIL DENGAN \r\nMETODE RIVEST CODE (RC4) PADA CV.KENCANA AGUNG \r\n \r\nOleh : Muhammad Viqi (1511503185) \r\n \r\nCV.Kencana  Agung  adalah  perusahaan  yang  bergerak  pada  bidang  jasa \r\npengangkutan sampah. Pada bidang pengangkutan sampah ini CV.Kencana Agung \r\nmenggunakan email dalam kegiatan bisnisnya seperti penawaran harga, Invoice, \r\ndan data penting lainnya. Maka dari itu CV. Kencana Agung membutuhkan sebuah \r\npengamanan data penting berupa lampiran-lampiran yang dikirim secara online \r\nmelalui  surat  elektronik  (Email).  Sebelumnya  pengiriman  surel  menggunakan \r\nlayanan milik Google dan masih menggunakan keamanan sederhana yang diberikan \r\noleh Google, sehingga tidak dapat menjamin keutuhan datanya sampai ke penerima. \r\nDalam melakukan pengiriman data yang paling penting adalah menjaga keutuhan \r\nserta keaslian dari data yang akan dikirim. Untuk meminimalkan serangan pada \r\ntransmisi data biasanya diterapkan kriptografi. Oleh karena itu, dibutuhkan aplikasi \r\npengamanan data untuk merahasiakan isi pesan perusahaan. Pada penelitian ini \r\nmetode  yang  dilakukan  untuk  pengamanan  data  perusahaan untuk  terjamin \r\nkeamanannya  dengan  menggunakan  metode  RC4,  yang  digunakan  untuk \r\nmengamankan data berupa teks maupun lampiran yang akan dikirim melalui email. \r\nDengan  metode  RC4  memungkinkan  pihak  perusahaan  untuk  menetapkan  diri \r\nmereka sebagai  satu-satunya pengirim  yang sah atau untuk  memastikan hanya \r\norang yang dituju yang dapat membaca pesan. Dengan adanya teknik Kriptografi \r\nini maka data perusahaan yang bersifat rahasia akan memiliki tingkat keamanan \r\nyang lebih baik karena berkas yang disimpan sudah mengalami pengacakan yang \r\nsulit dibaca oleh orang yang ingin mencuri data tersebut.  \r\n \r\nKata kunci : Kriptografi, Email, RC4 \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(120,'1511503201','2021-02-05 14:01:49','6020','../files/1511503201.pdf',' \r\n \r\nSISTEM PENDUKUNG KEPUTUSAN GIZI BALITA \r\nDENGAN METODE SIMPLE ADDICTIVE WEIGHTING \r\n(SAW) BERBASIS WEB PADA POSYANDU FLAMBOYAN II \r\nDI WILAYAH KELURAHAN REMPOA CIPUTAT TIMUR \r\n \r\nAplikasi  Sistem  Pendukung  Keputusan  Gizi  Balita  ini  dibuat  untuk mengatasi \r\nmasalah kurang akuratnya data hasil perhitungan status gizi balita jika dihitung \r\ndengan cara yang tradisional, selain itu aplikasi ini dibuat juga untuk membantu \r\npara  kader  di  Posyandu  Flamboyant  II  yang  sudah  mulai  kewalahan dalam \r\nmelakukan perhitungan gizi balita dengan cara yang tradisional. Kemudian hasil \r\npenyelesaian dari masalah tersebut adalah data yang dihitung melalui program \r\ndengan menggunakan metode SAW yang berbasis WEB lebih akurat dan dapat di \r\nbandingkan  dengan  hasil  perhitungan  melalui  cara  tradisional.  Dengan adanya \r\nprogram ini juga lebih membantu kinerja pada kader di Posyandu Flamboyant II \r\ndalam  perhitungan  status  gizi.  Kesimpulan  dari  pembuatan  Sistem Pendukung \r\nKeputusan Gizi Balita ini adalah, diperlukannya suatu program untuk menunjang \r\nkinerja para kader di Posyandu Flamboyant II untuk perhitungan gizi balita, agar \r\nhasilnya  lebih  akurat  dan  ibu-ibu  yang  mempunyai  balita  dapat merasa  lebih \r\ntenang dengan status gizi balitanya dan juga para orang tua dapat mengetahui \r\nasupan makanan yang tepat dan juga mengetahui tumbuh kembang balitanya. \r\n \r\nKata Kunci : Sistem Pendukung Keputusan, Gizi Balita, Simple Addictive \r\nWeighting (SAW). \r\nxiii+ 82 halaman; 11 tabel; 64 gambar; 1 lampiran. '),(121,'1511503268','2021-02-05 14:01:49','58773','../files/1511503268.pdf',' \r\n \r\nIMPLEMENTASI SISTEM PENDUKUNG KEPUTUSAN UNTUK \r\nMEMILIH SISWA TELADAN DENGAN METODE SIMPLE ADDITIVE \r\nWEIGHTING BERBASIS WEB PADA MTS MIFTAHUL HUDA \r\n \r\nOleh : Abdul Ajis (1511503268) \r\n \r\nMTs  Miftahul  Huda  merupakan  salah  satu institusi pendidikan  swasta  di \r\nTasikmalaya yang mendidik siswanya agar mempunyai sikap dan kepribadian yang \r\nbaik agar menjadi panutan bagi lingkung sekolah dan masyarakat. Oleh karena itu \r\nMTs  Miftahul  Huda  selalu  melakukan  pemilihan  siswa  teladan  disetiap  akhir \r\nsemester-nya. Namun penilaian siswa teladan masih bersifat subjektif dari wali \r\nkelasnya dan hanya menilai dari segi ranking nya saja. Sehingga banyak siswa yang \r\nmengeluh  tentang  keputusan  tersebut. Untuk  mengatasi  hal  ini  maka  perlu \r\ndirancang  adanya  sistem  pendukung  keputusan.  Sistem  Pendukung  Keputusan \r\n(SPK)  adalah  suatu  sistem  informasi  berbasis  komputer  untuk  menyediakan \r\ndukungan  kepada  pengambil  keputusan  dalam  memecahakan  masalah.  Metode \r\nyang  digunakan  adalah Simple  Additive  Weighting (SAW).  Metode  ini  dapat \r\nmelakukan penilaian secara lebih tepat karena didasarkan pada nilai kriteria dan \r\nbobot  yang  sudah  ditentukan. Hasil  dari  penelitian  ini  adalah  telah  berhasil \r\nmembuat aplikasi dalam menentukan siswa teladan dengan menghitung 5 kriteria \r\nyaitu nilai ketidakhadiran dengan bobot 20%, rata-rata raport dengan bobot 30%, \r\nkepribadian dengan bobot 20%, ekstrakurikuler dengan bobot 10% dan kedisplinan \r\ndengan  bobot  20%. Dengan  menggunakan sistem  pendukung  keputusan ini \r\ndiharapkan dapat membantu para guru untuk menentukan siswa teladan secara tepat \r\nkarena dapat menghitung berdasarkan kriteria dan bobot yang sudah ditentukan. \r\n \r\nKata kunci : Sistem Pendukung Keputusan, Simple Additive Weighting, Teladan \r\n \r\nxii+69 halaman; 51gambar; 20 tabel; 4 lampiran; \r\n \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(122,'1511503359','2021-02-05 14:01:49','188603','../files/1511503359.pdf',' \r\nAPLIKASI KRIPTOGRAFI KEAMANAN FILE MENGGUNAKAN \r\nALGORITMA ADVANCED ENCRYPTION STANDARD 128 (AES-128) \r\nBERBASIS WEB PADA PT. LINTAS NUSANTARA PERDANA \r\nOleh : Ikhsan As-Salafus Sholih (1511503359) \r\n \r\nPT. Lintas Nusantara Perdana merupakan perusahaan yang bergerak dalam bidang \r\nJasa Transportasi atau lazimnya disebut \'Ekspedisi\' dengan menggunakan moda \r\ntransportasi kereta api untuk mengirim barang. Perusahaan ini sudah mempunyai \r\n75 cabang yang tersebar di Pulau Jawa sampai dengan Pulau Bali. Dengan begitu \r\nPT. Lintas Nusantara Perdana memiliki banyak data penting yang perlu dijaga \r\nkerahasiannya  seperti  data  keuangan  dan  data  perpajakan  yang  tidak  bisa \r\ndisebarkan secara umum. Seiring berkembangnya teknologi yang semakin maju, \r\nmemanfaatkan  teknologi  di  bidang  keamanan  data  sangat  diperlukan  dari \r\nmenyimpan  data  sampai  mengelola  data  tersebut.  Data  yang  disimpan  harus \r\nterjamin keamanannya dari ancaman yang bisa mengancam kelanjutan dari suatu \r\nbadan usaha untuk terhindar dari manipulasi data, kerusakan data dan berbagai \r\nancaman yang bisa menjadi masalah. Untuk mengatasi masalah pada PT. Lintas \r\nNusantara Perdana maka diperlukan suatu aplikasi pengamanan data yang dapat \r\nmengamankan berkas file dokumen yang dimiliki. Aplikasi pengamanan data ini \r\nmemakai algoritma  kriptografi  AES-128  (Advanced  Encryption  Standard-128). \r\nAplikasi ini dibangun dengan bahasa pemrograman PHP berbasis web dan data \r\nyang bisa dienkripsi dan didekripsi dengan tipe file *.doc, *.xls, *.pdf, *.docx, \r\n*.xlsx, *.ppt, *.pptx, *.jpg, *.png. Aplikasi ini dapat mengamankan dan menjaga \r\nkerahasiaan data dan informasi pada PT. Lintas Nusantara Perdana dari terjadinya \r\npencurian dan manipulasi data oleh pihak yang tidak berkepentingan.  \r\n \r\nKata kunci : Kriptografi, AES-128, PHP, File \r\nxiii +47 halaman , 42 gambar, 7 tabel, 1 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(123,'1511503383','2021-02-05 14:01:49','20799','../files/1511503383.pdf',' \r\nDETEKSI TRENDING TOPICS TWEET BAHASA INDONESIA \r\nMENGGUNAKAN METODE BNGRAM STUDI KASUS PT KOMPAS \r\nCYBER MEDIA (KOMPAS.COM) \r\n \r\nOleh : Qreesna Ramadhona Putra (1511503383) \r\n \r\nKompas.com merupakan sebuah portal berita dan artikel online di Indonesia yang \r\nberada  di bawah  naungan  PT  Kompas  Cyber  Media. Sebagai  media online, \r\nkompas.com dituntut menyajikan berita secara cepat dan relevan. Namun terkadang \r\nada peristiwa yang tidak tersampaikan kepada masyarakat karena kurangnya akses \r\ninformasi, terutama hal-hal yang berhubungan dengan topik bertema ekonomi. Hal \r\nini dapat diatasi dengan pengolahan teks atau text mining. Data yang digunakan \r\nberupa tweet dari Twitter, karena Twitter merupakan media sosial yang paling aktif \r\ndi Indonesia dan memiliki basis pengguna yang besar. Tweet yang dikumpulkan \r\nkemudian diolah untuk mendapatkan trending topics bertema ekonomi. Penelitian \r\nini bertujuan untuk membantu penyajian berita khususnya topik bertema ekonomi \r\npada hari berikutnya dari waktu pendeteksian tren yang bersumber dari streaming \r\ntweet pada Twitter, sehingga berita yang disajikan lebih relevan terhadap peristiwa \r\nyang sedang hangat diperbincangkan. Metode yang digunakan untuk mendeteksi \r\ntrending topics yaitu BNgram. Penelitian ini menghasilkan  Topic Recall, Keyword \r\nPrecision dan Keyword Recall pada deteksi trending topics terhadap dataset yang \r\ntelah diuji sebesar 0,67, 0,46 dan 0,42. \r\nKata Kunci : Text Mining, BNgram, Twitter, Trending Topics \r\n \r\nxiii+74 halaman; 45 gambar; 18 tabel; 1 lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(124,'1511503425','2021-02-05 14:01:49','58441','../files/1511503425.pdf',' \r\n \r\nJudul : PERANCANGAN APLIKASI  AUGMENTED  REALITY \r\nBERBASIS ANDROID SEBAGAI MEDIA PROMOSI PADA \r\nSMK KARTIKA X-2 JAKARTA \r\n \r\nPromosi merupakan suatu cara yang harus dilakukan setiap sekolah swasta \r\nuntuk  dapat  memperkenalkan  sekolahnya.  Promosi  yang  dilakukan  di  setiap \r\nsekolah  swasta saat  ini  masih banyak dilakukan  dengan  cara  menggunakan \r\nlembaran brosur. SMK Kartika X-2 Jakarta merupakan salah satu sekolah swasta \r\nyang masih menggunakan lembaran brosur untuk mempromosikan sekolahnya. \r\nPromosi dengan menggunakan lembaran brosur tentunya kurang interaktif sehingga  \r\ndaya tarik  calon siswa untuk masuk sekolah tersebut begitu rendah. Dengan adanya \r\nsuatu  aplikasi  yang  interaktif  tentunya  merupakan  suatu  keinginan  bagi  pihak \r\nsekolah  untuk  dapat mempromosikan  sekolahnya  dengan  cara  yang  interaktif \r\nsehingga dapat meningkatkan daya tarik calon siswa yang akan masuk di sekolah \r\ntersebut. Perkembangan  teknologi  yang  begitu  pesat,  bisa  dimanfaatkan  untuk \r\nmembuat sebuah aplikasi untuk media promosi yang interaktif . Oleh karena itu, \r\ndengan memanfaatkan perkembangan teknologi informasi dan komunikasi maka \r\ndirancang sebuah aplikasi berbasis smartphone android yang dapat memberikan \r\ninformasi  secara virtual dan  interaktif. Augmented  reality merupakan  suatu \r\nteknologi informasi  dan  komunikasi yang  dapat  menampilkan informasi suatu \r\nbenda maya dua dimensi dan tiga dimensi ke dalam sebuah lingkungan nyata lalu \r\nmemproyeksikan  objek-objek secara virtual dan  juga realtime. Unity  3D \r\nmerupakan software (perangkat lunak) yang digunakan untuk membuat aplikasi \r\naugmented reality ini. Aplikasi augmented reality ini memerlukan sebuah marker \r\nuntuk dapat menampilkan objek 3D dengan cara mengarahkan kamera ke arah \r\nmarker tersebut. Pada aplikasi ini, gambar yang digunakan sebagai marker adalah \r\nsebuah gambar bentuk dua dimensi. Marker yang digunakan pada aplikasi ini \r\nadalah sebuah brosur yang telah dibuat oleh pihak sekolah. SketchUp merupakan \r\nsoftware yang digunakan untuk membuat objek 3D. Objek 3D akan tampil apabila \r\nproses tracking (pendeteksian) marker berhasil dilakukan dengan menggunakan \r\nkamera. Aplikasi augmented  reality ini  memberikan  kemudahan  dalam \r\nmenyampaikan  suatu  infromasi  dan  juga  lebih  interaktif. Aplikasi augmented \r\nreality ini dapat membantu pihak sekolah untuk memberikan informasi tentang \r\nsekolahnya sehingga meningkatkan minat calon siswa yang akan masuk sekolah \r\ntersebut dan nama sekolah tersebut menjadi dikenal oleh kalangan masyarakat luas.  \r\n \r\nKata kunci : Promosi, Android, Augmented Reality, Virtual, 3D \r\n \r\nxiii+69 halaman, 51 gambar, 5 tabel, 3 lampiran \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(125,'1511503441','2021-02-05 14:01:49','7136','../files/1511503441.pdf',' \r\n \r\nIMPLEMENTASI SISTEM PENUNJANG KEPUTUSAN PENILAIAN \r\nKINERJA GURU PADA MADRASAH TSANAWIYAH NEGERI 27 \r\nJAKARTA \r\n \r\nMadrasah  Tsanawiyah  Negeri  (MTSN)  27  Jakarta  merupakan  sebuah lembaga \r\ntempat anak didik memperoleh pendidikan dan pelajaran yang diberikan guru. \r\nMTSN  27  Jakarta  mempersiapkan  para  pendidik  yang  berkualitas  dalam \r\nmelaksanakan  pengajaran  terhadap  anak  didiknya  agar  mampu  menghasilkan \r\nlulusan terbaik dan mempunyai akhlak yang mulia. MTSN 27 Jakarta melakukan \r\npenilaian kinerja guru setiap 6 bulan untuk memonitor perkembangan kualitas \r\nguru serta memantau kinerja para guru. Penilaian terhadap kinerja guru dianggap \r\npenting oleh pihak sekolah untuk meningkatkan kualitas guru secara pribadi serta \r\nmeningkatkan akreditasi MTSN 27 Jakarta. Selama ini proses penilaian kinerja \r\nguru  di  MTSN  27  Jakarta  masih  menggunakan  lembaran  kertas  kemudian \r\ndikumpulkan  di  staf  akademik.  Masalah  pada  proses  penilaian  tersebut \r\nmemerlukan perhitungan  yang  sangat  rumit  dan  panjang.  Sistem  saat  ini \r\nmemerlukan waktu selama 2 hari dan memungkinkan terjadinya kesalahan pada \r\nlaporan atau rekap pada penilaian Penelitian ini bertujuan untuk menyelesaikan \r\nmasalah penilaian kinerja guru menggunakan metode Simple Additive Weighting \r\n(SAW).  SAW  dapat menentukan  nilai  bobot  untuk  setiap  atribut,  kemudian \r\nmelakukan  proses perankingan  yang  akan  menyeleksi  alternatif  terbaik  dari \r\nsejumlah  alternatif. Penelitian  ini  menghasilkan  rekomendasi  yang  lebih  cepat \r\nserta  keakuratan  sebesar 90%  dibanding  dengan  sistem  sebelumnya.  Sistem \r\npenunjang  keputusan  penilaian kinerja  guru  yang  dirancang  dapat  membantu \r\npihak sekolah dalam melakukan penilaian kinerja guru secara cepat dan akurat. \r\n \r\nKata kunci : Sistem penunjang keputusan, SAW, penilaian kinerja guru \r\nxiv + 92 Halaman; 51 Gambar; 21 Tabel; 1 Lampiran '),(126,'1511503466','2021-02-05 14:01:49','22817','../files/1511503466.pdf',' \r\n \r\nIMPLEMENTASI DATA MINING CLUSTERING BERBASIS WEB \r\nUNTUK PENGELOMPOKKAN PROVINSI BERDASARKAN KONSUMSI \r\nBBM DENGAN ALGORITME K-MEANS PADA BPH MIGAS \r\n \r\nOleh : Indah Rizky Mahartika (1511503466) \r\n \r\nBPH  Migas adalah suatu  badan  yang  dibentuk  untuk  melakukan  pengaturan \r\npengawasan terhadap penyediaan dan pendistribusian Bahan Bakar Minyak dan \r\nGas Bumi serta Pengangkutan Gas Bumi melalui pipa pada Kegiatan Usaha Hilir. \r\nPada BPH Migas, banyak sekali data dari kegiatan penyaluran BBM yang tercatat. \r\nData tersebut cenderung hanya dijadikan arsip dan laporan. Untuk mengoptimalkan \r\npemanfaatan data tersebut maka dibutuhkan suatu sistem yang dapat mengolah data \r\nsupaya menjadi  suatu  informasi  yang  bermanfaat.  Salah  satunya  adalah \r\nmenggunakan teknik data mining. Pada penulisan tugas akhir ini, dibangun suatu \r\nsistem yang dapat mengelompokkan provinsi yang ada di Indonesia berdasarkan \r\ntingkat  konsumsi  BBM menggunakan data penyaluran  BBM dari BPH  Migas. \r\nPendekatan  yang  dilakukan  adalah  menggunakan  algoritme  K-Means,  dengan \r\nmetode pengukuran jarak Euclidean Distance, serta atribut yang digunakan adalah \r\njumlah JBU (Jenis BBM Umum) by order dan jumlah volumenya. Dataset yang \r\ndigunakan adalah dataset penyaluran BBM dalam 12 bulan selama tahun 2018. \r\nHasil diperoleh setelah melakukan iterasi sebanyak empat kali. Setelah melakukan \r\niterasi keempat, centroid tidak berubah dari centroid sebelumnya yaitu centroid \r\nhasil dari iterasi ketiga sehingga iterasi dihentikan. Hasil akhir yang diperoleh dari \r\npenelitian ini yaitu program mampu mengklasterisasi sesuai kebutuhan. Misalnya \r\ndibutuhkan 3 cluster dengan spesifikasi berbeda. Cluster 1 merupakan kelompok \r\nprovinsi dengan pesanan JBU rendah dan volume BBM-nya juga rendah (anggota \r\nterdiri  dari Aceh,  Bali,  gorontalo,  Kalimantan  Barat,  Kalimantan  Selatan, \r\nKalimantan Tengah, Kalimantan Timur, Kalimantan Utara,  Lampung,  Maluku, \r\nMaluku Utara, Nusa Tenggara Barat, Nusa Tanggara Timur, Papua, Papua Barat, \r\nSulawesi Barat, Sulawesi Selatan, Sulawesi Tengah, Sulawesi Tenggara, Sulawesi \r\nUtara), sedangkan cluster 2 merupakan sekumpulan provinsi dengan pesanan JBU \r\ntinggi namun volume BBM-nya sedang (anggota terdiri dari Banten, Yogyakata, \r\nJawa  Barat,  Jawa  Tengah,  Jawa  Timur),  dan cluster 3 merupakan  kelompok \r\nprovinsi dengan pesanan JBU sedang tapi volume BBM-nya tinggi (anggota terdiri \r\ndari Bengkulu,  DKI  Jakarta, Jambi, Bangka  Belitung,  Kepulauan  Riau,  Riau, \r\nSumatera Barat, Sumatera Selatan, Sumatra Utara). Evaluasi cluster menggunakan \r\nDavies  Bouldin  Index menghasilkan  nilai  0,32.  Semakin  kecil  nilai  DBI  atau \r\nsemakin mendekati 0, menunjukan bahwa cluster yang terbentuk relatif sangat baik \r\ndan ideal.  \r\n \r\nKata  Kunci  : Data Mining, Clustering, K-Means, Euclidean  Distance, Davies \r\nBouldin Index \r\nxiv+100 halaman; 25 gambar; 13 tabel; 4 lampiran Perpustakaan Universitas Budi Luhur\r\n'),(127,'1511503532','2021-02-05 14:01:49','76510','../files/1511503532.pdf',' \r\nKLASIFIKASI TWEET GEMPA BUMI BERBAHASA INDONESIA \r\nMENGGUNAKAN METODE NAÃVE BAYES CLASSIFIER PADA BADAN \r\nNASIONAL PENANGGULANGAN BENCANA (BNPB) \r\nOleh: Ramdhani Febriansyah (1511503532) \r\n \r\nSosial media menjadi kebutuhan primer manusia saat ini, bahkan dalam keadaan \r\nbencana.  Peran  sosial  media  sebagai  upaya  peringatan  bagi  daerah  terdampak \r\nbencana (post early warning system) sangatlah penting, karena informasi yang \r\ndisebarkan  secara  cepat  dalam  hitungan  menit  dapat  membantu  mengurangi \r\njatuhnya korban karena sifatnya yang public dan real-time. Sehingga dalam hal ini \r\nsosial media sangat berperan penting menjadi sumber data (data resource) dalam \r\nmisi  penyelamatan  oleh  tim  SAR.  Salah  satu  sumber  data  tersebut  biasanya \r\ndiperoleh dari tagar (keywords) pada Twitter, namun dalam hal ini terbatasnya \r\npenulisan  karakter  pada Twitter membuat  pengguna sering  menggunakan \r\nsingkatan kata dan ejaan kata yang salah. Oleh karena itu disini penulis akan \r\nmenggunakan metode klasifikasi dengan algoritme NaÃ¯ve Bayes yang ada pada \r\nsebuah tweet dalam  membantu  BNPB mengambil  informasi  bencana  gempa \r\ndengan  cepat  dan akurat. Hasil  penelitian  menunjukan  bahwa  aplikasi  ini \r\nmendukung  keakuratan  informasi  yang didapat  dengan  algoritme NaÃ¯ve  Bayes \r\nClassifier jika  data  latih (data  training) berjumlah  banyak.  Serta aplikasi text \r\nmining yang  sudah  berjalan  dengan  baik,  memudahkan  Badan  Nasional \r\nPenanggulangan Bencana (BNPB) menerima informasi terkait kebencanaan lebih \r\ncepat  dan  akurat. Namun  memiliki  kekurangan  yaitu  informasi  yang  didapat \r\nkurang spesifik dan proses klasifikasi algoritme belum dapat ditampilkan dalam \r\nUser Interface (UI). \r\nKata Kunci: Tweet, Gempa, NaÃ¯ve Bayes Classifier, Klasifikasi \r\n(XVI + 47 Halaman; 17 Gambar; 5 Tabel; 2 Lampiran) \r\n \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(128,'1511503581','2021-02-05 14:01:49','20756','../files/1511503581.pdf',' \r\n \r\nIMPLEMENTASI DATA MINING UNTUK MEMPREDIKSI \r\nPENERIMAAN PERMOHONAN CALON NASABAH ASURANSI \r\nKESEHATAN DENGAN MENGGUNAKAN ALGORITMA NAÃVE BAYES \r\nBERBASIS WEB PADA PT. ASURANSI SINARMAS \r\n \r\nOleh : Lady Caesar Sevika Detale (1511503581) \r\n \r\n \r\nKesehatan merupakan bagian  yang amat penting bagi  kehidupan manusia. PT. \r\nAsuransi Sinarmas adalah salah satu asuransi yang menyediakan produk asuransi \r\nkesehatan. Banyaknya masyarakat yang mendaftar dan mengajukan permohonan \r\nasuransi kesehatan, membuat pihak asuransi harus lebih memperhatikan mengenai \r\npenerimaan permohonan asuransi kesehatan. Hal tersebut dikarenakan pemberian \r\njaminan kesehatan memiliki resiko  yang cukup  tinggi. Di sisi  lain, banyaknya \r\nnasabah yang sering terlambat dan kurang peduli membayar premi, membuat pihak \r\nasuransi mengalami  kerugian  semakin  besar.  Maka  dari  itu, upaya untuk \r\nmeminimalisir  adanya permasalahan  tersebut,  pihak  asuransi  harus lebih \r\nmemperhatikan lagi terhadap penerimaan permohonan calon nasabah. Banyaknya \r\ndata historis penerimaan permohonan calon nasabah hanya dijadikan sebagai arsip \r\natau laporan yang disimpan dalam file Microsoft Excel, yang seharusnya dapat \r\ndimanfaatkan untuk memberikan hasil keputusan penerimaan permohonan calon \r\nnasabah yang akan datang. Oleh karena itu, penulis membuat sebuah sistem untuk \r\nmemprediksi penerimaan permohonan calon nasabah asuransi yang bersifat efektif \r\ndan tepat. Penelitian ini menggunakan Data Mining dengan algoritma NaÃ¯ve Bayes. \r\nDari hasil pengujian sebanyak 3 kali dengan menggunakan metode Holdout, yaitu \r\njumlah model data dan uji data sejumlah 80% 20%, 70% 30%, dan 60% 40% yang \r\nmemiliki  akurasi  berturut-turut  sebesar 75.19%,  72.86%,  72.06%  dengan  nilai \r\nprecision sebesar 77.27%, 75.61%, 73.87%, serta recall sebesar 91.4%, 89.86%, \r\n90.11%. \r\n \r\n \r\nKata kunci : Data Mining, Prediksi, Algoritma NaÃ¯ve Bayes, Metode Holdout. \r\n \r\n \r\nxv+78 halaman; 64 gambar; 16 tabel; 9 lampiran. \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(129,'1511510859','2021-02-05 14:01:49','127627','../files/1511510859.pdf',' \r\n IMPLEMENTASI ALGORITMA AES-128 (ADVANCED ENCRYPTION \r\nSTANDARD - 128) UNTUK DOKUMEN TRAN\r\nRENTCAR PARIWISATA \r\n \r\nKeamanan  data merupakan  salah  satu aspek  yang  sangat  penting dalam  dunia \r\ninformasi.  Terlebih  jika  informasi  yang disimpan  dan  dikirim bersifat  sangat \r\nrahasia, dimana pihak luar yang tidak diperbolehkan untuk mengetahuinya karena \r\njika data penting ini sehingga bocor kepihak yang tidak bertanggung jawab maka \r\nakan menimbulkan kerugian bagi pihak yang datanya dicuri. Salah satu cara yang \r\ndapat digunakan yaitu dengan melakukan pengacakan data/file yang biasa disebut \r\ndengan kriptografi, yaitu teknik mengubah data asli menjadi data yang tidak bisa \r\ndibaca tanpa pengetahuan khusus, untuk menangani permasalahan yang ada pada \r\nDavs  Rentcar Pariwisata.  Maka  dari itu  diperlukan  aplikasi  pengamanan  data \r\nyang  dapat mengamankan  berkas  file  yang  dimiliki. Advanced  Encryption \r\nStandard (AES) digunakan sebagai standar algoritma kriptografi dikolaborasikan \r\ndengan  kunci  yang  terlebih  dahulu  dilakukan  hash.  Algoritma Advanced \r\nEncryption  Standard (AES)  digunakan  pada  aplikasi  ini  untuk  mengenkripsi \r\ndokumen  transaksi,  Berdasarkan  implementasi  dan  uji  coba  program  aplikasi \r\nenkripsi dan dekripsi yang menggunakan algoritma AES (Advanced Encryption \r\nStandard) tersebut  mampu  mengamankan  isi database saat  proses input,  dan \r\nmengembalikan data seperti semula saat data tersebut ditampilkan  \r\n \r\nKata kunci : Kriptografi, AES (Advanced Encryption Standard), Encryption, \r\nDecryption \r\nix, 64 halaman; 49 gambar; 5 tabel; 1 lampiran '),(130,'1512300110','2021-02-05 14:01:50','104014','../files/1512300110.pdf',' \r\n  \r\nIMPLEMENTASI FIREWALL MENGGUNAKAN MIKROTIK \r\nPADA SMK PGRI 11 CILEDUG TANGERANG \r\n \r\nOleh: Sunan Akbar (NIM: 1512300110) \r\n \r\n Di era globalisasi modern saat ini, khususnya di bidang teknologi jaringan \r\ninternet telah mengalami perkembangan yang sangat pesat. Bahkan hampir seluruh lini \r\nkehidupan kita telah menggunakan teknologi tersebut dan telah merasakan manfaatnya, \r\ntidak  terkecuali  sudah  semakin  banyaknya  instansi  pendidikan  yang  sudah \r\nmenggunakan jaringan komputer sebagai sarana untuk membantu proses pembelajaran \r\noleh para staff pengajar atau para siswa ataupun untuk hanya sekedar melakukan \r\npertukaran data (data sharing). Namun beberapa orang yang tidak bijak menggunakan \r\nkomputer dan jaringan digunakan untuk hal yang tidak perlu seperti membuka situs \r\nonline yang berbau negatif, menonton video yang mengandung kekerasan dan hal - hal \r\nyang tidak diinginkan, dan sebagainya. Oleh karena itu disini penulis akan mencoba \r\nmelakukan implementasi firewall dengan menggunakan Mikrotik yang ada di instansi \r\nSMK PGRI 11 Ciledug Tangerang yang bertujuan agar para siswa yang menggunakan \r\nkamputer lebih bijak menggunakan komputer untuk kepentingan pendidikan sekolah \r\nsekaligus memblokir beberapa situs yang tidak diinginkan baik para siswa maupun \r\npengguna  lab  komputer  sekolah.  Pada  kasus  ini  penulis  menyarankan  konfigurasi \r\nfirewall pada instansi SMK PGRI 11 CILEDUG TANGERANG menggunakan Router \r\nMikrotik, tujuannya untuk memblokir akses asing, dimana network bisa masuk dan \r\nkeluar melalui router bagi network mana saja. \r\n \r\nKata Kunci : Internet, Firewall, Mikrotik \r\nVIII + 55 Halaman, 29 Gambar, 2 Lampiran, 7 Tabel Perpustakaan Universitas Budi Luhur\r\n'),(131,'1512300227','2021-02-05 14:01:50','20824','../files/1512300227.pdf',' \r\n \r\nIMPLEMENTASI APLIKASI INTERAKTIF PEMBELAJARAN \r\nMENGENAL ABJAD, ANGKA, DAN LATIHAN MEMBACA \r\nSTUDI KASUS: TK NEGERI MERUYA UTARA 02 \r\nOleh : Hafizd Nofaldi (1512300227) \r\n \r\nDesain aplikasi ini dimaksudkan sebagai sebuah terobosan dalam bentuk media \r\npembelajaran, yaitu dengan menggunakan metode media interaktif. Pembuatan media \r\ninteraktif ini didukung karena pembelajaran sebelumnya masih menggunakan metode \r\nmanual berupa buku. Hampir di setiap instansi pendidikan memiliki media informasi \r\ndalam menunjang proses pembelajaran. Dalam menyampaikan sebuah pembelajaran \r\nyang tepat dan efisien salah satu caranya dengan mengembangkan sebuah teknologi \r\ninformasi. Banyak metode pembelajaran berbasis teknologi yang ada saat ini, salah satu \r\nnya  dengan  menggunakan  metode  Pembelajaran  interaktif.  dan  belum  ada  yang \r\nmembuat animasi interaktif sebagai media pembelajaran pada TK Negeri Meruya Utara \r\n02.  Pembelajaran interaktif juga dapat digunakan sebagai wadah bagi siswa/siswi untuk \r\nbermain dan belajar. Berdasarkan penelitian pada TK Negeri Meruya Utara 02, dapat \r\nditemukan  beberapa  kekurangan  dalam  pembelajaran  berbasis  teknologi.  Dengan \r\nmenggunakan  metode  pembelajaran  interaktif  ini,  diharapkan  dapat  menciptakan \r\nsuasana pembelajaran yang menarik. Oleh Karena itu, penulis tertarik untuk menangani \r\nbeberapa  masalah  tersebut,  metode  yang  digunakan  penulis  ialah  observasi  dan \r\npendekatan  terhadap  pihak  TK  Negeri  Meruya  Utara  02.  Media  yang  digunakan \r\nmerupakan gabungan dari berbagai media, seperti tulisan, gambar, animasi interaktif \r\nserta audio yang dikemas dengan Adobe Animate CC 2015. sehingga menghasilkan \r\nsuatu  program  yang  disebut implementasi aplikasi  interaktif.  Hasil  dari  penulisan \r\nlaporan ini berupa implementasi aplikasi interaktif yang bertema tentang pengenalan \r\nabjad, angka, dan latihan membaca dalam bentuk format swf. Serta penulis membuat \r\nstationary berupa kop surat, amplop surat, dan merchandise berupa mug (gelas). \r\n \r\nKata Kunci: Media Pembelajaran, Animasi, Multimedia, Interaktif. \r\n \r\nXI + 60 Halaman, 70 Gambar, 4 Lampiran Perpustakaan Universitas Budi Luhur\r\n'),(132,'1512300284','2021-02-05 14:01:50','20593','../files/1512300284.pdf',' \r\n \r\nPENERAPAN MULTIMEDIA INTERAKTIF MEDIA PEMBELAJARAN \r\nMENGENAL BIDANG PROFESI \r\nPADA PAUD AMALIYAH \r\nOleh : Rizky Indra Kusryandanu (1512300284) \r\n \r\n Desain aplikasi ini dimaksudkan sebagai sebuah terobosan dalam bentuk \r\nmedia pembelajaran, yaitu dengan menggunakan metode media interaktif. Pembuatan \r\nmedia interaktif ini didukung karena pembelajaran sebelumnya masih menggunakan \r\nmetode manual berupa buku. Hampir di setiap instansi pendidikan memiliki media \r\ninformasi  dalam  menunjang  proses  pembelajaran.  Dalam  menyampaikan  sebuah \r\npembelajaran yang tepat dan efisien salah satu caranya dengan mengembangkan sebuah \r\nteknologi informasi. Banyak metode pembelajaran berbasis teknologi yang ada saat ini, \r\nsalah satu nya dengan menggunakan metode Pembelajaran interaktif. dan belum ada \r\nyang membuat animasi interaktif sebagai media pembelajaran pada PAUD Amaliyah.  \r\nPembelajaran interaktif juga dapat digunakan sebagai wadah bagi siswa/siswi untuk \r\nbermain dan belajar. Berdasarkan penelitian pada PAUD Amaliyah, dapat ditemukan \r\nbeberapa kekurangan dalam pembelajaran berbasis teknologi. Dengan menggunakan \r\nmetode  pembelajaran  interaktif  ini,  diharapkan  dapat  menciptakan  suasana \r\npembelajaran  yang  menarik dan  efisien.  Oleh  Karena  itu,  penulis  tertarik  untuk \r\nmenangani beberapa masalah tersebut, metode yang digunakan penulis ialah observasi \r\ndan pendekatan terhadap pihak PAUD Amaliyah. Media yang digunakan merupakan \r\ngabungan dari berbagai media, seperti tulisan, gambar, animasi interaktif serta audio \r\nyang dikemas dengan Adobe Animate CC 2015. sehingga menghasilkan suatu program \r\nyang disebut  aplikasi  interaktif.  Hasil  dari  penulisan  laporan  ini  berupa  aplikasi \r\ninteraktif yang bertema tentang pengenalan abjad, angka, dan latihan membaca dalam \r\nbentuk format swf. Serta penulis membuat stationary berupa kop surat, dan merchandise \r\nberupa mug (gelas). \r\n \r\nKata Kunci: Media Pembelajaran, Animasi, Multimedia, Interaktif. \r\n \r\nX + 58 Halaman, 36 Gambar, 3 Lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(133,'1512500024','2021-02-05 14:01:50','20379','../files/1512500024.pdf',' \r\n \r\nSISTEM PENUNJANG KEPUTUSAN PEMILIHAN \r\nGURU TERBAIK PADA SMA CENDERAWASIH II DENGAN \r\nMENGGUNAKAN METODE PERBANDINGAN EKSPONENSIAL \r\n \r\nOleh : Djuan Narita ( NIM : 1512500024 ) \r\nPenelitian ini membahas tentang sistem penunjang keputusan pemilihan guru \r\nterbaik pada  SMA Cenderawasih II   yang bertujuan untuk menghasilkan keputusan \r\ndalam pemilihan guru terbaik sesuai dengan  kriteria pada SMA Cenderawasih  II , \r\nmasalah yang terjadi  adalah belum adanya metode dalam pemilihan guru terbaik \r\nsehingga  keputusan  masih  bersifat subyektif  belum  adanya  sistem  penunjang \r\nkeputusan  (SPK) untuk  pemilihan  guru  terbaik,proses  pengumpulan  dan \r\npengolahan  data  masih  terjadi  kesalahan  dan  data  yang  dimasukan  lamban \r\ndikarenakan kurang nya staff  kurikulum Oleh karena itu di perlukan adanya metode \r\nyang sesuai dengan kebutuhan yang ada di SMA Cenderawasih II. Untuk mengatasi \r\npermasalahan  tersebut  penulis  membuat  aplikasi  dengan  menerapkan  Metode \r\nPerbandingan  Eksponensial  dengan  menggunakan  kriteria-kriterria  yang  sudah \r\nditetapkan sekolah yaitu pendagogik, keperibadian, sosial dan professional. Lapran \r\nyang  dihasilakn  dalam  sistem  ini  adalah  hasil  keputusan  guru  terbaik  yang \r\ndiserahkan langsung secara pribadi kepada guru yang terpilih, laporan hasil guru \r\nterbaik yang menampilkan lima reanking data guru denga nilai yang berurutan dari \r\nyang  terbesar  hingga  terkecil.  Dengan  menggunakan  Bahasa  pemrograman \r\ndatabase MySQL Front yang di jalankan di sistem windows Dalam penelitian ini \r\nsistem informasi yang dihasilkan memberikan penilaian dengan efektif den efisien \r\nsehingga laporan menjadi lebih jelas  \r\nKata kunci : sistem penunjang keputusan pemilihan guru terbaik,  Metode \r\nPerbandingan Eksponensial , SPKPerpustakaan Universitas Budi Luhur\r\n'),(134,'1512500040','2021-02-05 14:01:50','280603','../files/1512500040.pdf',' \r\nMEMBANGUN WEBSITE PENJUALAN E-COMMERCE BERBASIS \r\nCONTENT MANAGEMENT SYSTEM (CMS) (STUDI KASUS: NYLSHOP) \r\nDENGAN MODEL BUSINESS MODEL CANVAS \r\nOleh : Nur Azizah (NIM: 1512500040) \r\nE-Commerce  (Electronic  Commerce) adalah  suatu  kegiatan  penjualan  dan \r\npembelian produk barang atau jasa dengan menggunakan jaringan internet dan \r\nkomputer. Masalah yang dapat ditemui kendala yang dihadapi seperti Produk \r\nlama tidak terjual, sehingga model lama yang dimiliki Nylshop selalu tersimpan \r\ndi gudang. Kesulitan dalam mencari produk yang akan dipesan dan pelanggan \r\ntidak mengetahui informasi produk yang sudah habis. Untuk mengurangi produk \r\nbarang  yang  lama  di  gudang.  Mempermudah  untuk  mencari  informasi  yang \r\ndibutuhkan secara benar dan tepat waktu serta dapat diakses dari mana saja baik \r\npihak  nylshop  maupun  pelanggan.Metode  yang  digunakan  adalah Business \r\nModel Canvas yang akan digunakan untuk menganalisis model bisnis Nylshop. \r\nPenelitian ini menghasilkan untuk meningkatkan mengolah produk pakaian dan \r\nmempermudah  melihat  pemesanan  sehingga  dapat  meningkatkan  jumlah \r\npelanggan dari kemajuan dalam segi penjualan serta pemesanan produk pakaian. \r\n \r\nKata kunci : E-commerce,Business Model Canvas,Pakaian. \r\nix+75halaman;79 gambar; 2 tabel; 18 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(135,'1512500073','2021-02-05 14:01:50','178673','../files/1512500073.pdf',' \r\nPENERAPAN  E - COMMERCE MENGGUNAKAN CONTENT \r\nMANAGEMENT SYSTEM (CMS) STUDI KASUS TOKO SURYA AGUNG \r\nELEKTRIK \r\nOleh : Anggi Ramadhan (1512500073) \r\n E-Commerce (Elektronic commerce) juga di sebut perdagangan elektronik \r\nmerupakan sebuah pelangganan, penjualan, pemasaran Produk dan jasa melalui \r\ninternet  dan  jaringan  komputer.  Semua  komponen  yang  ada dalam  transaksi \r\npenjualan  di  aplikasikan  dalam E-Commerce seperti  layanan  produk,  cara \r\npembayaran, dan cara promosi. Penulis mengambil studi kasus pada Toko Surya \r\nAgung  Elektrik, Surya  Agung Elektrik merupakan  sebuah  toko  listrik  yang \r\nberlokasi  di  Jalan  Kedoya  Duri  Raya,  Kelurahan  Kedoya  Selatan,  Kecamatan \r\nKebon  Jeruk,  Jakarta  Barat.  Masih  banyak  masalah  yang  dihadapi  pada  Toko \r\nSurya Agung ini dikarenakan tempat penjualan yang kecil dan berada di pinggir \r\njalan sehingga tidak ada lahan parkir dan pelanggan malas untuk antri,  pihak \r\npemilik  pun  tidak  memiliki  media  khusus  untuk  promosi Produk,  serta  untuk \r\npengecekan stok Produk, pembuatan nota transaksi, dan pembuatan laporan masih \r\ndilakukan secara manual. Tujuan dari penelitian ini adalah membangun website e-\r\ncommerce menggunakan Content  Management  System CMS yaitu wordpress. \r\nPenelitian ini juga menggunakan metode Bussiness  Model  Canvas  (BMC) dan \r\nSearch Engine Optimization (SEO) untuk membantu Toko Surya Agung Elektrik \r\ndalam penjualan. Hasil dari penelitian ini untuk membangun sebuah website e-\r\ncommerce yang  bertujuan  untuk  mempermudah  konsumen  dalam  melakukan \r\ntransaksi tanpa adanya batasan waktu dan tempat, serta memudahkan pemilik toko \r\ndalam meningkatkan penjualan dan membuat laporan yang dibutuhkan. \r\nKata kunci : E-Commerce, BMC, CMS, Listrik \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(136,'1512500107','2021-02-05 14:01:50','19980','../files/1512500107.pdf',' \r\nPENERAPAN E-COMMERCE WEBSITE DAN SEO PADA TOKO ECONG \r\nSPORT \r\n \r\nOleh : Siska Indrawati (NIM : 1512500107) \r\n \r\nToko  Econg  Sport  merupakan  sebuah  usaha  yang  bergerak  dalam  bidang \r\npenjualan berbagai macam pakaian renang dan senam. Toko Econg Sport masih \r\nmemiliki  beberapa  kekurangan  dalam  rangka  menunjang  proses  transaksi \r\npenjualan  barang.  Tujuan  dari  penulisan  ini  adalah  membangun  suatu  website \r\npenjualan pada toko econg sport untuk membantu pemilik toko dalam melakukan \r\ntransaksi  jarak  jauh.  Metode  Analisa  yang  dilakukan  dalam  penelitian  ini \r\nmenggunakan metode Business Model Canvas (BMC) untuk mengidentifikasi dan \r\nmengevaluasi  model  bisnis  yang  duterapkan  pada  toko  econg  sport.  Didalam \r\npenelitian  ini  menggunakan  teknik  mesin  pencarian  atau Search  Engine \r\nOptimazion (SEO) yang akan di gunakan untuk meningkatkan trafik pengunjung \r\npada sebuah halaman website dan juga di gunakan agar sebuah halaman website \r\ndapat di telusuri dengan baik di halaman pencarian google. Salah satu indicator \r\nutama  keberhasilan SEO adalah  semakin keyword tertentu  di search  engine. \r\nSemakin tinggi posisi website dengan keyword tertentu di search engine,  maka \r\nsemakin tinggi pula pengunjung atau visitor yang berkunjung ke website. \r\nKata kunci :E-commerce, IFML, SEO, BMC. \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n');
INSERT INTO `document` VALUES (137,'1512500172','2021-02-05 14:01:50','98113','../files/1512500172.pdf',' \r\nPENERAPAN E-COMMERCE MENGGUNAKAN CONTENT \r\nMANAGEMENT SYSTEM  (CMS) WORDPRESS UNTUK PENJUALAN \r\nALAT TULIS KANTOR PADA PT. POLIPRINT MUKTI MEDIA \r\n \r\nOleh : Abie Mei Rizky (1512500172) \r\nSemakin  berkembangnya  teknologi  pada  era  saat  ini  tentunya  semakin \r\nmempermudah  setiap  masyarakat  untuk  memanfaatkan  kemajuan  teknologi \r\ntersebut,  mengingat  kebutuhan  manusia  juga  seiring  meningkat  dengan \r\nperkembangan  teknologi saat  ini.  Salah  satunya  perkembangan  dalam  proses \r\nbisnis dan tranksaksi  jual beli, e-commerce merupakan salah satu hal yang sangat \r\nberkembang pesat dalam proses bisnis dan transaksi secara online.  Penelitian ini \r\ndilakukan  pada  PT.  Poliprint  Mukti  Media, yaitu  perusahaan  yang  menjual \r\nberbagai macam kebutuhan alat tulis kantor. Pada saat ini penjualan pada PT. \r\nPoliprint Mukti Media masih kurang efektif, dimana customer harus datang ke \r\ntoko untuk membeli produk, transakasi online yang dimiliki hanya melalui e-mail \r\ndan  hanya  dilakukan  oleh customer yang  sudah  berlangganan.  Tidak  adanya \r\nmedia pemasaran yang dilakukan secara online. Tujuan dari penelitian ini adalah \r\nmembangun  sebuah website  e-commerce menggunakan Content  Mangement \r\nSystem (CMS) Wordpress. Penelitian ini menggunakan metode Business Model \r\nCanvas (BMC)  untuk  membantu  memperjelas  elemen  apa  saja  yang  dapat \r\nmembantu  PT.  Poliprint  Mukti  Media  dalam  kelangsungan  produksi  dan \r\npenjualannya. Hasil dari penelitian ini adalah membangun website e-commerce \r\nyang mampu  diakses  kapan  saja  dan  dimana  saja  oleh  pegawai  dan  calon \r\ncustomer,  serta  mempermudah  PT.  Poliprint  Mukti  Media  untuk  melakukan \r\npenjualan  dan  pemasaran  secara online, sehingga  mampu  meningkatkan  dan \r\nmemperluas ruang lingkup penjualan. \r\nKata kunci : E-Commerce, Content Management System (CMS), Wordpress, \r\nBusiness Model Canvas (BMC), PT. Poliprint Mukti Media \r\nxvi + 119 halaman; 93 gambar; 4 tabel; 25 lampiran. \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(138,'1512500180','2021-02-05 14:01:50','20400','../files/1512500180.pdf',' \r\n \r\nTUGAS AKHIR \r\n \r\nPENERAPAN METODE ANALYTICAL HIERACHY PROCESS(AHP) DAN \r\nSIMPLE ADDITIVE WEIGHTING(SAW) DALAM SISTEM PENUNJANG \r\nKEPUTUSAN PEMILIHAN PEGAWAI TERBAIK PADA UNIT \r\nPENGELOLA GRAHA RAYA STUDI KASUS PERUSAHAAN PROPERTI \r\n \r\nOleh : Raka Fitra Pradana (NIM : 1512500180) \r\n \r\n \r\nKinerja  pegawai    yang  kompeten  merupakan  idaman  bagi  setiap  perusahaan  \r\ndengan melakukan pengolahan sumber daya manusia yang optimal, pegawai yang \r\nmempunyai kinerja kompeten dapat membantu perusahaan dalam bersaing , Untuk \r\nmenciptakan kinerja pegawai yang kompeten dan produktif penerapan penghargaan \r\natas  pegawai terbaik menjadi salah satu cara untuk menciptakan persaingan yang \r\nsehat. Penghargaan pegawai terbaik berdasarkan penilaian kinerja pegawai yang \r\ndiukur  melalui  beberapa  kriteria  yang  memenuhi  standar,  dengan  menerapkan \r\nsistem penunjang keputusan   diharapkan membantu dalam penilaian dengan baik. \r\nSistem yang akan dibuat ini menggunakan metode Analytical Hierarchy Process \r\n(AHP) untuk menentukan bobot kriteria dan metode Simple Additive Weighting \r\n(SAW) digunakan  untuk  menentukan pegawai terbaik  dengan  menghasilkan \r\nperankingan alternatif. Dengan adanya sistem penunjang keputusan ini, diharapkan \r\ndapat membantu pengambil keputusan dalam menetukan pegawai terbaik sehingga \r\nmenghasilkan keputusan maksimal dan tepat. \r\n \r\n \r\nKata Kunci : SPK, AHP, SAW, Pegawai Terbaik \r\nxii+82 Halaman;  38 Gambar;  29 Tabel;  6 LampiranPerpustakaan Universitas Budi Luhur\r\n'),(139,'1512500198','2021-02-05 14:01:50','57310','../files/1512500198.pdf',' \r\n \r\nPENERAPAN E-COMMERCE DENGAN BUSINESS MODEL CANVAS \r\n(BMC) BERBASIS WEBSITE PADA AWJASHOP \r\nOleh : Ridho Putra Kusmanda (1512500198) \r\nAwjashop  merupakan online  shop yang menjual  aneka  alat  tidur  mulai  dari \r\npiama  hingga  bedcover. Online  shop ini  memiliki  pelanggan  yang  cukup  banyak \r\nnamun  hanya  dapat  dipesan  melalui instagram dan  terhubung  melalui  aplikasi \r\nwhatsap dan juga tidak mudah dicari dalam mesin pencari. Karna itu, onlineshop ini \r\nakan menerapkan e-commerce dengan dibuatkannya website untuk awjashop tersebut. \r\nJuga menambahkan SEO agar website dapat mempermudah website untuk ditemukan \r\noleh  orang  banyak serta  memiliki  fitur  pemesanan  yang  dapat  memaksimalkan \r\npengenalan produk  yang dimiliki awjashop sehingga meningkatkan penjualan dan \r\nonlineshop ini  dapat  berkembang  serta  bersaing.  Dalam  pembuatan website ini \r\nmenggunakan metode yaitu Business Model Canvas untuk menganalisis model dan \r\nkerangka dalam online shop tersebut. Website ini juga menggunakan woocommerce \r\nyang berfungsi untuk mengolah produk dari dalam website. Juga merupakan sebuah \r\nplugin yang banyak digunakan oleh pengguna wordpress.  \r\nKata kunci : E-Commerce, website, Onlineshop, Business Model Canvas \r\nix+91 halaman; 69 gambar; 1 tabel; 12 lampiran Perpustakaan Universitas Budi Luhur\r\n'),(140,'1512500222','2021-02-05 14:01:50','69201','../files/1512500222.pdf','  \r\nANALISA DAN PERANCANGAN E-COMMERCE BERBASIS WEB  \r\nPADA ORANGE ISLAND STORE  \r\nMENGUNAKAN METODE BUSINESS MODEL CANVAS  \r\nOleh: Sandy Putra Utama (Nim: 1512500222)  \r\nOrange Island Store merupakan sebuah distro yang menjual pakaian dan \r\nattribute supporter persija yang beralamat di jl. Panjang Arteri Klp. Dua Raya. \r\nUsaha ini dibilang telah mengalami perkembangan dengan cukup baik meskipun \r\npenjualan hanya dilakukan dengan cara menjual produk di Store dan media sosial \r\nseperti  Instagram.  Maka  tujuan  dari  penelitian  ini  dalam  merancang  penjualan \r\nberbasis e-commerce pada Orange Island Store untuk membantu meningkatkan \r\npenjualan secara online dan memberikan informasi produk terbaru yang di jual \r\nmelalui website. Adapun sistem e-commerce yang digunakan adalah wordpress, \r\nwordpress  adalah platform pembuatan website yang  diciptakan  oleh  Matt \r\nMullenweg dan Mike Little pada tahun 2003. Wordpress juga merupakan salah \r\nsatu  nama web  developer yang  berbasis CMS (Content  management  system). \r\nMetode penelitian yang di lakukan adalah metode business model canvas. Metode \r\npenelitian  ini  bersifat  kualitatif  dan  deskriptif  dengan  melakukan  metode \r\nwawancara.  Hasil  yang  dicapai  dalam  mengimplementasikan  sistem  penjualan \r\nberbasis e-commerce diharapkan dapat memudahkan pihak Orange Island Store \r\ndalam  mengelola  transaksi  penjualan  produk  maupun  pelanggan  yang \r\nmemanfaatkan  media internet untuk  melakukan  pemesanan  produk  sehingga \r\ndapat meningkatkan penjualan.  \r\nKata  Kunci  : E-Commerce, Penjualan, Orange  Island  Store,  Business model \r\ncanvas.  \r\nviii + 96 halaman; 88 gambar; 3 tabel; 21 lampiran \r\n  \r\n \r\n  \r\n \r\n  \r\n \r\n  \r\n  \r\n \r\n  \r\n \r\n  \r\n \r\n  \r\n \r\n \r\n  \r\n \r\ni Perpustakaan Universitas Budi Luhur\r\n'),(141,'1512500248','2021-02-05 14:01:50','291164','../files/1512500248.pdf',' \r\n \r\nMEMBANGUN WEBSITE PENJUALAN BERBASIS E-COMMERCE PADA TOKO \r\nKHAYANGAN OUTDOOR MENGGUNAKAN CMS WORDPRESS \r\n \r\nOleh : Meydiana Putri (1512500248) \r\n \r\nAktivitas transaksi jual-beli barang dengan pelanggan yang dilakukan secara \r\nonline menggunakan komputer yang terhubung dengan internet adalah proses yang \r\nsering  dilakukan  oleh  para  pedagang  yang  bergerak  dibidang  penjualan.  Pada \r\numumnya proses transaksi jual-beli biasanya sering dilakukan secara bertatap muka \r\ndengan pelanggan. Contohnya yang terjadi  pada Toko Khayangan Outdoor, toko \r\nyang  menjual peralatan  pendakian  gunung  ini  masih  menggunakan  toko  fisik \r\nsehingga proses penjualan hanya dapat diakses dengan datang ke toko saja, dalam \r\npenggunaan  media  promosi  toko  ini  hanya  menggunakan  media  Whatsapp  saja \r\nsehingga untuk proses pemesanan para pelanggan masih harus datang ke toko untuk \r\nmembeli produk yang harus membutuhkan waktu dan tenaga, sekaligus menyediakan \r\ndana untuk transportasi datang ke toko adalah termasuk proses yang menyulitkan \r\nuntuk para pelanggan. Pembuatan laporan hasil penjualan masih berupa pembukuan \r\nsehingga  mengakibatkan  laporan  tidak  akurat.  Oleh  karena  itu  peneliti  akan \r\nmembahas  website  penjualan  berbasis  e-commerce  dengan  penerapan  business \r\nmodel  convas  untuk  meningkatkan  dan  mempermudah  penjualan  pada  toko \r\nkhayangan outdoor di daerah jakarta selatan yang menggunakan konsep e-commerce \r\nuntuk dapat mengembangkan penjualan dengan jangkauan yang lebih luas dan dapat \r\nmemudahkan akses informasi kepada para pelanggan.  \r\n \r\nKata kunci:Business Model Canvas, E-Commerce, Alat Pendakian Gunung. \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(142,'1512500255','2021-02-05 14:01:50','211569','../files/1512500255.pdf',' \r\nPenerapan Data Mining Untuk Menentukan Varian Produk Lipstik Yang \r\nSering Dibeli Secara Bersamaan Pada PT Titian Citra Kharisma Dengan \r\nAlgoritma Apriori \r\n \r\nOleh : Syahnaz Sofinar Amru (1512500255) \r\n \r\nPT Titian Citra Kharisma merupakan perusahaan bisnis yang bergerak di dalam \r\nbidang kosmetika. Ditengah persaingan bisnis yang sangat ketat, PT Titian Citra \r\nKharisma  harus  menentukan  strategi  yang  tepat  agar  dapat  terus  bertahan. \r\nMinimnya pengetahuan dalam data mining, sehingga data-data transaksi yang ada \r\nbelum digunakan secara maksimal. Menyadari permasalahan yang dihadapi oleh \r\nPT Titian Citra Kharisma, penulis membuat penelitian kombinasi varian produk \r\nkamalia  lipmatte yang  sering  dibeli  secara  bersamaan  oleh  pelanggan.  Tujuan \r\npenelitian  ini  yaitu,  dari  informasi  yang  dihasilkan  agar  dapat  dimanfaatkan \r\nmenjadi sebuah product bundling yang lebih disukai atau diminati oleh pelanggan, \r\nsehingga diharapkan akan lebih meningkatkan omset penjualan produk kamalia \r\nlipmatte. Dari informasi tersebut pula, dapat dijadikan sebuah saran untuk PT Titian \r\nCitra Kharisma dalam pengelolaan stok produknya. Dimana dalam penelitian ini, \r\nteknik data mining yang digunakan adalah teknik association rule dengan algoritma \r\napriori.  Penelitian  ini  memperoleh  hasil  bahwa  dari  berbagai  varian  kamalia \r\nlipmatte  yang  ada,  terdapat  2  (dua)  kombinasi item yang  sering  dibeli  secara \r\nbersamaan oleh pelanggan yaitu: dengan confidence sebesar 28,16% jika membeli \r\nvarian soft pink maka akan membeli varian soft brown; dan dengan confidence \r\nsebesar 31,10% jika membeli varian fierce red maka akan membeli varian soft pink. \r\nHasil dari penelitian ini telah diuji bahwa rule tersebut telah memenuhi kondisi dari \r\nlift ratio, serta telah diuji menggunakan alat bantu data mining yaitu perangkat \r\nlunak WEKA. \r\n \r\n \r\nKata Kunci: data mining, association rule, algoritma apriori \r\n \r\nviii + 73 halaman; 11 gambar; 27 tabel; 2 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(143,'1512500263','2021-02-05 14:01:51','102611','../files/1512500263.pdf',' \r\n \r\nPENERAPAN E-COMMERCE UNTUK MENINGKATKAN PENJUALAN \r\nPADA TOKO JAKET KULIT NAUFAL \r\nOleh : Ahmad Rizki Fadillah (NIM: 1512500263) \r\nE-Commerce merupakan suatu konsep  yang biasa digambarkan sebagai \r\nproses jual beli barang atau jasa pada media internet. E-commerce merupakan \r\nkegiatan bisnis yang dijalankan secara elektronik melalui suatu jaringan internet \r\natau kegiatan jual beli barang atau jasa melalui jalur komunikasi digital. Penelitian \r\nini mengambil studi kasus pada toko Jaket Kulit Naufal yaitu usaha yang bergerak \r\ndalam bidang fashion yang menjual jaket kulit pria dan wanita. Mekanisme sistem \r\npenjualan  pada toko Jaket  Kulit  Naufal masih  kurang  efektif, sehingga \r\nmengharuskan konsumen mesti datang langsung ke toko. Pemasaran produk yang \r\nsaat  ini  dilakukan  hanya  melalui Sosial  Media.  Selain  itu,  dalam  pembuatan \r\nlaporan masih secara manual menggunakan pembukuan. Tujuan dari penelitian ini \r\nadalah  membangun website  e-commerce menggunakan Content Management \r\nSystem (CMS)  yaitu wordpress. Penelitian ini menggunakan metode Bussiness \r\nModel Canvas (BMC) untuk membantu memperjelas dengan bagan elemen apa \r\nsaja yang dapat membantu toko Jaket Kulit Naufal dalam kelangsungan produksi \r\ndan penjualannya. Hasil tujuan dari penelitian ini adalah membangun website e-\r\ncommerce untuk mempermudah konsumen dalam transaksi tanpa adanya batasan \r\nwaktu dan tempat dan juga memudahkan pemilik toko Jaket Kulit Naufal dalam \r\nmeningkatkan penjualan dan  pemasarannya serta  mempermudah  pemilik  toko \r\ndalam penyusunan laporan yang diperlukan. \r\nKata kunci : E-commerce, Jaket, Wordpress \r\nx+105 halaman; 68 gambar; 16 tabel; 20 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(144,'1512500305','2021-02-05 14:01:51','20926','../files/1512500305.pdf',' \r\nSISTEM PENUNJANG KEPUTUSAN PEMILIHAN KARYAWAN \r\nTERBAIK PADA PD. TIARAMAS GLASSINDO DENGAN METODE \r\nPERBANDINGAN EKSPONENSIAL (MPE) \r\nOleh : Vanya Eka Syafitri ( NIM : 1512500305 ) \r\nPenelitian ini membahas tentang sistem penunjang keputusan pemilihan karyawan \r\nterbaik  pada  PD.  Tiaramas  Glassindo  yang  bertujuan  untuk  menghasilkan \r\nkeputusan  dalam  pemilihan  karyawan terbaik  sesuai  dengan  kriteria  pada  PD. \r\nTiaramas Glassindo. Masalah yang terjadi sekretaris mengalamin kesulitan dalam \r\nproses pengolahan data dan nilai. Sedangkan direktur utama mengalami kesulitan \r\ndalam rekap  nilai  mengurutkan  dari  yang  terbesar  sampai  yang  terkecil yang \r\nhanya dilakukan sendiri mengakibatkan proses pemilihan karyawan terbaik belum \r\nmaksimal  dan membutuhkan  waktu  yang  lama.  Diperlukan  suatu  sistem \r\npenunjang keputusan (SPK)  yang dapat  memperhitungkan segala kriteria  yang \r\nmendukung  pengambilan  keputusan  guna  membantu  mempermudah  proses \r\npengambilan keputusan tersebut. Menerapkan Metode Perbandingan Eksponensial \r\n(MPE) dengan menggunakan kriteria-kriteria yang sudah ditetapkan perusahaan \r\nyaitu  kehadiran  ditempat  kerja,  ketepatan  waktu  dalam  menyelesaikan  tugas, \r\ntanggung  jawab  dan  profesionalitas  dalam  bekerja,  kejujuran,  dan  komunikasi \r\npada customer. Laporan yang dihasilkan dalam sistem ini adalah cetak karyawan \r\nterbaik  yang akan diserahkan  langsung  secara  pribadi  kepada  karyawan  yang \r\nterpilih sebagai  karyawan  terbaik,  laporan  hasil  karyawan  terbaik  yang \r\nmenampilkan nilai data  karyawan beserta  keterangan  terpilihnya  karyawan \r\nmenjadi karyawan terbaik atau tidak terpilih, laporan history nilai karyawan, dan \r\nlaporan history karyawan terbaik dari tiap periode. Sistem penunjang keputusan \r\npemilihan karyawan terbaik ini dibuat dengan menggunaan bahasa pemprograman \r\nPHP Framework Laravel, serta menggunakan database MySQL  yang dijalankan \r\ndi sistem operasi Windows. \r\nKata Kunci : Sistem Penunjang Keputusan, Metode Perbandingan Eksponensial \r\n(MPE), Pemilihan Karyawan Terbaik. \r\nx + 121 halaman; 83 gambar; 9 tabel; 13 lampiranPerpustakaan Universitas Budi Luhur\r\n'),(145,'1512500313','2021-02-05 14:01:51','57508','../files/1512500313.pdf',' \r\n \r\nPenerapan Sistem Penjualan Online Berbasis E-Commerce Menggunakan \r\nContent Management System (CMS) Studi Kasus Toko Alfian \r\n \r\nOleh : Dery Saputra ( 1512500313 ) \r\n \r\nToko Alfian adalah salah satu toko yang menjual alat-alat listrik. Toko alfian \r\nyang berlokasi di Pik. Kopti Rt. 01/011 No. 35 Semanan Kalideres Jakarta Barat. \r\nPenulis melakukan  analisa mengenai sistem penjualan. Perkembangan teknologi \r\nyang  semakin  maju  khususnya  bidang  komputer  membuat  masyarakat  banyak \r\nmenggunakannya. Pada  saat  ini sistem  yang berjalan pada Toko Alfian masih \r\nbelum  menggunakan  teknologi  berbasis e-commerce,  sehingga  dalam \r\nmemasarkan  produknya  perusahaan  tersebut  kurang  luas  cakupannya,  ini \r\nmenyebabkan pendapatan yang diperoleh Toko Alfian kurang maksimal. Aplikasi \r\ntoko online     (e-commerce) adalah solusi dari permasalahan tersebut, aplikasi ini \r\nmenggunakan Content Management Sistem (CMS) yaitu wordpress. Aplikasi ini \r\ndibuat  dengan  metode  observasi  dan  wawancara  untuk  pengujian  tingkat \r\npenerimaan pemakai aplikasi. Tujuan dari tugas akhir ini adalah membuat aplikasi \r\ntoko online (e-commerce) dimana customer dapat memesan secara online dengan \r\nmudah dan cepat, sehingga keuntungan yang diperoleh perusahaan tersebut dapat \r\ntercapai dengan maksimal. \r\n \r\nKata kunci : E-Commerce, CMS, Wordpress \r\nX + 100 halaman; 90 gambar; 16 tabel; 16 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(146,'1512500321','2021-02-05 14:01:51','98111','../files/1512500321.pdf',' \r\n \r\nPERANCANGAN SISTEM INFORMASI PENJUALAN ALAT LISTRIK \r\nBERBASIS E-COMMERCE STUDI KASUS TOKO LISTRIK MILLENIUM \r\n \r\nOleh : Erik Chandra ( NIM : 1512500321 ) \r\n \r\n \r\nToko Listrik Millenium ini merupakan salah satu usaha yang bergerak di \r\nbidang penjualan, khususnya penjualan alat-alat listrik. Toko ini mengharapkan \r\ndapat  memperoleh  keuntungan  yang  maksimal  tanpa  keterbatasan  waktu  dan \r\ntempat,  sehingga customer dapat  berinteraksi  dan  berperan  secara  aktif  dalam \r\nproses  jual-beli tanpa dibatasi waktu dan tempat. Masalah yang sering terjadi \r\npada  Toko  Listrik  Millenium  adalah  sulitnya  mengetahui  sisa  stok  barang  di \r\nkarenakan  pencatatan  masi  menggunakan  tulis  tangan,  sehingga  produk  hanya \r\ntersimpan didalam gudang. Berdasarkan masalah yang terjadi, maka diperlukan \r\nsebuah sistem  untuk  mempermudah  Toko  Listrik  Millenium  untuk \r\nmemaksimalkan  penjualanya.  Sistem  tersebut  di  usulkan  berdasarkan \r\npermasalahan yang ada pada proses bisnis yang sekarang sedang berjalan. Dengan \r\nmemanfaatkan E-Commerce pada  sistem  yang  baru  diharapkan kelemahan-\r\nkelemahan  yang  terdapat  sebelumnya  diharapkan  dapat  diatasi  sehingga  dapat \r\nmenghasilkan  informasi  yang  akurat.  Pada  tahapan  ini  penulis  mencoba \r\nmenganalisa model bisnis dengan menggunakan Business Model Canvas ( BMC ). \r\nDengan  harapan  hasil  karya yang  masi  jauh  dari  kata  sempurna  ini  dapat \r\nmemberikan  jalan  keluar  untuk  membantu  menyempurnakan  sistem  berbasis \r\nwebsite E-commerce pada Toko Listrik Millenium. \r\nKata Kunci : E-Commerce, BMC, Listrik \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(147,'1512500339','2021-02-05 14:01:51','102880','../files/1512500339.pdf',' \r\n \r\nANALISIS DAN PERANCANGAN ELECTRONIC CUSTOMER  \r\nRELATIONSHIP MANAGEMENT (E-CRM) BERBASIS WEB UNTUK \r\nMENINGKATKAN PELAYANAN BIMBINGAN BELAJAR \r\n(STUDI KASUS : LEMBAGA BIMBEL PRIMAGAMA) \r\n \r\nOleh: Sisca Agdinsa Ramadhan (NIM: 1512500339) \r\n \r\nPerkembangan  teknologi  internet  saat  ini  sangat  pesat  dan  menuntut \r\npenggunanya untuk terbiasa menerapkan teknologi dalam segala aspek kehidupan. \r\nSalah satunya dalam bidang pendidikan. Bimbingan belajar merupakan lembaga \r\npembelajaran  yang  saat  ini  keberadaannya  semakin  banyak  tersebar  di  seluruh \r\nIndonesia. Penelitian ini dilakukan pada salah satu lembaga bimbingan belajar yaitu \r\nPrimagama. Dengan banyaknya pesaing dalam bisnis ini, maka diperlukan strategi \r\nbisnis yang baik agar perusahaan mampu bersaing dengan meningkatkan pelayanan \r\nterhadap  customer.  Permasalahan  yang  sering  ditemui  di  lembaga  bimbel \r\nPrimagama  yaitu  keterlambatan  pembayaran  dan  pelunasan  biaya  bimbel  tiap \r\nsemester, penyampaian keluhan masih secara lisan sehingga penanganan keluhan \r\nagak lambat, kurangnya koordinasi perusahaan dengan orangtua mengenai kegiatan \r\nakademis anaknya di tempat bimbel. Berdasarkan permasalahan yang ada, penulis \r\nmencoba  menganalisa  dan  merancang  sistem  usulan  dengan  menggunakan \r\npendekatan electronic Customer Relationship Management (e-CRM). Sistem e-\r\nCRM  ini  dibangun  menggunakan  bahasa  pemrograman  PHP  dan database \r\nMYSQL. Sistem ini dibuat agar hubungan perusahaan dan customer dapat dikelola \r\nlebih baik dan perusahaan dapat meningkatkan pelayanan dan loyalitas customer \r\nsehingga mengurangi permasalahan yang ada. Penelitian ini menghasilkan sebuah \r\nprototype CRM  yang  diharapkan  dapat  membantu  perusahaan  mengatasi \r\npermasalahan yang ada. Penelitian ini meliputi prototype CRM pada fitur promosi, \r\npenangana keluhan, evaluasi belajar, pengumuman/reminder tagihan biaya bimbel. \r\n \r\nKata kunci : Lembaga Bimbel, Customer Relationship Management, Loyalitas, Customer. \r\n \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(148,'1512500347','2021-02-05 14:01:51','74889','../files/1512500347.pdf',' \r\n \r\nIMPLEMENTASI E-COMMERCE BERBASIS CMS ( CONTENT \r\nMANAGEMENT SYSTEM ) PADA BATIK PEKALONGAN TOKO \r\nBERKAH \r\n \r\nOleh : Ari Nurhansah (NIM : 1512500347) \r\n \r\n \r\nBatik pekalongan toko berkah adalah salah satu usaha yang bergerak di bidang \r\npenjualan pakaian batik. Toko ini hanya mempunyai satu toko fisik yang berada di \r\nCipadu. Oleh karna itu transaksi jual beli hanya dilakukan pada toko tersebut, Hal \r\nini mempersulit pelanggan yang ingin membeli pakaian batik karna pelanggan \r\nharus datang ke toko terlebih dahulu. Selain itu setiap ada transaksi jual beli dengan \r\npelanggan, karyawan selalu mencatat transaksi tersebut di buku penjualan. Dalam \r\nproses ini penulis melihat ada beberapa masalah. Masalah tersebut di antaranya \r\nsulitnya membeli pakaian batik pekalongan toko berkah jika pelanggan jauh dari \r\ntoko fisik karna keterbatasan jarak dan waktu. Dan pencatatan penjualan masih \r\ndilakukan  secara  manual  sehingga  kesalahan  pencatatan  atau  kelupaan  dalam \r\npencatatan ke buku penjualan beresiko tinggi. Oleh karena itu penulis menyusun \r\ntugas akhir ini yang berjudul \"Implementasi E-commerce Berbasis CMS (Content \r\nManagement System ) Pada Batik Pekalongan Toko Berkah\". Dengan harapan \r\npelanggan bisa membeli batik tanpa harus datang ke toko dan juga para karyawan \r\ndapat membuat laporan penjualan dengan mudah tanpa harus mecatat lagi ke buku \r\npenjualan. \r\n \r\nKata Kunci : Implementasi, E-commerce , CMS \r\nix+80 halaman; 81 Gambar;  12 Lampiran.Perpustakaan Universitas Budi Luhur\r\n'),(149,'1512500362','2021-02-05 14:01:51','75977','../files/1512500362.pdf',' \r\n \r\nMEMBANGUN SISTEM PENJUALAN BERBASIS E-COMMERCE PADA \r\nJOGJA MOTOR SPORTS DENGAN MENGGUNAKAN CMS \r\nWORDPRESS \r\nOleh : Billy Adam Sutrisno (1512500362) \r\n Perkembangan  kebutuhan  informasi  sejalan  dengan  perkembangan  ilmu \r\npengetahuan dan teknologi yang semakin pesat, khususnya pada komputer dan \r\ninternet. Teknologi internet saat ini digunakan tidak hanya untuk jejaring sosial \r\ntetapi juga digunakan untuk bisnis online. Toko spareparts Jogja Motor Sports \r\nmerupakan suatu usaha jenis wirausaha kecil dan menengah yang bergerak dalam \r\nbidang  penjualan  penjualan spareparts kendaraan  roda  dua.  Masalah  yang \r\ndihadapi  oleh  toko  jogja  motor sports adalah selama  ini  pelanggan  tidak \r\nmengetahui  adanya spareparts-spareparts yang  terjual  dengan  adanya  promo, \r\npelanggan hanya bisa belanja dengan datang ke toko dan pelanggan yang datang \r\nhanya  berasal  dari  sekitar  saja,  jadi  penjualan spareparts dirasakan  kurang \r\nmeningkat, sering terjadi ketidak-akuratan data pada proses pembuatan laporan, \r\nmedia promosi masih menggunakan iklan dimajalah otomotif sehingga dirasakan \r\nmasih kurang dalam segi pemasarannya. Rancangan e-commerce dengan metode \r\nbusiness model canvas digunakan untuk meningkatkan  penjualan sparepart pada \r\ntoko  jogja  motor sports di  tangerang  adalah  untuk  mengembangkan  penjualan \r\nbarangnya  tidak  hanya  secara offline saja,  sehingga  penjualannya  dapat \r\nmeningkat. \r\nKata Kunci : website, e-commerce, penjualan, jogja motor sports, cms, spareparts  \r\nix+98 halaman; 75 gambar; 33 tabel; 19 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(150,'1512500370','2021-02-05 14:01:51','81198','../files/1512500370.pdf',' \r\nPENERAPAN E-COMMERCE BERBASIS CONTENT MANAGEMENT \r\nSYSTEM (CMS) DENGAN METODE BUSINESS MODEL CANVAS (BMC) \r\nPADA KONVEKSI GAMIS TAWAKAL \r\n \r\nOleh : Aji Guntoro (NIM:1512500370) \r\n Penggunaan  teknologi  dan  informasi  semakin  berkembang  hal  ini \r\nmenyebabkan  terjadinya  persaingan  pemanfaatan  teknologi  informasi  terutama \r\npada bidang  jual  beli online salah  satunya  adalah  Konveksi  Gamis  Tawakal. \r\nKonveksi Gamis Tawakal adalah konveksi rumahan dan salah satu pelaku UMKM \r\nyang bergerak dibidang fashion muslim yang memproduksi gamis pria. Konveksi \r\nGamis Tawakal berdiri sejak 2016 dan berada pada wilayah Taman Kota,Jakarta \r\nBarat. Karena hanya konveksi rumahan pemilik gamis tawakal memasarkan dan \r\nmenjual  produk  hanya  dengan  mendirikan  stand  pada  acara-acara  pengajian \r\nkhususnya pengajian pria. Untuk mengatasi permasalahan dalam penjualan maka \r\ndibuatlah website toko online untuk Konveksi Gamis Tawakal menggunakan salah \r\nsatu CMS (Content Management System) yaitu Wordpress dengan menggunakan \r\nmetode Business Model Canvas (BMC). Dengan adanya toko online diharapkan \r\ndapat mendatangkan para pelanggan baru serta memudahkan para pelanggan untuk \r\nmendapatkan produk dari Konveksi Gamis Tawakal. Dan dengan adanya media \r\npemasaran  melalui  instagram  dan  facebook  diharapkan  dapat  memudahkan \r\npelanggan untuk mendapatkan informasi mengenai produk dari Konveksi Gamis \r\nTawakal. \r\n \r\nKata Kunci  : E-Commerce, Wordpress , Busines Model Canvas ,  \r\n     Content Management System \r\n \r\nx + 130 Halaman; 92 Gambar; 22 Lampiran; 31 Tabel Perpustakaan Universitas Budi Luhur\r\n'),(151,'1512500388','2021-02-05 14:01:51','212404','../files/1512500388.pdf',' \r\n \r\nPENERAPAN METODE E-COMMERCE DAN SEO UNTUK \r\nMENINGKATKAN KINERJA PENJUALAN \r\nPADA TOKO BIRU ROYAL ATRIBUT \r\n \r\nOleh : Nur Najma Mulyaningrum (1512500388) \r\n \r\nBiru  Royal  Atribut  adalah  salah  satu  bisnis  yang  bergerak  dibidang \r\nkonveksi  seperti  pakaian  dinas  dan  atribut  bagi  pegawai  di  lingkungan \r\nkementerian  hukum  dan  hak  asasi  manusia.  Seiring  perkembangan  kebutuhan \r\npermintaan  pelanggan  maka  pembisnis  membuat  stok  atribut  tersebut,  pada \r\numumnya  usaha  dengan  konsep  penjualan  atribut  kementerian  mengutamakan \r\nkebutuhan  untuk  pakaian  dinas,  calon  pegawai  negeri  sipil,  tanda  pangkat \r\nupacara,  lencana tanda  jabatan (bagi  yang  berhak), papan  nama. Proses  bisnis \r\npada  bagian  penjualan  barang  di  Biru  Royal  Atribut  tersebut  masih  bersifat \r\nkonvensional dimana pelanggan  harus  mendatangi toko untuk membeli  barang \r\nyang  diinginkan,  persoalan  penjualan  secara  langsung  berkaitan  dengan  ruang \r\nlingkup  dan  waktu  yang  terbatas.  Dari  permasalahan  tersebut  maka  dibuatkan \r\nsebuah website E-Commerce. Adapun langkah pengumpulan data yang dilakukan \r\nyaitu analisa dokumen, wawancara, pengamatan, dan studi pustaka. Kemudian \r\ndilanjutkan dengan membuat Business Model Canvas (BMC), dapat membantu \r\nuntuk mempercepat proses analisis kekuatan dan kekurangan bisnis. Serta untuk \r\nanalisis desain sistem menggunakan diagram yang ada dalam UML yaitu activity \r\ndiagram, use case diagram, class diagram, dan system sequence diagram. Fokus \r\nPenelitian ini adalah penyampaian informasi produk dan penjualan produk kepada \r\nkonsumen  secara online.  Manfaat  yang  didapat  dari  penerapan  sistem E-\r\nCommerce ini  adalah  konsumen  tidak  perlu  bertatap  muka  langsung  dengan \r\npenjual  sehingga    proses  transaksi  akan  lebih  efisien, dan  keuntungan  berupa \r\nruang  lingkup  yang  lebih  luas.  Penggunaan  teknik  SEO  merupakan  bagian \r\npenting dalam rangka  menjaga kelangsungan hidup dari sebuah website dalam \r\njangka waktu yang panjang, juga dapat memberikan nilai penerimaan keuntungan \r\nyang besar dari sisi bisnis. \r\n \r\nKata Kunci : E-Commerce, SEO, Toko Online, Business Model Canvas. \r\n \r\nix+87 halaman, 55 gambar, 1 tabel; 15 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(152,'1512500396','2021-02-05 14:01:51','20564','../files/1512500396.pdf',' \r\n \r\nSISTEM INFORMASI PENUNJANG KEPUTUSAN \r\nPENENTUAN GURU TERBAIK DENGAN METODE ANALYTICAL \r\nHIERARCHY PROCESS  (AHP) \r\nStudi Kasus : SMP Islam Al Hikmah \r\n \r\nOleh : Nugroho Bagus Wibowo (NIM : 1512500396) \r\n \r\nGuru adalah salah satu panutan dalam dunia pendidikan yang berperan sebagai \r\npendidik, pembimbing, penilai serta sebagai contoh teladan terhadap anak didik \r\nyang  diajarnya.  Predikat  guru  berprestasi  merupakan  salah  satu  cara  untuk \r\nmeningkatkan mutu dari kualitas pendidikan di SMP Islam Al Hikmah. Banyaknya \r\nguru yang ada sulit untuk melakukan keputusan pemilihan guru berprestasi secara \r\ncepat  dan akurat  serta  membutuhkan  waktu  yang  lama  dalam  perhitungannya. \r\nPenelitian  ini  bertujuan  untuk membuat  suatu Decision  Support  System (DSS) \r\ndengan metode analytical hierarchy process (AHP) berbasis web yang dirancang \r\nmenggunakan Hypertext  Preprocessing (PHP),  dan  database  MySQl  untuk \r\nmempermudah dalam pemilihan guru berprestasi secara cepat dan akurat tanpa \r\nmembutuhkan waktu yang lama dalam perhitungannya. Selain itu sistem dapat \r\ndiakses dimana saja dan kapan saja karena berbasis web terhubung langsung dengan \r\njaringan internet. Pemilihan guru berprestasi ditentukan dari menjumlahkan hasil \r\npenentuan kriteria-kriteria yang ada dengan bobot yang telah ditentukan. Hasil yang \r\nada akan dirangking sesuai dengan perhitungan yang ada pada metode AHP.  \r\n \r\nKata Kunci: DSS, Guru, Metode AHP, Web. \r\n \r\nxi+114 halaman; 90 Gambar; 25 Tabel; 16 Lampiran \r\n \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(153,'1512500404','2021-02-05 14:01:51','20113','../files/1512500404.pdf',' \r\n \r\nIMPLEMENTASI E-COMMERCE BERBASIS WEB DENGAN CONTENT \r\nMANAGEMENT SYSTEM (CMS) WORDPRESS PADA TOKO FIKHRI \r\nFAHRUL COLLECTION \r\n \r\nOleh : Muhammad Hanafi Nasution (1512500404) \r\n \r\nToko Fikhri Fahrul Collection merupakan salah satu usaha yang bergerak dalam \r\nbidang penjualan celana jogger, penjual mengeluhkan sedikitnya pelanggan pada \r\npenjualan produknya sehingga pendapatan yang masuk hanya sedikit dan diluar \r\ndari ekspetasi yang diinginkan. Penjual mengharapkan agar tokonya mendapatkan \r\npendapatan maksimal. Toko Fikhri Fahrul Collection juga masih menggunakan \r\nproses transaksi manual sehingga proses transaksi nya hanya dapat diakses di satu \r\ntempat. Maka  dari  itu,  penulis  mencoba  untuk  menerapkan e-commerce \r\nmenggunakan Content Management System (CMS) WordPress pada Toko Fikhri \r\nFahrul Collection dengan  memanfaatkan  teknologi  internet  sehingga  proses \r\npenjualannya dapat diakses kapan saja dan dimana saja menggunakan internet. \r\nSupaya  penjual  bisa  untuk  memasarkan  produk-produknya  secara  luas  (tidak \r\nterpaku dalam satu  tempat  saja) dan meraih  keuntungan  yang lebih besar dari \r\nsebelumnya yang pendapatannya kurang maksimal dari ekspetasi yang diinginkan \r\npenjual karena hanya menjual produknya di satu tempat saja. \r\n \r\nKata Kunci : penjualan celana jogger, E-commerce, CMS WordPress \r\n \r\nx+94 halaman; 97 gambar; 17 lampiran; \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(154,'1512500420','2021-02-05 14:01:51','116365','../files/1512500420.pdf',' \r\nPENERAPAN E-COMMERCE DALAM MENINGKATKAN PENJUALAN \r\nPADA TOKO DAPUR FILM DIGITAL \r\nOleh : Zulfikri Batapi (1512500420) \r\nDapur Film Digital adalah sebuah unit usaha yang bergerak pada bidang penjualan \r\nperangkat keras dan perangkat lunak komputer. Toko ini masih memiliki beberapa \r\nkekurangan dalam menunjang proses transaksi jual beli barang. Transaksi yang saat \r\nini dilakukan hanya sebatas pembeli datang ke toko lalu memilih barang yang \r\ndiinginkan dan juga bisa melalui social media seperti WhatsApp dan juga bisa \r\nmelalui online  marketplace seperti  tokopedia.  Dengan  hanya  mengandalkan \r\npenjualan dari sosial media dan online marketplace, dirasa masih kurang untuk \r\nmeningkatkan  tingkat  penjualan  barang.  Oleh  karena  itu  dibangunlah  sebuah \r\nWebSite  E-commerce dengan  menggunakan wordpress  woocomerce, hosting, \r\ndomain untuk mengoptimalkan tingkat penjualan barang pada Toko Dapur Film \r\nDigital. Metode  yang digunakan untuk  membuat e-commerce ini  yaitu  dengan \r\nmenggunakan activity diagram, use case diagram, system sequence diagram, serta \r\nifml,  Maka  dari  itu  dengan dibangunnya  sebuah website  e-commerce dapat \r\nmeningkatkan penjualan pada toko dan juga dapat menyelesaikan masalah masalah \r\nyang dialami oleh toko dapur film digital. \r\nKata Kunci : e-commerce, perangkat keras, perangkat lunak, meningkatkan pen- \r\n    jualan \r\nix + 108 halaman; 75 gambar; 6 tabel; 10 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(155,'1512500446','2021-02-05 14:01:51','57768','../files/1512500446.pdf',' \r\n \r\nIMPLEMENTASI E-COMMERCE \r\nPADA TOKO UNA BABY \r\n \r\nOleh : Sufyan Aris Saputra (NIM : 1512500446) \r\nToko Una Baby merupakan salah satu badan usaha yang berfokus dalam bidang \r\npenjualan  pakaian  dan  perlengkapan  bayi.  Di  zaman  yang  sudah  umumnya \r\ncanggih seperti ini terutama dari sisi IT, Toko Una Baby mencoba memanfaatkan \r\nfasilitas e-commerce. Keadaan saat ini, pelanggan yang ingin membeli pakaian \r\ndan perlengkapan bayi di Toko tidak bisa melihat daftar produk  yang tersedia \r\nsehingga kurang mendapatkan informasi. Pelanggan memiliki waktu yang terbatas \r\nuntuk melakukan transaksi pemesanan karena hanya bisa dilakukan pada waktu \r\njam  kerja.  Pada  penelitian  ini penulis mengimplementasikan  menggunakan \r\nContent  Management  System (CMS)  dengan  metode  pengembangan  sistem \r\nWaterfall. Hasil penelitian menunjukkan bahwa dengan mengidentifikasi masalah \r\nyang terjadi, sistem e-commerce mampu menyediakan beberapa fitur fungsional \r\nyang lebih memudahkan pelanggan dalam proses transaksi pembelian produk di \r\nToko Una Baby dan dalam waktu yang lebih lama lagi. Penulis berharap dengan \r\ndiciptakannya website berbasis e-commerce ini  mampu  memaksimalkan \r\npendapatan dari hasil penjualan produk dan mempromosikan nama Toko kepada \r\npelanggan dalam jarak yang lebih luas lagi. \r\n \r\nKata Kunci : E-commerce, Content Management System, Pakaian dan \r\nPerlengkapan Bayi \r\n \r\nxii + 101 halaman; 72 gambar; 10 tabel; 21 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(156,'1512500487','2021-02-05 14:01:51','69400','../files/1512500487.pdf',' \r\n \r\nPENERAPAN E-COMMERCE BERBASIS CONTENT MANAGEMENT \r\nSYSTEM (CMS) UNTUK PELAYANAN KATERING PADA PT SELERA \r\nAMANAH INDONESIA \r\nOleh: Jotry Firdani Maharaja (1512500487) \r\nDi zaman yang serba digital ini semua aktifitas kegiatan jual-beli baik produk fisik, \r\nproduk digital,  maupun  jasa sudah dilakukan secara cepat,  murah, dan  mudah \r\ndengan adanya sistem E-commerce. PT Selera Amanah Indonesia merupakan badan \r\nusaha  yang  bergerak  dalam  bidang  jasa  catering di  tangerang.  Kendala yang \r\ndihadapi adalah kepercayaan. Kepercayaan bukan sesuatu yang gratis dan didapat \r\ndengan mudah dan Strategi promosi yang dilakukan masih cara konvensional yaitu \r\nmulut ke mulut sehingga jangkauan pasar hanya di dekat perusahaan. Berdasarkan \r\nPermasalahan  yang ada pada PT Selera Amanah Indonesia peneliti melakukan \r\nperancangan  dalam  pembuatan  website  E-Commerce berbasis Content \r\nManagement System (CMS) untuk memudahkan proses penjualan secara online. \r\nDalam pengumpulan data, peneliti menggunakan studi lapangan seperti wawancara \r\ndan analisa dokumen. Rancangan E-Commerce digunakan dapat  meningkatkan \r\npenjualan  pada  PT  Selera  Amanah  Indonesia  di  tangerang.  Penelitian  ini \r\nmenghasilkan  aplikasi E-Commerce yang  dapat  menunjang  penjualan  dan \r\npengolahan data penjualan serta transaksi yang ada pada perusahaan. \r\nKata kunci:,E-Commerce,Catering,Content Management System, Penjualan \r\nx + 110 Halaman; 81 Gambar; 15 Lampiran; 28 Tabel \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(157,'1512500503','2021-02-05 14:01:51','20572','../files/1512500503.pdf',' \r\n \r\nSISTEM PENUNJANG KEPUTUSAN PENILAIAN KINERJA GURU \r\nMENGGUNAKAN METODE SIMPLE ADDITIVE WEIGHTING STUDI \r\nKASUS: SMA MUHAMMADIYAH 18 JAKARTA \r\n \r\nOleh : Muhammad ivan fadillah (NIM : 1512500503) \r\n \r\n Penelitian  ini  bertujuan  untuk  mengembangkan  sistem  pendukung \r\nkeputusan yang dapat memudahkan dalam proses penilaian kinerja guru yang ada \r\ndi SMA Muhammadiyah 18 Jakarta dan memberikan alternatif peningkatan hasil \r\nseleksi  penilaian  kineja  guru.  Sistem  penunjang  keputusan  ini  menggunakan \r\nmetode Simple additive weighting (SAW). Sistem ini dapat menampilkan hasil \r\nperangkingan guru berkinerja baik berdasarkan hasil perhitungan metode SAW. \r\nHasil perangkingan  guru diurutkan dari hasil total  nilai  tertinggi  ke total nilai \r\nterendah. Sistem penunjang keputusan ini juga bisa digunakan untuk tahun ajaran \r\nberikutnya sesuai dengan kebutuhan untuk evaluasi kinerja guru pertahun ajaran \r\nbaru. Sistem penunjang keputusan penilaian kinerja guru dengan metode SAW ini \r\ndapat  membantu  mempermudah  pelaksanaan  penilaian  kinerja  guru  di  SMA \r\nMuhammadiyah 18 Jakarta dari yang bagus kinerjanya sampai yang tidak bagus \r\ndan memberikan alternatif hasil perangkingan dengan metode SAW. Karenanya, \r\nguru dituntut untuk tanggung jawab tersebut, tidak hanya sekedar membuat peserta \r\ndidik  menjadi  tahu  dan  memahami  bahan  ajar  yang  diberikan,  tetapi  dapat \r\nmenjadikan  peserta  didik  menjadi  manusia  terdidik  yang  memahami  perannya \r\nsebagai  manusia,  sehingga  bermanfaat  bagi  diri  sendiri  dan  lingkungan \r\ndisekitarnya. Pada sistem penunjang keputusan penilaian kinerja guru ini dibuat \r\ndengan MySQL sebagai database dan PHP sebagai tool pembuat sistem. \r\n \r\nKata Kunci : SPK, SAW, penilaian, kinerja guru \r\nviii+ 96 halaman;  41 Gambar;  31 Tabel;  10 LampiranPerpustakaan Universitas Budi Luhur\r\n'),(158,'1512500537','2021-02-05 14:01:51','212123','../files/1512500537.pdf',' \r\nRANCANG BANGUN WEBSITE PENJUALAN BERBASIS E-COMMERCE \r\nPADA TOKO AL HAJ COLLECTION \r\nOleh : Putri Safitri (NIM: 1512500537) \r\nElectronic commerce merupakan suatu kontak transaksi perdagangan antara \r\npenjual  dan  pembeli  dengan  menggunakan  media internet.  Salah  satu  aktifitas \r\npenjualan,  pemasaran,  jasa  melalui  internet  dan  jaringan  komputer  yang  sekarang \r\nbiasa disebut belanja online. Penelitian ini mengambil studi kasus pada toko Al Haj \r\nCollection yaitu usaha yang bergerak dalam bidang fashion yang menjual berbagai \r\nmacam pakaian muslim. Mekanisme sistem penjualan pada toko Al Haj Collection \r\nsekarang masih kurang efektif, dimana konsumen  harus datang  langsung ke toko. \r\nCara  pemasaran  yang  saat  ini  dilakukan  hanya  melalui  Sosial  Media.  Selain  itu, \r\ndalam pembuatan laporan masih menggunakan pembukuan. Tujuan dari penelitian ini \r\nadalah membangun website e-commerce menggunakan Content Management System \r\n(CMS)  yaitu wordpress.  Penelitian  ini  menggunakan  metode Bussiness  Model \r\nCanvas (BMC) untuk membantu memperjelas elemen apa saja yang dapat membantu \r\nAl Haj  Collection  dalam  kelangsungan  produksi  dan  penjualannya.  Hasil  dari \r\npenelitian  ini  adalah  membangun website  e-commerce untuk mempermudah \r\nkonsumen  dalam  transaksi  tanpa  adanya  batasan  waktu  dan  tempat dan  juga \r\nmemudahkan pemilik toko Al Haj Collection dalam meningkatkan manajemen dan \r\npemasarannya, sehingga toko akan lebih dikenal secara luas oleh masyarakat karena \r\ndapat diakses oleh banyak orang dan juga membantu dalam penyusunan laporan yang \r\ndiperlukan. \r\nKata kunci : E-commerce, CMS, BMC, Pakaian \r\nix + 104 halaman; 83 gambar; 17 tabel; 15 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(159,'1512500545','2021-02-05 14:01:52','20090','../files/1512500545.pdf',' \r\n \r\nSISTEM PENUNJANG KEPUTUSAN PEMILIHAN SUPPLIER TERBAIK  \r\nDENGAN METODE ANALYTICAL HIERARCHY PROCESS PADA \r\nKLINIK AMC \r\n \r\nOleh : AUDDIE MAHLYDA (NIM 1512500545) \r\n  \r\n \r\nKlinik AMC dituntun  untuk  memberikan  pelayanan  yang  memadai  dan \r\nmemuaskan  agar  kebutuhan  masyarakat  dalam  pelayanan  kesehatan  terpenuhi. \r\nDengan  ini  maka  Klinik  harus  meningkatkan  kualitas  pelayanannya  dalam \r\npembelian  obat  kepada  pasien.  ketatnya  persaingan  pelayanan  kesehatan, \r\nmembuat  bisnis  kesehatan  semakin berat  untuk  dihadapi,  terutama  dalam  jasa \r\npelayanan terhadap konsumen. Dalam era persaingan bebas ini, Klinik menyadari \r\nbahwa dalam meningkatkan pelayanan obat kepada konsumen sangat terkait erat \r\ndengan pemilihan supplier. Hal ini terkait dengan adanya pengaruh antara kualitas \r\ndan layanan  yang  dihasilkan  dalam  sebuah  Klinik  dengan  kualitas  obat  yang \r\ndisediakan.  Sedangkan  kualitas  obat  yang  disediakan  sangat  terkait  dengan \r\nkualitas supplier.  Masalah  yang  sering  terjadi  adalah  dalam  proses  pemilihan \r\nsupplier yang tidak mudah. Dengan banyaknya jumlah supplier yang menawarkan \r\nobat, maka pihak Klinik harus selektif dan cermat dalam memilih supplier. Dari \r\npenelitian  tersebut  dibuatkan  sebuah  sistem  penunjang  keputusan  pemilihan \r\nsupplier terbaik  dengan  metode  Analytical  Hierarkhi  Process  yang  dapat \r\nmempermudah dalam pemilihan supplier terbaik pada klinik AMC. \r\n \r\n \r\nKata Kunci : SPK, AHP, Pemilihan Supplier Terbaik \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(160,'1512500578','2021-02-05 14:01:52','68014','../files/1512500578.pdf',' \r\n \r\nRANCANGAN ELECTRONIC CUSTOMER RELATIONSHIP \r\nMANAGEMENT (E-CRM) BERBASIS WEB DALAM UPAYA \r\nMENINGKATKAN PENJUALAN PADA PT. DIGITAL TRAVEL \r\nINDONESIA \r\n Semakin  berkembangnya  teknologi  informasi  menyebabkan  kita  harus \r\nmenerapkan  teknologi  informasi  kedalam suatu  bisnis.  Salah  satu  cara  yang \r\ndigunakan oleh banyak perusahaan adalah dengan menerapkan teknologi informasi \r\ndalam mencari pelanggan baru dan setia. Salah satu metode yang dapat digunakan \r\nadalah Customer  Relationship  Management (CRM)  agar  perusahaan  terus \r\nmendapatkan pelanggan baru dan juga tetap memperhatikan pelanggan yang ada. \r\nPT.  Digital  Travel  Indonesia  adalah  sebuah  biro  jasa  perjalanan wisata \r\nmancanegara, setelah 5 tahun berdiri perusahaan ini masih sulit untuk mencari \r\npelanggan baru dan mempertahankan pelanggan yang ada, sehingga menyebabkan \r\ntarget penjualan perusahaan tidak tercapai. Beberapa masalah yang dihadapi oleh \r\nperusahaan  adalah lambatnya  merespon keluhan  dikarenakan  perusahaan  harus \r\nmencari  paket tour yang  digunakan,  belum  adanya testimoni dari  pelanggan \r\nsehingga perusahaan sulit mendapatkan calon pelanggan, tidak adanya informasi \r\nketersediaan paket tour dan informasi slot paket tour, dan tidak adanya informasi \r\npelanggan yang loyal sehingga perusahaan sulit untuk memberikan diskon kepada \r\npelanggan yang loyal. Oleh karena itu diperlukan suatu sistem Electronic Customer \r\nRelationship  Management (E-CRM)  berbasis web untuk  menyelesaikan \r\npermasalahan yang ada, dan diharapkan dapat menjawab masalah target penjualan \r\ntidak tercapai yang dialami oleh PT. Digital Travel Indonesia. \r\n \r\nKata  Kunci: Customer  Relationship  Management,  target  penjualan, Electronic \r\nCustomer Relationship Management \r\nix + 111 halaman; 67 gambar; 28 tabel; 7 lampiran \r\n Perpustakaan Universitas Budi Luhur\r\n'),(161,'1512500586','2021-02-05 14:01:52','101610','../files/1512500586.pdf',' \r\n \r\nDESAIN DAN PENGEMBANGAN E-COMMERCE DENGAN MODEL \r\nBISNIS KANVAS : STUDI KASUS TOKO LAST SNEAKERS \r\n \r\nOleh: Alvionita Desiana (NIM: 1512500586) \r\n \r\nInternet  merupakan  salah  satu  jaringan  global  yang  menghubungkan  jaringan \r\nkomputer  diseluruh  dunia,  sehingga  komunikasi  dan  interaksi  antar  satu \r\nperusahaan dengan customer. Cara Toko Last Sneakers mempromosikan tokonya \r\nkepada masyarakat masih sederhana sehingga masyarakat kurang mengenal toko \r\ntersebut.  Kehadiran e-commerce sebagai  media  transaksi  baru  ini  tentunya \r\nmenguntungkan banyak pihak, baik pihak customer maupun pihak produsen dan \r\npenjual.  Untuk  itu  Toko  Last  Sneakers  mulai  mencari  terobosan  baru  dengan \r\nmemanfaatkan e-commerce sebagai salah satu media promosi dan penjualan untuk \r\nmeningkatkan omzet penjualan serta pemasarannya tidak terbatas namun dapat \r\ndiketahui oleh banyak masyarakat. Tujuan dari penulisan ini adalah membuatkan \r\nsuatu media website e-commerce pada Toko Last Sneakers untuk memudahkan \r\ncustomer untuk  melakukan  pembelian  tanpa  harus  datang  langsung  ke  toko. \r\nMetode  yang  digunakan  adalah Business  Model  Canvas yang  akan  digunakan \r\nuntuk menganalisis model bisnis Toko Last Sneakers. Sistem ini menggunakan \r\nbahasa pemograman PHP dengan Framework CodeIgniter. Hasil dari penelitian \r\nini  adalah website yang  dijadikan  sebagai  media  promosi  dan  mempermudah \r\nproses penjualan yang dilakukan secara online. \r\n \r\nKata kunci : E-commerce, Business Model Canvas, website, PHP, sneakers. \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(162,'1512500594','2021-02-05 14:01:52','138218','../files/1512500594.pdf',' \r\nSISTEM PENUNJANG KEPUTUSAN PEMILIHAN SISWA \r\nTERBAIK PADA SEKOLAH UMUM SURYA BANGSA DENGAN \r\nMENGGUNAKAN METODE ANALYTICAL HIERARCHY \r\nPROCESS (AHP) \r\nOleh : Sri Hanafi (NIM : 1512500594) \r\nSekolah Umum Surya Bangsa adalah sekolah yang bergerak di bidang pendidikan, \r\nyayasan ini mulai berdiri sejak tahun 2002.  Dengan nama sekolah \"One Two Three \r\nSchool\" sekolah ini berada di lingkungan palem semi Tangerang. Kemudian pada juli \r\n2006  di  buka  kelas  untuk  tingkat  sekolah  dasar.  Masalah  yang  ada  dalam \r\nmengevaluasi  siswa  terbaik  adalah belum  menggunakan  metode  yang  dapat \r\nmenentukan  prioritas  dari  banyak  kriteria, dan  belum  adanya  pembobotan  untuk \r\nsetiap  kriteria. yang  mengakitbatkan  hasil  pernilaian  kurang  tepat  Penelitian  ini \r\nbertujuan. untuk  mengembangkan  sebuah  sistem  penunjang  keputusan  penentuan \r\nsiswa terbaik menggunakan metode Analytical Hierarchy Process (AHP). Dengan \r\nmencari    nilai  banding  kriteria. Dengan  metode  AHP  dapat  di  ketahui prioritas \r\nkriteria, sebagai pemilihan dalam best character ini terdapat tiga kriteria yang paling \r\nmenentukan adalah kejujuran dengan bobot 0.2131, kerajinan dengan bobot 0.1302, \r\ndan kesopanan dengan bobot 0.1232. \r\nKata  Kunci  : Analytical  Hierarchy  Process (AHP), Sekolah  Umum  Surya \r\nBangsa,Pemilihan siswa terbaik  \r\nix+146 halaman 14;81gambar;31tabel;25lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(163,'1512500610','2021-02-05 14:01:52','162116','../files/1512500610.pdf',' \r\n \r\nSISTEM PENUNJANG KEPUTUSAN PEMILIHAN \r\nKARYAWAN TERBAIK MENGGUNAKAN METODE \r\nANALYTICAL HIERARCHY PROCESS (AHP) \r\nPADA PT. RADIO ELSHINTA \r\nOleh : Ary Maulana Pratama (NIM : 1512500610) \r\n \r\nKinerja karyawan yang tidak stabil sangat mempengaruhi hasil yang ingin dicapai \r\nperusahaan. PT. Radio Elshinta merupakan perusahaan yang bergerak di bidang \r\njaringan  radio  siaran  Indonesia  yang  berpusat  di  Jakarta,  dimana  perusahaan \r\ntersebut menyiarkan berita dan informasi yang aktual. Masalah yang terdapat dalam \r\nmengadakan  sistem  pemilihan  karyawan  terbaik  adalah  belum  adanya  bobot \r\nkeriteria dan  subkriteria beserta  metode  dalam  pemilihan  karyawan  terbaik, \r\nsehingga  sulit  untuk  menentukan  karyawan  terbaik  yang  tepat  dan  akurat. \r\nPenelitian ini bertujuan untuk membangun sistem penunjang keputusan pemilihan \r\nkaryawan  terbaik dengan  menerapkan  metode Analytical  Hierarchy  Process \r\n(AHP). Penghitungan bobot subkriteria pada kriteria Personal skill yang dihasilkan \r\ndalam penelitian ini adalah Subkriteria Kreativitas dan inisiatif serta fleksibilitas \r\n3,87%, kemampuan berfikir secara rasional  dan kemauan untuk  maju 28,78%, \r\nDisiplin  kerja  dan  rasa  tanggung  jawab  dalam  melaksanakan  tugas 17,52%, \r\nkemampuan  berkomunikasi  dan  bekerja  sama 8,52%, Kerajinan,  ketekunan, \r\nkerapihan,  kejujuran,  &  loyal  dalam  melaksanakan  pekerjaan 17,59%, \r\nKedewasaan, hormat kepada atasan dan stabilitas 8,7%, Rasa memiliki perusahaan \r\n15,01% dengan hasil uji Consistency Ratio (CR) sebesar 0,0502. Sistem penunjang \r\nkeputusan ini dapat memberikan informasi dengan lebih jelas dan cepat sehingga \r\ndapat memudahkan proses pemilihan karyawan terbaik pada PT. Radio Eshinta. \r\n \r\nKata kunci: Sistem Penunjang Keputusan, karyawan, AHP. \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(164,'1512503085','2021-02-05 14:01:52','40453','../files/1512503085.pdf',' \r\n \r\nPENERAPAN E-COMMERCE DAN SEO PADA TOKO PLANTY CLUB \r\n \r\nOleh : Vinka Novianti Prasya (1512503085) \r\n \r\n Planty Club adalah Perusahaan yang bergerak dalam kuliner vegan yang \r\nmenjual  berbagai makanan  beku  (frozen  food)  berbahan  dasar  tanpa  daging \r\nhewani dan susu. Proses bisnis pada bagian penjualan produk pada toko planty \r\nclub tersebut masih bersifat konvensional dimana pelanggan harus mendatangi \r\ntoko untuk membeli barang yang diinginkan, persoalan penjualan secara langsung \r\nberkaitan  dengan  ruang  lingkup  dan  waktu  yang  terbatas.  Dari  permasalahan \r\ntersebut  maka  dibuatkan  sebuah website  E-Commerce.  Adapun  langkah \r\npengumpulan  data  yang  dilakukan  yaitu  analisa  dokumen,  wawancara, \r\npengamatan, dan studi pustaka. Kemudian dilanjutkan dengan membuat Business \r\nModel  Canvas (BMC),  dapat  membantu  untuk  mempercepat  proses  analisis \r\nkekuatan dan kekurangan bisnis. Serta untuk analisis desain sistem menggunakan \r\ndiagram yang ada dalam UML yaitu activity diagram, use case diagram, class \r\ndiagram, dan system sequence diagram. Fokus Penelitian ini adalah penyampaian \r\ninformasi produk dan penjualan produk kepada konsumen secara online. Manfaat \r\nyang didapat dari penerapan sistem E-Commerce ini adalah konsumen tidak perlu \r\nbertatap  muka  langsung  dengan  penjual  sehingga    proses  transaksi  akan  lebih \r\nefisien, dan keuntungan berupa ruang lingkup yang lebih luas. Penggunaan teknik \r\nSEO merupakan bagian penting dalam rangka menjaga kelangsungan hidup dari \r\nsebuah website dalam jangka waktu yang panjang, juga dapat memberikan nilai \r\npenerimaan keuntungan yang besar dari sisi bisnis. \r\n \r\nKata Kunci : E-Commerce, SEO, Toko Online, Business Model Canvas, \r\n  Website.  \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(165,'1512503101','2021-02-05 14:01:52','87468','../files/1512503101.pdf',' \r\n \r\nSISTEM PENDUKUNG KEPUTUSAN PENENTUAN GURU TERBAIK \r\nPADA SEKOLAH MENENGAH PERTAMA (SMP) MAZROATUL ULUM \r\nMENGGUNAKAN METODE ELIMINATION AND CHOICE \r\nTRANSLATION REALITY ( ELECTRE ) \r\n \r\nOleh : Irgi Arifal Nulhakim (1512503101) \r\n \r\nGuru merupakan tenaga pendidik profesional dengan tugas mendidik, mengajar, \r\nmembimbing, mengarahkan dan mengevaluasi peserta didik. SMP Mazroatul Ulum \r\nyang berlokasi di kecamatan Ciledug kota Tangerang merupakan salah satu sekolah \r\nyang berupaya meningkatkan mutu pendidikan agar dapat bersaing dengan sekolah \r\nlainnya. Salah satu upaya yang dilakukan adalah dengan mengevaluasi kinerja guru. \r\nPermasalahan dalam melakukan pemilihan guru terbaik masih dipengaruhi unsur \r\nsubjektifitas dimulai dari metode yang digunakan belum tepat karena penilaian \r\nyang dilakukan dengan cara penunjukkan sampai dengan kriteria yang digunakan \r\nbelum menggunakan bobot secara standar. Terlebih lagi, saat memberikan penilaian \r\nterdapat penilaian yang tidak pasti atau tidak tepat karena penilaian yang diberikan \r\nberbeda - beda.  Dengan  adanya  sistem  pendukung  keputusan  penentuan  guru \r\nterbaik diharapkan dapat membantu proses pengambilan keputusan guru terbaik \r\nlebih mudah, cepat dan akurat. Penelitian ini bertujuan merancang dan membuat \r\nsistem pendukung keputusan guru terbaik menggunakan metode Elimination And \r\nChoice  Translation  Reality (Electre).  Sistem  ini  menggunakan  metode  electre \r\nsebagai proses perhitungan dan perangkingan. Hasil yang didapat sistem ini dapat \r\nmemberikan perangkingan dan kemudahan dalam menentukan guru terbaik. Guru \r\nterbaik adalah guru yang memiliki nilai hasil tertinggi dengan membandingkan \r\nantar kriteria dan guru lainnya. Sistem pendukung keputusan ini menggunakan \r\nbahasa pemrograman PHP dan MySql sebagai database. \r\n \r\nKata Kunci : Sistem Pendukung Keputusan, Penentuan Guru Terbaik, Metode \r\nElectre. \r\n \r\nx +111 halaman; 81 gambar; 19 tabel; 12 lampiran. Perpustakaan Universitas Budi Luhur\r\n'),(166,'1512503119','2021-02-05 14:01:52','189319','../files/1512503119.pdf',' \r\n \r\n \r\nPENERAPAN E-COMMERCE MENGGUNAKAN CMS \r\n(CONTENT MANAGEMENT SYSTEM) WORDPRESS PADA \r\nTOKO OBAMA (OREN BANG MAMAT) \r\n \r\n \r\nOleh: Muhammad Fiqri Hidayatullah (NIM: 1512503119) \r\n \r\n \r\nToko OBAMA (Oren Bang Mamat) adalah toko yang menjual beraneka ragam \r\nmerchandaise seperti syal, kaus dan jersey klub sepak bola Persija Jakarta. Dalam \r\nproses penjualan pada toko OBAMA (Oren Bang Mamat) masih melalui system \r\nmanual, dimana pembeli harus datang langsung ke toko untuk membeli barang. \r\nHal  ini  membuat  penjualan  dan  pemasaran produk  kurang  optimal  karena \r\npenjualan produk hanya berada disekitar toko saja. Penulis akan membuat suatu \r\nsistem e-commerce menggunakan business model canvas untuk diterapkan pada \r\ntoko oren bang mamat. Hadirnya e-commerce sebagai media transaksi jual beli \r\npada toko OBAMA (Oren Bang Mamat) akan memberikan keuntungan seperti \r\nkemudahan  informasi  yang  didapat,  kemudahan  cara  pembayaran,  pemrosesan \r\npemesanan  yang  lebih  cepat,  meningkatkan  jangkauan  pemasaran  produk  atau \r\njasa menjadi lebih luas dan mendapatkan keperayaan yang lebih dari pelanggan. \r\nUntuk itu, pada penelitian ini penulis akan membuat \"Penerapan E-Commerce \r\nMenggunakan  CMS  (Content  Management  System) Wordpress pada  Toko \r\nOBAMA  (Oren  Bang  Mamat)\"  untuk  mengatasi  permasalahan  yang  ada  pada \r\ntoko OBAMA. \r\n \r\nKata Kunci: e-commerce, Content Management System, wordpress \r\n \r\nxi + 89 halaman; 105 gambar; 18 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(167,'1512503127','2021-02-05 14:01:52','20549','../files/1512503127.pdf',' \r\nSISTEM PENUNJANG KEPUTUSAN UNTUK PEMILIHAN SUPPLIER \r\nPADA SICI BUSANA DENGAN METODE ANALYTICHAL HIERARCY \r\nPROCESS(AHP) DAN SIMPLE ADDITIVE WEIGHTING(SAW)  \r\n \r\nOleh: Prabowo Adi Pangestu(1512503127) \r\nDi era globalisasi seperti saat ini ilmu pengetahuan dan teknologi yang \r\nsudah  berkembang  sangat  bermanfaat  bagi  kehidupan  manusia.  Segala  macam \r\nkegiatan manusia saat ini dapat dikerjakan dengan cepat dan mudah menggunakan \r\nkomputer. Pemilihan supplier merupakan  salah  satu  hal  yang  penting  dalam \r\naktivitas  pembelian  bagi  perusahaan,  di  mana  aktivitas  pembelian  merupakan \r\naktivitas  yang  memiliki  nilai  penting  bagi  perusahaan  karena  pembelian \r\nkomponen, bahan baku, dan persediaan merepresentasikan porsi yang cukup besar \r\npada  produk  jadinya.  Dalam  mengambil  keputusan  untuk  memilih supplier, \r\npengambil  keputusan  (decision  maker)  membutuhkan  alat  analisis  yang \r\nmemungkinkan  mereka  untuk  memecahkan  masalah  yang  bersifat  kompleks \r\nsehingga  keputusan  yang  diambil  lebih  berkualitas.  Pemilihan supplier harus \r\ndilakukan  secara  hati-hati  karena  pemilihan supplier yang  salah  akan \r\nmenyebabkan  terganggunya  proses  operasional  perusahaan.  Dengan  adanya \r\nsistem pendukung keputusan diharapkan dapat membantu dalam proses pemilihan \r\nsupplier dengan  penilaian supplier dengan  tepat  dan  akurat,  Menghasilkan \r\nrancangan  sistem  penunjang  keputusan  pemilihan supplier yang  dapat \r\nmemberikan  penilaian  yang  efektif  bagi  masing-masing  alternatif,  dan \r\nMenyediakan  laporan  hasil  proses  pemilihan supplier untuk  mempermudah \r\nanalisa kriteria keputusan. Sistem penunjang keputusan pemilihan supplier akan \r\nmembantu pihak Sici Busana dalam melakukan proses pengambilan keputusan \r\npemilihan supplier yang sesuai kriteria secara efektif sehingga dapat memberikan \r\nhasil maksimal bagi pihak Sici Busana. \r\nKata  Kunci: Sistem  Penunjang  Keputusan. Supplier, Analytichal  Hierarcy \r\nProcess, Simple Additive Weighting \r\nix +100 Halaman; 42 Gambar ;31 Tabel ;17 Lampiran \r\n \r\n \r\n \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(168,'1512503168','2021-02-05 14:01:52','243002','../files/1512503168.pdf',' \r\n \r\nSISTEM PENUNJANG KEPUTUSAN PEMILIHAN \r\nKARYAWAN TERBAIK SETIAP JABATAN DENGAN \r\nMENERAPKAN METODE ANALYTICAL HIERARCHY \r\nPROCESS dan SIMPLE ADDITIVE WEIGHTING \r\nPADA PT. WAHANA PIRANTI TEKNOLOGI \r\n \r\nOleh : Fitra Rahmatullah (NIM : 1512503168) \r\n \r\nKaryawan adalah Sumber Daya  Manusia  (SDM) yang dimanfaatkan dalam \r\nmencapai target yang ditetapkan dan juga merupakan aset penting yang harus dijaga \r\noleh perusahaan. PT. Wahana Piranti Teknologi merupakan sebuah perusahaan \r\nyang bergerak dibidang distributor IT yang berupaya membidik dan menangkap \r\nPasar Indonesia. Kinerja karyawan yang tidak stabil saat ini, mempengaruhi hasil \r\nyang  ingin  dicapai  PT.  Wahana  Piranti  Teknologi. Salah  satu  upaya dalam \r\nmeningkatkan  kinerja  karyawan yaitu mengadakan sistem  pemilihan  karyawan \r\nterbaik yang dapat memberi motivasi dan dorongan dalam meningkatkan kinerja \r\nkaryawan. Masalah yang terdapat dalam mengadakan sistem pemilihan karyawan \r\nterbaik adalah belum adanya kriteria,  bobot  keriteria  beserta metode  dalam \r\npemilihan karyawan terbaik, sehingga sulit untuk menentukan karyawan terbaik \r\nyang tepat dan akurat. Penelitian ini bertujuan untuk membangun sistem penunjang \r\nkeputusan pemilihan karyawan terbaik setiap jabatan dengan menerapkan metode \r\nAnalytical  Hierarchy Process (AHP) dan Simple  Additive Weighting (SAW). \r\nPenghitungan  bobot  kriteria pada  jabatan technical yang  dihasilkan  dalam \r\npenelitian  ini  adalah Kriteria Lama  Bekerja  4,1%,  Kriteria  Presentasi  5,58%, \r\nKriteria Project 58,76%, Kriteria Sertifikasi 21,03%, dan Kriteria Training 10,53%, \r\ndengan  hasil  uji Consistency  Ratio (CR)  sebesar 0,0745.  Sistem  penunjang \r\nkeputusan ini dapat memberikan informasi dengan lebih jelas dan cepat sehingga \r\ndapat memudahkan proses pemilihan karyawan terbaik pada PT. Wahana Piranti \r\nTeknologi. \r\n \r\nKata kunci: Sistem Penunjang Keputusan, Karyawan, AHP, SAW. \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(169,'1512503192','2021-02-05 14:01:52','92370','../files/1512503192.pdf',' \r\n \r\nRANCANGAN ELECTRONIC CUSTOMER RELATIONSHIP \r\nMANAGEMENT (E-CRM) DALAM UPAYA MENINGKATKAN \r\nLOYALITAS PELANGGAN BERBASIS WEB. (STUDI KASUS PADA \r\nPT.ARFA MUTIARA MULIA) \r\nPada era globalisasi saat ini semua kegiatan ditunjang melalui teknologi \r\nsistem  informasi  dan  ilmu  pengetahuan  yang  berkembang  semakin  pesat. \r\nPerkembangan yang semakin pesat ini menuntut para pelaku bisnis untuk lebih \r\nkreatif dan inovatif dalam  mengembangkan bisnis. Suatu  perusahaan dapat \r\ndikatakan berhasil memperoleh faktor penting untuk kelanjutan perusahaan jika \r\nmenjadikan pelanggan sebagai prioritas utamanya dan memberikan perlakuan \r\nkhusus agar pelanggan bertahan dalam perusahaan tersebut. PT. Arfa Mutiara \r\nMulia adalah perusahaan biro perjalanan umroh dan haji yang melayani paket \r\numroh dan haji.  PT. Arfa Mutiara Mulia mengalami kendala dalam penanganan \r\nkeluhan yang belum optimal sehingga pelanggan masih merasa tidak puas. \r\nSelain itu pengiriman informasi rencana perjalanan dikirim melalui grup chat, \r\nmenyebabkan terkadang pelanggan tidak menerima informasi perihal rencana \r\nperjalanan. Penyebab lainnya pelanggan ragu untuk mendaftar karena belum \r\nadanya review dari pelanggan lain. Customer Relationship Management (CRM) \r\nmerupakan  salah  satu  strategi  yang  digunakan  untuk  berinteraksi  dengan \r\npelanggan untuk mendapatkan informasi yang cukup tentang pelanggan dan \r\nmengolah informasi tersebut menjadi nilai tambah perusahaan. Oleh karena itu, \r\ndiperlukan suatu sistem Electronic Customer Relationship Management (E-\r\nCRM) berbasis website yang menyediakan interface antara pelanggan dengan \r\npihak PT.Arfa Mutiara Mulia untuk menyelesaikan permasalahan  yang ada \r\nsehingga dapat meningkatkan loyalitas pelanggan. \r\n \r\nKata  Kunci  : Customer  Relationship  Management, Electronic  Customer \r\nRelationship Management dan Meningkatkan loyalitas pelanggan \r\n \r\nxi + 104 halaman; 63 gambar; 24 tabel; 13 lampiran  Perpustakaan Universitas Budi Luhur\r\n'),(170,'1512503242','2021-02-05 14:01:52','117238','../files/1512503242.pdf',' \r\n \r\nIMPLEMENTASI E-COMMERCE BERBASIS WEB DENGAN CONTENT \r\nMANAGEMENT SYSTEM (CMS) WORDPRESS PADA TOKO \r\nTATASHOPS \r\n \r\nOleh : TRY ABDI PUTRA (NIM : 1512503242) \r\n \r\nE-commerce merupakan  transaksi  perdagangan  atau  jual  beli  melalui  media \r\nelektronik  yang  terhubung  dengan  internet.  Tatashops  merupakan  toko \r\nkonvensional yang bergerak di bidang penjualan produk perlengkapan bayi seperti \r\nperlengkapan makan, perlengkapan tidur, perlengkapan mandi, dan perlengkapan \r\npakaian. Dalam beberapa terakhir ini, toko Tatashops mengalami penurunan hasil \r\npenjualan.  Hal  ini  disebabkan  oleh  perkembangan e-commerce yang  saat  ini \r\nsemakin  pesat,  sehingga  toko  konvesional  seperti  toko  Tatashops  ini  kalah \r\nbersaing  dengan  toko online yang  dapat  memberikan  banyak  kemudahan  bagi \r\npenjual  maupun  pelanggan.  Salah  satu  solusi  dari  permasalahan  ini  adalah \r\nmengimplementasikan e-commerce berbasis web dengan content  management \r\nsystem (CMS) wordpress pada  toko  Tatashops.  Dengan e-commerce toko \r\nTatashops dapat bersaing dalam penjualan produk perlengkapan bayi dan dapat \r\nmeningkatkan  hasil  penjualan.  Dengan e-commerce dapat  memudahkan \r\npelanggan untuk membeli produk secara online tanpa harus datang langsung ke \r\ntoko  Tatashops.  Dengan  e-commerce  dapat  memudahkan  pelanggan  untuk \r\nmengetahui informasi ter-update mengenai produk terbaru. Dengan e-commerce \r\ndapat  memudahkan  penjual  untuk  mengetahui  laporan  penjualan,  laporan \r\npengiriman,  laporan  potongan  harga,  laporan refund,  laporan  retur,  laporan \r\nrekapitulasi, dan laporan produk terlaris. \r\n \r\nKata Kunci : Implementasi, Penerapan, E-Commerce, Toko Online, Toko Bayi. \r\n \r\nX + 99 halaman; 96 gambar; 16 lampiran \r\n \r\n \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(171,'1512503267','2021-02-05 14:01:53','123598','../files/1512503267.pdf',' \r\n \r\nSISTEM PENUNJANG KEPUTUSAN PEMILIHAN SISWA TERBAIK PADA \r\nMADRASAH ALIYAH NEGERI 10 JAKARTA DENGAN METODE SIMPLE \r\nADDITIVE WEIGHTING (SAW) \r\n \r\nOleh : Endru Sefyan Vidaryono (1512503267) \r\n \r\nSaat ini Teknologi Informasi sudah berkembang sangat cepat. Perkembangan selalu \r\nada agar dapat memudahkan manusia dalam berbagai pekerjaan dan kegiatan, termasuk \r\ndalam pengambilan keputusan. Suatu pengambilan keputusan memang selalu memiliki \r\ntanggung jawab yang sangat besar. Oleh karena itu, sebuah keputusan harus diambil \r\nberdasarkan data, tidak hanya berdasarkan subjektivitas dari pengambil keputusan. \r\nMadrasah Aliyah Negeri 10 Jakarta pada setiap tahunnya selalu mengadakan pemilihan \r\nsiswa terbaik. Dalam proses tersebut, penulis melihat masih ada beberapa masalah yang \r\nperlu diatasi. Masalah tersebut diantaranya sulitnya menentukan siswa terbaik secara \r\ncepat, tepat dan akurat, sulit mencari metode yang tepat untuk penilaian siswa terbaik, \r\nsering terjadi kesalahan perhitungan dan penilaian memakan waktu yang cukup lama. \r\nOleh  kaeran  itu,  untuk  mengatasi  masalah  tersebut  diperlukannya  suatu  Sistem \r\nPenunjang  Keputusan.  Penulis  mengambil  judul  \"Sistem  Penunjang  Keputusan \r\nPemilihan Siswa Terbaik Pada Madrasah Aliyah Negeri 10 Jakarta dengan Metode \r\nSimple Additive Weighting (SAW)\". Metode ini dipilih karena untuk mencari nilai \r\nalternatif  terbaik  dari  penilaian  alternatif  dengan  kriteria  yang  berbeda  trennya, \r\nsehingga sangat relevan untuk mengatasi masalah pengambilan keputusan. \r\n \r\nKata kunci : Sistem Penunjang Keputusan, Simple Additive Weighting, Siswa Terbaik \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(172,'1512503275','2021-02-05 14:01:53','20841','../files/1512503275.pdf',' \r\nIMPLEMENTASIE-COMMERCE BERBASISCONTENT MANAGEMENT \r\nSYSTEM (CMS) WORDPRESS PADA TOKO DELTSA BABY SHOP \r\nOleh : Alfi Romdhoni (NIM: 1512503275) \r\n \r\nDeltsa baby shop adalah usaha ritel yang menyediakan berbagai kebutuhan \r\nbayi, berdiri pada tahun 2017 yang berlokasi di ITC Permata Hijau LT. Dasar \r\nBlok D5 No.9 Jakarta Selatan.Pada deltsa baby shop tersebut, penulis membangun \r\nsebuah  website e-commerce untuk  meningkatkan penjualan. Dimana  hasil \r\nwawancara yang dilakukan pada toko deltsa baby shop, sistem penjualan produk \r\nsaat ini hanya pelanggan yang mengunjungike toko secara langsung. Sehingga \r\nproduk  yang  ditawarkan  pun  tidak  menjangkau  luas  ke  calon  pelanggan. \r\nKehadiran e-commerce sebagai media transaksi baru ini tentunya menguntungkan \r\nbanyak pihak, baik pihak pelanggan, maupun pihak produsen dan penjual, sangat \r\nmungkin  untuk  mendukung  proses  mempermudah  penjualan  menjadi  lebih \r\nefisien. Hal tersebut menjadi peluang untuk menangani masalah yang terjadi pada \r\ndeltsa  baby  shop. Dengan  sistem e-commerce ini  penulis  mencoba \r\nmengimplementasikan e-commerce untuk penjualan dan proses bisnisnya secara \r\nonline sehingga  dapat  diakses  kapan  saja  dan  dimana  saja  oleh  pelanggan. \r\nSehingga  dapat  memudahkan  kegiatan  penjualan  serta  mampu  bertahan  dan \r\nbersaing  dengan  website  lainnya yang serupa  seperti yang  ada  pada  saat  ini. \r\nPenulis mengimplementasikan  website  dengan  menggunakan Content \r\nManagement  System  (CMS) dan  menggunakan  database  phpmyadmin.  Penulis \r\nberharap  dengan  adanya website  e-commerce untuk  mempermudah  penjualan \r\nyang bebasis web, dapat membantu deltsa baby shop dalam mengatasi masalah-\r\nmasalah yang sering terjadi saat ini. \r\n \r\nKata Kunci : Implementasi, website e-commerce, Content Management System \r\n(CMS), deltsa baby shop. \r\n \r\nxiv+145 halaman; 139 gambar; 5 tabel; 20 lampiran \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(173,'1512503283','2021-02-05 14:01:53','193423','../files/1512503283.pdf',' \r\nSISTEM PENUNJANG KEPUTUSAN PEMILIHAN GURU TERBAIK \r\nPADA SMK AL-HIDAYAH CINERE DENGAN METODE SIMPLE \r\nADDITIVE WEIGHTING (SAW) \r\n \r\nOleh: Rudi Adrian (NIM:1512503283) \r\nPerubahan zaman dan teknologi yang begitu cepat dewasa ini menuntut dunia \r\npendidikan untuk beradaptasi. Ruang kelas bukan satu-satunya tempat belajar bagi \r\nsiswa, karena saat ini dunia virtual bisa membantu semua orang untuk belajar \r\nseperti Google, Wikipedia dan lain-lain. Kendati demikian, peran guru tidak dapat \r\ntergantikan oleh mesin atau teknologi secanggih apapun. Guru adalah orang yang \r\nmenumbuhkan empati sosial, membangun manusia menjadi lebih berilmu, kreatif \r\nserta mengkokohkan semangat persatuan dan semangat kesatuan. SMK Al-Hidayah \r\nCinere saat ini sangat membutuhkan perkembangan teknologi informasi khususnya \r\npada sistem informasi untuk menilai kinerja para guru disekolah, dari penilaian \r\ntersebut akan diambil seorang guru yang mendapat apresiasi guru terbaik dari pihak \r\nsekolah karena kinerjanya yang lebih baik. Sistem informasi ini dibutuhkan karena \r\nuntuk menentukan guru terbaik bukan hal  yang mudah mengingat semua guru \r\nmemiliki tujuan sama yaitu mencerdaskan anak-anak bangsa, oleh karena itu sistem \r\ninfromasi dibuat untuk mendapatkan sebuah keputusan yang tepat dan akurat dalam \r\npemilihan guru terbaik. Untuk mendapatkan sebuah keputusan dibutuhkan Sistem \r\nPenunjang  Keputusan  yang  menggunakan metode Simple  Additive  Weighting \r\n(SAW), lalu sistem tersebut dijalankan berbasis web dengan bahasa pemograman \r\nPhp dan menggunakan  MySQL  sebagai database untuk  penyimpanan  data, \r\nkemudian  sistem  tersebut  dioprasikan  menggunakan  sistem  oprasi Windows \r\nsehingga menghasilkan data yang efektif dan efisien. \r\n \r\nKata  Kunci:  Sistem Penunjang  Keputusan, Pemilihan  Guru  Terbaik, Simple \r\nAdditive Weighting (SAW) \r\n \r\nx+138 Halaman; 95 Gambar; 16 Lampiran; 32 Tabel  \r\n \r\n  \r\n \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(174,'1512503309','2021-02-05 14:01:53','98338','../files/1512503309.pdf',' \r\n \r\nSISTEM PENUNJANG KEPUTUSAN \r\nPENENTUAN KARYAWAN TERBAIK PADA PT. ENERGI SINAR \r\nSENTOSA DENGAN METODE ANALYTICAL HIERARCHY PROCESS  \r\nDAN SIMPLE ADDITIVE WEIGHTING  \r\n \r\nOleh : Adi Widiyanto (NIM : 1512503309) \r\n \r\n \r\nKaryawan  merupakan  tenaga  kerja  yang  memiliki  tugas  untuk  menjalankan \r\nsebuah  aktivitas  yang  telah  diatur  sesuai  dengan  kebutuhan  perusahaan. \r\nPengelolaan  Sumber  Daya  Manusia  (SDM)  dari  suatu  perusahaan  sangat \r\nmempengaruhi  tingkat  keberhasilan  kerja  dari  perusahaan. PT.  Energi  Sinar \r\nSentosa  adalah  perusahaan  yang  bergerak  di  bidang  supplier  minyak  industri. \r\nUntuk meningkatkan kinerja para karyawan, perusahaan akan memberikan subuah \r\nreward kepada  karyawan sebagai  apresiasi  atas  kinerjanya  yang  maksimal. \r\nNamun pada perusahaan ini belum memiliki suatu metode yang digunakan untuk \r\nmenentukan  karyawan  terbaik  dan  masih  menggunakan  cara  manual  dengan \r\nmenentukan satu kriteria untuk menjadi acuan penilaian. Penelitian ini bertujuan \r\nuntuk membuat suatu Decision Support System (DSS) dengan metode analytical \r\nhierarchy process (AHP) dan Simple Additive Weighting (SAW) berbasis web \r\nyang  dirancang  menggunakan Hypertext  Preprocessing (PHP),  dan database \r\nMySQl untuk  mempermudah  dalam  pemilihan karyawan  terbaik. Metode \r\nanalytical  hierarchy  process (AHP) digunakan  untuk  menentukan  bobot  dari \r\nmasing-masing  kriteria  yang  sudah  ditentukan dan Simple  Additive  Weighting \r\n(SAW) untuk perangkingan.  \r\n \r\nKata Kunci: DSS, Karyawan, Metode AHP, SAW. \r\n \r\nviii-89 halaman; 43 gambar; 30 tabel; 13 lampiranPerpustakaan Universitas Budi Luhur\r\n'),(175,'1512503333','2021-02-05 14:01:53','61277','../files/1512503333.pdf',' \r\nPENERAPAN E-COMMERCE DALAM MENUNJANG PENJUALAN \r\nPADA TOKO SINAR GALUH BATTERY \r\n \r\nOleh :Wahyu Budiarto (NIM : 1512503333) \r\n \r\nToko Sinar Galuh Battery beralamat di Jl,Raden Saleh No.90 Karang Tengah, \r\nTangerang, merupakan suatu perusahaan  yang berdiri di bidang penjualan Aki \r\nmotor dan mobil. Sistem penjualan yang digunakan saat ini, dengan caracustomer \r\nharus datang langusung ke Toko Sinar Galuh Battery untuk melihat product yang \r\ndijual. Dengan sistem tersebut akan menyita waktu customer sehingga kesulitan \r\nmemperoleh informasi mengenai spesifikasi product yang dijual oleh Toko Sinar \r\nGaluh  Battery.  Dengan  adanya websitee-commerce ini  diharapkan  dapat \r\nmenjawab  masalah  yang  ada  pada  Toko  Sinar  Galuh  Battery,  memudahkan \r\ncustomer memperoleh informasi mengenai spesifikasi product yang ditawarkan \r\noleh Toko Sinar Galuh Battery. Memudahkan toko Sinar Galuh Battery dalam \r\nproses penjualan product kepada customer yang berada di luar daerah. serta bisa \r\nmelakukan pemesanan tanpa harus datang ke toko. Memudahkan customer dalam \r\nproses  pembayaran,  karena  proses  pembayaran  bisa  dilakukan  melalui  transfer \r\nBank.  Kemudian  dengan  adanya  fasilitas  untuk  mencetak  laporan  pemesanan, \r\nlaporan  penjualan,  pembayaran,  pengiriman,  rekapitulasi product terjual,  dan \r\nstock.Diharapkan website  e-commerce ini  dapat  berdampak  baik  kepada  Toko \r\nSinar Galuh Battery ataupun customer. \r\n \r\nKata Kunci :E-commerce, penjualan, aki \r\n \r\nix + 94 halaman; 82 gambar; 4 tabel; 17 lampiran \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(176,'1512503366','2021-02-05 14:01:53','342467','../files/1512503366.pdf',' \r\n \r\nMEMBANGUN SISTEM ELECTRONIC CUSTOMER RELATIONSHIP \r\nMANAGEMENT (E-CRM) DALAM MENINGKATKAN PELAYANAN \r\nDAN LOYALITAS MAHASISWA KELAS KARYAWAN UNIVERSITAS \r\nBUDI LUHUR \r\n \r\nOleh : Ayu Purnama Sari (1512503366) \r\nMemberikan informasi perkuliahan khususnya pada mahasiswa kelas karyawan \r\nsangatlah penting mengingat keterbatasan waktu yang dimiliki oleh mahasiswa \r\nkelas  karyawan.  Saat  ini  penyampaian  informasi  perkuliahan  sudah  melalui \r\nwebsite  yang  dimiliki  Universitas  Budi  Luhur. Namun,  kurangnya  kesadaran \r\nmahasiswa dalam mengecek website tersebut membuat mahasiswa yang tertinggal \r\nberita  mengenai  informasi  perkuliahan  seperti  informasi  mengenai  kehadiran \r\ndosen, informasi mengenai pengisian dan pembayaran KRS, informasi mengenai \r\npengisian KPRS, informasi mengenai pembayaran angsuran serta belum adanya \r\nfitur pendaftaran  kuliah  dan  fitur  untuk  melihat event yang  berlangsung  pada \r\nwebsite  tersebut.    Maka  dari  itu,  Universitas  Budi  Luhur  terus  berupaya \r\nmeningkatkan  komunikasi  yang  baik  dengan  para  mahasiswa  kelas  karyawan. \r\nUntuk mengatasi masalah tersebut, di perlukan sebuah Sistem Informasi E-CRM. \r\nMaka dari itu penulis mengambil judul \"Membangun Sistem Electronic Customer \r\nRelationship  Management (E-CRM)  dalam  Meningkatkan  Pelayanan  dan \r\nLoyalitas Terhadap Mahasiswa Universitas Budi Luhur Kelas Karyawan\" yang \r\nberfokus  kepada  3  tahapan  E-CRM  yaitu Acquire,  Enchance,  Retain.  \r\nBerdasarkan  hasil  analisa  dengan  menerapkan  E-CRM  menghasilkan  beberapa \r\nnotifikasi yaitu Pengisian KRS, Pembayaran KRS, pengisian KPRS, pembayaran \r\nAngsuran,  informasi  dosen  tidak  hadir,  notifikai pendaftaran  serta  fitur \r\npendaftaran online dan fitur untuk memberikan informasi mengenai Universitas \r\nBudi  Luhur.  Dengan  membangun  sistem  CRM  ini  diharapkan  dapat \r\nmenyelesaikan  permasalahan  yang  di  alami  Universitas  Budi  Luhur  Kelas \r\nKaryawan \r\n \r\nKata  Kunci  : Electronic  Custumer  Relationship  Management, meningkatkan \r\nloyalitas dan pelayanan, Universitas  \r\n \r\nxii + 155 halaman; 58 gambar; 40 tabel; 18 lampiran \r\n  \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(177,'1512503390','2021-02-05 14:01:53','20475','../files/1512503390.pdf',' \r\nANALISA DAN RANCANGAN E-COMMERCE PADA SEMPURNA JAYA \r\nALUMINIUM PRODUCT \r\n \r\nOleh : Nabilah Ayu Martiana (NIM: 1512503390) \r\n \r\nTeknologi informasi sangatlah berpengaruh untuk kemajuan suatu usaha agar \r\ndapat bersaing dengan para pesaing yang lain di era industri. Berbagai macam \r\ncara dilakukan untuk mempromosikan usaha yang dimiliki, salah satu nya dengan \r\nmenggunakan website e-commerce. E-commerce merupakan suatu kegiatan jual \r\nbeli  yang  dilakukan  secara online. Sempurna  Jaya  Aluminium Product adalah \r\nsebuah perusahaan yang bergerak dalam bidang penjualan furniture atau alat-alat \r\nrumah tangga seperti rak piring, jemuran, dan tangga yang terbuat  dari bahan \r\naluminium. Saat ini penjualan melalui instagram pada Sempurna Jaya Aluminium \r\nProduct belum maksimal. Karena informasi produk yang diberikan tidak lengkap, \r\nsehingga banyak pelanggan yang kesulitan untuk mengetahui informasi tentang \r\nproduk dari Sempurna Jaya Aluminium Product. Untuk mengatasi permasalahan \r\nini, maka dibuatlah website menggunakan salah satu Content Management System \r\n(CMS) yaitu wordpress. Tujuan dari penelitian ini adalah memberi solusi dari \r\nmasalah-masalah yang ada dengan merancang sebuah sistem informasi penjualan \r\nberbasis e-commerce. Hasil dari penelitian ini adalah website penjualan berbasis \r\ne-commerce yang dapat  dijadikan  sebagai  media  promosi  untuk  membantu \r\nSempurna Jaya Aluminium Product  dalam hal pemasaran dan proses penjualan \r\nproduk serta mempermudah pelanggan melakukan pemesanan secara online. \r\n \r\nKata Kunci : E-Commerce, CMS, Wordpress, Website \r\n \r\nviii + 105 halaman; 84 gambar; 15 tabel; 18 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(178,'1512503424','2021-02-05 14:01:53','20697','../files/1512503424.pdf',' \r\n \r\nPERANCANGAN WEBSITE E-COMMERCE UNTUK MENINGKATKAN \r\nPENJUALAN PADA PRIMA JAYA FURNITURE \r\n \r\nOleh : Caroline Lumbanita Marpaung (NIM : 1512503424) \r\n \r\nPerkembangan teknologi yang sangat pesat mempengaruhi sistem perdagangan. \r\nE-commerce hadir untuk mempermudah dalam melakukan kegiatan transaksi jual \r\nbeli. Saat ini Prima Jaya Furniture melakukan pemasaran dengan cara mencetak \r\nbrosur  yang berisi katalog produk dan harga  yang nantinya diperlihatkan staff \r\ntoko kesetiap pelanggan yang datang. Sistem penjualan yang berjalan saat ini, \r\nyaitu pelanggan harus datang ke toko untuk melakukan pemesanan produk, itu \r\nsangat  menyulitkan  pelanggan  karena  harus  meluangkan  waktu untuk \r\nmengunjungi toko. Untuk menyelesaikan masalah tersebut, penulis menggunakan \r\nmetode business  model  canvas,  metodologi  perancangan  sistem  menggunakan \r\nUnfield Modelling Language (UML), dan metodologi pengembangan sistem yang \r\ndigunakan  untuk  membangun  sistem e-commerce. Perancangan website e-\r\ncommerce pada  Prima  Jaya  Furniture  merupakan  langkah  yang  tepat  untuk \r\nmeningkatkan  penjualan  dan  promosi  produk  sehingga  pelanggan  dapat \r\nmengetahui  informasi  yang  lengkap  mengenai  produk  yang  dijual  pada  Prima \r\nJaya Furniture tanpa harus datang ke toko, pihak Prima Jaya Furniture pun dapat \r\nmengatasi  masalah  pengolahan  produk.  Sistem  ini  dibuat  menggunakan \r\nwordpress berbasis content management system (CMS). Hasil dari penelitian ini \r\nadalah perancangan website e-commerce pada  Prima  Jaya  Furniture  yang \r\ndigunakan  sebagai  sarana  promosi  penjualan  yang  lebih  efektif  daripada \r\nsebelumnya dan meningkatkan hasil penjualan pada Prima Jaya Furniture. \r\n \r\nKata kunci: Website, E-Commerce, Business Model Canvas \r\nix + 96 halaman; 84 gambar;  7 tabel; 17 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(179,'1512503432','2021-02-05 14:01:53','103081','../files/1512503432.pdf',' \r\nSISTEM PENUNJANG KEPUTUSAN PENAMBAHAN FUNGSIONAL \r\nAPLIKASI PADA PT JARI SOLUSI INTERNATIONAL DENGAN \r\nMENGGUNAKAN METODE ANALYTICAL HIERARCY PROCESS (AHP) \r\nDAN SIMPLE ADDITIVE WEIGHTING (SAW) \r\n \r\nOleh : Fadila Hasana (1512503432) \r\nPT  Jari  Solusi  International  merupakan startup yang  fokus  pada product \r\ndevelopment berbasis android dan web dengan  teknologi cloud.  Saat  ini  Jari \r\nberkonsentrasi pada solusi mobile pekerjaan lapangan. Customer dari PT Jari Solusi \r\nInternational  adalah  perusahaan  yang  umumnya  bergerak  di  bidang finance dan \r\nkeuangan. Banyaknya  fungsional  usulan  atau  keluhan  dari customer yang  akan \r\ndiselesaikan dengan fungsional baru untuk aplikasi tidak semuannya PT Jari Solusi \r\nInternational  dapat  menambahkan  fungsional  tersebut  ke  aplikasi.  PT  Jari  Solusi \r\nHarus mempertimbangkan fungsional apa yang memang harus ditambahkan untuk \r\naplikasi.  Tetapi  penambahan  fungsional  aplikasi  sulit  dilakukan  karena  tidak \r\ndiketahuinnya fungsional yang dibutuhkan oleh customer saat ini, selain itu dalam \r\nproses  penambahan  fungsional  aplikasi  akan  melibatkan  beberapa  bagian,  yaitu \r\ndevelopment dan pemasaran. Karena banyak pihak yang terlibat, sulit mengadakan \r\ndiskusi  dimana  semua  pihak  yang  berkaitan dapat  hadir.  Hal  lainnya  yang \r\nmengakibatkan  sulitnya  penambahan  fungsional  baru  aplikasi  adalah  dalam \r\npenambahan  fungsional  aplikasi  tidak  memiliki  ketentuan-ketentuan  yang  tetap \r\nuntuk  digunakan  sebagai  acuan  penambahan  fungsional  aplikasi. Jadi  dibutuhkan \r\nsistem yang dapat membantu PT Jari Solusi International dalam menilai fungsional \r\napa yang akan ditambahkan pada aplikasi. \r\nKata Kunci : fungsional, aplikasi, sistem penunjang keputusan \r\nxii+139 Halaman; 96 Gambar; 40 Tabel, 17 Lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(180,'1512503465','2021-02-05 14:01:53','103417','../files/1512503465.pdf',' \r\nSISTEM PENUNJANG KEPUTUSAN PEMILIHAN SUPPLIER \r\nPROFITABLE UNTUK SEBUAH PROYEK PADA PT MITRA SUKSES \r\nKREASINDO DENGAN MENGGUNAKAN METODE ANALYTICAL \r\nHIERARCY PROCESS (AHP) DAN SIMPLE ADDITIVE WEIGHTING (SAW) \r\n \r\nOleh : Iqra Habibi (1512503465) \r\nGarmen merupakan sebuah bisnis usaha yang bergerak di bidang pembuatan \r\npakaian dalam jumlah besar. Dalam kegiatannya garmen tidak lepas dari kegiatan \r\nproduksi yang tentunnya melibatkan banyak pihak, salah satunnya adalah supplier. \r\nSupplier merupakan aspek penting berlangsungnya operasional perusahaan. PT Mitra \r\nSukses  Kreasindo  merupakan  perusahaan  garmen  yang  berkomitmen  untuk \r\nmemberikan kepuasan pelanggan dengan memberikan harga terbaik dengan bahan \r\nberkualitas tinggi dan memproduksi produk terbaik. Beberapa kendala ditemukan \r\ndalam  pemilihan supplier untuk  suatu  proyek  pada  PT  Mitra  Sukses  Kreasindo. \r\nMulai dari pengambil keputusan merasa ragu dalam pemilihan supplier yang tepat \r\nyang  akan  menyumplai  produksi  untuk  sebuah  proyek,  kriteria  dalam  pemilihan \r\nsupplier yang  selalu  berubah-ubah  dan  tidak  diketahuinnya  tingkat  prioritas  atau \r\nbobot  kriteria  hingga  sulitnya  mencari  data supplier. Dalam  pengerjaan  sebuah \r\nproyek diharapkan perusahaan mendapatkan supplier yang profitable dan tentunnya \r\nsesuai dengan kebutuhan dan keadaan proyek yang akan berjalan. Oleh karena itu, \r\ndiperlukan sistem penunjang keputusan pemilihan supplier profitable untuk sebuah \r\nproyek yang akan menggunakan metode Analytical Hierarchy Process (AHP) dalam \r\npenetapan bobot kriteria dan Simple Additive Weighting (SAW) dalam membantu \r\npengambil keputusan dalam menilai supplier untuk sebuah proyek.  \r\n \r\nKata Kunci : Decision Support System, Supplier, Kriteria, Bobot, Analytical \r\nHierarcy Process, Simple Additive Weighting \r\n \r\nxi +123 Halaman; 62 Gambar; 36 Tabel ; 17 Lampiran \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(181,'1512503531','2021-02-05 14:01:53','266205','../files/1512503531.pdf',' \r\n \r\nPENERAPAN ELECTRONIC CUSTOMER RELATIONSHIP \r\nMANAGEMENT (E-CRM) UNTUK PELAYANAN TERHADAP \r\nPELANGGAN PADA AHASS SAFA MOTOR \r\n \r\nOleh: Dodi Restiadi (NIM : 1512503531) \r\nPerkembangan  teknologi  informasi  yang  pesat  saat  ini  telah  memasuki \r\nsemua aspek kehidupan. Hal ini ditandai dengan banyaknya pengguna komputer, \r\nbaik  untuk  kepentingan  perusahaan  atau  bisnis  sampai  kepada  hal-hal  yang \r\nbersifat  hiburan  dan  Pendidikan.  Pesatnya  perkembangan  bisnis  yang \r\nmengadaptasi  teknologi  informasi,  mendorong  terjadinya  persaingan  bisnis, \r\nSetiap pelaku bisnis bersaing untuk merebut pangsa pasar dan meraih pelanggan \r\nyang  mau  menggunakan  produk  atau  jasa  dari  perusahaannya.  Bengkel  Ahass \r\nSafa Motor adalah salah satu franchise PT Wahana Makmur Sejati yang bergerak \r\ndibidang jasa yaitu perbaikan motor khususnya untuk motor-motor produksi dari \r\nHonda. Dengan pengimplementasian E-CRM pada Ahass Safa Motor akan sangat \r\nmembantu  dalam  menjalin  hubungan  yang  baik  dengan  pelanggan  yang  pada \r\nakhirnya  akan  meningkatkan  loyalitas  pelanggan  pada  Ahass  Safa  Motor. \r\nCustomer  Relationship  Management merupakan  suatu  strategi  yang  digunakan \r\nperusahaan dalam menjalin dan menjaga hubungan baik dengan pelanggan, hal ini \r\nditujukan  agar  pelanggan  merasa  puas  atas  layanan  yang  diberikan  oleh \r\nperusahaan dan pada akhirnya menjadi pelanggan tetap dari perusahaan. \r\n \r\n \r\nKata  Kunci:  penerapan electronic  customer  relationship  management (e-crm), \r\nprototype, bengkel. \r\nX + 147 Halaman; 81 Gambar;  38 Tabel; 15 Lampiran Perpustakaan Universitas Budi Luhur\r\n'),(182,'1512503564','2021-02-05 14:01:54','21011','../files/1512503564.pdf',' \r\n \r\nIMPLEMENTASI WEBSITE E-COMMERCE BERBASIS CMS (CONTENT \r\nMANAGEMENT SYSTEM) WORDPRESS PADA CLOTHING LINE \r\nCOOLKIDS CLUB FASHION \r\n \r\nOleh : Fauzi Ramdani (1512503564) \r\n \r\n  Di era globalisasi  yang tingkat perkembangan teknologi nya semakin hari \r\nsemakin maju, konsep yang dimunculkan dalam segala bidang terutama bidang \r\npenjualan  sangat  bervariasi,  salah  satunya  konsep e-commerce. Konsep e-\r\ncommerce memberikan banyak kemudahan dan kelebihan dalam proses transaksi \r\njual beli. Coolkids Club Fashion merupakan sebuah usaha dalam bidang clothing \r\nline di Indonesia. Awalnya hanya menyediakan jasa custom design untuk kaos, \r\ntetapi karena banyaknya permintaan dan berkembangnya cara berpakaian, maka \r\nowner memutuskan untuk branding dan memproduksi produknya sendiri. Adapun \r\npermasalahan yang dihadapi dalam proses penjualan dan pemasaran menggunakan \r\nmedia sosial Instagram dan Line@ (Line at), diantaranya: tidak memiliki fitur \r\npencarian produk, laporan penjualan yang masih berupa pembukuan dan produk \r\nyang tersedia maupun yang kosong tidak terdata dengan baik. Tujuan dari penulisan \r\nini yaitu dengan dibuatnya website e-commerce dapat memberi solusi bagi masalah \r\nyang terjadi dan meningkatkan penjualan produk pada Coolkids Club Fashion. \r\nMetode yang digunakan dalam penelitian ini adalah Business Model Canvas serta \r\nmembuat website e-commerce menggunakan CMS Wordpress. Diharapkan dengan \r\ndibuatnya website e-commerce ini  dan  hadirnya  sistem e-commerce dapat \r\nmenguntungkan semua pihak, baik pelanggan maupun owner. \r\n \r\nKata kunci : E-commerce, CMS, Wordpress, Business Model Canvas \r\n \r\nxii+161 halaman; 150 gambar; 28 tabel; 23 lampiran  Perpustakaan Universitas Budi Luhur\r\n'),(183,'1512503606','2021-02-05 14:01:54','20839','../files/1512503606.pdf',' \r\n \r\nSISTEM PENUNJANG KEPUTUSAN DALAM  \r\nMENGARAHKAN JURUSAN SETELAH LULUS SMP DI SMP PGRI 396 \r\nKELAPA DUA DENGAN METODE ANALYTICAL HIERARCHY \r\nPROCESS  \r\n(AHP) DAN SIMPLE ADDITIVE WEIGHTING (SAW)  \r\nStudi Kasus : SMP PGRI 396 KELAPA DUA \r\n \r\nOleh : Nabhan Husein Muzhaffar Rahman Lubis (NIM : 1512503606) \r\n \r\nSebagian  besar  siswa  setelah  lulus sekolah  menengah, bingung  akan  harus \r\nkemana melanjutkan jenjang sekolahnya. Hal tersebut juga yang membuat para \r\nsiswa tidak terlihat menonjol dalam berprestasi, karena mereka melanjutkan ke \r\njenjang yang tidak sesuai. Bimbingan konseling atau BK memiliki peranan yang \r\npenting dalam dunia pendidikan. Karena unit bk berfungsi sebagai pengarah atau \r\npembantu dalam merencanakan studi siswa. Sistem Pendukung Keputusan atau \r\nSPK  akan  menjadi  sebuah  solusi  bagi  sekolah  dan  siswa  dalam  membantu \r\nmengarahkan para siswa dalam memilih jurusan di jenjang berikutnya. Penelitian \r\nini  bertujuan  untuk  membuat  suatu  sistem  penunjang  keputusan  dalam \r\nmengarahkan siswa  setelah lulus smp. Penelitian ini dilakukan di SMP PGRI 396 \r\nKELAPA DUA, sekolah ini belum memiliki bimbingan konseling atau unit BK.  \r\nSistem ini akan dibuat menggunakan metode analytical hierarchy process (AHP) \r\ndan simple  addtive  weighting (SAW) untuk  menghasilkan  keputusan  yang \r\nrelevan. Metode AHP digunakan untuk menentukan bobot kriteria yang dimana \r\nkriteria  tersebut  adalah  jurusan  dari  sekolah  menengah  atas  maupu  sekolah \r\nmenengah kejuruan. Sedangkan Metode SAW akan digunakan untuk menghitung \r\nnilai  mata  pelajaran  yang  terkait  dengan  jurusan-jurusan  sma/smk. Dengan \r\ndibuatnya  sistem  ini,  sistem  ini  akan  membantu peran  bk  yang  belum  ada di \r\nsekolah. \r\n \r\nKata Kunci: SPK, BK, Metode AHP, Metode SAW, SMP, SMA, SMK, Jurusan. \r\n \r\nxiii+117 halaman; 82 Gambar; 27 Tabel; 9 Lampiran \r\n \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(184,'1512503614','2021-02-05 14:01:54','71174','../files/1512503614.pdf',' \r\n \r\nMEMBANGUN SISTEM PENJUALAN BERBASIS E-COMMERCE \r\nMENGGUNAKAN CMS (CONTENT MANAGEMENT SYSTEM) \r\nWORDPRESS PADA TOKO JDANW MUSIC \r\nOleh : Kun Permadi Pamungkas (NIM : 1512503614) \r\nJdanW Music merupakan sebuah toko yang bergerak dalam bidang penjualan alat \r\nmusik seperti gitar dan bass. Masalah yang dihadapi Toko JdanW Music yaitu \r\npemasaran pada  produk-produk  yang  belum  terjangkau  luas  dan  juga  dalam \r\npengolahan data yang ada seperti laporan dan pencatatan transaksi berjalan yang \r\nmasih  dilakukan  secara  manual  sehingga  sulit  dalam  mencari  data  dan  sering \r\nterjadi ketidak-akuratan dalam pembuatan laporan. Dengan adanya teknologi yang \r\nberkembang  pesat  saat  ini,  memungkinkan  untuk  membangun  bisnis  menjadi \r\nlebih  berkembang  dan  maju.  Hal  tersebut  menjadi  peluang  untuk  menangani \r\nmasalah  yang  terjadi  pada  Toko  JdanW Music. Dengan  membangun  sistem \r\npenjualan  berbasis e-commerce menggunakan content  management  system dan \r\njuga metode Business Model Canvas untuk menganalisis bisnis perusahaan serta \r\ndengan Strategi SEO dan juga Marketing akan membuat kegiatan penjualan pada \r\nToko  JdanW Music lebih  efektif  dan  efisien, meningkatkan  penjualan produk \r\nserta mampu bertahan dan bersaing dengan bisnis serupa yang ada pada saat ini. \r\nPenulis berharap dengan sistem penjualan usulan alat musik seperti gitar dan bass \r\nberbasis e-commerce dapat  membantu Toko JdanW Music dalam  mengatasi \r\nmasalah-masalah yang sering terjadi. \r\n \r\nKata Kunci : E-Commerce, Gitar, Bass, Meningkatkan Penjualan \r\n \r\nxi+91 halaman; 67 gambar; 16 simbol; 18 lampiran Perpustakaan Universitas Budi Luhur\r\n'),(185,'1512503648','2021-02-05 14:01:54','76354','../files/1512503648.pdf',' \r\n \r\n \r\nPENERAPAN E-COMMERCE MENGGUNAKAN CONTENT \r\nMANAGEMENT SYSTEM (CMS) WORDPRESS PADA TOKO JHM \r\nHERBAL \r\n \r\n \r\nOleh: Anggi Praya Hasibuan (NIM: 1512503648) \r\n \r\n \r\nToko  JHM  Herbal  adalah  toko  yang  menjual  beraneka  ragam produk  untuk \r\nkesehatan tubuh berupa produk herbal seperti kurma, madu, susu kambing dan \r\nlain sebagainya. Toko JHM  Herbal masih menggunakan sistem manual dalam \r\nproses penjualan produk yaitu pelanggan harus datang langsung ke toko untuk \r\nmelihat,  membeli dan  melakukan  transaksi  pembayaran. Hal  ini  membuat \r\npenjualan  produk  kurang  optimal  karena  penjualan  produk terbatas  pada \r\npelanggan yang berada di sekitar toko saja. Oleh sebab itu, penulis membuat suatu \r\nsistem E-Commerce menggunakan Content Management System (CMS) dengan \r\nmetode Bussines  Model  Canvas untuk  diterapkan  pada  toko  JHM  Herbal. \r\nHadirnya E-Commerce sebagai media transaksi jual beli pada Toko JHM Herbal \r\nmemberikan keuntungan antara lain: memperluas pemasaran produk karena dapat \r\ndiakses oleh  siapa  saja,  dimana  saja  dan  kapan  saja, memudahkan  dalam \r\nmemberikan  informasi  produk  yang  dipasarkan, memudahan  proses  transaksi \r\npembayaran, meningkatkan  penjualan  produk, dan mempermudah  dalam \r\npembuatan laporan penjualan toko.  \r\n \r\nKata Kunci: E-Commerce, Bussines Model Canvas, Content Management System, \r\nWordpress \r\n \r\nxi + 103 halaman; 97 gambar; 15 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(186,'1512503739','2021-02-05 14:01:54','74020','../files/1512503739.pdf',' \r\n \r\nMEMBANGUN WEBSITE PENJUALAN ONLINE (E-COMMERCE) \r\n PADA TOKO ANIMAUX PET SHOP \r\n \r\nOleh : Yuni Ardi (NIM : 1512503739) \r\n \r\nToko Animaux Pet  Shop  adalah  merupakan  toko  yang  bergerak  di  bidang \r\npenjualan  yang menyediakan  makanan, aksesoris  dan  obat-obatan  hewan yang  \r\nberlokasi di Warung Jati Barat Raya No.40 B Pasar minggu, Jakarta Selatan.Pada \r\ntoko Animaux  Pet  Shop,  melakukan    suatu perancangan  sistem e-commerce \r\nsupaya  mempermudah  penjualan. Dalam  menjalankan  usahanya  pada toko \r\nAnimaux  Pet  Shop masih  mengalami  kendala  dalam  mengetahui  informasi \r\npesanan  dari customer karena  pemesanan masih  lewat  telpon  dan  tidak  ada \r\ndokumen  untuk  merekam  pesanan  dari customer barang  yang  diterima  tidak \r\nsesuai pesanan. Untuk  menyelesaikan permasalahan tersebut, maka dibutuhkan \r\nsebuah sistem untuk mendukung sistem penjualan pada toko Animaux Pet Shop. \r\nBerdasarkan kondisi diatas, penulis melakukan penelitian yang membantu Toko \r\nAnimaux Pet Shop menyelesaikan masalah yang terjadi saat ini. Metode dalam \r\nmengembangkan  dalam  merancang website dengan  menggunakan Waterfall \r\nDevelopment, dan  implementasi  sistem E-commerce mengunakan  tool Content \r\nManagement  System (CMS). Dengan  adanya aplikasi e-commerce diharapkan  \r\ndapat mempermudah customer membeli barang melalui website dan mengatasi \r\nmasalah masalah yang sering terjadi di toko Animaux Pet Shop. \r\n \r\nKata Kunci : E-commerce, Makanan, Aksesoris, Obat-Obatan hewan. \r\nX + 89 halaman; 82 gambar; 15 tabel; 9 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(187,'1512503754','2021-02-05 14:01:54','194795','../files/1512503754.pdf',' \r\n \r\nPENERAPAN E-COMMERCE BERBASIS CONTENT MANAGEMENT \r\nSYSTEM (CMS) DENGAN MENGGUNAKAN BUSINESS MODEL \r\nCANVAS (BMC) UNTUK PELAYANAN PENJUALAN PAKAIAN PADA \r\nMERAKUNI \r\nOleh : Moch Rezaf Ivanka Haris (1512503754) \r\nDinamika sosial masyarakat didunia saat ini telah mengalami perubahan pesat. \r\nHal  ini  ditandai  oleh  perkembangan  yang  spektakuler  di  bidang  teknologi \r\ninformasi  dan  teknologi  komunikasi.  Melalui  internet,  pedagang  dapat \r\nmenawarkan produknya secara online kepada pembeli tanpa perlu bertatap muka. \r\nE-commerce (perdagangan  melalui  internet)  mengizinkan  pedagang  untuk \r\nmenjual  produk-produk  dan  jasa  secara  online.  Calon  pembeli  atau  konsumen \r\ndapat  menemukan  website  pedagang,  membaca,  melihat  produk-produk,  dan \r\nmemesannya secara online. Adapun permasalahan yang di hadapi oleh Merakuni \r\nyaitu menurunnya omset penjualan dari bulan januari 2019 hingga mei 2019, dan \r\nbelum adanya proses pembuatan laporan penjualan dan laporan produk terlaris. \r\nMetode penelitian ini menggunakan business model canvas yang dikembangkan \r\nmenggunakan  sistem Search  Engine  Optimisazion (SEO)  dan Content \r\nManagement  System (CMS).  Hasil  dari  penelitian  ini  adalah dengan  adanya \r\nwebsite  e-commerce Merakuni dapat mendatangkan  para  pelanggan baru  agar \r\nmeningkatkan  penjualan dan Pemilik  dapat  mengetahui  produk  yang  paling \r\ndiminati  dan  mengetahui  data  penjualan  pada Merakuni dengan  adanya  fitur \r\nlaporan penjualan dan laporan produk terlaris. \r\n \r\nKata Kunci : Fashion, e-commerce, website, SEO, Content Management System, \r\nBusiness Model Canvas. \r\nx+99 Halaman; 92 Gambar; 15 Tabel; 18 Lampiran \r\n  \r\n \r\n \r\n \r\n \r\n \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(188,'1512510569','2021-02-05 14:01:54','178745','../files/1512510569.pdf',' \r\n \r\nPENERAPAN METODE ANALYTICAL HIERARCHY PROCESS) \r\n(AHP) DAN SIMPLE ADDITIVE WEIGHTING (SAW) DALAM SISTEM \r\nPENUNJANG KEPUTUSAN PEMILIHAN KARYAWAN TERBAIK PADA \r\nPT. TRANS RETAIL INDONESIA DIVISI ACCOUNT PAYABLE \r\n \r\nOleh : Jordy Sudirgo (1512510569) \r\n \r\nKaryawan merupakan sebuah investasi bagi organisasi maupun perusahaan untuk \r\ndapat tumbuh dan berkembang sesuai dengan visi dan misi perusahaan. PT Trans \r\nRetail Indonesia atau Carrefour adalah sebuah perusahaan yang bergerak dibidang \r\njasa retail atau bergerak dibidang dagang  yaitu  hypermarket  yang berasal  dari \r\nperancis, Carrefour termasuk kedalam kelompok supermarket internasional. Dari \r\npermasalahan yang ada saat ini Belum adanya kriteria yang tetap dan pembobotan \r\npada  masing-masing  kriterianya.  Manajer  Account  Payable  kesulitan  dalam \r\nmengambil keputusan pemilihan pegawai terbaik karena proses pemilihan hanya \r\nmenilai dari kinerja yang dilihat dengan unsur penglihatan mata atau pendapat \r\nindividual.Untuk mengatasi permasalahan yang ada, maka usaha yang dilakukan \r\npenulis  adalah  dengan  melakukan  pembuatan  aplikasi  menggunakan  metode \r\nAnalytical Hierarchy Process untuk mencari bobot kriteria dan metode Simple \r\nAdditive  Weighting  digunakan  sebagai  metode  untuk  mencari  perangkingan \r\nalternatif.  Sistem  penunjang  keputusan  ini  dibangun  Pada  PT.  Trans  Retail \r\nIndonesia  menggunakan  bahasa  pemrograman  Microsoft  Visual  Studio  2008 \r\nsebagai  tools    dan  database  MySql.  Laporan    yang  dihasilkan  oleh  sistem  ini \r\nberupa laporan hasil keputusan yang menentukan alternative terbaik yang terpilih. \r\n \r\nKata kunci  : Sistem  Penunjang  Keputusan,  Analytical  Hierarchy  Process, \r\nSimple Additive Weighting, Karyawan \r\n \r\nix + 109 halaman;  37 gambar; 31 tabel; 12 lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(189,'1512510833','2021-02-05 14:01:54','19892','../files/1512510833.pdf',' \r\n \r\n \r\nSISTEM PENUNJANG KEPUTUSAN PENERIMAAN KARYAWAN \r\nMENGGUNAKAN METODE TOPSIS PADA PT. MITRA BUANA \r\nKOORPORINDO BERBASIS WEB \r\n \r\n \r\nOleh : Jarot Eko Prasetyo (1512510833) \r\n \r\n         Pengelolaan SDM dari suatu  perusahaan  adalah salah satu  aspek  penting \r\nuntuk menentukan keberhasilan kerja dari perusahaan tersebut. Untuk mendapat \r\nSDM yang berkemampuan, perusahaan menerapkan seleksi penerimaan karyawan \r\nyang  ketat  pada  pelamar - pelamar  pekerjaan  agar  sesuai  dengan  kebutuhan \r\nperusahaan. Perekrutan karyawan pada perusahaan. Selama ini proses pengecekan \r\ndan  seleksi  dilakukan  secara  manual  dengan  melihat  satu  persatu  berkas  yang \r\ndikirimkan oleh pelamar. Hal ini tentu saja selain sangat merepotkan juga tidak \r\nefisien dan memakan waktu yang cukup lama, belum lagi kemungkinan terjadinya \r\nhuman error dan penilaian yang bersifat subyektif sehingga kandidat yang terpilih \r\nbukanlah kandidat yang terbaik. Sehingga pada penelitian ini mengajukan sebuah \r\nalgoritma TOPSIS yang diimplementasikan ke dalam sebuah aplikasi, nilai dari \r\nmasing-masing  Alternatif  akan  dihitung  dan  dilakukan  perangkingan  melalui \r\naplikasi.  HR  &  GA  Dept.  Head  dapat  melihat  hasil  perangkingan  dan  bisa \r\nmemutuskan siapa yang berhak di rekrut menjadi karyawan pada PT. Mitra Buana \r\nKoorporindo \r\n \r\nKata Kunci : Pelamar, Perekrutan, Perusahaan \r\n \r\nIX + 123 Halaman; 92 Gambar; 13 Tabel; 20 Lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n');
INSERT INTO `document` VALUES (190,'1512530252','2021-02-05 14:01:54','20241','../files/1512530252.pdf',' \r\n \r\nPENERAPAN METODE WEIGHTED PRODUCT (WP) DALAM SISTEM \r\nPENUNJANG KEPUTUSAN PENENTUAN PEGAWAI TERBAIK PADA \r\nBAGIAN PENYUSUN PROGRAM DAN ANGGARAN 1 BADAN \r\nNASIONAL PENANGGULANGAN BENCANA BERBASIS WEB \r\n \r\n \r\nOleh : \r\nEko Budianto  (1512530252) \r\n \r\n         \r\nBagian Penyusun Program dan Anggaran 1 bertugas menyusun program \r\nbeserta anggaran kegiatan pada masing-masing unit kerja pada Badan Nasional \r\nPenanggulangan Bencana (BNPB). Kinerja yang maksimal tentu diharapkan oleh \r\nkepala Kepada Bagian Penyusun Program dan Anggaran 1 untuk meningkatkan \r\nkualitas pekerjaan sehingga laporan Kepala Bagian Penyusun Program dan \r\nAnggaran 1 kepada Biro Perencana menjadi baik dan menjadi nilai lebih jika \r\ndibandingkan dengan Unit-unit yang lainnya. Untuk meningkatkan kinerja \r\ndiperlukan sebuah penyemangat dan sebuah peringatan untuk pegawai  yang \r\nmengalami kinerja menurun. Penyemangat pada Bagian Penyusun Program dan \r\nAnggaran 1 dengan cara memberikan sebuah reward atau bonus kepada pegawai \r\nyang kinerjanya teratas dan untuk mengatasi penurunan kinerja dari seorang \r\npegawai Bagian Penyusun Program dan Anggaran 1 memberikan sebuah Surat \r\nPeringatan. Untuk melakukan penilaian mengenai kinerja dari seorang pegawai \r\npada  Bagian Penyusun Program dan Anggaran 1\r\n dilakukan dengan cara \r\nmengamati progress pekerjaan serta tanggung jawab pekerjaan pegawai. Tugas \r\nAkhir ini menggunakan Metode Weigted Product dan menggunakan data Pegawai \r\nPada Bagian Penyusun Program dan Anggaran 1 BNPB. Hasil Tugas Akhir \r\nberupa Aplikasi \r\nyang mampu menghasilkan perangkingan pada masing\r\n-masing \r\npegawai. \r\n \r\nKata Kunci : Pegawai, Keputusan \r\n \r\nIx + \r\n1\r\n34\r\n \r\nHalaman; 92 Gambar; 13 Tabel; 20 Lampiran \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(191,'1513500023','2021-02-05 14:01:54','344482','../files/1513500023.pdf',' \r\n \r\nSISTEM PENGATUR KECEPATAN PUTARAN POMPA AIR \r\nBERDASARKAN SUHU PANEL SURYA BERBASIS \r\nARDUINO MEGA 2560 \r\nOleh : Adam Firmansyah (NIM : 1513500023) \r\n \r\nPanel surya merupakan device yang sudah sempurna untuk diaplikasikan sebagai \r\nPLTS. Hal ini dikarenakan sumber energi yang dipakai sudah ada di beberapa \r\ntempat  di  wilayah  Indonesia.  Namun  perbedaan  suhu  di  beberapa  tempat  di \r\nwilayah Indonesia yaitu berbeda-beda. Kendala disini adalah jika suhu terlalu \r\ntinggi dapat mempengaruhi kinerja optimal pada panel surya. Berdasarkan hal \r\ntersebut penelitian kali ini membahas tentang sistem putaran pompa air terhadap \r\nsuhu pada panel surya. Water Cooling System akan mengaliri air pada permukaan \r\nbawah panel surya jika suhu sudah di atas 30Â°C. Jika suhu sudah melebihi dari \r\n30Â°C maka sistem pengatur pompa air akan aktif dan akan mengeluarkan air secara \r\nbertahap dari penampungan yang akan menurunkan suhu pada panel surya. Pada \r\npenelitian ini didapatkan suhu rata-rata panel surya adalah 30Â°C dan suhu tersebut \r\nadalah  suhu  di  atas  normal  panel  surya,  yang  akan  menyebabkan  terjadinya \r\npenurunan  keluaran  yang  di  hasilkan  panel  surya  tersebut.  Maka  dengan \r\nmenggunakan  sistem  pengatur  kecepatan putaran  pompa  air  akan  dapat \r\nmenurunkan suhu pada panel surya dan mengoptimalkan keluaran yang dihasilkan \r\ndari panel surya. Dengan demikian, dibuatlah sistem pengatur kecepatan putaran \r\npompa air berdasarkan suhu panel surya, semoga bisa mengoptimalkan kinerja \r\npada panel surya tersebut.  \r\n \r\nKata kunci : Arduino Mega 2560, RTC, Water Cooling System, Sistem Pengatur \r\nKecepatan Putaran Pompa Air, Panel Surya. \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(192,'1513500049','2021-02-05 14:01:54','141506','../files/1513500049.pdf',' \r\nSISTEM DISTRIBUSI AIR BERSIH BERBASIS ARDUINO \r\nUNO MENGGUNAKAN RFID DAN SENSOR FLOWMETER \r\nOleh : Irfan Pratama Putra (NIM : 1513500049) \r\nBelakangan ini banyak sekali beberapa daerah kekurangan air bersih, terutama \r\nbeberapa daerah di Indonesia. Hal ini disebabkan oleh berbagai macam faktor, \r\nmulai  dari  pencemaran  air,  musim  kemarau,  dan  sulitnya  akses  untuk \r\nmendapatkan  air  bersih.Tetapi  pemerintah  dalam  hal  ini  menyikapi  serius \r\nmasalah  ini,  karena  masalah  ini  menyangkut  kesehatan  dan  kesejahteraan \r\nmasyarakat.Oleh karena itu pemerintah berupaya membantu mendistribusikan air \r\nbersih kebeberapa daerah di Indonesia.Akan tetapi terdapat suatu masalah pada \r\nsaat pendistribusian air bersih yaitu kurang meratanya pendistribusian.Hal ini \r\nmenyebabkan beberapa masyarakat yang tidak mendapatkan air.Oleh sebab itu \r\nsaya disini mencoba mengatasi masalah tersebut dengan membuat alat \"SISTEM \r\nDISTRIBUSI AIR BERSIH BERBASIS ARDUINO UNO MENGGUNAKAN RFID \r\nDAN  SENSOR  FLOWMETER\".  Diharapkan  dengan  terciptanya  alat  ini  bisa \r\nmengatasi  masalah  yang  terjadi  di  lapangan  saat  pendistribusian  air \r\nbersih.Dalam membuat alat ini saya mengandalkan  trend pada zaman ini yang \r\nserba online. Kita sudah berada dizaman yang dimana setiap benda di sekitar kita \r\ntelah berada di fase teknologi 4.0 IoT yang sekarang semakin berkembang di \r\nnegara kita. Maka dengan ini saya ingin membuat sebuah alat yang ada di sekitar \r\nkita dengan memanfaatkan teknologi IoT ini, yakni SISTEM DISTRIBUSI AIR \r\nBERSIH BERBASIS ARDUINO UNO MENGGUNAKAN RFID DAN SENSOR \r\nFLOWMETER.Sistem distribusi air bersih berbasis arduino uno menggunakan \r\nrfid  dan  sensor  flowmeter  yang  akan  di  rancang  menggunakan  komponen-\r\nkomponen seperti, RFID yang berperan sebagai penjatahan dalam pengambilan \r\nair. Sensor Flowmeter disini berperan sebagai pendeteksi berapa air yang sudah \r\nkeluar dan kecepatan air keluar.Diharapkan dengan adanya alat Sistem distribusi \r\nair bersih berbasis arduino uno menggunakan rfid dan sensor flowmeter ini bisa \r\nmengatasi masalah pendistribusian yang tidak merata. \r\nKata kunci : Distribusi, Arduino Uno, RFID, Flowmeter.  \r\n Perpustakaan Universitas Budi Luhur\r\n'),(193,'1513500106','2021-02-05 14:01:54','70249','../files/1513500106.pdf',' \r\nSistem Sablon Otomatis Menggunakan Arduino Uno Yang Di \r\nKendalikan Melalui Android \r\nOleh : Muhamad Rifaldi (NIM : 1513500106) \r\n \r\nDalam dunia industri, teknologi memiliki peran yang penting \r\ndalam  proses produksi. Salah satunya adalah perkembangan \r\nteknologi dalam bidang penyablonan. Hal tersebut tidak lepas dari \r\nmeningkatnya  permintaan  konsumen  terhadap  barang - barang \r\nproduksi  dari  satu  industri.  Untuk  mempercepat  produksi,  pihak \r\nindustri memerlukan suatu sistem yang dapat bekerja secara efisien \r\ndan dapat memonitoring hasil produksi. Produksi khususnya proses \r\nsablon,  diperlukan  koordinasi  baik  dari  kinerja  dan  hasil \r\nproduksinya, sehingga diperoleh efisiensi kerja yang maksimal. \r\nDalam proses penyablonan masih banyak yang menggunakan sablon \r\nmanual  yang membutuhkan  waktu  yang  lama  untuk  menghasilkan \r\nsatu objek. Padahal dalam dunia industri bisa menghasilkan banyak \r\nproduk  sehingga  diperlukan  pengawasan  yang  dapat  memantau \r\nkinerja  dari  sistem  tersebut.  Pada  tugas  akhir  ini,  dibuat  sistem \r\nsablon secara otomatis untuk dilakukan proses produksi selanjutnya. \r\nMesin sablon ini dilengkapi dengan solenoid yang berfungsi sebagai \r\npenggerak  pneumatic,  infrared  untuk  mendeteksi  baju.  Untuk \r\nmenjalankan  dan  menghentikan  alat  ini  dapat  menggunakan \r\nandroid. \r\n \r\n \r\n Kata Kunci : Sablon,Pneumatic,Arduino UnoPerpustakaan Universitas Budi Luhur\r\n'),(194,'1513500114','2021-02-05 14:01:55','91371','../files/1513500114.pdf',' \r\nSISTEM PARKIR CERDAS BERBASIS ARDUINO MEGA 2560 Rev3 \r\nOleh : Ahmad Renaldi (NIM : 1513500114) \r\nMeningkatnya penggunaan mobil tidak diseimbangkan dengan penyediaan area \r\nparkir  yang memadai dan mengakibatkan banyak pengendara  yang parkir  di \r\nsembarang tempat. Sistem perparkiran yang ada hanya memanfaatkan area parkir \r\ndan petugas parkir yang mengawasi. Pengendara juga harus berkeliling untuk \r\nmencari  tempat  yang  kosong  apabila  petugas  atau pengendara  tidak \r\nmemperhatikan daya tampung area parkir tersebut maka pemilik kendaraan akan \r\nterpaksa harus keluar jika tidak mendapatkan tempat parkir. Untuk mengatasi hal \r\ntersebur membuat sistem parkir dengan menggunakan sistem mikrokontrol yang \r\nmemudahkan pengguna kendaraan mengetahui jumlah dan letak tempat parkir \r\nyang  kosong.Perancangan  sistem  parkir  ini  bertujuan  kendaraan  dapat \r\nmengetahui bagian lahan parkir yang tersedia yang akan diberitahukan melalui \r\nLED (Light Emitting Diode) pada pintu masuk lahan parkir, sistem parkir ini juga \r\ndapat memisahkan kendaraan truk, bis dan minibus menggunakan Ultrasonik \r\n(HC-SR04)  sebagai sensor untuk mendeteksi ketinggian kendaraan pada gerbang \r\nmasuk dan juga agar memudahkan untuk mengawasi total kendaraan yang ada \r\npada  lahan  parkir  dengan  indikator  LED  (Light  Emitting  Diode).  Seluruh \r\nkendaraan yang masuk akan menggunakan NFC untuk masuk dan membayar \r\nbiaya parkir. Rancangan ini menggunakan Arduino MEGA 2560 Rev3 sebagai \r\nprocessor untuk mengolah data. Servo yang mengatur palang akan digerakkan \r\nketika pengendara menempelkan Parking Card. Saat lahan parkir penuh maka \r\nindicator LED akan menyala menjadi warna merah dan servo akan menutup dan \r\nmencegah kendaraan masuk lagi. Servo akan kembali terbuka saat ada lahan yang \r\nkosong. \r\nKata kunci : sistem parkir, Arduino, sensor infrared,RTC, sensor ultrasonik \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(195,'1513500130','2021-02-05 14:01:55','5392','../files/1513500130.pdf',' \r\nSISTEM SORTIR BARANG BERBASIS ARDUINO DILENGKAPI \r\nSENSOR WARNA DAN MONITORING JUMLAH BARANG VIA \r\nANDROID \r\n \r\nSistem sortir barang berbasis Arduino dilengkapi sensor warna dan monitoring \r\njumlah  barang  via  Android  adalah  suatu  rangkaian  alat  yang  berfungsi untuk \r\nmeringankan  proses  kerja  dari  penyortiran  barang  berdasarkan  warna  secara \r\nmanual  pada  perusahaan  industri  tertentu. Tujuan  dari  penelitian  ini  adalah \r\nmembuat  alat  penyortiran  barang  berdasarkan  warna  secara  otomatis  dan \r\nmonitoring  hasil  penjumlahan  barang  sebagai  penyambung  informasi  dari  alat \r\nmenuju ke Android melalui jaringan internet. Adapun alat ini dilengkapi dengan \r\nsensor  warna  TCS3200  sebagai  pendeteksi  warna,  sensor  infrared  sebagai \r\npenghitung objek, motor DC dan konveyor sebagai media penggerak, motor Servo \r\nsebagai  media  penyortiran,  Arduino  sebagai  media  pengendali,  dan  ESP8266 \r\nsebagai  media  komunikasi  serta  Android  sebagai  media  monitoring.  Dengan \r\npemanfaatan suatu alat tersebut maka diharapkan dapat meningkatkan waktu kerja \r\nsecara efisien pada produktivitas perusahaan industri. \r\n \r\nKata Kunci: arduino, android, sensor warna, sensor infrared, motor DC, motor \r\nservo, ESP8266 '),(196,'1513500197','2021-02-05 14:01:55','84326','../files/1513500197.pdf',' \r\nDISPENSER OTOMATIS MENGGUNAKAN ARDUINO UNO BERBASIS \r\nSMS GATEWAY \r\nOleh : Tyas Indah Sukmaniar (NIM : 1513500197) \r\n \r\nPada saat ini, kita sudah berada dizaman yang dimana setiap benda di sekitar kita \r\ntelah berada di fase teknologi 4.0 IoT yang sekarang semakin berkembang di \r\nnegara kita. Maka dengan ini saya ingin membuat sebuah alat yang ada di sekitar \r\nkita dengan memanfaatkan teknologi IoT ini, yakni dispenser otomatris berbasis \r\nSMS Gateway. Dengan adanya alat ini memudahkan kita untuk menyelesaikan \r\npekerjaan dengan lebih evisiensi waktu.Dispenser otomatis berbais SMS Gateway \r\nyang akan di rancang menggunakan komponen-komponen seperti, Sensor infrared \r\nyang  berperan  sebagai  intruksi  untuk  menyalakan  water  pump  DC.  Sensor \r\nultrasonic untuk mendeteksi ketyinggian air pada gelas, dan sebagai pendeteksi \r\nair yang ada di dalam galon, jika air di dalam galon telah habis maka SMS \r\nGateway  akan  mengirim  pesan  ke  smartphone  pengguna.Diharapkan  dengan \r\nadanya alat dispenser otomatis berbasis SMS Gateway ini bisa membantu kita \r\nkedalam kehidupan sehari-hari. \r\nKata kunci : dispenser, IOT, SMS Gateway. \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n Perpustakaan Universitas Budi Luhur\r\n'),(197,'1513500221','2021-02-05 14:01:55','87940','../files/1513500221.pdf',' \r\nALAT PEMBERI PAKAN KUCING OTOMATIS BERBASIS WEB \r\nSERVER DAN DIKONTROL DENGAN ANDROID MENGGUNAKAN \r\nMIKROKONTROLLER ARDUINO  \r\nOleh: Elbert Elvianus Barus (NIM: 1513500221)  \r\nAlat pemberi pakan kucing otomatis berbasis web server dan dikontrol \r\ndengan android  menggunakan mikrokontroller arduino ini akan memberi pakan \r\nkucing yang ada terdapat pada sebuah kontainer. Dimana pada saat jam makan pagi \r\nmaka  kontainer  akan  terbuka  hingga  berat  pakan yang  telah  ditentukan untuk \r\nmengisi tempat makan kucing dan akan memberikan informasi ke sebuah web \r\nserver untuk dimasukkan data bahwa kucing telah diberi makan pagi. Dan ketika \r\npada jam siang maka kontainer akan terbuka kembali hingga berat pakan pada \r\ntempat makan kucing telah sesuai yang kita atur dan akan memberikan informasi \r\nke sebuah web server yang berisikan pesan kucing telah diberi makan siang. Untuk \r\njam  malam  kontainer  akan terbuka  kembali  hingga  berat  pakan  kucing sesuai \r\nkeinginan  serta akan memberikan informasi ke sebuah web server bahwa kucing \r\ntelah diberi makan malam. Disini web servernya akan menggunakan Server Mysql \r\nmenggunakan XAMPP sebagai alat koneksi web dengan android dan menggunakan \r\nmodule Wifi ESP8266 untuk tersambung ke internet. Pada perancangan modul ini \r\nterbagi menjadi dua bagian yaitu perancangan perangkat keras dan perangkat lunak. \r\nPerangkat  keras  dari  alat  ini  terdiri  dari  mikrokontroller,  rangkaian load  cell, \r\nrangkaian wifi, Rangkaian Motor Servo dan RTC (Real Time Clock). Sedangkan \r\nperangkat lunak didesain menggunakan bahasa C Arduino IDE untuk memberikan \r\nintruksi - intruksi  pada  Mikrokontroller  ATMega328  (Arduino Uno)  untuk \r\nmengoperasikan sistem kerja alat. \r\nKata Kunci : Arduino, Android,Motor Servo, load cell, Wifi, RTC Perpustakaan Universitas Budi Luhur\r\n'),(198,'1513500247','2021-02-05 14:01:55','325656','../files/1513500247.pdf',' \r\n \r\nAkses Kelistrikan Rumah menggunakan SMS Gateway dan Akses Ruang \r\nmenggunakan RFID Berbasis Arduino Mega 2560 \r\nOleh : Arief Rizki Rahmadi  (NIM : 1513500247) \r\n    Di  era  globalisasi  ini,banyak  sekali  perkembangan  yang  terjadi  di  bidang \r\nteknologi.  Kunci  adalah sistem keamanan pada pintu. Dan listrik adalah suatu \r\nenergi  yang  sangat berpengaruh  di  dalam  kehidupan  manusia.  Tidak  dapat  di \r\npungkiri manusia tidak dapat terlepas dari listrik. Karena listrik dimanfaat kan  \r\nmanusia untuk menerangi sebuah ruangan, menyalakan komputer,dan perangkat \r\nelektronik  lainnya.Sehingga  membantu  pekerjaan  manusia.  Masalah  yang  ada \r\nketika kita berpergian kita seringkali menyalakan lampu agar menandakan ada \r\norang agar tidak menjadi sasaran tindakkan kriminal. Lampu pun menyala sampai \r\nberjam-jam bahkan berhari-hari, biaya tagihan listrik  pun menjadi  mahal.  Dan \r\nSistem buka pintu pada umumnya masih menggunakan kunci untuk membuka-nya. \r\nCara seperti itu sangat rentan di duplikasi, dan ketika ada yang keluar masuk rumah \r\nkita  pun  tidak  tahu  siapa  yang  keluar  dan  masuk  rumah  kita.  Penelitian  ini \r\nmempunyai tujuan agar kunci yang digunakan untuk membuka dan menutup pintu \r\ntidak dapai di duplikasi. Sehingga meminimalisir tindakkan kriminal. Serta pada \r\nsaat  kita  berpergian  jauh  kita  dapat  mengontrol  listrik  dari  jarak  jarak  jauh,  \r\nterutama  dalam  masalah  ini  berupa  lampu  dan  kita  bisa  menggunakan  lampu \r\nseperlunya atau pada waktu yang kita inginkan pada saat kita berada di dalam \r\nrumah. Sehingga kita dapat menghemat biaya listrik. Maka daripada itu penulis \r\nmembuat sebuah alat yang berjudul \"Akses Kelistrikan Rumah menggunakan \r\nSMS Gateway dan Akses Ruang menggunakan RFID Berbasis Arduino Mega \r\n2560\" dimana untuk membuka dan menutup pintu menggunakan RFID,dan ketika  \r\nkita mengakses pintu  akan ada notification yang di kirim kan oleh GSM 800L, serta \r\nuntuk mengontrol lampu menggunakan smatrphone sebagai remote nya. Diman \r\nsecara keseluruhan alat ini di kontrol oleh Arduino Mega 2560. Hasil dari penelitian \r\nini yaitu kita dapat mengontrol listrik khususnya lampu dimana pun kita berada, \r\ndapat menghemat biaya tagihan listrik tiap bulannya. Dan mengetahui dengan pasti \r\nsiapa yang keluar maupun masuk rumah kita. \r\n  \r\nKunci : RFID, SMARTPHONE, Arduino Mega 2560, GSM 800L.Perpustakaan Universitas Budi Luhur\r\n'),(199,'1513500270','2021-02-05 14:01:55','122271','../files/1513500270.pdf',' \r\n \r\nROBOT PENGAMBIL BARANG MENGGUNAKAN STIK PS2 WIRELESS \r\nBERBASIS MIKROKONTROLER ARDUINO MEGA 2560 \r\nOleh : Adimas Noegraha (NIM : 1513500270) \r\n \r\nSaat ini perkembangan teknologi di dunia berkembang dengan cepat dan \r\npesat,  khususnya  dalam  dunia  robotik.  Banyak  sekali  jenis  robot  yang  dapat \r\nmembantu  manusia  dalam  melakukan  pekerjaan  secara  efektif  dan  efisien. \r\nBerdasarkan  hal  tersebut, maka  penelitian  ini  bertujuan  untuk  membuat  robot \r\npengambil barang dengan menggunakan joystick yang dikendalikan oleh manusia. \r\nDengan  adanya  robot  tersebut  maka  pengguna  akan  lebih  mudah  dalam \r\nmengambil  dan  memindahkan  barang.  Robot  ini  dikendalikan  menggunakan \r\njoystick PS2 yang berbasis wireless dan sensor infrared untuk mengetahui ada \r\ntidaknya benda dibagian depan robot tersebut. Proses memberikan dan mengambil \r\nbarang pada lengan robot tersebut menggunakan pneumatik yang digunakan untuk \r\nmenjapit  dan  mengangkat  barang.  Perangkat  keras  robot  ini  terdiri  dari \r\nmikrokontroller arduino mega 2560, rangkaian relay DPDT (Duble Pole Duble \r\nThroe), joystick PS2 wireless dan sensor infrared. Perangkat lunak ini didesain \r\nmenggunakan  bahasa  C  Aduino  IDE  untuk  memberikan intruksi-intruksi  pada \r\nMikrikontroller Arduino guna mengoprasikan sistem kerja robot tersebut. Rabot \r\nini  di  desain  sesederhana  mungkin  untuk  mempermudah  pengguna  dalam \r\nmengendalikannya. \r\n \r\nKata Kunci : arduino, stik ps2, infrared, pneumatic, wireless \r\n  Perpustakaan Universitas Budi Luhur\r\n'),(200,'1513500296','2021-02-05 14:01:55','193533','../files/1513500296.pdf',' \r\nIMPLEMENTASI INTERNET OF THINGS (IOT) PADA SISTEM \r\nMONITORING PANEL SURYA BERBASIS ANDROID DENGAN \r\nARDUINO UNO R3 \r\nOleh: Nur Hadli (NIM: 1513500296) \r\nTujuan dari Tugas Akhir ini adalah merancang bangun perangkat keras, \r\nperangkat lunak, dan mengetahui kerja prototipe sistem monitoring panel surya.  \r\nSistem  monitoring  panel  surya  berbasis  web  server  dan  menampilkan  hasil \r\nmonitoring melalui aplikasi android ini akan memonitoring suhu, arus dan tegangan \r\npada panel surya. Saat arduino mengambil data dari setiap sensor, arduino akan \r\nmengirim data sensor ke modul ESP-01 sesuai dengan waktu yang telah di tentukan. \r\nModul ESP-01 menyimpan data di database. Kemudian aplikasi android meminta \r\ndata sensor ke database untuk kemudian ditampilkan di smartphone. Data yang \r\nditampilkan berupa grafik dan tabel dari suhu, arus dan tegangan pada panel surya. \r\nKetika suhu yang di tampilkan lebih dari suhu maksimum yang ditentukan, maka \r\nakan muncul notifikasi pada android. Pada perancangan sistem ini terbagi menjadi \r\nperangkat  keras  dan  perangkat  lunak.  Pada  perangkat  keras  terdiri  dari \r\nmikrokontroller, sensor suhu DS18B20, sensor arus dan tegangan INA219, modul \r\nWi-Fi  ESP8266, dan Modul  RTC  DS3231.  Sedangkan untuk  perangkat lunak, \r\ndatabase yang digunakan adalah SQL dan untuk pengelolaannya menggunakan \r\nPHPMyAdmin.  Perancangan  sistem  untuk  website  menggunakan  XAMPP \r\nkemudian di upload ke layanan hosting yaitu hostinger. Penerimaan data dari web \r\nserver menggunakan android studio untuk membuat aplikasi android. Pembuatan \r\nsistem monitoring ini diharapkan dapat memudahkan proses monitoring suhu, arus \r\ndan tegangan pada panel surya jika terhubung dengan internet. \r\n \r\nKata Kunci : Arduino, Monitoring, Panel Surya, RTC, Android, ESP, Web Server  \r\n \r\n \r\n \r\n  \r\n  Perpustakaan Universitas Budi Luhur\r\n');

